INSERT INTO `multimedia` (`id`, `titulo`, `nota`, `clasificacion`, `tipo`, `sinopsis`, `imagen`, `imagenPortada`, `estreno`)
VALUES
	(36,'Medium',NULL,NULL,'Serie','Se inspira en la vida de la medium Allison Dubois. Patricia Arquette interpreta a una mujer casada y madre de tres hijas que intenta comprender sus dotes de medium y su capacidad para comunicarse con los muertos. Su marido (Jake Weber) es un hombre cariñoso que la apoya incondicionalmente. Ambos luchan para encontrar el equilibrio entre la vida familiar y el sobrenatural don de Allison. El fiscal Devalos (Miguel Sandoval) la contrata para utilizar sus poderes en la resolución de casos criminales. (FILMAFFINITY)','https://image.tmdb.org/t/p/500w/r9zn8ATxIh2nNIzUNer1KOJtiVA.jpg','https://image.tmdb.org/t/p/original/aqawO5mYblDRwEmHjMiLJa8LyIr.jpg','0000-00-00'),
	(45,'Top Gear',NULL,NULL,'Serie','Top Gear. Programa de automóviles. Toda clase de pruebas con coches y resto de vehículos, incluyendo viajes a través de desiertos, caminos tortuosos. Experimentos con motores, lanzamientos por encima de caravanas....','https://image.tmdb.org/t/p/500w/AhcPiOviZ36mE5DjkX3aI9zIQJ9.jpg','https://image.tmdb.org/t/p/original/6Arzjzy70bZoHC0LYNUUuW8ODgN.jpg','0000-00-00'),
	(95,'Buffy, cazavampiros',NULL,NULL,'Serie','Buffy y su madre se mudan desde Los Ángeles a Sunnydale. En el subsuelo del pueblo habita el Maestro, el más antiguo y poderoso vampiro que existe. El Maestro está atrapado en el punto místico llamado La Boca del Infierno, que él trato de abrir cuando, por causa de un terremoto, quedó atrapado, hace décadas. En Sunnydale, Buffy conoce a Willow y Xander, que se convierten en sus amigos y que, sin querer, la tendrán que ayudar en su lucha contra el Maestro. Además esta Giles, el bibliotecario de la escuela, que es un Vigilante u Observador, que desde siempre se han dedicado a entrenar y guiar a las Cazadoras, pero sin intervenir directamente en la lucha contra los vampiros. Además Buffy conoce un misterioso aliado, de nombre Angel, del que se enamora. Pero es un amor imposible, pues Angel es un vampiro, aunque por una maldición gitana recobró su alma y ahora lucha contra ellos.','https://image.tmdb.org/t/p/500w/n3WHDYeG5EPlQzQmu4tWz0I38KJ.jpg','https://image.tmdb.org/t/p/original/prtfjCpoIvKZ7IMFzjfQM6I04mk.jpg','0000-00-00'),
	(121,'Doctor Who',NULL,NULL,'Serie','Doctor Who es una serie de televisión británica de ciencia ficción producida por la BBC. La denominada serie clásica, se emitió entre 1963 y 1989. \n\nEl programa muestra las aventuras de un Señor del Tiempo conocido como \"El Doctor\", que explora el universo en su TARDIS, una nave espacial con conciencia propia capaz de viajar a través del tiempo y el espacio. Por fuera, simula ser una cabina de policía azul. Con la ayuda de distintos acompañantes, el Doctor se enfrenta a una variedad de enemigos mientras salva civilizaciones, visita tanto el pasado como el futuro, ayuda a gente común y corrige injusticias.','https://image.tmdb.org/t/p/500w/p62osAAoVW6IwMPlGXxpQnQdBNx.jpg','https://image.tmdb.org/t/p/original/qgtHj2YyIMwGCCq2QQfWUvkqAUx.jpg','0000-00-00'),
	(141,'Cheers',NULL,NULL,'Serie','Cheers es una comedia de situación estadounidense emitida originalmente por la NBC, ambientada en un bar de Boston (Massachusetts) cuyo nombre era al igual que el de la serie: Cheers, hoy en día Cheers Beacon Hill. En el mismo, un grupo de clientes habituales del local se reunían para beber y divertirse.\nPoco después de ser estrenada en 1982, fue cancelada antes de terminar su primera temporada por sus bajos niveles de audiencia, sin embargo se decidió continuar con su emisión y la serie se convirtió en éxito de audiencia en temporadas posteriores.','https://image.tmdb.org/t/p/500w/ic6IPDg0YZ4rCXvzuBUMVnv4Qkk.jpg','https://image.tmdb.org/t/p/original/nD1ZQBKbgKSmKcrAkWTofohsScj.jpg','0000-00-00'),
	(253,'Star Trek',NULL,NULL,'Serie','Serie que relata los viajes de la astronave USS Enterprise. Su Misión de Cinco Años consiste en explorar nuevos mundos y buscar nuevas civilizaciones. Es el año 2264, dos siglos después de que el hombre superara en sus viajes la velocidad de la luz y se realizara el primer viaje de la Enterprise NX-01. Durante los tres primeros años, el capitán James T. Kirk y su tripulación encuentran criaturas que se metamorfosean, asesinos, locos, seres tan poderosos que pueden controlar la mente de sociedades enteras, pero también seres muy débiles e incapaces de controlar su propia mente. Los expedicionarios vivirán peligrosas aventuras que los obligarán a luchar por su vida y la de sus amigos. Todas esas pruebas contribuirán a forjar un vínculo de amistad entre tres insólitos personajes: el valiente y carismático capitán, el irascible doctor y el Vulcaniano sin emociones.','https://image.tmdb.org/t/p/500w/be1YqppKzGxMFbK659zY7ysqZup.jpg','https://image.tmdb.org/t/p/original/f2wbC7fxiOJqzTb6HPr4N6bsjLF.jpg','0000-00-00'),
	(291,'Coronation Street',NULL,NULL,'Serie','Esta serie británica sigue las vidas de los residentes de la ficticia calle Coronation, situada en el gran Manchester, y que está conformada principalmente por gente de clase obrera.','https://image.tmdb.org/t/p/500w/5APjn4LnV5wWk5DXq7ZewT6zzP1.jpg','https://image.tmdb.org/t/p/original/xe6y8SJU0NyGEECu2LV9cXoY81g.jpg','0000-00-00'),
	(456,'Los Simpson',NULL,NULL,'Serie','Comedia americana de animación creada por Matt Groening para la compañía Fox. La serie es una parodia satírica del estilo de la clase media americana encarnada por una familia con ese mismo nombre, compuesta por Homer, Marge, Bart, Lisa, y Maggie Simpson. La trama se desarrolla en la ciudad ficticia de Springfield y parodia la cultura, la sociedad, la televisión estadounidense y muchos otros aspectos de la condición humana.','https://image.tmdb.org/t/p/500w/hpU2cHC9tk90hswCFEpf5AtbqoL.jpg','https://image.tmdb.org/t/p/original/u8BMLmwoc7YPHKSWawOOqC1c8lJ.jpg','0000-00-00'),
	(549,'Ley y orden',NULL,NULL,'Serie','Ley y orden es una serie dramática estadounidense sobre procedimiento legal y policial, creado por Dick Wolf y parte de la franquicia. Fue estrenada en la cadena NBC y en varias cadenas de cable. La ley y el orden se estreno el 13 de septiembre de 1990, y completó su 20 y última temporada el 24 de mayo de 2010. En el momento de su cancelación, La ley y el orden fue el drama criminal de más larga duración en la televisión en horario estelar estadounidense.','https://image.tmdb.org/t/p/500w/A4kt2TAsV8bq0csfwJbfgiZtG4g.jpg','https://image.tmdb.org/t/p/original/jUKiOgSYVAP8ARYPotgnBwIK1x7.jpg','0000-00-00'),
	(557,'Spider-Man',NULL,NULL,'Pelicula','Peter Parker es un joven y tímido estudiante que vive con su tía May y su tío Ben desde la muerte de sus padres. Un día es mordido por una araña que ha sido modificada genéticamente, descubriendo al día siguiente que posee unos poderes poco habituales: tiene la fuerza y agilidad de una araña.','https://image.tmdb.org/t/p/original/sWvxBXNtCOaGdtpKNLiOqmwb10N.jpg','https://image.tmdb.org/t/p/original/bCDaKZLRkrVVtPNyHxUfKvepW1N.jpg','2002-05-01'),
	(580,'Star Trek: Espacio profundo nueve',NULL,NULL,'Serie','Star Trek: Espacio profundo nueve (Star Trek: Deep Space Nine) (algunas veces abreviada ST:DS9 o DS9) es una serie de ciencia ficción estadounidense estrenada en 1993, que se extendió a lo largo de siete temporadas. Se ubica dentro del universo ficticio de Star Trek de Gene Roddenberry, creada por Rick Berman y Michael Piller a petición de Brandon Tartikoff, y fue producida por CBS Paramount Television. Los escritores principales, además de Rick Berman y Michael Piller, fueron Ira Steven Behr, Robert Hewitt Wolfe, Ronald D. Moore, Peter Allan Fields, Bradley Thompson, David Weddle, y René Echevarria.\n\nComo una spin-off de Star Trek: La nueva generación, DS9 comenzó mientras su predecesora aún estaba al aire, lo cual llevó a varios episodios entrelazados entre ambas series. Además, dos miembros de TNG, Miles O\'Brien y Worf, se convirtieron en miembros regulares de DS9.\n\nA diferencia de otros programas de Star Trek, DS9 tuvo lugar en una estación espacial en vez de una nave estelar, par','https://image.tmdb.org/t/p/500w/cm3srKkyVn8zUK40ox8ZNjRJRdE.jpg','https://image.tmdb.org/t/p/original/vE6138ykaEXQkCSEHyuBIgfGlUZ.jpg','0000-00-00'),
	(605,'Sabrina, cosas de brujas',NULL,NULL,'Serie','La serie se centra en Sabrina Spellman, que es una estudiante de 16 años que vive en una casa de aspecto victoriano con sus dos tías Hilda y Zelda Spellman y su gato parlante Salem Saberhagen. Sabrina lleva la vida normal y corriente de una chica de su edad, va a la escuela preparatoria, le gusta ir a la pizzería Slicery con sus amigos. Pero todo cambia radicalmente cuando llega su 16º cumpleaños y sus tías le revelan el gran secreto de la familia: son brujas, incluida ella aunque ella es mitad bruja y mitad mortal. Desde ese momento Sabrina va descubriendo sus poderes, que su gato Salem en realidad es un hombre que quería dominar el mundo, al cual su castigo fue quedar convertido en gato, e incluso que ese normal armario donde guardaban las toallas es en realidad un paso para ir a El Otro Reino (\'la otra esfera\' en España), una dimensión en la que viven brujos y brujas y que les ofrece la posibilidad de poder ir a Marte o a la Luna, entre otras muchas cosas, como viajes en el tiempo ','https://image.tmdb.org/t/p/500w/4PhaaA593zHfAyYUIXVWTih3qcD.jpg','https://image.tmdb.org/t/p/original/nNhj3coHNVVJPVM7fm5PEYVTCMO.jpg','0000-00-00'),
	(615,'Futurama',NULL,NULL,'Serie','Serie de animación creada por Matt Groening (creador también de Los Simpson) y David X. Cohen (guionista también de Los Simpson). Ambientada en la ciudad de \"Nueva Nueva York\" en el año 3000, la serie comienza con Philip J. Fry, un joven repartidor de pizza neoyorquino fracasado y desmotivado que es criogénicamente congelado por accidente la Nochevieja de 1999. Mil años después es descongelado, encontrándose en Nueva Nueva York el 31 de diciembre de 2999. El intento de Fry por escapar de la entonces obligatoria asignación laboral como repartidor termina cuando es contratado en Planet Express, una pequeña compañía de mensajería intergaláctica propiedad de su sobrino lejano, como repartidor. La serie trata sobre las aventuras de Fry y sus colegas cuando viajan por el universo haciendo repartos para Planet Express.','https://image.tmdb.org/t/p/500w/foDTy1NcfTzKnzXzgTp1FBu653F.jpg','https://image.tmdb.org/t/p/original/k5e8kAq9jpaSmgvFM10su5LXGFR.jpg','0000-00-00'),
	(655,'Star Trek: La nueva generación',NULL,NULL,'Serie','Star Trek: La nueva generación o Viaje a las estrellas: La nueva generación en Uruguay (Star Trek: The Next Generation) (algunas veces abreviada ST:TNG o TNG) es una serie de ciencia ficción estadounidense dentro del universo de Star Trek. Situada en el siglo XXIV, 21 años después de Star Trek: la serie original, el programa cuenta con una nueva tripulación y una nueva nave Enterprise. Su estreno fue el 28 de septiembre de 1987, contando con más de 27 millones de televidentes el episodio piloto \"Encuentro en Farpoint\". Con un total de 178 episodios (el mayor número de episodios que haya tenido alguna serie de Star Trek) y siete temporadas, llegó a su fin el 23 de mayo de 1994, con el episodio \"Todas las cosas buenas\".\n\nLos episodios siguen las aventuras de la tripulación del USS Enterprise (NCC-1701-D), una nave clase Galaxia. Como nave insignia de la Federación Unida de Planetas, la Enterprise está diseñada para la exploración y la diplomacia, pero preparada para la batalla si fuera ','https://image.tmdb.org/t/p/500w/nMASWgNCBlb3FW6bLYEOsm0UZL0.jpg','https://image.tmdb.org/t/p/original/m8Jp435AhUBmltmPyP5LOYjc80V.jpg','0000-00-00'),
	(693,'Amas de Casa Desesperadas',NULL,NULL,'Serie','La serie se desarrolla en Wisteria Lane, zona residencial situada en la imaginaria ciudad de Fairview, Eagle State. Trata de las vidas de cinco amas de casa, a través de sus vidas domésticas a la vez que se revelan varios misterios acerca de sus maridos, amigos y vecinos. El tono y estilo de la serie combina elementos de drama, comedia, misterio, telenovelas y sátira. Los personajes han sido criticados por grupos religiosos por carencia moral.','https://image.tmdb.org/t/p/500w/vbz8B3pIrGjWKY6Y3OhUDVugHz8.jpg','https://image.tmdb.org/t/p/original/vTKJig46fBdfl0tl5hZUUj3tOgV.jpg','0000-00-00'),
	(764,'Los asesinatos de Midsomer',NULL,NULL,'Serie','Su protagonista, hasta el año 2011, era el inspector jefe Tom Barnaby (John Nettles), que trabajaba para Caustron CID; más tarde, fue reemplazado por el actor Neil Dudgeon, que interpreta a un primo menor de Tom, John Barnaby. En cada episodio, Barnaby investiga uno de los numerosos asesinatos que ocurren en el condado ficticio de Midsomer, acompañado por un sargento, que fue cambiando durante la historia del programa: Gavin Troy (Daniel Casey), Dan Scott (John Hopkins) y Ben Jones (Jason Hughes).','https://image.tmdb.org/t/p/500w/k6D2KeBJUuwh0d7h7nZOE26vymN.jpg','https://image.tmdb.org/t/p/original/OgbbJMHFgi8oJOgCPoBQwi4ixS.jpg','0000-00-00'),
	(790,'Hércules Poirot',NULL,NULL,'Serie','Agatha Christie\'s Poirot, es una serie de televisión transmitida del 8 de enero de 1989 hasta el 13 de noviembre del 2013 por medio de la cadena ITV. La serie está basada en las novelas cortas de crimen tituladas \"Agatha Christie\'s\".\n\nLa serie siguió a Hercule Poirot, un famoso ex-policía belga que se muda a Londres después de la guerra y pronto su fama como un detective privado infalible lo convierte en una persona aún más conocida. Poirot junto a su equipo tienen que resolver los misteriosos crímenes que se presentan.','https://image.tmdb.org/t/p/500w/6AVdPMleNIPf2gGayhXsYcsQdFA.jpg','https://image.tmdb.org/t/p/original/owEg4UjJCo60tPFckAZ4CPmR0Ra.jpg','0000-00-00'),
	(873,'Colombo',NULL,NULL,'Serie','El teniente Colombo es un desaliñado y aparentemente despistado detective de policía que, a primera vista, suele ser considerado torpe e inofensivo. Lleva siempre gabardina y un puro mientras investiga y resuelve los casos más sorprendentes.','https://image.tmdb.org/t/p/500w/skWuseledUfSdS42GQaR5MPZpxS.jpg','https://image.tmdb.org/t/p/original/10AFO1tXhQWXrqPyyeSzk3E2ciu.jpg','0000-00-00'),
	(888,'Spider-Man',NULL,NULL,'Serie','¿Imaginas ser capaz de sentir el peligro, subir cualquier pared, ser lo suficientemente fuerte como para doblar el acero, y tener más agilidad que cualquier otro ser humano? Para Peter Parker es un hecho. Excepto que él no piensa que es un regalo. En su último año de instituto, Peter Parker fue mordido por una araña radioactiva. Después de breves alucinaciones, Peter se despierta con poderes increíbles - muy parecidos a los de una araña. Por lo tanto, para hacer algo de dinero extra, Peter toma el personaje de Spider-Man, y trata de seguir una carrera como luchador profesional. Cuando es testigo de un robo, permite que el criminal escape simplemente porque \"no es su problema\". Luego, cuando su querido tío Ben es asesinado, Peter descubre que el asesino no es otro que el criminal que no detuvo anteriormente. Ahora, Peter usa sus poderes para detener el crimen porque \"un gran poder conlleva una gran responsabilidad\".','https://image.tmdb.org/t/p/500w/yVS0mwGHf1NxiP3thnYNG0QK3sz.jpg','https://image.tmdb.org/t/p/original/wXthtEN5kdWA1bHz03lkuCJS6hA.jpg','0000-00-00'),
	(890,'Neon Genesis Evangelion',NULL,NULL,'Serie','En el año 1999, en la Antártida, ocurrió un cataclismo llamado \"El Segundo Impacto\", como resultado de un incidente ocasionado por unos seres conocidos como \"Ángeles\". Gran parte de la Tierra quedó devastada por el fenómeno, y la mitad de la población sucumbió en la catástrofe, aunque ahora la humanidad gradualmente se va recuperando. Años después, en el 2015, los \"Ángeles\" regresan y comienzan a atacar a la Tierra... Cada uno de los \"Ángeles\" es diferente de los demás, excepto por el hecho de que todos pueden generar un impenetrable escudo protector llamado Campo AT. La organización NERV revela su nuevo proyecto con miras a salvar el mundo: gigantes y bio-mecánicos robots conocidos como Evas, que son unos de las pocas fuerzas sobre la Tierra capaces de enfrentar a los \"Ángeles\". Sólo niños específicos pueden pilotar los Evas: Shinji Ikari, el hijo de el jefe de NERV y que no desea pelear, la reservada Rei Ayanami y la exaltada (y algo amante del combate) Asuka Langley. Mientras comba','https://image.tmdb.org/t/p/500w/fGXhmKyqRmx6NN3gQHeWNmiEryl.jpg','https://image.tmdb.org/t/p/original/bkw26fCT0MCcZbO1fhY2x1b9Fob.jpg','0000-00-00'),
	(1054,'The Young and the Restless',NULL,NULL,'Serie','Popular serial televisivo de casi 10.000 episodios. La historia gira alrededor de unas familias numerosas, de gente adinerada que viven una ciudad imaginaria llamada Genoa City. Los personajes de la telenovela se dividen en diferentes clanes, como los Newman, los Abbott y los Chancellor. En un primer momento el culebrón se centraba en la rivalidad de los Brooks y los Foster, aunque desde entonces ha evolucionado mucho. Actualmente los Chancellor poseen una gran notoriedad histórica en la ciudad, mientras que los Newman y los Abbot dominan el mundo de los negocios a nivel nacional.','https://image.tmdb.org/t/p/500w/9abMIArcm95q0CtTOTZnLdUIoSm.jpg','https://image.tmdb.org/t/p/original/5h58tbqpUhpdiQR1i4FawKWOidh.jpg','0000-00-00'),
	(1100,'Cómo conocí a vuestra madre',NULL,NULL,'Serie','How I Met Your Mother. Exitosa serie de la CBS que, en su primera temporada, obtuvo excelentes índices de audiencia además de ganar dos premios Emmy: uno a la dirección artística y otro a la fotografía. En el año 2030, Ted (Josh Radnor) relata a sus dos hijos adolescentes cómo conoció a su madre y cómo fue su vida hasta que, por fin, encontró el amor verdadero. Todo empezó cuando Marshall (Jason Segel), su mejor amigo, decidió casarse con Lily (Alyson Hannigan), su novia de toda la vida. Entonces Ted decidió lanzarse a la búsqueda del amor verdadero y formar una familia. Para conseguirlo contó con el apoyo de su amigo Barney (Neil Patrick Harris), un joven algo extravagante y muy hábil para conocer mujeres. Cuando, por fin, Ted conoce a Robin (Cobie Smulders), una impresionante joven canadiense que acaba de mudarse a Nueva York, está completamente seguro de que es amor a primera vista, pero el destino aún puede depararle muchas sorpresas.','https://image.tmdb.org/t/p/500w/5BMwFwNzSidVYArn561acqtktxv.jpg','https://image.tmdb.org/t/p/original/vF05nar5JAv8fcgNv4hQhwlm0HO.jpg','0000-00-00'),
	(1338,'Alerta Cobra',NULL,NULL,'Serie','Los protagonistas pertenecen a un cuerpo de élite encargados de velar por la seguridad de estos circuitos. Para ello deberán enfrentarse a robos, extorsiones, fugitivos y todo tipo de delincuentes que huyen de las ciudades.','https://image.tmdb.org/t/p/500w/qq6UOpN3xTyxjOvVrsa6laJcQX7.jpg','https://image.tmdb.org/t/p/original/vd4GYNpGugeXMt6hsCmnnf5TFNx.jpg','0000-00-00'),
	(1395,'Gossip Girl',NULL,NULL,'Serie','Los niños pijos de un instituto privado de Manhattan se salen siempre con la suya, hasta que una bloguera anónima, llamada la Reina Cotilla, espía sus movimientos.','https://image.tmdb.org/t/p/500w/kDUCF6thgPwPwOzpVHldp0ULdjj.jpg','https://image.tmdb.org/t/p/original/zcohP6W0KZijubdsVrOYt6WGc1F.jpg','0000-00-00'),
	(1396,'Breaking Bad',NULL,NULL,'Serie','Tras cumplir 50 años, Walter White (Bryan Cranston), un profesor de química de un instituto de Albuquerque, Nuevo México, se entera de que tiene un cáncer de pulmón incurable. Casado con Skyler (Anna Gunn) y con un hijo discapacitado (RJ Mitte), la brutal noticia lo impulsa a dar un drástico cambio a su vida: decide, con la ayuda de un antiguo alumno (Aaron Paul), fabricar anfetaminas y ponerlas a la venta. Lo que pretende es liberar a su familia de problemas económicos cuando se produzca el fatal desenlace.','https://image.tmdb.org/t/p/500w/tsRy63Mu5cu8etL1X7ZLyf7UP1M.jpg','https://image.tmdb.org/t/p/original/ztkUQFLlC19CCMYHW9o1zWhJRNq.jpg','0000-00-00'),
	(1398,'Los Soprano',NULL,NULL,'Serie','Los Soprano (The Sopranos) es una serie de televisión estadounidense creada y producida por David Chase. La serie se estrenó en Estados Unidos el 10 de enero de 1999 por el canal de televisión por cable HBO, que la emitió ininterrumpidamente hasta su desenlace, el 10 de junio de 2007. La trama de la serie gira en torno al mafioso de Nueva Jersey Tony Soprano (James Gandolfini) y las dificultades que enfrenta tanto en su hogar como en la organización criminal que dirige. A su vez, la serie también se centra en la historia de los personajes cercanos a Tony, especialmente su esposa Carmela (Edie Falco) y su sobrino y protegido Christopher Moltisanti (Michael Imperioli).','https://image.tmdb.org/t/p/500w/lNpkvX2s8LGB0mjGODMT4o6Up7j.jpg','https://image.tmdb.org/t/p/original/iCriCBcVNQVSKIJ2cXwJiQjYxFZ.jpg','0000-00-00'),
	(1399,'Juego de tronos',NULL,NULL,'Serie','En una tierra donde los veranos duran décadas y los inviernos pueden durar toda una vida, los problemas acechan. Desde las maquinaciones del sur a las salvajes tierras del este, pasando por el helado norte y el milenario muro que protege el reino de las fuerzas tenebrosas, dos poderosas familias mantienen un enfrentamiento letal por gobernar los Siete Reinos de Poniente. Mientras la traición, la lujuria y las fuerzas sobrenaturales sacuden los pilares de los reinos, la sangrienta batalla por el trono de Hierro tendrá consecuencias imprevistas y trascendentales. El invierno se acerca. Que empiece \'Juego de tronos\'.','https://image.tmdb.org/t/p/500w/suopoADq0k8YZr4dQXcU6pToj6s.jpg','https://image.tmdb.org/t/p/original/3hDtRuwTfQQYRst3kjhvp4Cogjw.jpg','0000-00-00'),
	(1400,'Seinfeld',NULL,NULL,'Serie','El cómico Jerry Seinfeld y sus excéntricos amigos (Constanza, Kramer y Elaine) viven en Nueva York y les pasan innumerables peripecias en esta genial comedia de situación donde la menor excusa sirve para regalarnos un delirante episodio. Batió todos los récords de audiencia que se pusieron por delante, y aún hoy en día sus reposiciones siguen contando con innumerables seguidores, no en vano \"Seinfeld\" es una verdadera leyenda de la televisión americana. \"Media hora acerca de nada\", así definió Jerry Seinfeld su teleserie cuando la presentó a los ejecutivos de la NBC, a comienzos de 1990. Contra todo pronóstico, ellos aceptaron. No en vano Seinfeld era ya por entonces uno de los cómicos más populares de Estados Unidos. ¿Su secreto? Sacar punta a las rutinas de cada día hasta convertirlas en reflexiones filosóficas dignas de figurar en un tratado sobre las grandezas y las miserias humanas.','https://image.tmdb.org/t/p/500w/lyTCCuymqg8egIaQXZAY5vE4MB0.jpg','https://image.tmdb.org/t/p/original/u3mFyqIprL5ou8Ue04Ecac6iDi7.jpg','0000-00-00'),
	(1402,'The Walking Dead',NULL,NULL,'Serie','\"The Walking Dead\" está ambientada en un futuro apocalíptico con la Tierra devastada por el efecto de un cataclismo, que ha provocado la mutación en zombies de la mayor parte de los habitantes del planeta. La serie, explora las dificultades de los protagonistas para sobrevivir en un mundo poblado por el horror, así como las relaciones personales que se establecen entre ellos, en ocasiones también una amenaza para su supervivencia.','https://image.tmdb.org/t/p/500w/wvdWb5kTQipdMDqCclC6Y3zr4j3.jpg','https://image.tmdb.org/t/p/original/wsq1xCuC9kDhFeoE7xuQFDC5iRC.jpg','0000-00-00'),
	(1403,'Marvel Agentes de S.H.I.E.L.D.',NULL,NULL,'Serie','El agente Phil Coulson, de la película \"Los vengadores\", regresa para liderar a un pequeño grupo de agentes altamente capacitados en el campo.','https://image.tmdb.org/t/p/500w/80BRASQnT9KT7BkFeEI0EdeRIF3.jpg','https://image.tmdb.org/t/p/original/zU8PRqDB8HnEAHczybMsaXvuaMk.jpg','0000-00-00'),
	(1405,'Dexter',NULL,NULL,'Serie','Serie de suspense que narra la historia de un hombre extraño llamado Dexter Morgan. Cuando era niño, Dexter fue maltratado y abandonado por sus padres, ahora es un exitoso e importante forense patológico... pero bajo su carismática personalidad, se esconde una terrible verdad. Dexter ha canalizado sus innatas necesidades homicidas en una segunda profesión que guarda celosamente en secreto: buscar, dar caza y asesinar brutalmente a despiadados criminales.','https://image.tmdb.org/t/p/500w/x3i8okUNTx0s7A7DlXAZjlxHFP5.jpg','https://image.tmdb.org/t/p/original/58H6Ctze1nnpS0s9vPmAAzPcipR.jpg','0000-00-00'),
	(1407,'Homeland',NULL,NULL,'Serie','El sargento de la Marina Nicholas Brody (Damian Lewis) regresa a casa ocho años después de su desaparición en Irak, donde vivió encarcelado y sometido a tortura. Finalmente, un comando de las fuerzas especiales lo localiza durante una misión. La joven Carrie Mathison (Claire Danes), una impulsiva e intuitiva agente de la CIA, sospecha que Brody se ha pasado al enemigo durante su cautiverio, pues unos meses antes un terrorista condenado a muerte le habló de un soldado norteamericano que había cambiado de bando. Basada en la serie israelí \"Prisoners of War\", creada por Gideon Raff.','https://image.tmdb.org/t/p/500w/391ixi0wVbFtFLQnOy8ZncWv2io.jpg','https://image.tmdb.org/t/p/original/6GAvS2e6VIRsms9FpVt33PsCoEW.jpg','0000-00-00'),
	(1408,'House',NULL,NULL,'Serie','House M. D. es un drama médico Estadounidense que se emitió originalmente por la cadena Fox durante ocho temporadas, desde el 16 de noviembre de 2004 al 21 de mayo de 2012. El protagonista de la serie es el Dr. Gregory House, un médico nada convencional, genio, misántropo y adicto a las drogas que dirige un equipo de diagnósticos en el \"Princeton-Plainsboro Teaching Hospital\" (nombre ficticio) en Nueva Jersey.','https://image.tmdb.org/t/p/500w/hiK4qc0tZijQ9KNUnBIS1k4tdMJ.jpg','https://image.tmdb.org/t/p/original/lW7MvZ4m49IUj2UrUu4z0xVVl81.jpg','0000-00-00'),
	(1409,'Hijos de la anarquía',NULL,NULL,'Serie','Creada por Kurt Sutter, responsable también de “The Shield”, “Sons of Anarchy” está ambientada en la localidad ficticia de Charming, situada en el Norte de California. Su protagonista es Jackson “Jax” Teller(Chalie Hunnam – “Hijos de los hombres”, “Cold Mountain”), un treintañero que, como el resto de su familia, pertenece a la banda de moteros Sons of Anarchy Motorcycle Club Redwood Original (SAMCRO en su acrónimo), un clan formado por antiguos veteranos de la guerra de Vietnam que se dedican a trapichear con todo, especialmente con armas que venden a bandas rivales.','https://image.tmdb.org/t/p/500w/sABDsMQOJyf6SCqnX1EnukF8aAq.jpg','https://image.tmdb.org/t/p/original/33fRHA8ToARmja6UiIkcINTU4d1.jpg','0000-00-00'),
	(1412,'Arrow',NULL,NULL,'Serie','Después de un violento naufragio y tras haber desaparecido y creído muerto durante cinco años, el multimillonario playboy Oliver Queen es rescatado con vida en una isla del Pacífico. De vuelta en casa en Starling City, es recibido por su madre, su hermana y su mejor amigo, quienes rápidamente notan que la terrible experiencia sufrida lo ha cambiado. Por otra parte, trata de ocultar la verdad acerca de en quién se ha convertido mientras trata de enmendar los errores que cometió en el pasado y de reconciliarse con su ex novia, Laurel Lance. Mientras trata de volver a contactar a las personas de su pasado jugando el papel del mujeriego adinerado, despreocupado y descuidado que solía ser, ayudado por su fiel chofer y guardaespaldas John Diggle, crea en secreto el personaje de un justiciero encapuchado, un vigilante que lucha contra los males de la sociedad tratando de darle a su ciudad la gloria que antes tenía; complicando esta misión.','https://image.tmdb.org/t/p/500w/xSM3Ba3Nabs2p0wW8vTJP0yx3Zv.jpg','https://image.tmdb.org/t/p/original/yrx3vmjElXHBIROEw6uQ4gQWOMW.jpg','0000-00-00'),
	(1413,'American Horror Story',NULL,NULL,'Serie','American Horror Story es una serie antológica de televisión, creada y producida por Ryan Murphy y Brad Falchuk. Cada una de sus temporadas narra una trama independiente, ambientada en lugares diferentes y cerrando siempre la historia; donde muchos actores repiten, pero siempre interpretando personajes distintos.','https://image.tmdb.org/t/p/500w/rNyOeC4uh0YMjZwtrLPFGyVIvyI.jpg','https://image.tmdb.org/t/p/original/mckCh2GYSerIqyCyPSLIStLvmZF.jpg','0000-00-00'),
	(1415,'Elementary',NULL,NULL,'Serie','Adaptación contemporánea del clásico personaje de Conan Doyle pero que esta vez estará resolviendo casos en la ciudad de Nueva York. Por primera vez en la historia el personaje de Watson estará interpretado por una mujer: Lucy Liu.','https://image.tmdb.org/t/p/500w/7sJrNKwzyJWnFPFpDL9wnZ859LZ.jpg','https://image.tmdb.org/t/p/original/q9dObe29W4bDpgzUfOOH3ZnzDbR.jpg','0000-00-00'),
	(1416,'Anatomía de Grey',NULL,NULL,'Serie','La vida de Meredith Grey no es nada fácil. Intenta tomar las riendas de su vida, aunque su trabajo sea de esos que te hacen la vida imposible. Meredith es una cirujana interna de primer año en el Hospital Grace de Seattle, el programa de prácticas más duro de la Facultad de Medicina de Harvard. Y ella lo va a comprobar. Pero no estará sola. Un elenco de compañeros de promoción tendrán que superar la misma prueba. Ahora están en el mundo real, son doctores del hospital. Y en un mundo donde la experiencia en el trabajo puede ser un factor de vida o muerte, todos ellos tendrán que lidiar con los altibajos de sus vidas personales.','https://image.tmdb.org/t/p/500w/3IIBf6VlwEyKAX4cN2XCM1gKdgM.jpg','https://image.tmdb.org/t/p/original/7ElKH7Ql2MIMvG0SqsGP6Iiwp5e.jpg','0000-00-00'),
	(1418,'Big Bang',NULL,NULL,'Serie','Mientras los físicos Leonard y Sheldon completan su pandilla de frikis con Howard y Raj, la aspirante a actriz Penny ocupa el piso de enfrente.','https://image.tmdb.org/t/p/500w/7RySzFeK3LPVMXcPtqfZnl6u4p1.jpg','https://image.tmdb.org/t/p/original/AmLAe6Hm4AqVaLX1Lsc82YnM4C2.jpg','0000-00-00'),
	(1419,'Castle',NULL,NULL,'Serie','Un escritor de novelas se une a una detective de Nueva York para resolver un caso de un asesino que emula a otro de la misma calaña, lamentablemente la relación entre ambos no es de lo mejor.','https://image.tmdb.org/t/p/500w/zOnLMRD3PIhwO5KZmWMVEnLokMo.jpg','https://image.tmdb.org/t/p/original/gkXKYjCjjEcRhYPMBLrB4SPPp91.jpg','0000-00-00'),
	(1420,'New Girl',NULL,NULL,'Serie','Jess (Zooey Deschanel) es una chica adorable que acaba de romper con su novio, así que en un cambio de rumbo decide irse a compartir piso con tres atractivos chicos en busca de una nueva y diferente vida. Pero, ¿será la convivencia correcta vivir con tres solteros?','https://image.tmdb.org/t/p/500w/j9GtqBORQs2SpOXQqHdKm2gEmJO.jpg','https://image.tmdb.org/t/p/original/8oCqMlKKomCArVtyOjRzMN6g40Z.jpg','0000-00-00'),
	(1421,'Modern Family',NULL,NULL,'Serie','Narrada desde la perspectiva de un documental, la serie ofrece un panorama honesto y divertido sobre la vida de varias familias, en donde se presentan la relación entre padres e hijos, diferencias generacionales y culturales.','https://image.tmdb.org/t/p/500w/4bzhxi3NRJwA3RYr3Rcb1rzF4rm.jpg','https://image.tmdb.org/t/p/original/gabjqvbqXsg4KL5JaBoPKPipiys.jpg','0000-00-00'),
	(1424,'Orange Is the New Black',NULL,NULL,'Serie','Piper Chapman (Taylor Schiling), una mujer de Connecticut con una vida estable y un alto cargo ejecutivo, es detenida a raíz de un delito de drogas que cometió hace una década: en aquellos días llevó un maletín con dinero de la droga para Alex Vause (Laura Prepon), una traficante y antigua amante de Piper. Tras el juicio, es enviada a prisión de mujeres en Litchfield, Nueva York. Basada en las vivencias reales de Kerman, cuya experiencia entre rejas le sirvió para escribir el best-seller autobiográfico \'Orange Is The New Black: My Year In A Women\'s Prison\'. A medio camino entre el drama y la comedia, una aclamada serie -fue una de las que mejor críticas obtuvo en su primera temporada en el 2013- que aborda temas relacionados con la cárcel como el sistema penitenciario norteamericano, el lesbianismo, la represión sexual, el abuso de poder o la corrupción policial.','https://image.tmdb.org/t/p/500w/z8Mg3YVZGd1iSnoDinEAoh9WTck.jpg','https://image.tmdb.org/t/p/original/ekaa7YjGPTkFLcPhwWXTnARuCEU.jpg','0000-00-00'),
	(1428,'Cazadores de mitos',NULL,NULL,'Serie','Mythbusters (en español Cazadores de mitos) es un programa de televisión estadounidense y australiano de divulgación científica emitido por Discovery Channel. Está protagonizado por los expertos en efectos especiales Adam Savage y Jamie Hyneman ayudados, hasta el final de la temporada de 2014, por Tory Belleci, Grant Imahara y Kari Byron. En el programa, los protagonistas usan sus conocimientos y habilidades para poner a prueba la veracidad de las leyendas urbanas y otras creencias de la cultura popular sometiéndolas al método científico.','https://image.tmdb.org/t/p/500w/s705IIeyfznuhQ9t5FPGMO0CEk3.jpg','https://image.tmdb.org/t/p/original/9MxhqYvwx8FSb5cRWUWEDfpWSfo.jpg','0000-00-00'),
	(1429,'Ataque a los Titanes',NULL,NULL,'Serie','Hace cien años, los titanes atacaron y diezmaron a la humanidad. Para sobrevivir, esta se recluyó en grandes ciudades amuralladas, creyendo que estaría segura para siempre. Pero, cien años después de aquel ataque, un titán colosal hace su aparición en una de las urbes, destruye el parapeto y permite que sus congéneres menores devoren de nuevo a los hombres. El Cuerpo de Exploradores, al que pertenece Eren Jaeger, deberá enfrentarse a ellos y contraatacarlos, para que la humanidad pueda vivir de nuevo en paz.','https://image.tmdb.org/t/p/500w/yvKrycViRMQcIgdnjsM5JGNWU4Q.jpg','https://image.tmdb.org/t/p/original/xtDs2WuiOyKYEn2bGax9TxX4GDo.jpg','0000-00-00'),
	(1431,'CSI: Las Vegas',NULL,NULL,'Serie','CSI: Crime Scene Investigation es una serie de televisión de ficción estadounidense transmitida por primera vez en los Estados Unidos por la cadena CBS. La serie se centra en torno a un grupo de científicos forenses y criminologos que trabajan en la ciudad estadounidense de Las Vegas (Nevada), investigando los crímenes que en ella suceden. La original fórmula de la serie y su éxito suscitó dos secuelas, CSI: Miami (2002-2012) y CSI: Nueva York (2004-2013), en torno a los equipos de científicos forenses de dichas ciudades, pero además influye en varias series posteriores relacionadas con la investigación criminal, como Bones o NCIS entre otras.','https://image.tmdb.org/t/p/500w/cvlLBcQWpO9X21jDHhgPJnE2aVq.jpg','https://image.tmdb.org/t/p/original/9XecVOLLkbGBNnpF2PvP8vQBmww.jpg','0000-00-00'),
	(1433,'Padre Made in USA',NULL,NULL,'Serie','American Dad! es una serie de televisión de animación para adolescentes y adultos del creador de Padre de familia, Seth MacFarlane.','https://image.tmdb.org/t/p/500w/hxez7Xn6Xc5bTtK3oTSnl594XYr.jpg','https://image.tmdb.org/t/p/original/aC1q422YhQR7k82GB8gW4KoD91p.jpg','0000-00-00'),
	(1434,'Padre de familia',NULL,NULL,'Serie','Padre de familia es una comedia de animación para adultos creada por Seth MacFarlane para la Fox Broadcasting Company. La serie se centra en los Griffin, una mediocre familia compuesta por los padres Peter y Lois; sus hijos Meg, Chris, y Stewie; y su antropomórfica mascota canina Brian. La serie está ambientada en la ciudad ficticia de Quahog, Rhode Island, y gran parte de su humor se exhibe en forma de pequeños cortes que frecuentemente se mofan de la cultura americana.','https://image.tmdb.org/t/p/500w/jbTqU6BJMufoMnPSlO4ThrcXs3Y.jpg','https://image.tmdb.org/t/p/original/tCBuvLgTP9bgjynNvQWa7LSUnHj.jpg','0000-00-00'),
	(1447,'Psych',NULL,NULL,'Serie','Shawn es un joven muy distinto a los demás. Desde pequeño, su padre, detective de profesión, le enseñaba a fijarse en todos los detalles de su alrededor, incluso hasta en los más nimios. Tanto que sus extraordinarios poderes de observación le hacen ser sospechoso de un crimen que no ha cometido. Sin embargo, gracias a su talento, termina convenciendo a la policía de que se trata de poderes psíquicos. De este modo, el joven se hace pasar desde entonces por un falso médium. El joven Shawn sabe aprovechar su inusual habilidad de observar. Y es que, además de trabajar como asesor de la policía, monta un negocio para enriquecerse a partir de su propia farsa. Con la ayuda de su mejor amigo, Gus, el joven protagonista pone en marcha una agencia de investigación llamada Psych donde, de manera picaresca, intentan solucionar los casos más insospechados, dejando a las fuerzas del orden totalmente impresionadas, aunque siempre quedan los escépticos.','https://image.tmdb.org/t/p/500w/5wdqm26SMIcYgRletxmAVMEQwGW.jpg','https://image.tmdb.org/t/p/original/fDI15gTVbtW5Sbv5QenqecRxWKJ.jpg','0000-00-00'),
	(1516,'El equipo A',NULL,NULL,'Serie','En 1972, cuatro de los mejores hombres del ejército de Estados Unidos fueron encarcelados por un delito que no habían cometido. Pero pronto escaparon de la prisión donde estaban recluidos para esconderse en el submundo de Los Ángeles. Hoy en día, aún buscados por el gobierno, sobreviven como soldados de fortuna.','https://image.tmdb.org/t/p/500w/ggPjnOA5sap6wyuAGUY7kwRseEi.jpg','https://image.tmdb.org/t/p/original/5FRRN2yAz0Xc3oqoURSIsQJynwM.jpg','0000-00-00'),
	(1606,'Entre fantasmas',NULL,NULL,'Serie','Melinda Gordon es una joven recién casada que posee el don de comunicarse con los espíritus de las personas que han muerto, un talento heredado de su abuela. Los muertos buscan la habilidad de Melinda para poder transmitir mensajes e información relevantes a los vivos. A pesar de su miedo, la compasión la lleva a ayudar a esas almas errantes a completar sus negocios inacabados con los vivos... ','https://image.tmdb.org/t/p/500w/59iA4qAQhyVr8FEhLHim25fCbl8.jpg','https://image.tmdb.org/t/p/original/u20Yzj0pYiWkNfVUstpwbsSI9kc.jpg','0000-00-00'),
	(1620,'CSI: Miami',NULL,NULL,'Serie','CSI: Miami es una serie de televisión estadounidense creada en 2002 sobre el trabajo del Laboratorio de Criminalística de la Policía de Miami Dade. Es el primer spin off de la serie original CSI: Las Vegas (2000), como posteriormente se haría con CSI: Nueva York (2004).\n\nEl Laboratorio del CSI de la Policía de Miami afronta cada investigación desde el análisis forense de la escena del crimen, combinando el uso de métodos científicos con el trabajo policial. Integrado por un equipo altamente calificado dirigido por el Teniente Horatio Caine,(David Caruso) conocido como \"H\" o \"con H de Honesty\" como Supervisor del turno de día, tiene entre sus principales componentes a Calleigh Duquesne, una experta en balística, Eric Delko, investigador experto en el análisis de fibras, Ryan Wolfe, Natalia Boa Vista y Walter Simmons. Junto a ellos, también trabaja el detective de homicidios de la Policía, Frank Tripp.\n\nLa serie refleja también la compleja situación de la ciudad de Miami, combinando los','https://image.tmdb.org/t/p/500w/2sjy8Tu8PJGFQI4Foz4682qk8Mw.jpg','https://image.tmdb.org/t/p/original/zjv3yTBt13i1fqmeEaYIUD3txFZ.jpg','0000-00-00'),
	(1622,'Sobrenatural',NULL,NULL,'Serie','Cuando eran niños, Sam y Dean Winchester, perdieron a su madre debido a una misteriosa y demoníaca fuerza supernatural. Posteriormente, su padre los crió para que fueran soldados. Él les enseño sobre el mal que vive en los rincones obscuros y en las carreteras secundarias de América... y también les enseñó como matarlo. Ahora los hermanos Winchester recorren el país en su Chevy Impala del \'67, luchando contra todo tipo de amenaza sobrenatural que encuentran en el camino.','https://image.tmdb.org/t/p/500w/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg','https://image.tmdb.org/t/p/original/58Qaj36FZDz54H36LsUI8mGiW9y.jpg','0000-00-00'),
	(1639,'Héroes',NULL,NULL,'Serie','Serie de TV (2006-2010). 4 temporadas. 77 episodios. Algunas personas nacen para ser extraordinarias. Un grupo de personas normales se ve, de la noche a la mañana, dotada de increíbles poderes. Así, mientras en Japón un anónimo oficinista descubre que tiene un don para teletransportarse, en Nueva York un artista se da cuenta de que es capaz de pintar el futuro, o en Los Ángeles un policía puede escuchar los pensamientos ajenos. Estas personas no sólo tendrán que aprender a conocer sus poderes y a dominarlos, sino que además deberán decidir qué destino quieren darles.','https://image.tmdb.org/t/p/500w/4DgAubucJP6y2yX2Yx4CLEgdIPA.jpg','https://image.tmdb.org/t/p/original/7Cn1Sj5yipu7tBX14BbaXuBHbL1.jpg','0000-00-00'),
	(1660,'Mi bella genio',NULL,NULL,'Serie','El astronauta Tony Nelson, enviado al espacio para realizar una misión, se ve obligado a lanzarse en paracaídas sobre una isla desierta. Mientras espera que lo rescaten, encuentra una botella semienterrada, de la que sale una mujer genio que, agradecida, acepta ser su sierva. Cuando Tony regresa a Co-Coa Beach (Florida), sabe muy bien que nadie creerá su aventura. El psicoanalista de la base, el doctor Bellows, esta convencido de que Tony ha sufrido alucinaciones. Además, Jeannie (así la llamó), se negó a mostrarse ante otras personas que no fueran su amo.','https://image.tmdb.org/t/p/500w/jcknghTQ6eb8sSpv4zIz0rw2PNp.jpg','https://image.tmdb.org/t/p/original/rJLPacKrjWUqjZrxiG8xTCMfGj.jpg','0000-00-00'),
	(1667,'Saturday Night Live',NULL,NULL,'Serie','Saturday Night Live es un show televisivo nocturno estadounidense, emitido en vivo, que revolucionó la televisión en los años 70 con su combinación de sketches, comedia, variedad, actores, músicos, e invitados especiales. Ha sido una cantera generadora de talentos muy fuerte de varios guinistas, actores, escritores, productores y cantantes. Creado por Lorne Michaels y desarrollado por Dick Ebersol, el programa fue estrenado por la cadena de televisión NBC. Durante más de 30 años, el programa ha presentado personajes locos, situaciones humorísticamente extrañas, parodias de los presidentes y políticos de turno, sarcásticas burlas a celebridades contemporáneas de la música y del cine, y shows musicales en vivo. Su reparto se compone de miembros repertorios, también conocidos como The Not Ready for Prime-Time Players (el nombre del reparto original del programa, que viene a significar «La Compañía No Apta para las Horas de Máxima Audiencia»), y nuevos miembros quienes se conocen como The','https://image.tmdb.org/t/p/500w/yYaxXMbobcB7PIM6XljZZk2x4FQ.jpg','https://image.tmdb.org/t/p/original/dUarLANS82FgBOHjRnJw42FB1z4.jpg','0000-00-00'),
	(1668,'Friends',NULL,NULL,'Serie','Las aventuras de seis jóvenes neoyorquinos unidos por una divertida amistad. Entre el amor, el trabajo y la familia, comparten sus alegrías y preocupaciones en el Central Perk, su café favorito.','https://image.tmdb.org/t/p/500w/qjUqBVLUPX1Pc4cyYljZfAJHf8N.jpg','https://image.tmdb.org/t/p/original/f496cm9enuEsZkSPzCwnTESEK5s.jpg','0000-00-00'),
	(1695,'Monk',NULL,NULL,'Serie','Serie de TV (2002-2009). 8 temporadas. 125 episodios. Adrian Monk (Tony Shalhoub) es un ex-policía de San Francisco que se hizo famoso por los métodos poco convencionales con los que resolvía los casos más complicados. Pero el asesinato de su esposa le convirtió en un maníaco obsesionado por todo lo que le rodea (gérmenes, alturas, multitudes, espacios cerrados, alimentos...), lo que hizo que fuera expulsado del cuerpo. Ahora Adrian es un detective privado que necesita ayuda hasta para ordenar el cajón de los calcetines, sencilla tarea que su complicada mente puede convertir en un reto angustioso. Afortunadamente para él, cuenta con la incondicional ayuda de Sharona (Bitty Schram), su enfermera, que es quien le ayuda tanto para poder enfrentarse a la vida diaria como en los casos que tienen en jaque a la policía. Su ex-jefe, por mucho que le pese, acude a Monk en muchas ocasiones para que aporte una visión alternativa, ya que sus neurosis le ayudan a desentramar crímenes aparentemente','https://image.tmdb.org/t/p/500w/sqtSI7uHhFSCvTx60pdqPXGhYCF.jpg','https://image.tmdb.org/t/p/original/1zsqAttsLBxFYCpo166FP0JipqZ.jpg','0000-00-00'),
	(1705,'Fringe',NULL,NULL,'Serie','Fringe (en España Fringe: Al límite, también conocida por sus títulos alternativos Fringe: La gran conspiración y Ciencia al límite) es una serie de ciencia ficción estadounidense creada por J. J. Abrams, Alex Kurtzman y Roberto Orci. Se estrenó a través de Fox Broadcasting Company el 9 de septiembre de 2008 y terminó el 18 de enero de 2013 después de cien episodios recopilados en cinco temporadas. La serie sigue a Olivia Dunham (Anna Torv), Peter Bishop (Joshua Jackson) y Walter Bishop (John Noble), quienes son miembros de la División Fringe de la Oficina Federal de Investigación cuya base se encuentra en Boston, Estados Unidos, bajo órdenes del Departamento de Seguridad Nacional. El equipo utiliza métodos de la ciencia fringe para ayudar al FBI a investigar diversos casos inexplicables, a menudo horribles, que están relacionados con un misterioso universo paralelo. La serie ha sido considerada como una mezcla entre The X-Files, Altered States y The Twilight Zone.','https://image.tmdb.org/t/p/500w/wmF2N0mZT9pLHJB8w2Rocfq80j2.jpg','https://image.tmdb.org/t/p/original/lUNV8vRRlDHPKFRuM65jHQlBJP9.jpg','0000-00-00'),
	(1823,'Vacaciones en el mar',NULL,NULL,'Serie','Comedia de situación ambientada en un lujoso y enorme barco de pasajeros que hace cruceros de lujo surcando los mares del mundo. Sus protagonistas fijos son algunos de los miembros de la tripulación (el capitán Stubing, el doctor Adam, Gopher, Isaac y Julie), mientras que en cada episodio aparecen nuevos pasajeros, cada uno con sus particulares historias.','https://image.tmdb.org/t/p/500w/aplztf8fotkLOnwBM0bNfNmlxSo.jpg','https://image.tmdb.org/t/p/original/fnsnazlj2bt3Fuj0pJ7wBPmuMLO.jpg','0000-00-00'),
	(1855,'Star Trek: Voyager',NULL,NULL,'Serie','Star Trek: Voyager (algunas veces abreviada ST:VOY, ST:VGR, ST:V) es una serie de televisión de ciencia ficción estadounidense, dentro del universo de Star Trek. Esta serie fue creada por Rick Berman, Michael Piller y Jeri Taylor, y es la cuarta serie televisiva de Star Trek, que comenzó en los años 1960 con Star Trek: La Serie Original, creada por Gene Roddenberry. Star Trek Voyager fue producida durante siete temporadas, entre 1995 y 2001, y es la única serie de T.V. de Star Trek en tener una mujer como capitán (Kathryn Janeway).\n\nEsta serie sigue las aventuras de la nave estelar USS Voyager, atrapada en el Cuadrante Delta a 75 mil años luz de la Tierra, mientras perseguía una nave de renegados Maquis. Ambas tripulaciones se unirán para emprender el camino de regreso a casa.','https://image.tmdb.org/t/p/500w/7YFranrnnIcCrgsLYQsoq8aE3Ir.jpg','https://image.tmdb.org/t/p/original/cYnVMJtuOCCzlo0QvIDKplOjFvj.jpg','0000-00-00'),
	(1871,'Gente de barrio',NULL,NULL,'Serie','Cuenta la vida doméstica y profesional de los habitantes de la ciudad ficticia de Walford, situada en el East End londinense. A lo largo de sus 32 temporadas ha ganado 268 premios y aun sigue en antena.','https://image.tmdb.org/t/p/500w/hUz0UHWSVd6e1g3I6vT4shAsnoY.jpg','https://image.tmdb.org/t/p/original/z4jgyI5TpoRZiJTNchkVkMrGQyz.jpg','0000-00-00'),
	(1911,'Bones',NULL,NULL,'Serie','Una antropóloga forense y un engreído agente del FBI forman equipo para investigar las causas de los homicidios que investigan.','https://image.tmdb.org/t/p/500w/uwbue4X5f3r1b4z19EP6lSlRED6.jpg','https://image.tmdb.org/t/p/original/eyTu5c8LniVciRZIOSHTvvkkgJa.jpg','0000-00-00'),
	(1920,'Twin Peaks',NULL,NULL,'Serie','Twin Peaks cuenta la historia del Agente Especial del FBI Dale Cooper y su investigación del asesinato de una chica local muy popular, Laura Palmer. También muestra la vida social en un pueblo de los Estados Unidos. El episodio piloto fue rodado en los pueblos de North Bend, Washington y Snoqualmie, Washington, cerca de Seattle, en los alrededores de las Cascade Mountains.','https://image.tmdb.org/t/p/500w/sfmm2PO9tWB8igwH5Cp4GDNij3R.jpg','https://image.tmdb.org/t/p/original/ypeuD2LJiHSotbwy5C7wFeZSBhv.jpg','0000-00-00'),
	(1930,'The Amazing Spider-Man',NULL,NULL,'Pelicula','Un estudiante de secundaria que fue abandonado por sus padres cuando era niño, dejándolo a cargo de su tío Ben (Martin Sheen) y su tía May (Sally Field). Como la mayoría de los adolescentes de su edad, Peter trata de averiguar quién es y qué quiere llegar a ser. Peter también está encontrando su camino con su primer amor de secundaria, Gwen Stacy (Emma Stone), y juntos luchan por su amor con compromiso. Cuando Peter descubre un misterioso maletín que perteneció a su padre, comienza la búsqueda para entender la desaparición de sus padres, una búsqueda que le lleva directamente a Oscorp, el laboratorio del Dr Curt Connors (Rhys Ifans), ex-compañero de trabajo de su padre. Mientras Spider-Man se encuentra en plena colisión con el alter-ego de Connors, el Lagarto, Peter hará elecciones que alterarán sus opciones para usar sus poderes y darán forma a un destino héroico.','https://image.tmdb.org/t/p/original/xYz4u1jWCKyXGzddMJeOL845DTr.jpg','https://image.tmdb.org/t/p/original/uiX2jlUHDYjb4kSGGCfhl4yAxIw.jpg','2012-06-23'),
	(1973,'24',NULL,NULL,'Serie','24 es una serie de televisión estadounidense del género de acción/drama que trata fundamentalmente el desempeño del agente federal Jack Bauer (Kiefer Sutherland), en la UAT (Unidad antiterrorista) de Los Ángeles. La serie también se enfoca en las actividades de otros agentes de la UAT, la participación de otras agencias gubernamentales, las acciones de diversos grupos terroristas y las reacciones en la Casa Blanca.\n\nEn un formato innovador, el espectador presencia la acción \"en tiempo real\": cada episodio de una hora representa una hora continua de acción de la trama. Cada temporada (compuesta por 24 capítulos) conforma así un día completo. Las sucesivas temporadas (si bien guardan una relación temporal y fáctica) no son contiguas, y relatan eventos cronológicamente distantes.','https://image.tmdb.org/t/p/500w/be6mDIMv7cg8duWkcYVnTB8rphO.jpg','https://image.tmdb.org/t/p/original/iq6yrZ5LEDXf1ArCOYLq8PIUBpV.jpg','0000-00-00'),
	(1981,'Embrujadas',NULL,NULL,'Serie','Tras la muerte de su abuela, las hermanas Halliwell descubren que son brujas. Desde ese momento deben aprender a manejarse con sus nuevos poderes y combatir con los demonios que tratan de asesinarlas.','https://image.tmdb.org/t/p/500w/iU6XAlXlG9GTIRkRYEcQoJYInDf.jpg','https://image.tmdb.org/t/p/original/tQlPfXtEHedQU399qvGK41gRLZN.jpg','0000-00-00'),
	(2004,'Malcolm',NULL,NULL,'Serie','Sitcom familiar que aborda los divertidos problemas y situaciones de una familia americana de clase media en la que el hijo Malcolm parece ser el único sensato... o al menos el único que da señales de cordura. La familia está compuesta por sus neuróticos padres Hal y Lois, el hermano mayor Francis y sus otros dos hermanos, Reese y Dewey.','https://image.tmdb.org/t/p/500w/5Nrh0PtHuU41f6F8m5WbGm2iEQa.jpg','https://image.tmdb.org/t/p/original/uwslHj6nEyPX5IbNXhuEeI0PTth.jpg','0000-00-00'),
	(2025,'Beverly Hills 90210',NULL,NULL,'Serie','Brenda y Brandon son dos hermanos que se mudan desde Minnesota al barrio de Beverly Hills de Los Ángeles por motivos familiares. Es allí donde van a conocer a una serie de amigos que serán su nueva pandilla en pleno desarrollo de la adolescencia a la madurez. Los protagonistas se enamoraran a lo largo de las diez temporadas que duró la serie pero también se desenamoran, se pelean con los amigos, se reconciliriaran, tendrán problemas con sus padres, con su colegio y con el mundo entero. Pero todo ello entre ropa de marca y coches de lujo. Se inicia la serie cuando los hermanos mellizos Walsh llegan a Beverly Hills, deben afrontar un choque de estilos de vida entre la fría Minnesota, de donde llegan los hermanos y la soleada y elitista California. En el colegio secundario, los mellizos se encuentran con un mundo dorado de dinero, elegancia y de cuerpos con aspectos que parecían irracionalmente perfectos hasta para los estándares de California del sur.','https://image.tmdb.org/t/p/500w/k1PL3QaOUSkTD9Qf4soz3nSpqt5.jpg','https://image.tmdb.org/t/p/original/sWfDgsXIpJYLWKb2RCqG2Ajsycq.jpg','0000-00-00'),
	(2038,'Drake y Josh',NULL,NULL,'Serie','Sin haber cruzado antes una palabra en el instituto, Drake y Josh se convierten en hermanastros de la noche a la mañana. Drake Parker toca la guitarra en su propia banda, llamada \"Drake y sus Notas Rockeras\". Es guapo y tiene éxito con las chicas, incluso sale a veces con dos chicas a la vez, y no le importa sacar malas notas, como le sucede a su hermanastro, Josh, un buen estudiante al que no le gustan los deportes, adora los trucos de magia, la cocina y los videojuegos. A Josh no le va bien con las chicas, y es fan de Oprah Winfrey. Viven con la madre de Drake y el padre de Josh y Megan, la hermana de Drake, a quien le gusta hacer bromas pesadas a los chicos. Todos forman una familia, con sus diferencias y sus distintas formas de ser.','https://image.tmdb.org/t/p/500w/kxo1T84BTJESTtIw80N984EbmWu.jpg','https://image.tmdb.org/t/p/original/sVHs1XFdXbFl9GznwKHw2iSgq2e.jpg','0000-00-00'),
	(2085,'Agallas, el perro cobarde',NULL,NULL,'Serie','La historia trata sobre un perro llamado Agallas y sus dueños: Muriel, una vieja mujer escocesa, y Eustaquio, un viejo agricultor gruñón. Este perro vive para salvarles la vida de tenebrosos monstruos, extraterrestres y otras criaturas míticas.','https://image.tmdb.org/t/p/500w/wxvnnh8rS9ge8296HUpj9BiwM6B.jpg','https://image.tmdb.org/t/p/original/6GgsPD43JYdQT1IdwByItdIrr5f.jpg','0000-00-00'),
	(2098,'Batman: La Serie Animada',NULL,NULL,'Serie','Bruce Wayne de día, Batman de noche. Junto a su inseparable aprendiz, Robin, Batman luchará por la estabilidad y bienestar de los habitantes de Gotham; protegiendo a la ciudad de villanos como Dos Caras, Joker, Harley Quinn y Pingüino.','https://image.tmdb.org/t/p/500w/x7oIDmaaeSg3zBaGgaRivUMYpgg.jpg','https://image.tmdb.org/t/p/original/gcOV7JFbJpNqH8mzSuL8jG1WVy4.jpg','0000-00-00'),
	(2190,'South Park',NULL,NULL,'Serie','South Park es una serie de televisión estadounidense de animación, creada por Trey Parker y Matt Stone para el canal Comedy Central. Está dirigida al público adulto y se caracteriza por satirizar con humor negro la sociedad, actualidad y cultura estadounidense a través de las historias y situaciones surrealistas que les suceden a sus protagonistas, cuatro niños (Stan, Kyle, Cartman y Kenny) residentes en un pueblo ficticio de Colorado que se llama South Park.','https://image.tmdb.org/t/p/500w/41neXsH222hV2zrsTyw8h7javon.jpg','https://image.tmdb.org/t/p/original/iiCY2QIGSnmtVkIdjkKAfwDs0KF.jpg','0000-00-00'),
	(2224,'The Daily Show with Trevor Noah',NULL,NULL,'Serie','Presentado por el humorista Jon Stewart, es el formato de sátira política más popular de la televisión norteamericana. Ha estado en antena en Comedy Central desde 1996 y ha ganado 18 Primetime Emmys. Se autodefine como un programa de noticias falso y enfoca su particular punto de vista en la actualidad, las noticias, los personajes políticos y de los medios de comunicación fundamentalmente con el objetivo de hacer reír. Generalmente el show comienza con un monólogo de Jon Stewart relacionado con los principales titulares de la actualidad. Después de este monólogo da paso a sus numerosos corresponsales y finalmente suele acabar con una entrevista a un personaje conocido.','https://image.tmdb.org/t/p/500w/uyilhJ7MBLjiaQXboaEwe44Z0jA.jpg','https://image.tmdb.org/t/p/original/xyaQj8PAHxPmvh3W7TZBRHLvViA.jpg','0000-00-00'),
	(2288,'Prison Break',NULL,NULL,'Serie','Prison Break, también conocida como Prison break, en busca de la verdad en Hispanoamérica, fue una serie de televisión dramática estadounidense que estrenó la cadena norteamericana Fox el 29 de agosto de 2005 y terminó el 24 de mayo de 2009 en su cuarta temporada (los dos episodios finales fueron editados directamente al DVD en EE. UU. el 21 de julio, pero el 24 de mayo fueron estrenados por una televisión israelí). La trama de la serie gira en torno a un hombre sentenciado a la pena de muerte y el elaborado plan de su hermano para salvarlo de la misma. Fue creada por Paul Scheuring y producida por Adelstein-Parouse Productions en asociación con Original Television y 20th Century Fox Television. La originalidad y la calidad de la serie la ha hecho merecedora de nominaciones a distintos premios como los Emmy y los Globo de Oro.','https://image.tmdb.org/t/p/500w/92OPBZpLc82y8CzOtrQ8P9RDvIN.jpg','https://image.tmdb.org/t/p/original/5E1BhkCgjLBlqx557Z5yzcN0i88.jpg','0000-00-00'),
	(2309,'Danny Phantom',NULL,NULL,'Serie','Danny Phantom es una serie animada de televisión creada por Butch  Hartman (también creador de Los padrinos mágicos) para Nickelodeon,  producida por los Estudios Billionfold y distribuida por la compañía  Nelvana. El personaje principal, Danny Fenton, echa un vistazo a un  portal fantasma creado por sus padres, y por accidente se vuelve mitad  humano y mitad fantasma. Ahora Danny tiene que luchar con la ayuda de  sus amigos para atrapar a los fantasmas y regresarlos a la zona  fantasma, mientras que lucha día a día en el agonizante mundo  adolescente.','https://image.tmdb.org/t/p/500w/4gFUAPBZg5Z1k8NGqwgLoOJFXJh.jpg','https://image.tmdb.org/t/p/original/gGFqKQFk4RktBmCYrd9leCqaINh.jpg','0000-00-00'),
	(2316,'The Office',NULL,NULL,'Serie','Steve Carell protagoniza The Office, un fresco y divertido vistazo, con formato pseudo-documental, al día a día en la vida de unos excéntricos trabajadores de la empresa Dunder Mifflin. El serio pero despistadísimo director Michael Scott se considera un magnífico jefe y mentor, pero realmente inspira más críticas que respeto a sus empleados.','https://image.tmdb.org/t/p/500w/vNpuAxGTl9HsUbHqam3E9CzqCvX.jpg','https://image.tmdb.org/t/p/original/5uwetbr0X8BPRy3Wmh63S9EhsiY.jpg','0000-00-00'),
	(2352,'La niñera',NULL,NULL,'Serie','Fran Fine (Fran Drescher), una joven judía del barrio de Queens de Nueva York, al ser despedida de la tienda donde trabajaba junto a su ex novio, encuentra un empleo como canguro en casa de Maxwell Sheffield (Charles Shaughnessy), un millonario productor de Broadway que vive solo con sus tres hijos. Fran vive una vida llena de sorpresas en la que trata de enamorar al padre de los niños que cuida.','https://image.tmdb.org/t/p/500w/hMHTCkiwUzsSZeDqeMiRdtX3qSG.jpg','https://image.tmdb.org/t/p/original/1zEdxchngKLIoHK2dEUXO8BgonA.jpg','0000-00-00'),
	(2426,'Ángel',NULL,NULL,'Serie','Ángel es una serie de televisión estadounidense, serie secuela de Buffy, la cazavampiros. Ambas comparten a su creador Joss Whedon en colaboración con David Greenwalt y se estrenó en los Estados Unidos el 5 de octubre de 1999 en conjunto con la cuarta temporada de su predecesora.  La trama central de la serie sigue a Ángel, el primer vampiro con alma humana, que en su búsqueda por la redención decide pelear del lado del bien y se muda a Los Ángeles. Con ayuda de antiguos compañeros de Sunnydale como Cordelia Chase y Wesley, así como de aliados nuevos como Charles Gunn y Winifred, Ángel funda una compañía de servicios especializados en resolver los casos sobrenaturales de la ciudad y restaurar la fe y las almas de los que han perdido el camino. Siendo su enemigo más frecuente la firma de abogados demoníaca Wolfram &amp; Hart.','https://image.tmdb.org/t/p/500w/pRPaghqbqNvC8uJToD4PIgVRRiw.jpg','https://image.tmdb.org/t/p/original/yC7F367aFSOzsPEvEmzmKtIXyfX.jpg','0000-00-00'),
	(2458,'CSI: Nueva York',NULL,NULL,'Serie','CSI: Nueva York es la tercera franquicia de la serie creada por Anthony Zuiker y producida por Jerry Bruckheimer. Quizás era la más esperada por el atractivo de la ciudad. Casi 19 millones de personas se apoltronaron en Estados Unidos el día del estreno de la primera tanda de este seriado policial que ya es objeto de culto entre los televidentes de todo el mundo. La presencia de Gary Sinise siempre aseguró parte del éxito de la versión neoyorquina de CSI. Este reconocido actor, ganador de premios Emmy y Golden Globe, nominado al Oscar por su desempeño en la célebre Forrest Gump y a quien también hemos visto en Truman y Apollo 13, encarna al detective Mac Taylor, reservado, brillante en su trabajo como jefe del departamento de criminalística. Junto a Sinise, el equipo del detective Taylor se completa con la atractiva, inteligente y medio misteriosa Stella Bonasera (Melina Kanakaredes); Don Flack (Eddie Cahill), el joven detective que parece haber heredado de sus padres la pasión por es','https://image.tmdb.org/t/p/500w/xwhp6vi30tOYnMcsHaIEbloLkH3.jpg','https://image.tmdb.org/t/p/original/blajdd5D01slFW2Er5SMwXhs9IM.jpg','0000-00-00'),
	(2527,'Emmerdale',NULL,NULL,'Serie','Telenovela británica ambientada en un pueblo ficticio de Yorkshire.','https://image.tmdb.org/t/p/500w/boPsYdMOZQj6FJy9xXmAkrEK7ry.jpg','https://image.tmdb.org/t/p/original/ualtuRRNYa9Fj61wSuBVcuvaVDP.jpg','0000-00-00'),
	(2593,'Sin rastro',NULL,NULL,'Serie','La serie trata sobre una unidad ficticia del FBI, compuesta por tres hombres y tres mujeres, que se encargan de solucionar las desapariciones de personas en Nueva York, tratando de aclarar si han sido secuestradas, se han suicidado o simplemente han huido. Normalmente cada capítulo trata de la investigación de la desaparición de una persona.','https://image.tmdb.org/t/p/500w/1KclsHGiGNTkn11puPbMMnnpRRT.jpg','https://image.tmdb.org/t/p/original/iNhE283iY7xtS8zCjhSxpTfOzn0.jpg','0000-00-00'),
	(2691,'Dos hombres y medio',NULL,NULL,'Serie','Charlie Harper es un soltero con dinero que tiene una casa en la playa y gran éxito con las mujeres. Pero su informal estilo de vida en Malibú se ve bruscamente interrumpido cuando su hermano Alan, muy deprimido por su divorcio, y su hijo Jake, llegan para quedarse a vivir con él. La situación se complica aún más gracias a Evelyn, la egocéntrica y controladora madre de Charlie y Alan. A pesar de la complejidad de sus vidas y de sus tensas relaciones, Charlie y Alan tienen una cosa en común: adoran a Jake y quieren lo mejor para él.','https://image.tmdb.org/t/p/500w/lW3r6Fb7dwZ0bpGwjYHMVkgSVRt.jpg','https://image.tmdb.org/t/p/original/sBR2LYNbgtnA76fbIO2AuX8duXD.jpg','0000-00-00'),
	(2710,'Colgados en Filadelfia ',NULL,NULL,'Serie','Cuatro amigos que regentan un pequeño bar en un barrio del sur de Philadelphia, la ciudad del amor fraternal, intentan mantener el equilibrio entre negocio y amistad, tarea nada fácil, ya que cada uno de ellos suele dejarse llevar únicamente por sus intereses personales, lo que desemboca en situaciones incómodas que amenazan con deteriorar sus relaciones personales.','https://image.tmdb.org/t/p/500w/w6t8mFlyB6JKcEGm3cojvylIc5O.jpg','https://image.tmdb.org/t/p/original/mLvKuGCI8oVaMhmAMLFtteQLLo9.jpg','0000-00-00'),
	(2734,'Ley y orden: unidad de víctimas especiales',NULL,NULL,'Serie','‘Ley y orden: unidad de víctimas especiales’ es una serie de televisión estadounidese grabada en Nueva York donde es también principalmente producida. Con el estilo de la original ‘Ley y orden’ los episodios son usualmente \"sacados de los titulares\" o basados libremente en verdaderos asesinatos que han recibido la atención de los medios.','https://image.tmdb.org/t/p/500w/cD9PxbrdWYgL7MUpD9eOYuiSe2P.jpg','https://image.tmdb.org/t/p/original/ydSvHgksuB8Ix0V05QEZBKrnIcg.jpg','0000-00-00'),
	(3022,'Rugrats: Aventuras en pañales',NULL,NULL,'Serie','Rugrats es una serie de televisión de dibujos animados que cuenta el día a día de varios bebés. Ellos son Tommy, Chuckie, Phil, Lil y Angelica. Así se conocen los acontecimientos que surgen en su vida y cómo ellos son capaces de transformarlos en una gran aventura gracias a su gran imaginación.','https://image.tmdb.org/t/p/500w/kZ26VMSbP5x64jeekoFcgqShcp0.jpg','https://image.tmdb.org/t/p/original/corsUEMQqLn9Ug392B1ek40gmqK.jpg','0000-00-00'),
	(3034,'Tatort',NULL,NULL,'Serie','La serie policiaca más longeva y famosa de Alemania, un clásico que lleva desde los años setenta enganchando a varias generaciones.','https://image.tmdb.org/t/p/500w/iMFYIuKTEf3eRegVNAJbRkz64wb.jpg','https://image.tmdb.org/t/p/original/j73WOp6ArCy8vK4vreIdSunoXAr.jpg','0000-00-00'),
	(3452,'Frasier',NULL,NULL,'Serie','El doctor Frasier Crane es un estirado psiquiatra que, tras su divorcio, se traslada de Boston a Seattle para llevar un programa-consultorio de radio. Nada más llegar, se entera de que tiene que vivir con su padre, un gruñón expolicía lisiado en acto de servicio. Frasier queda con frecuencia con su hermano (también psiquiatra, y todavía mucho más snob), con el que tiene conversaciones muy peculiares sobre arte, mujeres y la vida en general. En la vida de Frasier sólo hay dos mujeres estables: su asistenta, una inglesa muy deseada su hermano; y la directora de su programa, una soltera desesperada por tener novio.','https://image.tmdb.org/t/p/500w/wkjz4eqlFTmrfJPNM4m0sFx1rgL.jpg','https://image.tmdb.org/t/p/original/gYAb6GCVEFsU9hzMCG5rxaxoIv3.jpg','0000-00-00'),
	(3570,'Sailor Moon',NULL,NULL,'Serie','Narra la historia de Usagi Tsukino, una adolescente de 14 años muy distraída e imprudente cuya vida cambiará totalmente cuando un día por casualidad conoce a una gata llamada Luna, la cual le habla acerca de su misión como Sailor Scout y de salvar a la Tierra de futuros invasores malignos. Con el tiempo, surgen las demás sailors en su orden: Sailor Mercury (Ami Mizuno), Sailor Mars (Rei Hino), Sailor Jupiter (Makoto Kino) y Sailor Venus (Minako Aino).','https://image.tmdb.org/t/p/500w/nDDZ9yQoQpC9i3Q9W9EC7QdcPsX.jpg','https://image.tmdb.org/t/p/original/uDJrkdgddtzDlwNZw1Hy3HKiMy4.jpg','0000-00-00'),
	(3854,'El Espectacular Spider-Man',NULL,NULL,'Serie','La serie presenta a Peter Parker como un estudiante de preparatoria que en meses recientes ha adquirido los poderes y la identidad de Spider-Man. \n\nSus mejores amigos son Harry Osborn y Gwen Stacy, y mas adelante conoce a Mary Jane Watson.\n\nObtiene su primer empleo en el diario \"Daily Bugle\" dirigido por J. Jonah Jameson, e intenta conseguir algo de dinero para ayudar a su tia May.\n\nMientras debe lidiar con los problemas tipicos de todo adolecente y combatir el crimen en la Ciudad de New York.','https://image.tmdb.org/t/p/500w/2q8XkP4CSl2MTP7VfVeeHQHuUHD.jpg','https://image.tmdb.org/t/p/original/957mnVq6w3xIZwhO1isb4RWPatr.jpg','0000-00-00'),
	(3934,'La casa de Mickey Mouse',NULL,NULL,'Serie','Serie de TV (2006-Actualidad) creada y producida por Walt Disney Television Animation para Playhouse Disney. Protagonizada por Mickey Mouse y su pandilla, la serie tiene una finalidad educativa, pues pretende enseñar a los niños a descubrir el mundo.','https://image.tmdb.org/t/p/500w/dGvW61JwuqwtShk849PHZflOAX.jpg','https://image.tmdb.org/t/p/original/hwUMUAWj9QRLUKtMITwJwFK6wJz.jpg','0000-00-00'),
	(4057,'Mentes criminales',NULL,NULL,'Serie','Mentes criminales (Criminal Minds) es una serie de drama criminológico. Se estrenó el 22 de septiembre de 2005 en el canal de televisión estadounidense, CBS. Muestra el trabajo de los miembros del equipo de Unidad de Análisis de Conducta del FBI, un grupo de investigadores de diversas ramas de la criminología que se dedica a hacer análisis psicológicos y criminológicos a criminales para facilitar su captura.','https://image.tmdb.org/t/p/500w/nWw20ipGipwdOyLTkFfX2Uz4Grp.jpg','https://image.tmdb.org/t/p/original/t55oQCXehqB3Vizac5DxtrbpXlF.jpg','0000-00-00'),
	(4087,'Expediente X',NULL,NULL,'Serie','Expediente X es una serie de televisión estadounidense de ciencia ficción y misterio, que emitió la cadena FOX y fue creada por Chris Carter, centrada en los casos que investigan dos agentes del FBI, clasificados como \"Expedientes X\": fenómenos paranormales, avistamiento de ovnis, criaturas extrañas, etc.\n\nLa serie ha sido uno de los mayores éxitos de la cadena FOX. Sus personajes y frases se han convertido en iconos de la cultura popular al explotar e inspirar una gran cantidad de teorías sobre conspiraciones y existencia de vida extraterrestre.','https://image.tmdb.org/t/p/500w/1vpmGGDaW4aUGKCfQTV0ygAPtBu.jpg','https://image.tmdb.org/t/p/original/q1ym4JYnpgcohNv5prdlFXTtP8K.jpg','0000-00-00'),
	(4177,'Perry Mason',NULL,NULL,'Serie','Perry Mason (Raymond Burr) es un abogado experto en complejos casos de asesinato. Casi todos los capítulos siguen el mismo formato: el cliente de Perry Mason es acusado de homicidio. Mason, con la ayuda de su inseparable secretaria Della Street (Barbara Hale) y del investigador Paul Drake (William Hopper), analiza los más pequeños detalles para hallar al verdadero culpable y probar la inocencia de su cliente.','https://image.tmdb.org/t/p/500w/iq4BjyVsDxzg24XnjoGP0Xi2Tz5.jpg','https://image.tmdb.org/t/p/original/uoQh6JAYUYWVw4P99DV5HgKGNmI.jpg','0000-00-00'),
	(4194,'Star Wars: The Clone Wars',NULL,NULL,'Serie','La escasa tropa Jedi lucha por mantener la libertad y devolver la paz a la Galaxia frente al aparentemente interminable ejército droide, clones diseñados genéticamente. A través de cientos de planetas, los Caballeros Jedi y los Separatistas combaten por el futuro de la Galaxia, pero el número de planetas que van cayendo en manos del Lado Oscuro cada vez es mayor a causa de los movimientos de los Separatistas. El terrible conflicto se agrava porque nuestros héroes se ven absorbidos por la confusión de guerra, mientras el Conde Dooku, el asesino Asajj Ventress, su maestro Darth Sidious, el General Grievous y una amplia galería de enemigos nunca antes visto también conspiran y se unen para derrotarlos.\n\nLa historias de la serie \'Star Wars: The clone wars\' transcurre entre el \"Episodio II: El ataque de los clones\' y el \"Episodio III: La venganza de los Sith\" de la saga Star Wars.','https://image.tmdb.org/t/p/500w/m6eRgkR1KC6Mr6gKx6gKCzSn6vD.jpg','https://image.tmdb.org/t/p/original/e1nWfnnCVqxS2LeTO3dwGyAsG2V.jpg','0000-00-00'),
	(4229,'El laboratorio de Dexter',NULL,NULL,'Serie','Serie de TV (1996-2003). 4 temporadas. 78 capítulos. El laboratorio de Dexter es una serie de animación creada por Genndy Tartakovsky en 1996. La serie trata sobre un pequeño niño genio llamado Dexter, que tiene su propio laboratorio, y hace sus grandes y propios inventos, los cuales son la causa de sus aventuras (o desventuras).','https://image.tmdb.org/t/p/500w/cUJ948sNBVyFD6Iyu3otbXOmiwk.jpg','https://image.tmdb.org/t/p/original/fIK7MiVnbgB1tHOn0E9EhXa6iuK.jpg','0000-00-00'),
	(4376,'J.A.G.: Alerta roja',NULL,NULL,'Serie','Después de un accidente aéreo, el piloto naval Hamon Rabb es reasignado al departamento JAG como abogado. Allí tendrá que investigar, junto a un equipo de hombres y mujeres, asuntos y conflictos internos de La Marina.','https://image.tmdb.org/t/p/500w/4JNqR8YBAK8cvi595z5RDUzC26M.jpg','https://image.tmdb.org/t/p/original/zPyHpkJZ5O08lbgrQQIROXtb3xz.jpg','0000-00-00'),
	(4556,'Scrubs',NULL,NULL,'Serie','Scrubs es una serie de drama-comedia emitida entre octubre de 2001 y marzo de 2010. Sigue las vidas de los empleados del ficticio hospital universitario del Sagrado Corazón, donde no solo estudiarán medicina, sino que también aprenderán los caminos de la amistad y de la vida.','https://image.tmdb.org/t/p/500w/nWxgVgQubzlSmbjm7fbMIEeFTY4.jpg','https://image.tmdb.org/t/p/original/u1z05trCA7AuSuDhi365grwdos1.jpg','0000-00-00'),
	(4604,'Smallville',NULL,NULL,'Serie','Serie que narra los inicios de Superman -Clark Kent- en su pueblo natal, Smallville. Allí vivía con sus padres, estudiaba en el instituto local y conoció a su primera novia, Lana Lang, y a su futuro rival, Lex Luthor.','https://image.tmdb.org/t/p/500w/qfiB0VDNEXP9IZDrOhNakwPZ0Tc.jpg','https://image.tmdb.org/t/p/original/pUhJGETy2sec4vEkiqJ9eGeIywc.jpg','0000-00-00'),
	(4606,'Garfield y sus amigos',NULL,NULL,'Serie','Garfield y sus amigos fue una serie animada americana basada en la popular tira cómica Garfield, creada por Jim Davis. Cada episodio consiste de dos segmentos de Garfield, dos Quickies, cortos basados en las tiras cómicas, y un Orson\'s Farm. Este último se titula originalmente U.S Acres y consiste en las aventuras de animales de granja basados en otra tira cómica de Davis, aunque menos popular. Para una emisión internacional se renombro como Orson\'s Farm, por lo que en Latinoamérica se le conoce como La Granja de Orson.','https://image.tmdb.org/t/p/500w/4TK1IREtfd7Ki8JWfwR1WahO5IP.jpg','https://image.tmdb.org/t/p/original/3HyTfZ9sSCoZPYrYHMffhRVm3Af.jpg','0000-00-00'),
	(4607,'Perdidos',NULL,NULL,'Serie','Historia de un variopinto grupo de supervivientes de un accidente de aviación en una isla del Pacífico aparentemente desierta, una isla en la que suceden cosas muy extrañas. Luchando por la supervivencia, casi medio centenar de personas mostrarán lo mejor y lo peor de sí mismas.','https://image.tmdb.org/t/p/500w/nqzBAMnuMI0xuwtdlEcxcQafyXY.jpg','https://image.tmdb.org/t/p/original/yrhlddSxQOeb503LkybxhhJJT4d.jpg','0000-00-00'),
	(4614,'Navy: investigación criminal',NULL,NULL,'Serie','NCIS sigue a unos agentes federales del Equipo de Respuesta en Casos Principales (ocasionalmente se trata de terrorismo, pues el NCIS se encarga de investigar posibles atentados terroristas, mientras estén de algún modo relacionadas con la marina) del Servicio de Investigación Criminal Naval, cuyo cuartel general está en el Arsenal Naval de Washington, en Washington DC. Al equipo le asignan frecuentemente casos prominentes como la muerte del asesor de misiles nucleares del Presidente, una situación de bomba en un buque de guerra de la Armada, la muerte de una celebridad durante un reality show en una base del Cuerpo de Marines de los Estados Unidos, amenazas terroristas y secuestros. Sin embargo, les pueden asignar cualquier tipo de caso criminal, siempre que esté relacionado con el Cuerpo de Marines o la Armada.','https://image.tmdb.org/t/p/500w/yD1R7QCNqrcaf15AxkLbgRLI9Dz.jpg','https://image.tmdb.org/t/p/original/q9TVqJSHfJPsEJGHtxHuBvOdKu9.jpg','0000-00-00'),
	(4629,'Stargate SG-1',NULL,NULL,'Serie','Stargate SG-1 es una serie televisiva estadounidense derivada del largometraje de ciencia ficción \'Stargate: Puerta a las Estrellas\' (1994). Producida por los estudios Metro Goldwyn Mayer. Esta serie se centra en las vivencias y aventuras de un equipo de militares y científicos miembros de un proyecto ultra-secreto de las Fuerzas Aéreas de los Estados Unidos, que utiliza un ingenio extraterrestre (Stargate) para desplazarse a otros planetas de manera casi instantánea.','https://image.tmdb.org/t/p/500w/li9SZBpVzJz81ouqifVuH5C7Nod.jpg','https://image.tmdb.org/t/p/original/9Jegw0yle4x8jlmLNZon37Os27h.jpg','0000-00-00'),
	(4630,'Los padrinos mágicos',NULL,NULL,'Serie','Timmy Turner es un niño de 10 años al que nadie entiende, es muy poco popular y sus compañeros le suelen tomar el pelo. Sus padres le prestan poca atención, aunque lo quieren mucho, pues es su único hijo, y siempre lo dejan al cuidado de Vicky, la niñera malvada, que trata a Timmy como esclavo. Es allí donde intervienen Cosmo y Wanda, los recién asignados padrinos mágicos de Timmy. Los padrinos mágicos son seres mágicos que se le asignan a los niños que no llevan una vida feliz, sin embargo muchos deseos que Timmy llega a pedir lo llevan a empeorar una situación que parecía sencilla, por lo cual Timmy debe obedecer \"Las Reglas\" o seguir la intuición de malas noticias que posee Wanda, por el contrario Cosmo es despreocupado con los deseos de Timmy por lo que ambos tienen aventuras grandiosas y siempre Wanda trata de remediar los problemas causados por ambos. ','https://image.tmdb.org/t/p/500w/jlruzecsif3tkCSoHlUaPR01O7U.jpg','https://image.tmdb.org/t/p/original/3ryMj7tIvVtiXyI2tLvHYTjOjq4.jpg','0000-00-00'),
	(4686,'Ben 10',NULL,NULL,'Serie','Serie de TV (2005-2008). Ben 10 cuenta las aventuras de Ben Tennyson, un niño normal de diez años que descubre en sus vacaciones de verano un extraño reloj extraterrestre dentro de un meteorito que chocó contra la Tierra. Ben pronto se da cuenta de que este reloj no es un aparato cualquiera, sino el artefacto alienígena mas poderoso del Universo, el Omnitrix. Este reloj le permite transformarse en diez seres extraterrestres distintos sin perder su personalidad, aunque eventualmente sería capaz de desbloquear nuevos alienígenas. Ahora, con la ayuda del Omnitrix, Ben, junto a su prima Gwen y a su abuelo Max combatirán un sinfín de villanos, asegurando que este verano sea sin duda \"el mejor verano de la historia\". En 2008 se estrenó una segunda serie que continúa la historia de esta primera, \"Ben 10: Alien Force\".','https://image.tmdb.org/t/p/500w/gHoE5UByMIjbhBnbYxezrCVGwCL.jpg','https://image.tmdb.org/t/p/original/lU1ollblNqLSAof7fzvfiHSqb9C.jpg','0000-00-00'),
	(4734,'Jumong',NULL,NULL,'Serie','Go Jo Seon cayó al Imperio Han, de China. Todo lo que quedó fueron  ciudades separadas, que no tenían otra opción más que aplacar al Impero  Han. En la serie, los Hans son retratados como crueles, tomando  prisioneros refugiados, y mostrando sus nuevas armas de hierro sobre  ellos.  Hae Mo Su, un soldado legendario, se une a Geum Wa, el Príncipe  Heredero de Bu Yeo para contrarrestar el salvajismo Han, creando el  Ejército Da Mul; defendiendo a los refugiados de Go Jo Seon. Hae Mo Su  es herido y lo encuentra la Princesa del Clan Ha Baek que lo atiende  devolviendole la salud y pagando un precio muy caro por ello. Apesar de  todo, los dos comienzan una relación. Hae Mo Su regresa con Geum Wa y  continúan con la contienda. Sin embargo, como el Ejército Da Mul  progresa en su objetivo de liberar a todos los refugiados, los Hans  disfrazan a sus soldados como a falsos refugiados, a quienes el Ejército  Da Mul intentan rescatar. Emboscados por los falsos refugiados y “la  caballería acora','https://image.tmdb.org/t/p/500w/cCAEmVxhOI2vdxCLh9POAtqc2rr.jpg','https://image.tmdb.org/t/p/original/lwQgX6d153FoxMTM2I5MLiyz0fr.jpg','0000-00-00'),
	(5371,'iCarly',NULL,NULL,'Serie','Carly es una estrella cibernética de 13 años que se dio a conocer a través de la página web que creó con unos amigos. La joven, a pesar de su popularidad, intenta aprender a llevar una vida normal.','https://image.tmdb.org/t/p/500w/hQ5FLB2WVzVUp8EAPa2J7rYC0Gw.jpg','https://image.tmdb.org/t/p/original/kP8Z51s9D8tiGnoRbL88db0e2jv.jpg','0000-00-00'),
	(5451,'Sin Senos no hay Paraíso',NULL,NULL,'Serie','Sin Senos No Hay Paraíso es una historia real que supera la ficción y cobra las deudas de la ambición y la vanidad desmedida con inesperadas sorpresas... Conoce la vida de mujeres y hombres que venden su alma al mejor postor en busca de un mejor futuro, sin importar si se entra en el mundo oscuro de la mafia y la vanidad.','https://image.tmdb.org/t/p/500w/3qSacGout8iH1VqMmJQx7cmBykY.jpg','https://image.tmdb.org/t/p/original/wG5uwLPMfHlYmXiVk9W88cV9llR.jpg','0000-00-00'),
	(5920,'El mentalista',NULL,NULL,'Serie','El mentalista es una serie policiaca americana sobre Patrick Jane, ex médium, que trabaja de asesor para la Oficina de Investigación de California (California Bureau of Investigation), usando su altamente desarrollada capacidad de observación, que anteriormente usaba para \"leer\" mentes.','https://image.tmdb.org/t/p/500w/q3pCsNvJ7CmdJUz2sJEEUY3pOPC.jpg','https://image.tmdb.org/t/p/original/snKUzvCl3kGv0RWBjEjnOXMGvdl.jpg','0000-00-00'),
	(7225,'Merlín',NULL,NULL,'Serie','Adaptacion a la televisión de la leyenda arturica en las que unos jóvenes Arturo y Merlin se enfrentan a sus primeros peligros y descubren el amor. Podremos ver al joven Colin Morgan (Dr. Who) interpretando al todavia inexperto Merlin, junto a los demas personajes de la leyenda arturica como son Arturo (Bradley James), Lancelot (Santiago Cabrera - Heroes -), Vivianne, la bruja del lago (Michelle Ryan - Bionic woman -) o el Gran Dragón (al que pone voz el veterano John Hurt).','https://image.tmdb.org/t/p/500w/Ast1yAVp6shrWeC6KCtayWgZGcM.jpg','https://image.tmdb.org/t/p/original/8eR5Jg7CxsuCOEBU5wW0opObxpi.jpg','0000-00-00'),
	(7458,'El cártel de los sapos',NULL,NULL,'Serie','La serie comienza con Martín González (Manolo Cardona) contando su historia de la carcel, recordando cuando tenía quince años y su madre trabajaba en Los Estados Unidos para enviarles dinero. Martín le pide a su mejor amigo Pepe Cadena (Diego Cadavid) que lo lleve a donde su hermano mayor Óscar Cadena (Fernando Solórzano), también conocido como Don Óscar — que en ese momento es el jefe supremo del Cartel del Pacífico — para entrar al negocio.','https://image.tmdb.org/t/p/500w/4jTSmEGdZ77A2dP6Y08gwo52LuF.jpg','https://image.tmdb.org/t/p/original/cSvzG2B2uafu5BoP5nt0OvrVrQG.jpg','0000-00-00'),
	(7482,'Las reglas del juego',NULL,NULL,'Serie','Drama de la TNT en la que un grupo de criminales y hackers se encargan de cometer robos y estafas a los millonarios o a los cargos poco transparentes para favorecer a los más necesitados.\n\nNate Ford (Timothy Hutton, \'El escritor\', \'Atrapado por amor\', `El llanero solitario\') es un investigador de seguros con unos grandes ideales que siempre trata de defender a los más indefensos. Su forma de actuar le ha hecho convertirse en el investigador con el mayor récord de recuperación de artículos robados. Sin embargo, Nate sufre una desilusión y se siente traicionado por la compañía para la que trabaja cuando ésta le niega a pagar el seguro para ayudar a sanar a su hijo enfermo. Furioso, Nate deja la compañía y decide convertirse en una especie de \"justiciero\", velando por los intereses de los más beneficiados.\n\nSu primera misión será devolver los planos de un avión robados a un alto ejecutivo. Junto a un grupo de hackers y criminales, Nate afrontará esta misión junto a muchas otras. En su gr','https://image.tmdb.org/t/p/500w/cubucYolMq8sFhw8V5e8zBoAcjD.jpg','https://image.tmdb.org/t/p/original/bVvZNDKaNvk5NZCEl0OjUxkXJZi.jpg','0000-00-00'),
	(7842,'El Show de Tom y Jerry',NULL,NULL,'Serie','El gato Tom y el ratón Jerry, el dúo más famoso, regresa para experimentar nuevas aventuras y enfrentarse en nuevas batallas.','https://image.tmdb.org/t/p/500w/kkCBqsnas7o0icD04s3OukKO3O7.jpg','https://image.tmdb.org/t/p/original/xPCQP3IiOHEtlHOz7twuVK51Kbs.jpg','0000-00-00'),
	(7869,'Los pingüinos de Madagascar',NULL,NULL,'Serie','Los pingüinos llevan sus misiones en su hábitat en el Parque Central. Aparecen Julien, el rey de los lémures, y sus súbditos Maurice y Mort, sus nuevos vecinos, que constituyen la exhibición de lémures en el zoológico. Ahora los pingüinos deben mantener las cosas bajo control, a menudo a pesar de las payasadas de los lémures así como auxiliar en labores poco comunes o aventuras fuera de lo común. Skipper rara vez llama al Rey Julien por su nombre, dirigiéndose a él siempre como \"Cola anillada\" (por ser un lemur de cola anillada).','https://image.tmdb.org/t/p/500w/z1ozzJ7AFvyMoYFKZhCblUzISX1.jpg','https://image.tmdb.org/t/p/original/9crraAy9YdFoIAMhu6E3YHtO1UB.jpg','0000-00-00'),
	(8358,'Miénteme',NULL,NULL,'Serie','Paul Ekman, un psicólogo capaz de detectar si la gente miente o dice la verdad analizando la expresión de su cara, sus gestos y su voz, usa ese don para resolver casos criminales. Considerado por la revista \'Time\' una de las 100 personas más influyentes del mundo, sus experiencias y sus libros le serán muy útiles al ex policía y doctor Cal Lightman, un experto en el engaño que colabora con la policía y otras agencias de seguridad para resolver enrevesados casos criminales. Este \"detector de mentiras humano\" cuenta con la ayuda de una psicóloga clínica, la doctora Gillian Foster, que aporta a la investigación sus conocimientos académicos. El trabajo de Lightman se hace imprescindible para todos los cuerpos policiales y agencias gubernamentales.','https://image.tmdb.org/t/p/500w/g84UGBI440SAY3uta189P9rgQme.jpg','https://image.tmdb.org/t/p/original/xAWQBCCoBEue19oBR8D8TJlz0zr.jpg','0000-00-00'),
	(9027,'Rebelde Way',NULL,NULL,'Serie','La serie cuenta las vivencias de unos adolescentes estudiantes internos en un colegio en Buenos Aires, Argentina, llamado Elite Way School destinado a los hijos de las familias más prestigiosas del país. Por otra parte, existe un método de becas en el cual el aspirante a ingresar en dicha institución realiza un examen, dependiendo de éste su incorporación al establecimiento.','https://image.tmdb.org/t/p/500w/6WUb3YhgNSpI2Hk33OKiNi0WKUz.jpg','https://image.tmdb.org/t/p/original/wu4Vi93RxaE1kkFM5ClmcVzkIby.jpg','0000-00-00'),
	(10283,'Archer',NULL,NULL,'Serie','En la agencia de espionaje internacional ISIS, las crisis mundiales no son más que una excusa para que sus empleados se hagan la vida imposible los unos a los otros. En el centro de la acción está Archer, un maestro del espionaje. Trabaja para su autoritaria madre, la directora de ISIS Malory. Su compañera de trabajo (y ex-novia) Lana ahora sale con Cyril el contable.','https://image.tmdb.org/t/p/500w/kt7cId9GV8mbKKW8I9cpeVFh7Fn.jpg','https://image.tmdb.org/t/p/original/J4bhku9PPpV7z6d5u2wtdWAS0O.jpg','0000-00-00'),
	(11250,'Pasión de gavilanes',NULL,NULL,'Serie','Los hermanos Reyes uran vengar la muerte de su hermana, lo que les lleva a instalarse como trabajadores en la mansión de la familia Elizondo. El profundo odio comienza a cambiar cuando los hermanos Reyes se integran en la vida de la familia. Con lo que no cuenta Juan es con que su vida y las de sus dos hermanos se cruzará con la de las tres hermanas Elizondo, corriendo el riesgo de caer presos de su propia venganza...','https://image.tmdb.org/t/p/500w/tw0r2GM7hIczoDvxhNDTcfVJL0z.jpg','https://image.tmdb.org/t/p/original/2vNyh5bkGn4cmeXZQADOa7Zba8d.jpg','0000-00-00'),
	(12225,'Peppa Pig',NULL,NULL,'Serie','La protagonista de esta serie es Peppa, una cerdita de rasgos antropomórficos que vive con su hermanito George y sus padres: Mamá (Mummy) Pig y Papá (Daddy) Pig. Tiene como escenario principal su hogar, es ahí donde ocurren las tramas de los episodios. En algunos episodios, se muestra a su familia saliendo de casa, paseando con su coche, en casa de sus amigos o estando ya en otro lugar.','https://image.tmdb.org/t/p/500w/bMtN24DmgHpzODpvAs70eL3ulZL.jpg','https://image.tmdb.org/t/p/original/ycf1ZqisXs8ZCGmw0reD1pI2Zlp.jpg','0000-00-00'),
	(12637,'Rebelde',NULL,NULL,'Serie','El \"Elite Way School\" es un exclusivo colegio privado de prestigio internacional donde adolescentes de clase alta estudian. El colegio cuenta con un programa de becas para jóvenes de bajos recursos con excelente nivel académico o deportivo; sin embargo, pocos de ellos logran graduarse, ya que son perseguidos por una sociedad secreta llamada “La Logia” cuyo propósito es conservar la “pureza” de la clase privilegiada. Entre el grupo de chicos que llega al club de veraneo que precede al año escolar, se encuentran Mía, Miguel, Diego y Roberta, que a pesar de sus grandes diferencias, descubren algo que los unirá por encima de los prejuicios, su profesión. Remake de la telenovela Rebelde Way producida en Argentina.','https://image.tmdb.org/t/p/500w/1D3sDadfGOsYEjZT8N2V2MeGcTN.jpg','https://image.tmdb.org/t/p/original/iehrrb9CmYCiV1hXp5pdGQQmGNe.jpg','0000-00-00'),
	(12926,'Teresa',NULL,NULL,'Serie','Teresa Chávez es una joven obsesionada por el dinero y la ambición. A pesar de su belleza y de haber crecido en el seno de una familia cariñosa, vive resentida, y su único deseo es abandonar el barrio humilde en el que vive.','https://image.tmdb.org/t/p/500w/cqwQQ5liJAUrV8HoL4Zs1CfXqyE.jpg','https://image.tmdb.org/t/p/original/17QQBTahkRE23bxJ4PmQ7tjMjyX.jpg','0000-00-00'),
	(12965,'María la del Barrio',NULL,NULL,'Serie','María Hernández \"María la del Barrio\" es una joven humilde, sin educación y soñadora, que vive con su madrina Casilda en las afueras de la Ciudad de México, y trabaja como recolectora de material reciclable en un basurero y está profundamente enamorada de un hombre atractivo que diariamente ve en la iglesia donde va de forma frecuente. El día en que María cumple 15 años, su madrina muere, y en su lecho de muerte le pide al Padre Honorio que le encuentre un lugar en donde su ahijada pueda trabajar y vivir.\n\nMaría es bienvenida en la casa del empresario Fernando de la Vega, uno de los hombres más influyentes y ricos del país. Él le enseña modales a María y la acoge como una miembro de la familia, aunque su esposa Victoria y la criada Carlota desprecian a María desde el primer momento.','https://image.tmdb.org/t/p/500w/w2C7HxlhUGT5E0Y4axfWQhBmqxE.jpg','https://image.tmdb.org/t/p/original/17iXdZ7muzMefCtPz0LuFnjQqcC.jpg','0000-00-00'),
	(12971,'Dragon Ball Z',NULL,NULL,'Serie','Es la continuación de la serie de anime \'Dragon Ball\'. Se divide básicamente en cuatro sagas: la llegada de los Saiyajins, la batalla contra Freezer, el nacimiento de Célula y el despertar de Monstruo Bu. De éstas se desprenden subsagas y algunas otras historias que no son originales del manga.','https://image.tmdb.org/t/p/500w/ydf1CeiBLfdxiyNTpskM0802TKl.jpg','https://image.tmdb.org/t/p/original/yoXe7LHOggXa7XzmRNW5aUMPaC3.jpg','0000-00-00'),
	(13354,'Question Time',NULL,NULL,'Serie','Los políticos, los funcionarios públicos y las celebridades se enfrentan a preguntas sobre temas de actualidad de una audiencia de estudio.','https://image.tmdb.org/t/p/500w/tdvxvWMbxkuWGzAHXOUQ86h3kbw.jpg','https://image.tmdb.org/t/p/original/nLGgjwQNnCKuDdJMDmp02pxB0u9.jpg','0000-00-00'),
	(13916,'Death Note',NULL,NULL,'Serie','Light Yagami es un excelente estudiante japonés que ha tenido una vida un tanto aburrida. Esto cambia radicalmente cuando encuentra tirado en el patio de la escuela un cuaderno negro conocido como Death Note (Libreta de la Muerte), perdido por un Shinigami (Dios de la muerte) llamado Ryuk. Cualquier humano cuyo nombre sea escrito en dicho cuaderno morirá; y, Light -luego de leer las instrucciones en el mismo- ha decidido utilizar este poder para crear un mundo sin criminales, \"perfecto\" según su visión. Cuando los criminales comienzan a morir de forma masiva y generalmente víctimas de ataque cardíaco, las autoridades envían al legendario detective L en busca del asesino. Con L pisándole los talones: ¿podrá mantener Light su propósito incluso arriesgando su vida?','https://image.tmdb.org/t/p/500w/2Yfzm5857lprGonYPl30XgEpTry.jpg','https://image.tmdb.org/t/p/original/vapuYy7yrYcML9bHuq5ct97hpSY.jpg','0000-00-00'),
	(14658,'Survivor',NULL,NULL,'Serie','Survivor es un popular reality estadounidense emitido por el canal CBS en el que un grupo de americanos son abandonados en un lugar remoto (normalmente una isla), con el fin de ganar un millón de dólares. Los concursantes deben superar pruebas para obtener recompensas (comida e higiene, entre otros) y para evitar ser eliminados. Las eliminaciones se producen por el voto directo de los concursantes. Uno a uno son eliminados hasta llegar a los dos finalistas (tres desde la decimotercera temporada, Survivor: Cook Islands). Survivor ha sido conducido desde su comienzo hasta la actualidad por Jeff Probst, encargado de explicar y comentar las diversas pruebas, de recibir a los concursantes en el consejo tribal (lugar donde se producen las eliminaciones) y de leer los votos que deciden quién deja el programa.','https://image.tmdb.org/t/p/500w/a8yIh4NjiK96EIS79JLLrjUKA8p.jpg','https://image.tmdb.org/t/p/original/wF7bSTwLT5DQrjQqNjrNwfloF08.jpg','0000-00-00'),
	(14814,'Las Kardashian',NULL,NULL,'Serie','La princesa de los tabloides Kim Kardashian y su familia peculiar incluyendo a su padrastro Bruce Jenner, su madre Kris Jenner, su hermana mayor Kourtney Kardashian, sus hermanos pequeños Khloé y Rob Kardashian y sus medias hermanas pequeñas Kendall y Kylie Jenner, son el tema de esta serie de realidad que relata la vida doméstica y frecuentemente caótica.','https://image.tmdb.org/t/p/500w/q79U95wgkocoECitZPfRDhZXBNz.jpg','https://image.tmdb.org/t/p/original/h4GJOGloecCnu7bqGtZtfVXseIe.jpg','0000-00-00'),
	(14929,'Heartland',NULL,NULL,'Serie','Amy (Amber Marshall) y Lou (Michelle Morgan) son dos hermanas que se mudan desde Nueva York a Heartland (en Alberta, Canadá), el viejo rancho con caballos de su abuelo Jack (Shaun Johnston), después de la inesperada muerte de su madre.','https://image.tmdb.org/t/p/500w/zNYK2dueTCJpIRDkgogt0pfEQQA.jpg','https://image.tmdb.org/t/p/original/pvXluCDJPZgLwh6ncW6XXe6PXxZ.jpg','0000-00-00'),
	(15260,'Hora de aventuras',NULL,NULL,'Serie','Finn un chico de doce años, fue encontrado en el bosque siendo un bebé por un perro de la familia, y su mejor amigo y hermano adoptivo es Jake, un perro de 28 años de edad, con poderes mágicos. Son aventureros que viven en \"La Tierra de Ooo\", un entorno lleno de personajes surrealistas. Algunas aventuras típicas del dúo son salvar princesas, luchar contra monstruos, la exploración de mazmorras o ayudar a los necesitados.','https://image.tmdb.org/t/p/500w/xNJGvSS5PcJoqNZJahgGPwu8F4z.jpg','https://image.tmdb.org/t/p/original/vpnV0g2VOounP0kHNi86oBPceMY.jpg','0000-00-00'),
	(15804,'El intrépido Batman',NULL,NULL,'Serie','Batman: The Brave & The Bold recupera la idea del cómic clásico del mismo nombre, en el que se juntaba a Batman con algún otro superhéroe de DC, como Aquaman o Linterna verde. Se ha buscado acercarla a la estética clásica, más cercana al colorido de la serie de los 60 de Adam West que a la oscuridad de The Dark Knight o la serie de 1992 creada por Bruce W. Timm.','https://image.tmdb.org/t/p/500w/jFKL8g3gl8vBjkiTVl6zT6kG6Eg.jpg','https://image.tmdb.org/t/p/original/tv2mOIRcPP4H0DhOH84xPgqui7d.jpg','0000-00-00'),
	(16286,'Yo soy Betty, la fea',NULL,NULL,'Serie','\'Yo soy Betty, la fea\' es una telenovela colombiana que se estrenó en septiembre de 1999 en su país de origen, con Ana María Orozco y Jorge Enrique Abello como actores protagonistas en los papeles de Beatriz y Armando. La producción contaba la historia de Betty, una joven y brillante economista que acaba fichando en una empresa de moda para el jefe de la compañía, de quien acaba enamorándose. Una situación que Armando acaba aprovechando a su favor pero que, contra todo pronóstico, acaba volviéndose en su contra al corresponder a los sentimientos de su secretaria.\n\nCreada por Fernando Gaitán Salom, esta telenovela cosechó un éxito arrollador no solo en Colombia, sino también a nivel internacional, al alcanzar más de 180 países y ser doblada a unos 25 idiomas. Además, fue origen de múltiples versiones que fueron surgiendo tras su enorme fama, sumando hasta 28 adaptaciones en todo el mundo hasta el año 2010.','https://image.tmdb.org/t/p/500w/ftiQHOrAGTGXVsJ1pcAVC5Dau78.jpg','https://image.tmdb.org/t/p/original/iEBOiXiDGaxVR6w8aKgG5MEusuO.jpg','0000-00-00'),
	(16420,'Los Chicos son Mejores que las Flores',NULL,NULL,'Serie','Geum Jan Di, es una chica humilde cuya familia es propietaria de una  tintorería. Un día mientras realiza una  entrega para un estudiante de  la prestigiosa Escuela Superior Shin Hwa, (escuela para ricos). Ella se  percata que el chico iba a suicidarse desde la azotea por obtener la  tarjeta roja de los F4 y justo en el preciso momento en el que salta,  Geum Jan Di le salva la vida al detenerlo y es llamada como la  chica/mujer maravilla. Este acto generó gran controversia en la ciudad,  por lo cual es becada para asistir a la escuela. Al principio es  maltratada y aislada por los demás estudiantes al recibir la tarjeta  roja de los F4 (4 flores), que es un grupo de alumnos que gobiernan  cruelmente la escuela por su belleza y riqueza. Gu Jun Pyo, líder de los  F4 y sucesor de la Compañía Shinhwa empieza a tener sentimientos hacia  Geum Jan Di, Yoon Ji Hoo también se enamora de Geum Jan Di, pero antes  de que se diera cuenta de que estaba enamorado de ella, él tenia sus  sentimientos ','https://image.tmdb.org/t/p/500w/g1xn0ce0PQ5Kk7FSj6lMuLNqyiX.jpg','https://image.tmdb.org/t/p/original/9IIDbs52GUKWXq6dPQECnPSIAwn.jpg','0000-00-00'),
	(17610,'NCIS: Los Ángeles',NULL,NULL,'Serie','La ficción relata la extraordinaria labor que lleva a cabo el Servicio de Investigación Criminal Naval (NCIS), que investiga y combate las actividades de asociaciones criminales, grupos terroristas y a las agencias de inteligencia extranjeras que constituyen una grave amenaza para la Marina norteamericana. Dentro de este servicio se enmarca la Oficina de Proyectos Especiales, una división especializada en la captura y localización de los criminales más peligrosos que ponen en jaque la seguridad nacional. La utilización de identidades falsas y de la más avanzada tecnología permite a este grupo de agentes encubiertos cumplir los objetivos asignados. Desplegados en distintos puntos del mundo cuando la ocasión lo requiere a través de los portaviones o de las fuerzas anfibias de la Marina, los agentes del NCIS están entrenados para identificar y frenar los peligros externos mientras trabajan en estrecha colaboración con las fuerzas de seguridad estatales, federales o locales.\n\nUn camaleóni','https://image.tmdb.org/t/p/500w/t5NK58wFhNIwaPTKOt19WbfxcID.jpg','https://image.tmdb.org/t/p/original/p0doUtM8RhXcAwHs6VmMZMQKpai.jpg','0000-00-00'),
	(18011,'Vecinos',NULL,NULL,'Serie','La serie muestra la vida cotidiana de la gente en los barrios mexicanos, donde cualquier cosa puede ser encontrada (por ejemplo, un ama de casa celosa, familia extraña, etc.). Cada episodio interactúa entre estos peculiares vecinos, donde se encuentran con problemas reales y ficticios, como fantasmas, luchas, etc. Está basada en la serie española \"Aquí no hay quién viva\".','https://image.tmdb.org/t/p/500w/vDFCOeT5KSA84AI3ATB4eCHrL6l.jpg','https://image.tmdb.org/t/p/original/c35P7xK3RQDINeHhSXqqKq3oKBk.jpg','0000-00-00'),
	(18165,'Crónicas vampíricas',NULL,NULL,'Serie','\"Crónicas Vampíricas\" cuenta la historia de dos hermanos vampiros obsesionados con la misma chica en un pequeño pueblo, donde seres sobrenaturales viven en secreto entre sus residentes.','https://image.tmdb.org/t/p/500w/k7T9xRyzP41wBVNyNeLmh8Ch7gD.jpg','https://image.tmdb.org/t/p/original/rKNnzmOA1REgxODY5wVe5UEr70w.jpg','0000-00-00'),
	(19614,'It',NULL,NULL,'Serie','Un tranquilo y pequeño pueblo de Maine está siendo aterrorizado por una fuerza malévola oculta tras la máscara de un payaso, y que tan sólo se la conoce como \"Eso\". Tras sus primeras víctimas, una pandilla formada por siete amigos de la infancia dedicen volver a reunirse para atacar el mal y destruirlo, intentando librar así del terror a su pueblo natal.','https://image.tmdb.org/t/p/500w/1ot3DeWBHaI3cbfQtqZqOI1VoPI.jpg','https://image.tmdb.org/t/p/original/uuTYA9LIlIRCFMgFlxWb1KznfEx.jpg','0000-00-00'),
	(21510,'Ladrón de guante blanco',NULL,NULL,'Serie','Neil Caffrey es un ladrón de guante blanco, que se escapa de una cárcel de máxima seguridad para ir en busca de su novia que le ha abandonado para siempre. Para cazar a Caffrey, el FBI llama a Peter Burke, el agente que le ha perseguido durante años y que fue el único que consiguió encerrarlo. El agente encontrará a Caffrey que le ofrece un buen trato, usará su experiencia criminal para ayudarle a atrapar a los ladrones más escurridizos del mundo a cambio de la libertad. Una relación muy especial que también compartirán Elisabeth, la mujer de Burke y Mozzie, el mejor amigo de este ladrón que ahora trabaja para los buenos.','https://image.tmdb.org/t/p/500w/pucfEVjRwLV5IuAuIYSwfWzgWI.jpg','https://image.tmdb.org/t/p/original/6U3EWYzHf7GECKgYEudOucqYw5Y.jpg','0000-00-00'),
	(21641,'¡Buena suerte, Charlie!',NULL,NULL,'Serie','Los Duncan son una familia normal, pero su vida sufre un giro radical con la llegada de la nueva hermanita: Charlie.','https://image.tmdb.org/t/p/500w/vWwSPYymDv7gZ1C1yzgNuEacbKy.jpg','https://image.tmdb.org/t/p/original/eRS8DTz3xKPIlmm9UCZKel3sQDc.jpg','0000-00-00'),
	(21755,'La Casa del Empeño',NULL,NULL,'Serie','La serie muestra la interacción del personal con los clientes, que aportan una variedad de artículos para vender o empeñar, lo que produce generalmente un regateo sobre el precio y una discusión acerca de sus antecedentes históricos. Cuenta con la narración de Rick, Corey (alias \"Big Hoss\"), Chumlee y Richard, quien es conocido como \"El Viejo\". La serie sigue también los conflictos interpersonales entre Richard, Rick, Corey y el amigo de Corey, Austin \"Chumlee\" Russell, quien también trabaja como empleado en la tienda','https://image.tmdb.org/t/p/500w/4rLC2hVMdtxnYafMlMYrK4nclIj.jpg','https://image.tmdb.org/t/p/original/hYVnLs9TDqch19eeCM5NmoX6xLQ.jpg','0000-00-00'),
	(25707,'Campeones: Oliver y Benji',NULL,NULL,'Serie','\'Campeones\' sigue a Oliver Atom, un joven futbolista con un talento excepcional para este deporte. Entrenado por Roberto, una exgloria del fútbol, Oliver puede soñar con los mayores trofeos de todo el mundo. Pero antes de la gloria, hay que ganar. Su principal rival dentro de este apasionado mundo será Benji, un portero de grandes aptitudes con el que tendrá una fuerte rivalidad.\n\nEste anime japonés reúne todos los elementos necesarios para los apasionados del fútbol: partidos espectaculares, jugadas maestras y una afición entregada. \'Super Campeones\' (\'Captain Tsubasa\') se estrenó el 13 de octubre de 1983 en TV Tokyo. Su trayectoria en televisión se resume en dos temporadas y 128 capítulos con un gran éxito de audiencia, dando lugar a todo un fenómeno social.','https://image.tmdb.org/t/p/500w/le8yZVANRVul8vdZtJow2XgFz7F.jpg','https://image.tmdb.org/t/p/original/ylTQ8kWL2Ln5aS4W7r8ajFB5kcp.jpg','0000-00-00'),
	(30801,'2 Días y 1 Noche',NULL,NULL,'Serie','2 Días y 1 Noche es un reality show de variedades de Corea del Sur con el lema \"verdadera variedad salvaje\". Su concepto principal es recomendar varios lugares de interés que los espectadores pueden visitar en Corea del Sur.','https://image.tmdb.org/t/p/500w/sDoSavurRsckAldstpCvUs30A6P.jpg','https://image.tmdb.org/t/p/original/44CeavkZLqW9Z7SkOffxLNJtAv9.jpg','0000-00-00'),
	(30983,'Detective Conan',NULL,NULL,'Serie','Shinichi Kudo es un joven detective que consigue esclarecer cualquier misterio, por difícil que sea. Un día, nuestro protagonista descubre los maléficos planes de una peligrosa organización criminal y es envenenado. Sin embargo, el veneno no lo mata, sino que por accidente, lo encoge y lo convierte en un niño de apenas 6 años. Atrapado en este cuerpo, Shinichi, bajo el seudónimo de Conan Edogawa, deberá resolver los casos más difíciles mientras intenta encontrar un antídoto que lo devuelva a la normalidad y hacer lo posible para que su amiga, Ran Mouri, no sospeche quién es realmente el sabiondo Conan...','https://image.tmdb.org/t/p/500w/8nzvbgGM1bDqK3fscy86LyOnDcf.jpg','https://image.tmdb.org/t/p/original/mLxiiTOOSyelQAb8SY0s39lFBa9.jpg','0000-00-00'),
	(30984,'Bleach',NULL,NULL,'Serie','La serie narra las aventuras de Ichigo Kurosaki, un adolescente que tiene la facultad de interactuar con los espíritus. Una noche, Ichigo se encuentra con una shinigami —personificación japonesa del Dios de la muerte— llamada Rukia Kuchiki, quien se sorprende que pueda verla. Sin embargo, su conversación es interrumpida por la aparición de un hollow, un espíritu maligno. Después de que Rukia fuera gravemente herida al tratar de proteger a Ichigo, esta intenta traspasarle parte de sus poderes a Ichigo para que pueda enfrentarse al hollow en igualdad de condiciones. No obstante, Ichigo sin darse cuenta los absorbe casi por completo y logra vencer con facilidad al espíritu.','https://image.tmdb.org/t/p/500w/qtfMr08KQsWXnCHY0a96N8NpQ2l.jpg','https://image.tmdb.org/t/p/original/ekp9PbSODHiTXXqnHJ4Sq6YHkhq.jpg','0000-00-00'),
	(31072,'La familia P. Luche',NULL,NULL,'Serie','Una familia que trata con los conflictos y problemas de la vida diaria pero en forma cómica y exagerada con la particularidad que viven en una ciudad que está edificada en su totalidad de peluche y con todos los accesorios de peluche.','https://image.tmdb.org/t/p/500w/43P6Pz3dlEeL4xXgunVF4MQpeOw.jpg','https://image.tmdb.org/t/p/original/zBajkGhOB2FsVVhp4uagcy5dyLn.jpg','0000-00-00'),
	(31132,'Historias corrientes',NULL,NULL,'Serie','Esta comedia animada sigue a un arrendajo azul y a un mapache que se encargan del mantenimiento de un parque y tienen un jefe que es una máquina de chicles.','https://image.tmdb.org/t/p/500w/bhF63Jd90gRYyTHd4y5GCGA2vX6.jpg','https://image.tmdb.org/t/p/original/mS5SLxMYcKfUxA0utBSR5MOAWWr.jpg','0000-00-00'),
	(31251,'Victorious',NULL,NULL,'Serie','El caos empieza a reinar en la vida de Tori Vega, cuando con 16 años es admitida en un nuevo instituto. Pero no en uno cualquiera, sino Hollywood Arts, una escuela de artes escénicas donde locos con talento estudian para convertirse en verdaderos artistas. Hasta ahora, Tori no creía tener mucho talento, y se contentaba con vivir a la sombra de su hermana mayor, Trina. Ahora, todo está a punto de cambiar... Sin embargo, Hollywood Arts sigue siendo un instituto, y Tori sigue siendo la chica nueva: tendrá que encontrar nuevos amigos, hacer los deberes, y simplemente tratar de encajar. ¿Conseguirá Tori cazar un papel protagonista en su nueva vida?','https://image.tmdb.org/t/p/500w/jpR7mT5nFAzWSGPseLpfFisoUtN.jpg','https://image.tmdb.org/t/p/original/4bXfaJXoiKOTPfb23Q9cuaNpE2x.jpg','0000-00-00'),
	(31586,'La Reina del Sur',NULL,NULL,'Serie','Teresa Mendoza comienza su aventura como una joven humilde enamorada de un piloto empleado por los Carteles mexicanos. Cuando ejecutan a su hombre Teresa tendrá que huir desesperada para no correr la misma suerte. Su escape la llevará al sur de España donde intentará comenzar una nueva vida. Tras varios golpes Teresa decide tomar las riendas de su destino y comienza a dirigir su propia organización. Mediante alianzas estratégicas y un agudo sentido para los negocios Teresa Mendoza “La Mexicana” controlará un negocio de distribución de drogas intercontinental como nunca se había visto.','https://image.tmdb.org/t/p/500w/3XjDhPzj7Myr8yzsTO8UB6E2oAu.jpg','https://image.tmdb.org/t/p/original/p11t8ckTC6EiuVw5FGFKdc2Z7GH.jpg','0000-00-00'),
	(31910,'Naruto Shippuden',NULL,NULL,'Serie','La historia transcurre en un mundo dominado por aldeas ninja. En las cuales el papel del ninja se traduce como el poder de cada país. Cada uno de estos cuenta con su aldea oculta que es donde estudian, entrenan, graduan y forman cada ninja. Los ninjas utilizan todo tipo de artes marciales desde la lucha cuerpo a cuerpo a ilusiones o técnicas secretas como por ejemplo la manipulación de elementos.  El protagonista es un joven aspirante a ninja Uzumaki Naruto, un muchacho que sueña en convertirse algun dia en el líder de su aldea (Hokage). Será para él una tarea difícil ya que cuando era solo un bebé le fué confiado en su interior el poder de un ser malvado, que antaño causo grandes males en su aldea (Konoha) y el cual irá poco a poco descubriendo y dominando. Por culpa de ese poder Naruto pasa una dura infancia con desprecio y negación por parte de los vecinos de su aldea...','https://image.tmdb.org/t/p/500w/z6ES1hCbLozoquj5wilidrtKBPp.jpg','https://image.tmdb.org/t/p/original/cIGqCdclILvuexM04PnRaFbtAWq.jpg','0000-00-00'),
	(31917,'Pequeñas mentirosas',NULL,NULL,'Serie','La trama sigue la vida de cuatro amigas (Spencer, Hanna, Aria y Emily) tras la desaparición de Alison, la quinta del grupo. Un año después comienzan a recibir mensajes anónimos de alguien que se hace llamar A. Los mensajes amenazan con rebelar sus secretos, incluso algunos que sólo Alison sabía.','https://image.tmdb.org/t/p/500w/ypLoTftyF5EpGBxJas4PThIdiU4.jpg','https://image.tmdb.org/t/p/original/9yym2bZE9vXRIVqkfLqVmWaBvHu.jpg','0000-00-00'),
	(32415,'Conan',NULL,NULL,'Serie','Conan es un programa de conversación nocturno tipo late night talk show que se emite de lunes a jueves en la señal TBS de Estados Unidos, a las 11:00 pm, hora del este. El programa, de una hora de duración, fue estrenado el 8 de noviembre de 2010. Está conducido por el escritor, presentador y comediante Conan O\'Brien, quien fue conductor del programa de la NBC Late Night with Conan O\'Brien por 16 años, y también de The Tonight Show with Conan O\'Brien, show que duró sólo siete meses al aire y que provocó la renuncia de O\'Brien a la cadena transmisora, la NBC, debido a conflictos por los horarios de salida del programa.3​ El 14 de mayo de 2014, TBS renovó a Conan, por lo menos hasta el 2018.','https://image.tmdb.org/t/p/500w/2Ib8kvWa9gGhJrAfGlhIvbmtbWn.jpg','https://image.tmdb.org/t/p/original/kp8SWb4z0PTi1oXd8xTgy1LlkOK.jpg','0000-00-00'),
	(32692,'Blue Bloods (Familia de policías)',NULL,NULL,'Serie','Frank Reagan es el jefe del Departamento de Policía de Nueva York. El duro oficial dirige el cuerpo tan diplomáticamente como a su familia, una saga de policías marcada por la trágica pérdida del hijo mayor.','https://image.tmdb.org/t/p/500w/xJBT35KlQYSKmuSXu4D4DFmv3ka.jpg','https://image.tmdb.org/t/p/original/4xWYZ0q6RlKnStWJlpz535uElfd.jpg','0000-00-00'),
	(32726,'Bob\'s Burgers',NULL,NULL,'Serie','Bob’s Burgers narra la historia de los Belcher, una familia disfuncional que regenta una hamburguesería situada entre un crematorio y la sede de organización que lucha por los derechos de los animales. En el día de su gran reapertura reciben la visita de unos inspectores de sanidad que investigan el rumor esparcido por Louise, la hija pequeña de Bob, de que en el restaurante servían carne humana proveniente del crematorio vecino con el único objetivo de superar a una compañera de clase que tiene un tío torero en España. Y lo que empieza siendo un desastre se acaba convirtiendo en todo un negocio.','https://image.tmdb.org/t/p/500w/cIXaqUB2pOIEiQsgO85r9RMKzpe.jpg','https://image.tmdb.org/t/p/original/joPhJJblNtFDOpp6zQlx0xJWsmM.jpg','0000-00-00'),
	(32798,'Hawai 5.0',NULL,NULL,'Serie','Hawaii Five-O es una versión moderna de la recordada serie de los años sesenta sobre una división especial de la policía encargada de terminar con el crimen en Hawaii. En esta nueva versión seguimos al detective Steve McGarrett (Alex O’Loughlin), un ex-oficial de la marina convertido en policía, que llega a Oahu para investigar el asesinato de su padre y es convencido a quedarse en Hawaii al liderar su propio equipo especial. Junto a McGarrett encontramos al detective Danny “Danno” Williams (Scott Caan), un ex-policía de New Jersey que prefiere la ciudad pero esta decidido a mantener la seguridad en la isla por su pequeña hija; y a Chin Ho Kelly (Daniel Dae Kim), un ex-detective de Honolulu acusado erróneamente de corrupción. El ultimo miembro del equipo es la prima de Chin, Kono (Grace Park), una bella local, recién salida de la academia y deseosa de establecerse en el equipo de elite.','https://image.tmdb.org/t/p/500w/tmv5fQRqW8bbetWjjSw01het0hk.jpg','https://image.tmdb.org/t/p/original/i5hbVv9VzAOq2yt2r0FGrcGbGzT.jpg','0000-00-00'),
	(33238,'Running Man',NULL,NULL,'Serie','Running Man es un espectáculo de variedades de Corea del Sur transmitido desde el 11 de julio de 2010 hasta ahora a través de SBS. El programa forma parte de la formación de \"Good Sunday\". El programa fue creado por Jo Hyo-jin, Kim Joo-hyung y Im Hyung-taek.','https://image.tmdb.org/t/p/500w/rHuXgDmrv4vMKgQZ6pu2E2iLJnM.jpg','https://image.tmdb.org/t/p/original/15SMnscZqd7HZ0bzruatOcKUlOV.jpg','0000-00-00'),
	(33765,'My Little Pony: La magia de la amistad',NULL,NULL,'Serie','Tercera serie de la franquicia de Hasbro. Twilight Sparkle, discípula de la princesa Celestia, soberana de Equestria, es enviada a Ponyville. Allí conocerá a Pinkie Pie, Rainbow Dash, Applejack, Fluttershy y Rarity, y descubrirá la fuerza de la amistad.','https://image.tmdb.org/t/p/500w/f8suwmcabeTAq8GO9RzK1eUBxMc.jpg','https://image.tmdb.org/t/p/original/fwW7WgJIjhBsnzk87Gyh6g9187m.jpg','0000-00-00'),
	(33907,'Downton Abbey',NULL,NULL,'Serie','Serie británica que se desarrolla en el año 1912, durante el reinado de Jorge V, y que retrata a la sociedad aristocrática de aquella época y sus litigios para ganar o mantener sus títulos nobiliarios.','https://image.tmdb.org/t/p/500w/vXbSoGHWtzViIgHxcD3tqLTr0lc.jpg','https://image.tmdb.org/t/p/original/3mYwiv6rsnEHnbark7a24Jbx2M9.jpg','0000-00-00'),
	(33987,'Corazón Valiente',NULL,NULL,'Serie','Ángela Valdez (Adriana Fonseca) y Samanta Sandoval (Ximena Duque) son dos amigas que llevan una vida apacible hasta que un día secuestran a Samanta. Casi veinte años después, las amigas vuelven a verse. Samanta es guardespaldas y le propone a Ángela que trabaje con ella. A Ángela le encargan la tarea de cuidar a la hija del multimillonario Juan Marcos Arroyo (José Luis Reséndez). Muy pronto se da cuenta de que Juan Marcos no es feliz: por una parte, porque su esposa (Sonya Smith) es una mujer soberbia y malvada que le es infiel con su guardespaldas y, por otra, porque su hermana tiene problemas bipolares. Samanta, por su parte, debe proteger a Guillermo del Castillo (Fabián Ríos), que resulta ser el primer amor de la infancia de Ángela, pero que ahora es un hombre mujeriego. Ella se enamora de Juan Marcos, lo que desata la ira de mucha gente, especialmente la de Fernanda del Castillo (Aylin Mujica), que siempre ha estado obsesionada con Juan Marcos','https://image.tmdb.org/t/p/500w/qgGX0Ej8f72MAPpFEA4vn4UUDZS.jpg','https://image.tmdb.org/t/p/original/4YWuiRyqnfalauuFC06S5yw92gH.jpg','0000-00-00'),
	(34307,'Shameless',NULL,NULL,'Serie','Remake norteamericano de la serie británica sobre la peculiar familia Gallagher, en la que Frank (William H. Macy), un padre soltero y alcohólico, trata de educar a sus seis inteligentes, salvajes e independientes hijos.','https://image.tmdb.org/t/p/500w/5s9XHTB9SLPdg3mNU6BlSLnZ9Qq.jpg','https://image.tmdb.org/t/p/original/4mg9hxlMQIMntI5dIGahlyxuxao.jpg','0000-00-00'),
	(34391,'Ultimate Spiderman',NULL,NULL,'Serie','Ultimate Spider-Man es una serie animada estadounidense creada por Man of Action Studios, basada en el cómic homónimo. La serie se lanzó el 1 de abril de 2012 en el canal Disney XD y finalizó con su cuarta temporada en enero de 2017.','https://image.tmdb.org/t/p/500w/fjtttNJpwa6usPstiYuyKMBFQDN.jpg','https://image.tmdb.org/t/p/original/eXtlDP6kgUyYw0G2L9AxSWUp14Q.jpg','0000-00-00'),
	(34524,'Teen Wolf',NULL,NULL,'Serie','Un animal muerde a un chico y lo convierte en hombre lobo. De repente, es el rey del deporte y de las chicas del instituto. Pero también afronta nuevos problemas.','https://image.tmdb.org/t/p/500w/1F2RnXLc0fmRt7iWfBK4mNVsjno.jpg','https://image.tmdb.org/t/p/original/ycj1ReH56364LiubRLLS4mY7hJw.jpg','0000-00-00'),
	(35610,'InuYasha',NULL,NULL,'Serie','InuYasha es el nombre de un demonio que en su día sellaron para que no provocara más problemas. Pero Kagome, fruto del destino, consigue atravesar la barrera mágica que separa el mundo actual con el de las guerras civiles, y quita el sello a Inu Yasha debido a la amenaza de cierto monstruo. Kagome posee la joya de las cuatro almas, que permite ganar gran poder, y ella será fruto del recelo de muchos monstruos en busca de ella. Pero la joya se ha roto en mil y un pedazos, e Inu Yasha y Kagome partirán en busca de todos los trozos de la joya.','https://image.tmdb.org/t/p/500w/f71mQJuG8oDiDTMGKKWWeW9iHWU.jpg','https://image.tmdb.org/t/p/original/5pMVrmb6tGmNAH0sX7guM9WbrU3.jpg','0000-00-00'),
	(37606,'El asombroso mundo de Gumball ',NULL,NULL,'Serie','Narra las divertidas aventuras de Gumball y su peculiar familia en el idílico pueblecito de Elmore. Un papá conejo rosa de 1,95 metros, una madre que se gana la vida vendiendo arco iris, un gato azul muy torpe y una conejita con un cerebro superdotado componen la familia protagonista. No hay que olvidar a Darwin, un pez rojo que se convirtió en miembro del clan el día en que le crecieron piernas y pulmones. Así es el asombroso mundo de Gumball.','https://image.tmdb.org/t/p/500w/u7Bin65b90ELLbPN4uI6dAHIhMu.jpg','https://image.tmdb.org/t/p/original/al3wD1MqEfwifOBBFnBM5uOl9OT.jpg','0000-00-00'),
	(37680,'Suits',NULL,NULL,'Serie','Michael Ross se gana la vida sobre la delgada línea de la legalidad. Es un joven con una inteligencia abrumadora, pero las malas compañías con las que se junta en la universidad le hicieron salirse y buscar una opción más vistosa a corto plazo, mejorar su economía. Entre sus triquiñuelas destaca el número de veces que se presenta en nombre de otros a los exámenes de corte de derecho. El azar le acabará situando en el despacho de uno de los abogados más jóvenes y brillantes de Manhattan, Harvey Specter. La inteligencia y dotes de Michael le asombrarán tanto que le tomará como su pupilo, a pesar de que no tenga la licenciatura. Juntos trabajarán mano a mano, ocultándole al resto del mundo la verdad: que juntos sólo suman un sólo título universitario.','https://image.tmdb.org/t/p/500w/qyDlF1U1yayXIUniECmGA1oBwZy.jpg','https://image.tmdb.org/t/p/original/nVz7cZZ59PsCLgiWFC0M0N6AFC3.jpg','0000-00-00'),
	(37854,'One Piece',NULL,NULL,'Serie','Riqueza, fama, poder... un hombre había obtenido todo en este mundo, era el Rey de los Piratas Gold Roger. Antes de morir sus últimas palabras inspiraron al mundo a aventurarse al mar: \"¿Mi tesoro? Si lo queréis es vuestro... lo he escondido todo en ese lugar\". Y así dio comienzo lo que se conoce como la Gran Era de la Piratería, lanzando a cientos de piratas al mar para encontrar el gran tesoro One Piece. Esta serie relata las aventuras y desventuras de uno de esos piratas, Monkey D. Luffy, quien accidentalmente de pequeño, comió una Fruta del Diablo (Akuma no Mi en japonés), en particular una Gomu Gomu no Mi que hizo que su cuerpo ganara las propiedades físicas de la goma, convirtiéndose en el hombre de goma. Luffy, después de dicho suceso, decide que se convertirá en el próximo Rey de los Piratas y para ello, deberá encontrar el \"One Piece\".','https://image.tmdb.org/t/p/500w/mBxsapX4DNhH1XkOlLp15He5sxL.jpg','https://image.tmdb.org/t/p/original/oag7edI9flSMawmNySEiSEJAbrf.jpg','0000-00-00'),
	(38693,'Lego Ninjago: Maestros del Spinjitzu',NULL,NULL,'Serie','Kai, Jay, Cole y Zane deben perfeccionar sus poderes elementales y armas Spinjitzu para proteger las tierras de Ninjago.','https://image.tmdb.org/t/p/500w/6hAAq3GUWMwD0yJpvBBnpJpCs3d.jpg','https://image.tmdb.org/t/p/original/fqb9X4th2p2voefRLqdv1xoZQmC.jpg','0000-00-00'),
	(39272,'Érase una vez',NULL,NULL,'Serie','Mezclando el mundo real y los cuentos de hadas, se cuenta la historia de Emma Swan, una mujer cuya vida cambia cuando su hijo, al que había dado en adopción diez años antes, la encuentra. Él cree que su madre pertenece a un mundo irreal y que es la hija de Blancanieves.','https://image.tmdb.org/t/p/500w/gDmGiZ9iCxUPrdZ7dyNwSPJtFmf.jpg','https://image.tmdb.org/t/p/original/oE6VlG1ntyCaMdlPVRtsPQja3hf.jpg','0000-00-00'),
	(39340,'Dos chicas sin blanca',NULL,NULL,'Serie','Ambientada en el barrio de Williamsbourg, del distrito de Brooklyn, en Nueva York, la serie relata la vida de dos camareras veinteañeras que trabajan juntas en un restaurante, para lograr cumplir su sueño de abrir un negocio de cupcakes. Max Black (Kat Dennings), proveniente de una familia pobre de la clase trabajadora, que además tiene un trabajo adicional como niñera para una mimada y detestable socialité de Manhattan; y Caroline Channing (Beth Behrs), quien nació rica pero que ahora es pobre, debido a que su padre fue atrapado operando en una enorme estafa. Las dos se convierten en amigas y construyen un sueño juntas, el de abrir una tienda de magdalenas (para eso necesitan alcanzar 250.000 dólares), aunque casi no pueden costear nada con el pago que reciben en su trabajo. Junto con ellas trabajan también en el restaurante su jefe, Han Lee (Matthew Moy); Oleg (Jonathan Kite), un alegre cocinero ucraniano; y Earl (Garrett Morris), el cajero. Al comienzo de cada episodio, se muestra ','https://image.tmdb.org/t/p/500w/rV9LriQm8J8UHsov1lk5c8aV1Id.jpg','https://image.tmdb.org/t/p/original/4FPy4dwP5vEJAuY0kiLr2CRvvHb.jpg','0000-00-00'),
	(39351,'Grimm',NULL,NULL,'Serie','¿Recuerdas los cuentos de hadas de tus padres te contaban antes de acostarte? Esas no eran historias, eran advertencias. Nick Burkhardt pensaba que realmente se había preparado para trabajar como detective de homicidios hasta que empezó a ver cosas que no podía explicar. Cuando su tía enferma Marie llega, la vida de Nick da un giro cuando ella revela que son descendientes de un grupo de élite de cazadores, también conocidos como \"Grimms\", que luchan para mantener el equilibrio de la humanidad a salvo de las criaturas sobrenaturales del mundo. Como Nick profundiza en su pasado, se da cuenta que tendrá que asumir la responsabilidad de sus antepasados y lidiar con una mitología más grande que la vida de los hermanos Grimm que ahora es demasiado real.','https://image.tmdb.org/t/p/500w/oS3nip9GGsx5A7vWp8A1cazqJlF.jpg','https://image.tmdb.org/t/p/original/40Lrj8AKZhGrEmbYbgLbHkqPZvq.jpg','0000-00-00'),
	(40075,'Gravity Falls',NULL,NULL,'Serie','Narra las aventuras de los mellizos de 12 años Dipper y Mabel Pines, que ven cómo se desvanecen sus planes para el verano cuando sus padres deciden mandarlos con su tío-abuelo Grunkle Stan, que vive en el corazón de Gravity Falls. Pronto, Dipper y Mabel descubren que en Gravity Falls no todo es lo que parece y confían el uno en el otro y en sus nuevos amigos para descubrir lo que REALMENTE está sucediendo en este extraño lugar...','https://image.tmdb.org/t/p/500w/l0XvAI856XdyDYEfr1njztjH7u0.jpg','https://image.tmdb.org/t/p/original/t9inzSLIttATX6RdnmDjL7T4WN7.jpg','0000-00-00'),
	(42009,'Black Mirror',NULL,NULL,'Serie','Black Mirror es una serie de televisión británica creada por Charlie Brooker que muestra el lado oscuro de la vida y la tecnología. La serie es producida por Zeppotron para Endemol. En cuanto al contenido del programa y la estructura, Brooker ha señalado que \"cada episodio tiene un tono diferente, un entorno diferente, incluso una realidad diferente, pero todos son acerca de la forma en que vivimos ahora - y la forma en que podríamos estar viviendo en 10 minutos si somos torpes\".','https://image.tmdb.org/t/p/500w/xpdw7ogSIMH1Wmnbx4irH3wimFP.jpg','https://image.tmdb.org/t/p/original/1EmOEkYd28cRX6JNw2ErgTrU5XG.jpg','0000-00-00'),
	(42035,'El barco',NULL,NULL,'Serie','Una catástrofe mundial provoca un cataclismo que lleva a la desaparición de la tierra firme. Con el planeta inundado de agua, la tripulación y los jóvenes alumnos de un buque escuela parecen ser los únicos supervivientes… Aislados del resto de un mundo que ni siquiera saben si ya existe, los principales responsables de que la nave llegue a puerto son el capitán (Juanjo Artero) y la científica del buque (Irene Montalá). Además de los alumnos está Ulises (Mario Casas), un polizón rebelde y con madera de héroe, y Ainhoa (Blanca Suárez), la hija adolescente del capitán, que se ha embarcado junto a su hermana pequeña Valeria (Patricia Arbues), a raíz del reciente fallecimiento de su madre.','https://image.tmdb.org/t/p/500w/juDksh1UeSodTjavLxiC4JJgn3F.jpg','https://image.tmdb.org/t/p/original/tfifgKMWPCtEebp7wH9vBKkDpcx.jpg','0000-00-00'),
	(42444,'Los Caballeros del Zodiaco',NULL,NULL,'Serie','Serie de TV (1986-1989). Popular serie de animación basada en un manga y anime que relata la historia de 5 míticos guerreros llamados \"caballeros\", que han adoptado varias constalaciones como símbolos guardianes. Fue emitida en la cadena televisiva TV Asahi desde Octubre de 1986 hasta Abril de 1989 en tres temporadas de 114 episodios. Inicialmente, la serie de televisión tenía planeadas 52 capítulos, pero su popularidad fue tan grande que se extendió a 73 episodios, convirtiéndose en la primera temporada de la serie y que corresponde al primer capítulo del manga, Santuario con algunos extras en el intermedio. Antes de que venciera el contrato fue pactada una segunda temporada, Asgard (episodios 74 al 99), que no estaba basada directamente en el manga, sino que fue inspirada en el episodio Hyoga en el país de los hielos que se encuentra al final del tomo 13 del manga. Posteriormente siguió una tercera temporada correspondiente al segundo capítulo del manga, Poseidón (ep. 100 al 114). L','https://image.tmdb.org/t/p/500w/88Rd5sdhAVJuG9H7eTA4nqddz4t.jpg','https://image.tmdb.org/t/p/original/rYp2lHcM5rsdEdzuYA56lk7xBDr.jpg','0000-00-00'),
	(43348,'Pablo Escobar, el patrón del mal',NULL,NULL,'Serie','Versión libre del libro \"La parábola de Pablo\". Describe la vida del narco colombiano Pablo Escobar Gaviria desde su infancia, El uso de la violencia indiscriminada lo convirtió en el narcotraficante más temible y sanguinario de finales del siglo XX. Llegó incluso a desestabilizar al Gobierno colombiano hasta el punto de ser el criminal más buscado del mundo. ','https://image.tmdb.org/t/p/500w/r1tMESor8QuPVKP2VxcVEX6t6ad.jpg','https://image.tmdb.org/t/p/original/jZqm7HFuxfH9P0LFjQZ8nzrCUHP.jpg','0000-00-00'),
	(44006,'Chicago Fire',NULL,NULL,'Serie','El espectáculo sigue las vidas de los bomberos y paramédicos que trabajan en el Departamento de Bomberos de la ciudad de Chicago en la estación de bomberos 51, formada por el Camión 81, el Escuadrón 3, la Ambulancia 61 y el Batallón 25.','https://image.tmdb.org/t/p/500w/W5geO8tq68ng4TsXyZ81phcPiz.jpg','https://image.tmdb.org/t/p/original/g9aoiYLbE3IrDiMms5fU4lv6BR4.jpg','0000-00-00'),
	(44217,'Vikingos',NULL,NULL,'Serie','Sigue las aventuras de Ragnar Lothbrok, el héroe más grande de su época. La serie narra las sagas de la banda de hermanos vikingos de Ragnar y su familia, cuando él se levanta para convertirse en el rey de las tribus vikingas. Además de ser un guerrero valiente, Ragnar encarna las tradiciones nórdicas de la devoción a los dioses, la leyenda dice que él era un descendiente directo de Odín, el dios de la guerra y los guerreros.','https://image.tmdb.org/t/p/500w/aq2yEMgRQBPfRkrO0Repo2qhUAT.jpg','https://image.tmdb.org/t/p/original/uNFSCxeZsZVIQ1TrD6mzu6uMQEb.jpg','0000-00-00'),
	(44953,'El señor de los cielos',NULL,NULL,'Serie','La serie narra la historia de Aurelio Casillas, uno de los narcotraficante más importantes de México en los años 90. La única ambición de Aurelio era convertirse en el narco más poderoso de todo México, sin importarle ser cauteloso y mucho menos llamativo. Logró tener fortuna, mujeres, casas, edificios y mansiones sin mucho esfuerzo.','https://image.tmdb.org/t/p/500w/qsTlD6rYb5vXOlBTT9Lj2hBp44X.jpg','https://image.tmdb.org/t/p/original/Ag7VUdnrRz5Qpq3Yn3E5OCvFnu0.jpg','0000-00-00'),
	(45140,'Teen Titans Go!',NULL,NULL,'Serie','Teen Titans Go! es una serie de animación que sigue las aventuras de los Jóvenes Titanes cuando no están salvando el mundo mientras viven juntos como adolescentes sin adultos que se entrometan. Las situaciones son, a diferencia de la mayoría de las series superheróicas, cómicas, alocadas y paródicas; por ejemplo, bromas juveniles que alcanzan nuevas cotas de peligrosidad, obtener el permiso de conducir tras destrozar el Batmóvil o lavar los trajes tras mancharlos al luchar contra sus enemigos.','https://image.tmdb.org/t/p/500w/lEWtzTBC6Ks5fdc4RgHRUZxts2w.jpg','https://image.tmdb.org/t/p/original/udaLIJ6Na7GOHjvTlyP9JFPTccv.jpg','0000-00-00'),
	(45790,'JoJo\'s Bizarre Adventure',NULL,NULL,'Serie','La trama se desarrolla en torno a la historia del linaje Joestar, una poderosa familia de origen británico destinada a combatir fuerzas sobrenaturales malvadas usando poderes adquiridos; la obra abarca varias generaciones de dicho linaje, las cuales son adaptadas en cada parte poniendo un descendiente como protagonista, empezando con Jonathan en el año 1880.  El nombre «JoJo», presente en el título de la obra, consiste en un juego de palabras compuesto por el nombre de los protagonistas de cada parte, los cuales pueden abreviarse como «Jojo» y usarse a forma de apodo; sin embargo, en las últimas partes de la obra se hacen juegos de palabras más complejos: por ejemplo, Josuke es un juego de palabras en japonés en que la sílaba «suke» (助) se puede leer también como «jo», y el diminutivo de Giorno Giovana (Gio. Gio.) tiene una pronunciación bastante similar a «Jojo». Todos los Joestar se identifican porque tienen una marca de nacimiento en forma de estrella de cinco puntas.','https://image.tmdb.org/t/p/500w/mLKN1dsimKPiXCZ48KED0X8a02t.jpg','https://image.tmdb.org/t/p/original/3MZoif9WtXelJXA749NgDxVURWX.jpg','0000-00-00'),
	(45815,'Avenida Brasil',NULL,NULL,'Serie','Esta es la dramática historia de Rita, que lucha por recuperar parte de la vida que su terrible madrastra, Carmina, le robó cuando todavía era solo una niña. Pero ella tendrá que enfrentarse a su pasado y decidir hasta dónde está dispuesta a llegar para vengarse de los que más le hicieron daño.','https://image.tmdb.org/t/p/500w/l6hrZvxoMyG5pGjyb9SBZ6dZjLp.jpg','https://image.tmdb.org/t/p/original/p8uzK1Lngu9q9dpnn4SwPKIT1H7.jpg','0000-00-00'),
	(45950,'High School DxD',NULL,NULL,'Serie','La historia esta protagonizada por Issei Hyodou, un estudiante de instituto bastante inútil y pervertido que tiene la mala suerte de ser asesinado por una chica en su primera cita. Issei se reencarna en un demonio y a partir de ese momento tendrá que servir a Rias Gremory, quien es otra demonio de alto rango que casualmente resulta ser la estudiante más guapa de todo su instituto.','https://image.tmdb.org/t/p/500w/oF8PNdntjZ7DUrAvnhNPPNRi0q6.jpg','https://image.tmdb.org/t/p/original/hu9rdpXrJZ8xLn7EGXRywctLNow.jpg','0000-00-00'),
	(46195,'Monogatari',NULL,NULL,'Serie','Monogatari se centra en Koyomi Araragi, un estudiante de tercer año de instituto que es ahora casi humano después de haber sido vampiro por un tiempo. Un día, una compañera de clase llamada Hitagi Senjōgahara, quien nunca habla con nadie, cae desde una alta escalera en los brazos de Koyomi. Él descubre que Hitagi no pesa casi nada, una contradicción física. A pesar de ser amenazado por ella, Araragi le ofrece su ayuda, y la presenta a Meme Oshino, un hombre excéntrico de mediana edad viviendo en un edificio abandonado que le ayudó a dejar de ser un vampiro.','https://image.tmdb.org/t/p/500w/laoasZRjuMUKjgKoEPe80c8Yhve.jpg','https://image.tmdb.org/t/p/original/4LpbI1joKQ9i3mB3piQdAWEZ8AK.jpg','0000-00-00'),
	(46260,'Naruto',NULL,NULL,'Serie','La serie se centra en torno a Uzumaki Naruto, un joven ninja de la aldea oculta de Konoha, del País del Fuego. Naruto es un chico travieso al que le gusta llamar la atención, haciendo que el maestro Iruka se enfade. Y debido a esto, no parece que sea capaz de graduarse en la escuela de ninjas. Pero Naruto tiene un sueño... convertirse en el jefe de la aldea de ninjas donde vive y así ser el siguiente Hokage, y por consiguiente ser reconocido como el mejor ninja.','https://image.tmdb.org/t/p/500w/oycArCLGgtWyUz5aho7ojFZkgjN.jpg','https://image.tmdb.org/t/p/original/uX1hWPJe5xT0siFUh2PQQbRRjW5.jpg','0000-00-00'),
	(46296,'Spartacus',NULL,NULL,'Serie','Traicionado por su país. Convertido en esclavo. Renacido como guerrero. Spartacus protagoniza la historia más gráfica y visceral del gladiador más famoso de Roma. Con un reparto estelar, asistimos a una mezcla única de acción, efectos gráficos y brutales batallas. Separado del amor de su vida, Spartacus tendrá que luchar por su supervivencia, participando en un espectáculo, donde el principal entretenimiento es la muerte. En un mundo de corrupción, violencia, sexo y fama acabará interviniendo en política y vivirá atormentado por el deseo de venganza.','https://image.tmdb.org/t/p/500w/1vhKauCQAq32u53X8n9qI896e6.jpg','https://image.tmdb.org/t/p/original/kAUI0oOWZbGAQMmv7WM6scvoE34.jpg','0000-00-00'),
	(46298,'Hunter × Hunter',NULL,NULL,'Serie','Gon Frecks, un niño de 12 años, vive con su tía Mito y su abuela en Isla Ballena, huérfano de madre y según su tía también de padre. Un día Gon es atacado por un oso del bosque, pero es salvado por un cazador quien le explica que está en busca de su maestro para así convertirse en un cazador, él es quien le dice que su padre Gin está vivo. Enterado de esto Gon decide convertirse en cazador para poder encontrar a su padre.','https://image.tmdb.org/t/p/500w/A702KA1gXlI3hB33hdhwPM708pY.jpg','https://image.tmdb.org/t/p/original/qbg6rLTRQ9LsdO28GGLMJvirmX5.jpg','0000-00-00'),
	(46639,'American Gods',NULL,NULL,'Serie','Un ex convicto recientemente liberado llamado Shadow conoce a un hombre misterioso que se hace llamar \"Wednesday\" y que sabe más de lo que parece sobre la vida y el pasado de Shadow.','https://image.tmdb.org/t/p/500w/uY3MJohUpY7UMMTK90BIhX5txEs.jpg','https://image.tmdb.org/t/p/original/gevw5nZRYz2kWj1PqW9pz4sgeeZ.jpg','0000-00-00'),
	(46786,'Bates Motel',NULL,NULL,'Serie','Precuela contemporánea de la película Psicosis, que nos hace un retrato íntimo de cómo se desarrolla la psique de Norman Bates durante sus años de adolescencia. Los fans descubrirán su historia de trasfondo oscuro y retorcido y conocerán de primera mano cuán profundamente intrincada es la relación con su madre, Norma, y cómo ello ayudó a forjar a uno de los asesinos en serie más famoso de todos los tiempos.','https://image.tmdb.org/t/p/500w/s3pypVJf05ELPCUA6jSW381nLwm.jpg','https://image.tmdb.org/t/p/original/2cxoT1dt3ZpaHNdiMKKWczhJe1c.jpg','0000-00-00'),
	(46896,'Los originales',NULL,NULL,'Serie','Spin off de \'Crónicas vampíricas\'. Se concentrará sobre Klaus (Joseph Morgan) y los originales de \'Crónicas vampíricas\' (después o antes de Elijah). Le veremos regresar al Nuevo Orleans y se reencontrará allí a su diabólico y antiguo protegido Marcel. Phoebe Tonkin, que da vida a la mujer lobo Hayley en la temporada 4 de \'Crónicas vampíricas\', también estará presente en el reparto de este potencial spin off que será escrito por Julie Plec, cocreadora de \'Crónicas vampíricas\'. La trama contará con Camille, una estudiante de psicología que despertará el interés de Klaus. A pesar de ser humana, el personaje tendrá su lado sombrío y quedará intrigada con el híbrido.','https://image.tmdb.org/t/p/500w/bYmZ4XBk2eW2r4H5IardtWxvOVM.jpg','https://image.tmdb.org/t/p/original/2llbXc2BOkLkBGgcNJCRbrWedUO.jpg','0000-00-00'),
	(46952,'The Blacklist',NULL,NULL,'Serie','El criminal más buscado del mundo, Thomas Raymond Reddington, se entrega misteriosamente y se ofrece a delatar a todos los que alguna vez han colaborado con él. Su única condición: sólo colaborará con Elisabeth King, una nueva agente del FBI, con quien parece tener alguna conexión que ella desconoce.','https://image.tmdb.org/t/p/500w/zXpSJLcczUt6EfbdULZanguzy87.jpg','https://image.tmdb.org/t/p/original/iQARSJNtneRkV7FQaLitgnAaUpB.jpg','0000-00-00'),
	(47699,'Reina de Corazones',NULL,NULL,'Serie','La historia transcurre en Las Vegas, en donde vive Reina Ortiz, una joven costurera que trabaja día y noche para mantener a su madrastra y a su hermana, las cuales solo la utilizan para sus bienes y caprichos. Desde que falleció su padre, Reina ha querido tener una vida distinta, con lujos y millones de dinero.1​\n\nPor otro lado, tenemos a Nicolás, un joven humilde que trabaja como mesero de fiesta y jugador de póker. Reina y él se conocen el día de la boda de Estefanía, una mujer caprichosa y con mucho dinero. Después de la fiesta, Reina se va, y Nicolás decide seguirla para poder enamorarla creyendo que es millonaria.','https://image.tmdb.org/t/p/500w/lZSLz4LCUmpbEb91SdJkdg0Cg2c.jpg','https://image.tmdb.org/t/p/original/5xdC1a8pSCKdacd2ijVZzhP1a1E.jpg','0000-00-00'),
	(48866,'Los 100',NULL,NULL,'Serie','Situada 97 años después de una guerra nuclear que ha destruido la civilización, los supervivientes de una nave espacial, que han sobrevivido durante 3 generaciones en el espacio, envían 100 delincuentes juveniles \"para testear\" las condiciones de la Tierra, con la esperanza de eventualmente volver a poblar el planeta. El grupo de jóvenes tratará de sobrevivir en un entorno desconocido y hostil a pesar de las brechas que se abren entre ellos, unos partidarios de seguir en conexión con la nave, otros a favor de empezar de cero sin depender de nadie. Mientras, en la nave, las luchas por el poder político se recrudecen, llevando a los dirigentes a situaciones extremas y difíciles decisiones.','https://image.tmdb.org/t/p/500w/hTExot1sfn7dHZjGrk0Aiwpntxt.jpg','https://image.tmdb.org/t/p/original/rTl0VdVt93CqWgn0Rpgf2qnrSNn.jpg','0000-00-00'),
	(48891,'Brooklyn Nine-Nine',NULL,NULL,'Serie','El detective Jake Peralta y el capitán Ray Holt encabezan esta comedia sobre conflictos generacionales en una comisaría de Nueva York. Uno es un detective que no se toma en serio las reglas de sus superiores, mientras que el otro es un inspector empeñado en que madure de una vez y trabaje conforme a las normas del departamento.','https://image.tmdb.org/t/p/500w/9AeiA1XtP5sel2tAf9LaGeUjhDb.jpg','https://image.tmdb.org/t/p/original/wd5JwnNOqEDIKZ672wjEo8hzL7k.jpg','0000-00-00'),
	(52910,'Ley de la Jungla',NULL,NULL,'Serie','Reality show híbrido que combina elementos de drama y documental. El programa es presentado por el comediante Kim Byung Man, y cada episodio invita a varias celebridades de diversos campos. Hasta ahora, muchas de las estrellas ídolos y actores famosos han aparecido en el programa. El programa presenta a los espectadores lugares exóticos de todo el mundo donde las celebridades deben trabajar juntas para completar misiones y sobrevivir. Las celebridades del elenco viajan a lugares naturales menos habitados para sobrevivir por su cuenta y experimentar la vida con las tribus y las personas locales. En cada lugar, los invitados tienen la tarea de cazar y preparar sus comidas y también crear refugio para la tribu. A veces se enfrentan a muchos desafíos difíciles. ¿Dónde visitará la tribu? ¿Y cómo sobrevivirán solos? ¡Estén atentos para comprobarlo!','https://image.tmdb.org/t/p/500w/7goeSggajsAa96CHG48vWrJz2o2.jpg','https://image.tmdb.org/t/p/original/qG2JpIDuYhuQOMSLqmMtHBBbfx5.jpg','0000-00-00'),
	(56570,'Outlander',NULL,NULL,'Serie','Sigue la historia de Claire Randall, una enfermera de combate casada en los años 40, que misteriosamente es arrastrada atrás en el tiempo hasta 1743, donde se lanza de inmediato a un mundo desconocido, viéndose amenazada su propia vida. Cuando se ve obligada a casarse con Jamie Fraser, un joven guerrero escocés caballeroso y romántico, Claire comienza un pasional triángulo entre dos hombres muy diferentes con dos vidas irreconciliables.','https://image.tmdb.org/t/p/500w/Ai6HryU8R00XSgiCTeQoF75um84.jpg','https://image.tmdb.org/t/p/original/b1hYWp0qDbTSL7XE3dXbN70K83D.jpg','0000-00-00'),
	(57041,'Gintama',NULL,NULL,'Serie','La historia de Gintama nos sitúa en un Japón sometido por unas criaturas alienígenas conocidas como Amantos. Gracias a estos el país goza de avances tecnológicos desmedidos, pero a la vez la especie humana ha sido desprendida de la autoridad de velar sobre su propio planeta. Para evitar revuelas bélicas se ha prohibido por completo el uso y porte de espadas en cualquier circunstancia por parte de los terrícolas,pero aun así en esta nueva era hay personas que se mantienen fieles a sus creencias y convicciones antañas como es el caso del protagonista, Gintoki. Gin, junto con otros dos igualmente estrambóticos personajes crean una tienda conocida como la Yorozuya, en donde se dedican a realizar cualquier tipo de trabajo que se les presente, pero al final rara vez logran obtener algo de dinero decente y tienen problemas incluso para pagar el alquiler del piso.','https://image.tmdb.org/t/p/500w/78vRhCYGcwpO8MHFEtNqzgGWBW9.jpg','https://image.tmdb.org/t/p/original/cWD3BD0aQFypLGVOvd23hWdg5bP.jpg','0000-00-00'),
	(57243,'Doctor Who',NULL,NULL,'Serie','Doctor Who es una serie de televisión británica de ciencia ficción producida por la BBC. El programa muestra las aventuras de un Señor del Tiempo conocido como \"El Doctor\", que explora el universo en su TARDIS, una nave espacial con conciencia propia capaz de viajar a través del tiempo y el espacio. Con la ayuda de distintos acompañantes, el Doctor se enfrenta a una variedad de enemigos mientras salva civilizaciones, visita tanto el pasado como el futuro, ayuda a gente común y corrige injusticias.','https://image.tmdb.org/t/p/500w/mQ9yeCuofNatSyErUKAPD1uOq8Q.jpg','https://image.tmdb.org/t/p/original/tSKJCwgeVpdn3YvcgZO3ro2N8tP.jpg','0000-00-00'),
	(57532,'La Patrulla Canina',NULL,NULL,'Serie','Protagonizada por 6 heroicos cachorros: Chase, Marshall, Rocky, Zuma, Rubble y Skye, que son entrenados y dirigidos por Ryder, un niño de 10 años que los rescató y les enseñó a utilizar sus habilidades para ayudar a los demás, formando la patrulla canina.','https://image.tmdb.org/t/p/500w/tEP8f7xGdhbGF3vfIQIfjnP0uZv.jpg','https://image.tmdb.org/t/p/original/vN9BE385YKPgumoyrOd8Z8yh6Nn.jpg','0000-00-00'),
	(57706,'Ranma ½',NULL,NULL,'Serie','Ranma ½ es una serie de manga escrita e ilustrada por la mangaka Rumiko Takahashi. La historia gira en torno a Ranma Saotome, un joven de 16 años que fue entrenado en las artes marciales desde que era pequeño. Como consecuencia de un accidente durante uno de sus entrenamientos, Ranma sufre de una maldición que le obliga convertirse en mujer cada vez que tiene contacto con el agua fría, mientras que el contacto con el agua caliente revierte dicho efecto convirtiéndolo nuevamente en chico. Durante la serie, Ranma intenta librarse de su maldición, mientras que debe lidiar con su compromiso de matrimonio con la adolescente Akane Tendo, que fue pactado varios años antes por los padres de ambos jóvenes.','https://image.tmdb.org/t/p/500w/aOKFwrMLpQ4e2GDSkM4JangvXIm.jpg','https://image.tmdb.org/t/p/original/57wldqHKcVluMoLnJCHR46myRnW.jpg','0000-00-00'),
	(58710,'Carita de Ángel',NULL,NULL,'Serie','Dulce María es como su nombre, una dulce niña de 5 años, llena de alegría y buenos sentimientos. Con la muerte de su madre, su padre, Luciano Larios, se hunde en la depresión y el dolor, y decide alejarse de todo y de todos. Interna a Dulce María en el colegio de monjas \"Reina de América\" y se marcha al extranjero dejándola al cuidado de su hermano Gabriel, que es sacerdote. La única que visita que recibe la niña es la de su querida tía Estefanía, a quien llama cariñosamente \"Tía Pelucas\" debido a que en lugar de mostrar su cabello, usa pelucas de colores que combina con su ropa.','https://image.tmdb.org/t/p/500w/5LWkYZ4FeE2FwKrTqDMTflhvNNc.jpg','https://image.tmdb.org/t/p/original/nHONjyGEOlOO2X6Xy9giIjGLCQZ.jpg','0000-00-00'),
	(58841,'Chicago P.D.',NULL,NULL,'Serie','Serie de TV (2014-Actualidad).  Spin-off de la serie Chicago Fire. Narra las historias del Distrito 21 del Departamento de Policía de Chicago, hombres y mujeres que lo dan todo para proteger su comunidad El distrito 21 está compuesto por dos grupos, los uniformados que patrullan la ciudad y se enfrentan a los delitos callejeros, y la unidad de inteligencia, que combate los grandes delitos - crimen organizado, tráfico de drogas, asesinatos y más.','https://image.tmdb.org/t/p/500w/f9eLOgAiN8x7nFXbedYxb3KCKxR.jpg','https://image.tmdb.org/t/p/original/2egXeYfUqXrbKpDuLUflKOpspjS.jpg','0000-00-00'),
	(59427,'Los Vengadores unidos',NULL,NULL,'Serie','\"Los Vengadores Unidos\" reúne al equipo de súper héroes más popular - Iron Man, Hulk, Capitán América, Thor, Ojo de Halcón y la Viuda Negra, junto con el recién llegado Halcón, siendo la primera vez en la historia de la animación que este heterogéneo grupo de héroes une sus fuerzas. Dirigido por Iron Man, los héroes entrenan y viven juntos en su nueva sede en la Torre Vengadores. Los villanos más peligrosos del planeta no tienen ninguna oportunidad cuando los Vengadores se reúnen - ya sea que eviten que el Dr. Doom conquiste Asgard, que Attuma conduzca al ejército Atlante contra la ciudad de Nueva York o que Drácula desate hordas de vampiros, los Vengadores deben trabajar juntos para tener éxito.','https://image.tmdb.org/t/p/500w/6ZqXMR9aLLdGjbxkIMo77EhZexy.jpg','https://image.tmdb.org/t/p/original/aVYPq7FSvsdNQOXVIFnndXJPCXn.jpg','0000-00-00'),
	(60059,'Better Call Saul',NULL,NULL,'Serie','Better Call Saul es una serie de televisión estadounidense creada por Vince Gilligan y Peter Gould. Se trata de un spin-off de Breaking Bad que consiste en una precuela de su historia. Situada en 2002, consiste en la vida del abogado James \"Jimmy\" McGill (Bob Odenkirk) siete años antes de su aparición como Saul Goodman en Breaking Bad. También se exploran eventos situados durante y después de Breaking Bad.','https://image.tmdb.org/t/p/500w/hPea3Qy5Gd6z4kJLUruBbwAH8Rm.jpg','https://image.tmdb.org/t/p/original/kKuaHGUs45GBtoTbtXnp68ghEbQ.jpg','0000-00-00'),
	(60572,'Pokémon',NULL,NULL,'Serie','La serie narra las aventuras del joven entrenador Pokemon de diez años Ash Ketchum, que decide comenzar su aventura para llegar a convertirse un día en un gran Maestro de Pokemon. Para ello deberá recorrer distintas regiones, capturar cuantos más pokemon pueda, y conseguir las medallas de gimnasio necesarias y así participar en la Liga Pokemon, ganarla y así estar un paso más cerca de convertirse en Maestro Pokemon. Para ello cuenta con la ayuda de Pikachu, su primer pokemon, que obtuvo de manos del Profesor Oak. En su recorrido conocerá y hará nuevos amigos, como Brock o Misty, que le acompañarán y ayudarán para conseguir alcanzar su sueño.','https://image.tmdb.org/t/p/500w/tvjCdVRkaaab2ezM9BctkAOXeyW.jpg','https://image.tmdb.org/t/p/original/xgNjGdZLlbPreF9Aa6Hzz3vMitV.jpg','0000-00-00'),
	(60574,'Peaky Blinders',NULL,NULL,'Serie','En Gran Bretaña, Reino Unido se recuperan de la desesperación de la Gran Guerra, las personas sobreviven a como pueden, y las bandas criminales proliferan en una nación sacudida económicamente.\n\nEs justamente aquí donde una familia de gánsteres irlandeses de origen nómada (a veces llamados gitanos o chatarreros) asentada en Birmingham (los Peaky Blinders) justo después de la Primera Guerra Mundial, dirigen un local de apuestas hípicas en la ciudad.  Las acciones del ambicioso, respetado, temerario y peligroso jefe de la banda, Thomas Shelby, llaman la atención del Inspector jefe Chester Campbell, un detective de la Real Policía Irlandesa que es enviado por el mismo Winston Churchill desde Belfast donde había sido enviado a limpiar la ciudad del Ejército Republicano Irlandés (IRA), comunistas, pandillas y delincuentes comunes.','https://image.tmdb.org/t/p/500w/wiE9doxiLwq3WCGamDIOb2PqBqc.jpg','https://image.tmdb.org/t/p/original/dYAeYkRqDfQrMGHdY7hrtllSPTu.jpg','0000-00-00'),
	(60585,'Bosch',NULL,NULL,'Serie','Bosch Es una  serie de televisión americana de género policiaco producida por Amazon y protagoniza Titus Welliver, como el detective de Policía de Los Angeles, Harry Bosch. La serie fue desarrollada para Amazon por Eric Overmyer y se está inspirada por tres de las novelas de Michael Connelly: Ciudad de Huesos, Echo Park y La rubia de hormigón.','https://image.tmdb.org/t/p/500w/jkDK2WoQDINrUr0mmvIRJH2TXIN.jpg','https://image.tmdb.org/t/p/original/1DhhUJnHcuGG7NhEbXW3t34OVr8.jpg','0000-00-00'),
	(60625,'Rick y Morty',NULL,NULL,'Serie','Comedia animada que narra las aventuras de un científico loco Rick Sánchez, que regresa después de 20 años para vivir con su hija, su marido y sus hijos Morty y Summer.','https://image.tmdb.org/t/p/500w/zJZfxi8X3XPHAhxXseRugtnNVtt.jpg','https://image.tmdb.org/t/p/original/5Yiep9EwcQgLolg013ETBVqHxuD.jpg','0000-00-00'),
	(60708,'Gotham',NULL,NULL,'Serie','Un nuevo recluta en el Departamento de Policía de Gotham City , James Gordon , se empareja con el veterano detective Harvey Bullock para resolver uno de los casos de más alto perfil de Gotham: el asesinato de Thomas y Martha Wayne . Durante su investigación, Gordon se reúne con el hijo de los Wayne \' Bruce , ahora bajo el cuidado de su mayordomo Alfred Pennyworth . El encuentro con el joven Wayne obliga aún más a Gordon a coger al misterioso asesino. En el camino, Gordon se involucra con las familias y asociados de la mafia de Gotham, incluyendo la Gángster Fish Mooney. Finalmente, Gordon se ve obligado a formar una amistad con Wayne, una amistad que le ayudará a formar el futuro del niño para convertirse en el Caballero Oscuro.','https://image.tmdb.org/t/p/500w/A9lC7Mn3D6alhO4rkuatdW8oCWy.jpg','https://image.tmdb.org/t/p/original/iR3L0p59rOz1JZETXp0QvK5H4AZ.jpg','0000-00-00'),
	(60735,'The Flash',NULL,NULL,'Serie','Después de que un acelerador de partículas cause una extraña tormenta, al investigador científico de la policía, Barry Allen, le cae un rayo y entra en coma. Meses después despierta con el poder de moverse a súper velocidad permitiéndole ser el ángel de la guardia de Central City. Aunque al principio se siente entusiasmado con sus nuevos poderes, Barry descubre que no es el único “meta-humano” que se originó tras la explosión del acelerador – y no todo el mundo está usando sus nuevos poderes para el bien. Los compañeros del laboratorio STAR dedican su vida a ayudar a Barry a proteger a los inocentes. Por ahora, solo algunos amigos cercanos saben que Barry es, literalmente, el hombre más rápido del mundo, pero no pasará mucho hasta que el mundo conozca que ahora Barry Allen es … Flash.','https://image.tmdb.org/t/p/500w/eyG9srihv68ScRdEbJZj66WT4O0.jpg','https://image.tmdb.org/t/p/original/2O8tlUzKS3uddGW5D2B9XM6b4e.jpg','0000-00-00'),
	(60743,'Constantine',NULL,NULL,'Serie','John intenta conectarse con el alma de la persona que más busca, su madre, que murió dando a luz al protagonista, sin éxito. Cuando Liv, la hija de un amigo fallecido, se convierte en el blanco de los demonios, John interviene para salvarla, y juntos forman una alianza.','https://image.tmdb.org/t/p/500w/3tq8kLes9zsPHu0zg0cz3E3GHN3.jpg','https://image.tmdb.org/t/p/original/gQ3bA1DBKyZwkDCHJFEAT0MkKpu.jpg','0000-00-00'),
	(60797,'Scorpion',NULL,NULL,'Serie','Scorpion es una serie de televisión estadounidense transmitida por CBS que se estrenó en el 2014. Se basa en la vida del autoproclamado genio y experto en ordenadores Walter O\'Brien. En la serie O\'Brien y sus amigos genios se ayudan entre ellos para resolver amenazas globales y salvar vidas.','https://image.tmdb.org/t/p/500w/fThSrHjuS1X82XoH9VrtvgvMIXm.jpg','https://image.tmdb.org/t/p/original/aV9IK76VgqYc9UwBCtvXX6Dr2Vq.jpg','0000-00-00'),
	(60863,'Haikyuu!!',NULL,NULL,'Serie','Un hecho fortuito desencadena el amor de Shouyou Hinata por el voleibol. Su club no tenía ningún miembro, pero de algún modo perseveró y finalmente realizó su primer y último partido regular de la escuela secundaria, donde fue aniquilado por Tobio Kageyama, un jugador superestrella conocido como \"Rey de la Corte.\" ¡Jurando venganza, Hinata ingresa en el club de voleibol Karasuno, de secundaria alta, solo para volver a encontrarse cara a cara con su odiado rival, Kageyama!','https://image.tmdb.org/t/p/500w/zotzm1IzazadBQOSocTQ8Ta1bCb.jpg','https://image.tmdb.org/t/p/original/qNKaeunuUdL0smnowVVgShCkWZ4.jpg','0000-00-00'),
	(61175,'Steven Universe',NULL,NULL,'Serie','Sigue la historia de Steven, el miembro más joven de un equipo de guardianes mágicos del Universo.','https://image.tmdb.org/t/p/500w/9daKewVsUrEldMz4M2bTj3PQY2Y.jpg','https://image.tmdb.org/t/p/original/lltlqLtEQkqrK8urlQcuC4vVogH.jpg','0000-00-00'),
	(61222,'BoJack Horseman',NULL,NULL,'Serie','Conoce al caballo más querido de los 90… veinte años después. Vive en Los Ángeles donde humanos y animales antropomórficos coexisten, BoJack Horseman es la historia de un hombre (bueno, un caballo-hombre) que llegó muy rápido a la cima y ahora tiene que averiguar qué hacer.','https://image.tmdb.org/t/p/500w/7tiK8OjsmoDzTfGdpVC4ji3O3Ig.jpg','https://image.tmdb.org/t/p/original/pB9L0jAnEQLMKgexqCEocEW8TA.jpg','0000-00-00'),
	(61345,'Z Nation',NULL,NULL,'Serie','En Z Nation nos encontramos justo tres años después de que los zombies se propagaran por todo el mundo. Apenas quedan reductos de humanos que sobreviven como pueden. Un grupo de supervivientes con experiencia militar tendrán que iniciar un largo viaje para llevar al último superviviente de los zombies hasta el último laboratorio que sigue funcionando y donde podrían encontrar la clave para frenar este plaga.','https://image.tmdb.org/t/p/500w/pYErfWWb52zq9QQFoZ0Qeoo5Yz.jpg','https://image.tmdb.org/t/p/original/geFT40zG22OCJSj7WkkCi71xWES.jpg','0000-00-00'),
	(61374,'Tokyo Ghoul',NULL,NULL,'Serie','En Tokyo ocurren asesinatos misteriosos cometidos por Ghouls, seres desconocidos que comen carne humana, un día Kaneki Ken un joven de 18 años que cursa la Universidad conoce a una chica en un restaurante y la invita a salir, pero luego se da cuenta que ella es un Ghoul y sufre un ataque de parte de ella, pero afortunadamente sobrevive y la muchacha muere; debido a sus heridas los médicos le hacen un transplante de riñon sin saber que la muchacha era una Ghoul y Kaneki termina convirtiéndose en un ser híbrido humano-ghoul y de ahora en adelante deberá vivir escondiéndose de los humanos.','https://image.tmdb.org/t/p/500w/yOarY3Yo0NMkuTuft87M5oAZa3C.jpg','https://image.tmdb.org/t/p/original/7Xl5CxMgHK0Eh6scuxCs3YYQcNQ.jpg','0000-00-00'),
	(61387,'NCIS: Nueva Orleans',NULL,NULL,'Serie','\'NCIS: New Orleans\' se trata del \'spin-off\' de la serie de \'Navy: Investigación criminal\' y se centra en cuatro personajes principales: El agente Pride tiene 50 años y se describe como un hombre carismático y lleno de vida, sin embargo es muy terco y directo; el agente Lasalle es tiene 30 años y es musculoso, diabólico y encantador a la vez, nació y creció en Luisiana y fue ayudante del sheriff; la agente Brody es imprevisible, divertida y feroz, tiene 30 años y cuenta con una mente incréible y una clase como la de Grace Kelly; y por último la Dr. Wade, una chica excéntrica y carente de límites sociales.\n\nTodos ellos forman el grupo de investigadores de NCIS: New Orleans que resolverán casos desde Pensacola a través del Mississipi y de Louisiana y hasta el norte de Texas. El \'spin-off\' de \'NAVY: Investigación criminal\' está producida por Gary Glasberg (\'El mentalista\') y Mark Harmon (\'Chasing Liberty\'). Por su parte, el reparto lo completan Scott Bakula como Dwayne Pride, Lucas Black ','https://image.tmdb.org/t/p/500w/q10iri9a2BruHhVESNWW31yFHCJ.jpg','https://image.tmdb.org/t/p/original/nIc1fd865mUJ2dgHxCQ4jKTUv6e.jpg','0000-00-00'),
	(61418,'Jane the Virgin',NULL,NULL,'Serie','Una devota joven descubre que, por error, ha sido inseminada artificialmente. Cuando Jane Villanueva era una niña, su abuela le dejó claras dos cosas: las telenovelas son la mejor forma de entretenimiento y perder la virginidad es lo peor que le puede ocurrir a una mujer. A sus 23 años y en pleno Miami, Jane es una chica responsable y piadosa, emocionada con crear un futuro junto a un novio perfecto con el que, por supuesto, no mantiene relaciones. Pero todos sus planes se van al traste cuando es inseminada accidentalmente por el despiste de una ginecóloga que pasa una mala racha. Paradojas del destino, el esperma pertenece a Rafael, un antiguo amor platónico de Jane, ahora casado con una retorcida mujer y dueño del hotel donde ella trabaja. Jane se ve obligada entonces a cambiar radicalmente de perspectiva: ahora su vida es la mejor telenovela y ella es la protagonista.','https://image.tmdb.org/t/p/500w/sSVmLcHMrOtZapIY0ip6M7shMjA.jpg','https://image.tmdb.org/t/p/original/ql8t0HGhSPeiyy8ZZIMbjqJmRS6.jpg','0000-00-00'),
	(61852,'Henry Danger',NULL,NULL,'Serie','Henry Hart (Jace Norman) consigue un trabajo de medio tiempo como Kid Danger, un compañero de lucha del super héroe anticrimen Capitán Man/Ray (Cooper Barnes). A pesar de que Ray le dijo a Henry que mantuviera el secreto sobre su trabajo, también lo tiene que hacer con sus mejores amigos Charlotte (Riele Downs) y Jasper (Sean Ryan Fox). Sus padres y su hermana menor Piper (Ella Anderson) no saben sobre su secreto. Una tienda llamada \"Junk\'n\'Stuff\", tiene una guarida secreta escondida debajo, donde Ray hace su trabajo. Pero capítulos adelante la historia cambia un poco, ya que Charlotte descubre que su amigo Henry es Kid Danger, entonces él se lo cuenta a Ray el cual lo despidió, y más adelante por una hazaña heroica, lo recontrata y contrata a Charlotte, desde entonces los dos trabajan para Capitán Man. Luego de que Jasper descubriera el secreto de Henry, el show dio un giro inesperado, ya que Capitán Man contrató a Jasper como empleado en \"Junk\'n\'Stuff\", de igual manera como ayudante','https://image.tmdb.org/t/p/500w/penixJFvlRwgw8wyxrX5RKEqPWX.jpg','https://image.tmdb.org/t/p/original/onddStWYELFaz4BbV8kavU11oCo.jpg','0000-00-00'),
	(61889,'Daredevil',NULL,NULL,'Serie','\'Daredevil\' es una serie cargada de acción que sigue las aventuras de Matt Murdock -abogado de día y superhéroe de noche- en el barrio de la ciudad de Nueva York conocido como Hell’s Kitchen. Matt quedó ciego tras un accidente de niño, pero ahora tiene los otros cuatro sentidos incrementados y se dedica a luchar contra la injusticia como el superhéroe Daredevil.','https://image.tmdb.org/t/p/500w/qsnXwGS7KBbX4JLqHvICngtR8qg.jpg','https://image.tmdb.org/t/p/original/9Vu49OxWp6LYKsvaEFNokDzKWP3.jpg','0000-00-00'),
	(61923,'Star vs. las fuerzas del mal',NULL,NULL,'Serie','Sigue la historia de Star, una apasionada y genial princesa adolescente de otra dimensión. Después de recibir una Varita Mágica Real todopoderosa para su cumpleaños número 14, sus padres de la realeza la envían a vivir con la familia Díaz y su responsable hijo Marco en la Tierra, y ella lleva su estilo interdimensional único a su nuevo hogar.','https://image.tmdb.org/t/p/500w/2UElp7Dkm3SiB9ZEdKEWNmAOijB.jpg','https://image.tmdb.org/t/p/original/dKFL1AOdKNoazqZDg1zq2z69Lx1.jpg','0000-00-00'),
	(62046,'Scream Queens',NULL,NULL,'Serie','Serie al estilo \"American Horror Story\", en la que cada temporada se desarrollará una historia y personajes diferentes. En la primera, se contará la historia de un campus universitario en el que de repente comienzan a sucederse una serie de asesinatos en masa.','https://image.tmdb.org/t/p/500w/oj81AUVQQ6hVgKTaXUnmia2zdpa.jpg','https://image.tmdb.org/t/p/original/4R69LJW37bNtTU1l2O3KDP40xI5.jpg','0000-00-00'),
	(62110,'Assassination Classroom',NULL,NULL,'Serie','La trama se centra en la clase 3-E de la secundaria Kunugigaoka, que tiene por objetivo matar a su profesor: \"Koro-sensei\", un ser con tentáculos que destruye parcialmente la Luna dejando una permanente Luna creciente y amenaza con destruir la Tierra en el plazo de un año, a menos que uno de sus alumnos lo asesine antes de la graduación. Para motivar a la clase a acabar con Koro-sensei, el gobierno promete dar como recompensa 10 mil millones de yenes a quien lo consiga.','https://image.tmdb.org/t/p/500w/62pIwEsYX2dtlyMJjDSM6zpDTU2.jpg','https://image.tmdb.org/t/p/original/fIOYLPOorKvP4wut9y0edpnWROz.jpg','0000-00-00'),
	(62286,'Fear the Walking Dead',NULL,NULL,'Serie','En el seno de una ciudad a la que las personas acuden para escapar, esconder sus secretos y enterrar su pasado, un brote misterioso amenaza con perturbar la poca estabilidad que Madison Clark -asesora escolar de un instituto- y Travis Manawa –profesor de lengua- han conseguido alcanzar.','https://image.tmdb.org/t/p/500w/58PON1OrnBiX6CqEHgeWKVwrCn6.jpg','https://image.tmdb.org/t/p/original/qWTw5I0ibY1QtM0UazkYetorQ2m.jpg','0000-00-00'),
	(62455,'Vis a vis',NULL,NULL,'Serie','Su amante la manipuló para que cometiera varios delitos fiscales. Ahora, esta joven inocente deberá aprender a sobrevivir en un mundo nuevo y despiadado. Y rápido.','https://image.tmdb.org/t/p/500w/iukGFUQQWUdgwTGGDLb1Pw3GoZP.jpg','https://image.tmdb.org/t/p/original/gctQfAuQbQRjfgBbWm3UW4XeVRa.jpg','0000-00-00'),
	(62521,'Acacias 38',NULL,NULL,'Serie','\'Acacias 38\' nos traslada cada tarde hasta 1899 para contarnos la historia de un grupo de criadas y las familias burguesas para las que trabajan. Una historia de ricos y pobres que refleja la confluencia de dos mundos en un único espacio, en un portal: Acacias 38.','https://image.tmdb.org/t/p/500w/p1vfmHHZkxCaTFDXjYNGB3WSkak.jpg','https://image.tmdb.org/t/p/original/6sNmvEwWQdEvbP233rPQQUb4tUT.jpg','0000-00-00'),
	(62560,'Mr. Robot',NULL,NULL,'Serie','Sigue a un misterioso anarquista que recluta a un joven programador de computadoras (Malek) que sufre de un trastorno antisocial y se conecta a la gente pirateándolos.','https://image.tmdb.org/t/p/500w/1SEVAgbaah9wE5xoLt4qWPMBdpL.jpg','https://image.tmdb.org/t/p/original/oKIBhzZzDX07SoE2bOLhq2EE8rf.jpg','0000-00-00'),
	(62643,'DC\'s Legends of Tomorrow',NULL,NULL,'Serie','Después de haber visto el futuro, el viajero del tiempo Rip Hunter tratará desesperadamente de evitarlo logrando la tarea de reunir a un dispar grupo de héroes y villanos para enfrentar una amenaza imparable, en la que no solo la seguridad del planeta está en juego sino el tiempo mismo.','https://image.tmdb.org/t/p/500w/4LTWJ7WNiSk5SUWhRkHT279026o.jpg','https://image.tmdb.org/t/p/original/iFlxHKi4zdRObDwjBpHCWmOyC9D.jpg','0000-00-00'),
	(62650,'Chicago Med',NULL,NULL,'Serie','Chicago Med se describe como \"un viaje emocional a través del caos del día a día del hospital más explosivo de la ciudad y el equipo de valientes médicos que lo mantiene unido.\" La serie hace frente a casos inspirados por acontecimientos de la actualidad, además de entrelazar con los personajes de Chicago Fire y Chicago P.D.','https://image.tmdb.org/t/p/500w/sHjNS2lYyEjwjjQXTZmdyMJ29bI.jpg','https://image.tmdb.org/t/p/original/8sWkBKCZ4FrzllsLjMQpiFxZWwM.jpg','0000-00-00'),
	(62688,'Supergirl',NULL,NULL,'Serie','Las aventuras de la prima de Superman en su propia carrera de superhéroe.  “A los 12 años, Kara escapó del condenado planeta Krypton con la ayuda de sus padres, al mismo tiempo que el bebé Kal-El. Protegida y criada en la Tierra por su familia adoptiva, los Danvers, Kara creció a la sombra de su hermana de crianza, Alex (Chyler Leigh), y aprendió a ocultar los poderes fenomenales que comparte con su famoso primo con el fin de mantener su identidad en secreto”.','https://image.tmdb.org/t/p/500w/jgb9xICHFX8wTGQ75js4uNbttQs.jpg','https://image.tmdb.org/t/p/original/o5j3ygU2sa4vH8z05pjSvOtkb5W.jpg','0000-00-00'),
	(62710,'Blindspot',NULL,NULL,'Serie','Blindspot parte de una atractiva mujer, sin recuerdos de su pasado, que aparece desnuda en Times Square cubriendo su cuerpo solamente de tatuajes intrincados. Su descubrimiento pone en marcha un gran y complejo misterio que llama inmediatamente la atención del FBI, que comienzan a seguir la hoja de ruta en su cuerpo para revelar una conspiración más amplia de delito y, de esa manera, descubrir la verdad sobre su identidad.','https://image.tmdb.org/t/p/500w/dYJrfkQeqGXeGMMTvYaM43XHce5.jpg','https://image.tmdb.org/t/p/original/vfSsxNazfNBvJAYPoglJeR0uUtb.jpg','0000-00-00'),
	(62715,'Dragon Ball Super',NULL,NULL,'Serie','La trama de la serie tiene lugar después de la batalla contra Pequeño Buu en medio del período de 10 años hacia el Torneo Mundial de las Artes Marciales 28. Está enlazada con las películas Dragon Ball Z: La Batalla de los Dioses y Dragon Ball Z: La Resurrección de F. La historia comienza a finales del Año 774, seis meses después de la derrota de Buu. La actual saga de Trunks del Futuro Alternativo ocurre el Año 780.','https://image.tmdb.org/t/p/500w/yJAOi2n0VYBEXdPI1NXv5FiOcBX.jpg','https://image.tmdb.org/t/p/original/n0yIE4NRNJJq81okHHEmMytOznU.jpg','0000-00-00'),
	(62741,'Kamisama Hajimemashita',NULL,NULL,'Serie','La historia comienza con Nanami Momozono, una chica que ha perdido su  casa a causa de las deudas de juego de su padre y ha sido abandonada por  éste. Al encontrarse en el parque sin casa o lugar adónde ir, conoce a  un joven y lo \"salva\" ya que estaba siendo amenazado por un perro, a  cambio de dicho acto el joven le concede su propiedad y el derecho de  ser el \"nuevo\" dios de la tierra.','https://image.tmdb.org/t/p/500w/xdTwlG8MYAOkFuAGUqt8LgmgTNZ.jpg','https://image.tmdb.org/t/p/original/ya4TK0J1HyYFX6EpcLOWBiHavHz.jpg','0000-00-00'),
	(63174,'Lucifer',NULL,NULL,'Serie','La serie se centrará en Lucifer (Tom Ellis) quien, aburrido e infeliz como el Señor del Infierno, dimite de su trono y abandona su reino para trasladarse a la ciudad de Los Angeles y abrir un lujoso piano-bar llamado Lux. Una vez allí ayudará a la policía a castigar a los más peligrosos criminales de la ciudad.','https://image.tmdb.org/t/p/500w/ktDJ21QQscbMNQfPpZBsNORxdDx.jpg','https://image.tmdb.org/t/p/original/wQh2ytX0f8IfC3b2mKpDGOpGTXS.jpg','0000-00-00'),
	(63210,'Shadowhunters: The Mortal Instruments',NULL,NULL,'Serie','Clary Fray nunca volverá a su vida normal de adolescente: ha descubierto que pertenece a una raza de cazadores de demonios y que tiene sangre de ángel.','https://image.tmdb.org/t/p/500w/wY8JJgXwCbof1cK3eccZW4cM7L4.jpg','https://image.tmdb.org/t/p/original/66YHvvVduC21xcMXPpBBF0ywyVZ.jpg','0000-00-00'),
	(63247,'Westworld',NULL,NULL,'Serie','Westworld está ambientada en un parque de atracciones futurista dirigido por el Doctor Robert Ford. Las instalaciones cuentan con androides cuya apariencia física es humana, y gracias a ellos los visitantes pueden introducirse en cualquier tipo de fantasía, por muy oscura que sea...','https://image.tmdb.org/t/p/500w/yGNnjoIGOdQy3douq60tULY8teK.jpg','https://image.tmdb.org/t/p/original/vRAFOKQ2JxOagiJZaGQxmqTY1yl.jpg','0000-00-00'),
	(63333,'The Last Kingdom',NULL,NULL,'Serie','La serie está ambientada en el siglo IX donde lo que hoy se conoce como Inglaterra eran varios reinos independientes. Las tierras anglosajonas son atacadas y en muchos casos gobernadas por fuerzas vikingas. El reino de Wessex se ha dejado solo bajo el mando del Rey Alfred el Grande. Uhtred, hijo huérfano de un noble sajón, es secuestrado por los normandos y criado como uno de ellos. Así, es obligado a elegir entre un reino que comparte sus ancestros y la gente a la que es leal.','https://image.tmdb.org/t/p/500w/QbtctI8EzlhsyFDMUMyG3fli8B.jpg','https://image.tmdb.org/t/p/original/wUFIEJCSmurmXPX0mP0cEgoltrk.jpg','0000-00-00'),
	(63401,'Somos osos',NULL,NULL,'Serie','\"Somos osos\" es una comedia protagonizada por tres hermanos osos, Pardo, Panda y Polar, que intentan integrarse de maneras muy extrañas en la sociedad de los humanos: ya sea buscando comida, tratando de hacer amigos o de volverse famosos gracias a Internet. Y si pueden conseguir algo de helado en el camino, ¡mucho mejor!','https://image.tmdb.org/t/p/500w/cl5FVcBEgddaC7dUL8HDMH6m2tp.jpg','https://image.tmdb.org/t/p/original/w5HBl9zeltw74xJ0Ozp2FVTr3RR.jpg','0000-00-00'),
	(63764,'Señora Acero',NULL,NULL,'Serie','Sara Aguilar (Blanca Soto) esta a punto de casarse con un importante agente de policía, Vicente Acero (Damián Alcázar), con quien tiene un hijo; Vicente desde hace tiempo tenia negocios delictivos con la mafia y principalmente con \"El Indio Amaro\" (Jorge Zárate) un peligroso narcotraficante y a quien Vicente le había robado 3 millones de dolares. Llega el día de la boda de Sara y Vicente, y tiene lugar un suceso: unos maleantes invaden la ceremonia por ordenes de \"El Indio Amaro\" y disparan primero al padre de Sara, matándolo, y después disparan a Vicente. Sara es secuestrada y llevada a una casa abandonada por “el Muñeco” (Arap Bethke), un conocido de la familia que los traiciona e intenta violarla.','https://image.tmdb.org/t/p/500w/gGvIqkndyu2Ci7pKIcWgCZQVrdp.jpg','https://image.tmdb.org/t/p/original/vXhBxsvpW2mGuXRbIK5Yazdp8Zg.jpg','0000-00-00'),
	(63926,'One Punch Man',NULL,NULL,'Serie','La historia tiene lugar en una de las metrópolis ficticias de la Tierra, la Ciudad Z en Japón. El mundo está lleno de extraños monstruos que misteriosamente aparecen y causan muchos desastres. Saitama, el protagonista, es un poderoso superhéroe que derrota fácilmente a los monstruos u otros villanos con un único golpe. Debido a esto, Saitama ha encontrado aburrida su fuerza y siempre está tratando de encontrar rivales más poderosos que le puedan igualar.  En sus aventuras se encuentra con nuevos amigos, enemigos y su propio discípulo, el cíborg Genos, y se une a la Asociación de Héroes para ganar fama por todas sus acciones para prevenir el mal. A pesar de derrotar a muchos enemigos poderosos que los principales héroes, incluso los de la Asociación de Héroes, son incapaces de derrotar, Saitama es incapaz de conseguir el reconocimiento de sus acciones en general. La mayoría de la gente lo discrimina por su apariencia física normal y algunos lo acusan de ser un héroe falso. Sólo un pequ','https://image.tmdb.org/t/p/500w/s0w8JbuNNxL1YgaHeDWih12C3jG.jpg','https://image.tmdb.org/t/p/original/a8BknzvFVK5EZ83rKg1a83iwaj0.jpg','0000-00-00'),
	(63980,'Camera Café',NULL,NULL,'Serie','En España se agrupan varios episodios formando un bloque. En ellos se ven, a modo de cámara oculta en la propia máquina distintas situaciones de empleados que acuden a escaquearse del trabajo. Cada personaje de los 17 que componen el reparto cumple un rol distinto: la secretaria atractiva, los trabajadores «don nadie», el «cerebrito» de contabilidad, y por supuesto, el jefe autoritario que también agacha la cabeza si es la directora de márketing la que grita.\n\nEl director del programa es Luis Guridi. Su pretensión respecto a Cámera Café era ofrecer una visión humorística, más o menos realista, del entorno laboral. Todos los estilos de humor, desde el surrealismo a la escatología simple, se dan la mano en esta microserie de corte costumbrista.','https://image.tmdb.org/t/p/500w/x71bs8fs4pIkGSG5m7nhKAW3r4a.jpg','https://image.tmdb.org/t/p/original/24puf0XhX4QqvBQmLS3LLFN4s94.jpg','0000-00-00'),
	(65334,'Miraculous: Las aventuras de Ladybug',NULL,NULL,'Serie','Cuando París corre peligro, Marinette se convierte en Ladybug. Lo que no sabe, es que su apuesto amigo Adrien es Cat Noir, otro superhéroe al servicio de la ciudad.','https://image.tmdb.org/t/p/500w/9RqliZcoDEjSEISeA0LY9meAiNv.jpg','https://image.tmdb.org/t/p/original/9TAXEZH1OBwLfTWX3tWiHzIvdGW.jpg','0000-00-00'),
	(65494,'The Crown',NULL,NULL,'Serie','Drama sobre las rivalidades políticas y los romances acaecidos durante el reinado de Isabel II, así como de los eventos que moldearían la segunda mitad del siglo XX.','https://image.tmdb.org/t/p/500w/4InrdamBEM31unNiuEHGYTPX1e2.jpg','https://image.tmdb.org/t/p/original/4a7HOUtb6sBpqmuByTxenRxlqds.jpg','0000-00-00'),
	(65555,'Amor eterno',NULL,NULL,'Serie','Kemal Soydere (Burak Özçivit) es hijo de una familia de clase media. En su último año en ingeniería de minas, una chica llamada Nihan Sezin (Neslihan Atagül) entra en su monótona vida. El amor parece imposible por la diferencia de clases entre ellos, pero se las arreglan para estar juntos. Hasta que un día, Kemal tiene que mudarse a Zoguldak para trabajar en una mina, dejando a Nihan en Estambul. Desconoce que su novia se casará obligada con Emir Kozcuoglu (Kaan Urgancioglu), un hombre enamorado de ella desde que eran niños. Kemal se aísla en su trabajo y pasan cinco años, hasta que un accidente en la mina hace que tome la decisión de regresar a Estambul para afrontar su pasado.','https://image.tmdb.org/t/p/500w/94YbjD2hAgMxaXb0cWXopAj4jGc.jpg','https://image.tmdb.org/t/p/original/al6OCoVRgdHhkGLVSvx4NPb4TJY.jpg','0000-00-00'),
	(65733,'Doraemon, el gato cósmico',NULL,NULL,'Serie','Doraemon es un gato robot cósmico que viene del futuro, es amigo de Novita, un niño muy despistado y algo torpe, al cual ayudara con sus grandiosos inventos futuristas los cuales saca de su bolsillo mágico, de este modo tratara de evitar los problemas que él ha provocado en el futuro.','https://image.tmdb.org/t/p/500w/vmpjv9CwcP8x1fJM6VTXdFVUbFK.jpg','https://image.tmdb.org/t/p/original/pXG8Exsmd50bq2Qx2RzByumgwqK.jpg','0000-00-00'),
	(65820,'Van Helsing',NULL,NULL,'Serie','Tras pasar tres años en coma, Vanessa se despierta en un mundo asolado por vampiros. Ella y un variopinto grupo de amigos supervivientes luchan por seguir con vida.','https://image.tmdb.org/t/p/500w/5VltHQJXdmbSD6gEJw3R8R1Kbmc.jpg','https://image.tmdb.org/t/p/original/r8ODGmfNbZQlNhiJl2xQENE2jsk.jpg','0000-00-00'),
	(65844,'Kono Subarashii Sekai ni Shukufuku wo!',NULL,NULL,'Serie','Esta popular comedia de mundos alternativos gira en torno a Kazuma Satou, un hikkikomori fan a muerte de los videojuegos, el anime y el manga. Un accidente de tráfico pone fin a su vida… o eso debería haber pasado, pero se despierta con una preciosa chica al lado que se presenta diciendo que es una diosa. La chica le dice “Tengo buenas noticias. ¿Te gustaría ir a un mundo alternativo? Puedes llevarte sólo una cosa que te guste” y él le contesta “Entonces, te llevaré a ti”. Con eso, es teletransportado a otro mundo en el que comienza su gran aventura sometiéndose a un rey demonio… aunque antes de eso tiene que trabajar duro para costearse la comida, la ropa y la vivienda. Kazuma quiere vivir en paz, pero la diosa le crea un problema tras otro, y entonces el ejército del rey demonio se fija en él.','https://image.tmdb.org/t/p/500w/rS7x1T2ZO57T61nKKgLoRUT0bw2.jpg','https://image.tmdb.org/t/p/original/ekQD9ItsjglqlCvoJiXqGXJb5Jz.jpg','0000-00-00'),
	(65930,'My Hero Academia',NULL,NULL,'Serie','Las personas no nacen igual. El protagonista de esta historia es uno de esos casos raros que nacen sin superpoderes, pero esto no le impedirá perseguir su sueño: ser un gran héroe como el legendario All-Might. Para convertirse en el héroe que quiere ser, se apuntará a una de las academias de héroes más prestigiosas del país: Yueiko. Con la ayuda de su ídolo, All-Might, ¿podrá convertirse en un verdadero héroe?','https://image.tmdb.org/t/p/500w/3ILMlmC30QUnYkY3XEBOyJ82Dqu.jpg','https://image.tmdb.org/t/p/original/mWHCII5OWHx5pRSN2VYYLvT8DbB.jpg','0000-00-00'),
	(66084,'Acapulco Shore',NULL,NULL,'Serie','Acapulco Shore es un programa de telerrealidad mexicano que se transmite  actualmente por la cadena MTV Latinoamérica, el cual sigue la vida  cotidiana de ocho jóvenes que pasan el verano viviendo juntos en el  puerto de Acapulco. Es la adaptación mexicana del programa de  telerrealidad estadounidense Jersey Shore.','https://image.tmdb.org/t/p/500w/exZrSuXA05mhklSSoZ65wT6xeNZ.jpg','https://image.tmdb.org/t/p/original/7sfy3nq1CjeoOgwg3N9hO8vLZSH.jpg','0000-00-00'),
	(66203,'Soy Luna',NULL,NULL,'Serie','Luna Valente va feliz por la vida arriba de sus patines. Pero su vida da un vuelco inesperado cuando sus padres reciben una propuesta imposible de rechazar: de la noche a la mañana, la familia Valente debe dejar su querido hogar y mudarse a otro país. Luna debe adaptarse a una nueva vida, nuevos amigos y un colegio nuevo, donde se encuentra con un mundo de lujos y elite que poco tiene que ver con ella. Luna se refugia en sus patines y gracias a ellos descubre una pista de patinaje que le ofrece un nuevo universo sobre ruedas.','https://image.tmdb.org/t/p/500w/z5EtkEDuIILoo3IrSi0FjZA9gVG.jpg','https://image.tmdb.org/t/p/original/mK1egVq2qMLMw4HIREUXuihKj9g.jpg','0000-00-00'),
	(66398,'Diomedes, el Cacique de La Junta',NULL,NULL,'Serie','A sus escasos 10 años, Diomedes comparte con su padre Rafael María la responsabilidad de sacar adelante su familia. En la Junta, Guajira, lugar que lo vio nacer, y en medio de tantos hermanos y poco dinero, Diomedes sabe que la lograrlo no es fácil. La vida de Diomedes da un giro al descubrir por primera vez el amor en manos de Mélida y es aquí cuando comienza a escribirse la historia del Diomedes enamorado y apasionado que será el resto de su vida. Pero con Mélida también llega su primera decepción amorosa y gracias a esto Diomedes descubre el don de versear que lo acompañará por siempre. Los años pasan y en medio de la lucha por conseguir el bienestar para su familia, en Diomedes crece la ilusión de ser cantante vallenato y con la ayuda de su tío Martín trabaja cantando en la gallera del pueblo, pero también conoce al gran amor de su vida, Lucía Arjona. La pareja se enamora perdidamente y viven un romane tormentoso, hasta que finalmente Diomedes la convierte en su esposa y empieza a','https://image.tmdb.org/t/p/500w/jeXcEHlAow5bkBtoNHQg9GajdVi.jpg','https://image.tmdb.org/t/p/original/dloUU6Qy5yDVIBd6EUhatBCiRsL.jpg','0000-00-00'),
	(66732,'Stranger Things',NULL,NULL,'Serie','A raíz de la desaparición de un niño, un pueblo desvela un misterio relacionado con experimentos secretos, fuerzas sobrenaturales aterradoras y una niña muy extraña.','https://image.tmdb.org/t/p/500w/rcA17r3hfHtRrk3Xs3hXrgGeSGT.jpg','https://image.tmdb.org/t/p/original/g3nzhHBDTrJ7RWhzozFTYFjvRbd.jpg','0000-00-00'),
	(66788,'Por trece razones',NULL,NULL,'Serie','A pesar del desconcierto que supone volver a oír la voz de Hannah, Clay descubrirá que son trece las razones por las cuales ha decidido quitarse la vida, trece caras de cassete y que, por ello, son trece las personas que deben escucharlas. Él es una de ellas.','https://image.tmdb.org/t/p/500w/Qzpe5J1Q6i4uYw2sGJSBbswqbD.jpg','https://image.tmdb.org/t/p/original/4hJnauO3EDPDyL6Y0L3yKiALuBF.jpg','0000-00-00'),
	(66840,'Bull',NULL,NULL,'Serie','Bull es un drama inspirado en los inicios de la carrera del Dr. Phil  McGraw, el fundador de una de las empresas de consultoría de juicios más  prolíficas de todos los tiempos. Brillante, descarado y encantador, el  Dr. Bull es uno de los mejores maestros de marionetas ya que combina la  psicología, la intuición humana y datos de alta tecnología para conocer  los gustos de los miembros del jurado, los abogados, los testigos y el  acusado. Bull emplea a un equipo envidiable de expertos en el Trial  Analysis Corporation para dar forma a defensas de éxito teniendo en  cuenta hasta el último detalle.','https://image.tmdb.org/t/p/500w/xFe9MQ043Nfs6DTILSMTUluMxl9.jpg','https://image.tmdb.org/t/p/original/uxJdTRTbR815kTwRk4BTRa5xs20.jpg','0000-00-00'),
	(67116,'Arma letal',NULL,NULL,'Serie','Martin Riggs es un antiguo agente especial de los SEAL ahora reconvertido en agente del cuerpo de policía de Los Ángeles. Riggs, natural de Texas, es de carácter volátil y suicida debido a la reciente muerte de su mujer embarazada. Por esto, su llegada a la ciudad causará una gran impresión, especialmente para su nuevo compañero de trabajo, el detective Roger Murtaugh, quien acaba de reincorporarse al cuerpo de policía después de haber sufrido un ataque al corazón y debe de mantenerse alejado de las situaciones que puedan causar estrés en su vida diaria. Lethal Weapon es una serie policial de acción que mezcla elementos de drama y comedia. Inspirada en la película del mismo nombre dirigida por Richard Donner (Los Goonies) y con un guión escrito por Shane Black (Kiss Kiss Bang Bang). Con un reparto encabezado por Clayne Crawford (Un paseo para recordar) en el papel de Martin Riggs y Damon Wayans (Mi esposa y mis hijos) como el agente Roger Murtaugh, esta serie sirve como reboot televis','https://image.tmdb.org/t/p/500w/yqZ5ACKeNJ30mylUEzvtWZu4pGU.jpg','https://image.tmdb.org/t/p/original/grGOtTZ0OfNQoWnNtdJOiY1LB8e.jpg','0000-00-00'),
	(67133,'MacGyver',NULL,NULL,'Serie','El mítico MacGyver regresa a la pequeña pantalla tras tres décadas alejado de la televisión. El clásico personaje seguirá haciendo frente a las misiones más complicadas gracias a su agudizado ingenio.','https://image.tmdb.org/t/p/500w/v2moumGovVAmDASYkjakIl2WrOM.jpg','https://image.tmdb.org/t/p/original/z3IpN86yJTmxCFz9KvoCDbB56Lp.jpg','0000-00-00'),
	(67136,'This Is Us',NULL,NULL,'Serie','Esta provocativa y honesta serie sigue a un grupo de personas bastante particular que, de pronto, ven cómo sus vidas se entrelazan unas con otras de las maneras más curiosas posibles, explorando sus propios conflictos, privaciones y dificultades. Pronto descubren que muchos de ellos comparten elementos comunes en sus vidas (algunos de ellos cumplen año el mismo día), incluso más de lo que cualquiera de ellos podrían esperar. This is Us es una serie que mezcla elementos de comedia y drama, y en la que los personajes deben lidiar con los aspectos difíciles de la vida, demostrando que el amor es una fuerza imparable y que los humanos son capaces de resistir más de lo que creen.','https://image.tmdb.org/t/p/500w/nanLj19kHrnv3yBzaOKcMTVDK03.jpg','https://image.tmdb.org/t/p/original/tZDcEfue6fDUcRJ6WxI1hhKPZrH.jpg','0000-00-00'),
	(67198,'Star Trek: Discovery',NULL,NULL,'Serie','La emblemática saga vuelve con una serie fresca, con nuevos personajes y una nueva nave. Su misión: explorar nuevos mundos y dar esperanzas a las futuras generaciones.','https://image.tmdb.org/t/p/500w/p3McpsDNTNmpbkNBKdNxOFZJeKX.jpg','https://image.tmdb.org/t/p/original/ihvG9dCEnVU3gmMUftTkRICNdJf.jpg','0000-00-00'),
	(67335,'Sin senos sí hay paraíso',NULL,NULL,'Serie','Catalina Manrique es hija de Doña Hilda y Albeiro y nació el día en que su madre se enteró que su hija mayor había sido asesinada. Hilda, destrozada por la muerte de su hija Catalina, la grande decidió que su segunda hija llevaría el mismo nombre. La infancia de Catalina, la pequeña estará marcada por el fantasma de su difunta hermana, ya que su madre y su padre harán todo lo posible para alejarla del entorno de mafiosos que acabaron con la vida de su primera hija.\n\nCatalina tendrá que desenterrar los dolorosos secretos de sus padres y soportar la maldad de La Diabla, quien tratará de convencerla de operarse los senos para ofrecerle su inocencia y virginidad a los narcos y políticos poderosos.\n\nPero lo que muchos no saben es que Catalina tiene una personalidad desafiante y demostrará que sin senos sí hay paraíso.','https://image.tmdb.org/t/p/500w/oAkpvVvoyZWMo9cpNk3aQoVKsjM.jpg','https://image.tmdb.org/t/p/original/7lBJ6lOS0uQqsH13U9iMTikawQS.jpg','0000-00-00'),
	(67637,'Hasta que te conoci',NULL,NULL,'Serie','\"Hasta que te conocí\", es una serie que narra la vida de Alberto Aguilera Valadez hacia su sueño a fama. Consta de 13 episodios, los cuales revelan datos nunca antes vistos en la vida del \"Divo de Juárez\". Una historia que cuenta cómo su talento lo llevó a vencer a su destino y superar la pobreza, las traiciones y los prejuicios de los que era víctima para convertirse en el icono musical más querido de América Latina .','https://image.tmdb.org/t/p/500w/3Hxv0LEgBqwvphij6ejIMdICIJA.jpg','https://image.tmdb.org/t/p/original/p9N0bJrPfrBAu9bSVk35swvJsyv.jpg','0000-00-00'),
	(67915,'GOBLIN: El solitario ser inmortal',NULL,NULL,'Serie','Un ser inmortal desea terminar su existencia buscando en todo el mundo su novia que es la destinada a sacar la espada que le atraviesa el pecho y solo ella es capaz de verla, pero luego de conocerse se enamoran y  es cuando todo cambia para el ser inmortal ya que debido al amor que siente encuentra una nueva razón para mantenerse vivo pero con esto pone en peligro a su amada que además es capaz de ver fantasmas, paralelamente existe un ángel de la muerte que se enamora perdidamente de la que resulta ser la reencarnación de la hermana del ser inmortal. Durante el desarrollo de esta serie se pueden disfrutar de momentos que evocan emisiones inimaginable y definitivamente no tiene ni un solo instante desperdiciado.','https://image.tmdb.org/t/p/500w/smSbK5cd8T9XHcxEUcems23BDEF.jpg','https://image.tmdb.org/t/p/original/fF3xPq5o2tGw0KjN4QSTA3y1Oqe.jpg','0000-00-00'),
	(68073,'Una casa de locos',NULL,NULL,'Serie','Lincoln Loud es un niño de 11 años que vive con sus 10 hermanas. Con la ayuda de su mejor amigo Clyde encontrarán la manera de divertirse cada día','https://image.tmdb.org/t/p/500w/36iVELhma9MawHkdMDPNRX8onEu.jpg','https://image.tmdb.org/t/p/original/vlBWeCbRHfDRk1aGS6cdsMM5Mj1.jpg','0000-00-00'),
	(68267,'Trollhunters: Cuentos de Arcadia',NULL,NULL,'Serie','Trollhunters narra las aventuras del grupo de residentes del vecindario ficticio conocido como Arcadia, donde descubrirán que existe un mundo debajo de su querida ciudad que es tan amplio y asombroso como ningún otro que conozcan en la superficie.  Nadie en el pueblo cree en los rumores que indican que los trolls existen, pero el joven de 15 años Jim Jr. está por descubrir que son una amenaza bastante real y que durante la noche casi nadie está seguro.','https://image.tmdb.org/t/p/500w/mhETUY8XxLewCZb6bKm6FyBlnhh.jpg','https://image.tmdb.org/t/p/original/9VZmMzINVdO3ZYGsKItU39pNO2l.jpg','0000-00-00'),
	(68507,'La materia oscura',NULL,NULL,'Serie','Lyra es una huérfana que vive en un universo paralelo en el que la ciencia, la teología y la magia están entrelazadas. La búsqueda de Lyra de un amigo secuestrado descubre un siniestro complot que involucra a niños robados, y se convierte en una búsqueda para comprender un fenómeno misterioso llamado Dust. Más tarde, en su viaje, se une a Will, un niño que posee un cuchillo que puede cortar ventanas entre mundos. A medida que Lyra se entera de la verdad sobre sus padres y su destino profetizado, los dos jóvenes se ven envueltos en una guerra contra los poderes celestiales que se extiende a lo largo de muchos mundos.','https://image.tmdb.org/t/p/500w/9yKCJTOh9m3Lol2RY3kw99QPH6x.jpg','https://image.tmdb.org/t/p/original/pn83ajFsi5iGEDeH8nKXcR6p3iz.jpg','0000-00-00'),
	(69050,'Riverdale',NULL,NULL,'Serie','Archie y sus amigos de Riverdale se verán envueltos en un siniestro misterio al tiempo que lidian con las complicaciones del sexo, el amor, los estudios y la familia.','https://image.tmdb.org/t/p/500w/qZtAf4Z1lazGQoYVXiHOrvLr5lI.jpg','https://image.tmdb.org/t/p/original/tS97EZrqmCraGHXbB8Kc2PbLDx2.jpg','0000-00-00'),
	(69158,'The Good Fight',NULL,NULL,'Serie','El spin-off de la aclamada serie The Good Wife se centrará en los personajes de Diane Lockhart y Lucca Quinn, un año después de los sucesos del último episodio de su predecesora.  The Good Fight es una serie de televisión estadounidense de temática jurídica, producida por la cadena CBS y estrenada en el servicio de vídeo bajo demanda de la cadena CBS. Esta serie es una secuela de The Good Wife, que se mantuvo en pantalla entre 2009 y 2016, con bastante éxito. Ambas están escritas y producidas por Michelle y Robert King.','https://image.tmdb.org/t/p/500w/u9kLNhE7e6YplzK6OrwQDX5ddU0.jpg','https://image.tmdb.org/t/p/original/agtz1JudCowvOzQLeuMWueOTLTh.jpg','0000-00-00'),
	(69291,'Kobayashi san Chi no Maid Dragon',NULL,NULL,'Serie','Kobayashi vive sola en un apartamento, hasta que un día, Tooru aparece en su vida y terminan viviendo juntas. Tooru mira con desprecio a los seres humanos, los cuales, percibe como inferiores y simples, pero después de haber sido salvada por Kobayashi, ella hace todo lo posible para devolverle el favor y la ayuda en todo tipo de cosas, aunque no todo va de acuerdo al plan.','https://image.tmdb.org/t/p/500w/vc3GVrH46tZPUk7RxRpQO6wH3ny.jpg','https://image.tmdb.org/t/p/original/pJQNdoWG8WPUkPCwkIifc9zy5q9.jpg','0000-00-00'),
	(69478,'El cuento de la criada',NULL,NULL,'Serie','Para enfrentarse a una tasa de natalidad en declive, un régimen fundamentalista ha empezado a tratar a las mujeres como propiedades. Como una de las pocas mujeres fértiles que quedan, Defred es una criada, una más de la casta de mujeres forzadas a una servidumbre sexual para intentar repoblar el mundo.','https://image.tmdb.org/t/p/500w/jXB3OoWPkojsOP2O2OoLCeAIDRS.jpg','https://image.tmdb.org/t/p/original/i4gfpSCEvHp9upRDZLTUX4SHRdV.jpg','0000-00-00'),
	(70484,'Britannia',NULL,NULL,'Serie','Relata el intento del ejército imperial romano de conquistar las salvajes tierras británicas dominadas por clanes y druidas. Es el año 43 a.C. y Kerra (Reilly), la hija del rey de los Cantii, se ve forzada a dejar a un lado sus diferencias con su archi enemiga, la reina Antedia (Wanamaker) para combatir juntas a los invasores. Los romanos, liderados por el General Aulus Plautius (Morrisey), llegan con la determinación de triunfar donde Julio César fracasó, y conquistar esta tierra mítica en los límites del Imperio Romano. Aulus es un líder fuerte, pero esconde un oscuro secreto que amenaza su misión. Mientras las tribus y los druidas se unen para combatir a los romanos, Kerra se enfrenta al mayor reto de su vida como líder de la resistencia.','https://image.tmdb.org/t/p/500w/dQLpDcHFMbVV33cRxJcnrCKsuWt.jpg','https://image.tmdb.org/t/p/original/eRn7ZfplxSsIkPoWuW0PgQJo7Px.jpg','0000-00-00'),
	(70523,'Dark',NULL,NULL,'Serie','Tras la desaparición de un niño, cuatro familias desesperadas tratan de entender lo ocurrido a medida que van desvelando un retorcido misterio que abarca tres décadas.','https://image.tmdb.org/t/p/500w/75HgaphatW0PDI3XIHQWZUpbhn6.jpg','https://image.tmdb.org/t/p/original/5LoHuHWA4H8jElFlZDvsmU2n63b.jpg','0000-00-00'),
	(70672,'Hombres en una Misión',NULL,NULL,'Serie','Las celebridades masculinas juegan a la fantasía como estudiantes de secundaria, dan la bienvenida a estudiantes de transferencia estelar cada semana y participan en batallas de humor ingenioso y payasadas.','https://image.tmdb.org/t/p/500w/odItfoVoACL99EmWmqmWxBCrpXg.jpg','https://image.tmdb.org/t/p/original/zak7mqMxJGnnWplSdbjDtV7bg2Y.jpg','0000-00-00'),
	(70785,'Anne with an E',NULL,NULL,'Serie','Anne Shirley es una niña huérfana que vive en un pequeño pueblo llamado Avonlea que pertenece a la Isla del Príncipe Eduardo, en el año 1890. Después de una infancia difícil, donde fue pasando de orfanato a hogares de acogida, es enviada por error a vivir con una solterona y su hermano. Cuando cumple 13 años, Anne va a conseguir transformar su vida y el pequeño pueblo donde vive gracias a su fuerte personalidad, intelecto e imaginación.','https://image.tmdb.org/t/p/500w/70YdbMELM4b8x8VXjlubymb2bQ0.jpg','https://image.tmdb.org/t/p/original/6P6tXhjT5tK3qOXzxF9OMLlG7iz.jpg','0000-00-00'),
	(71024,'Castlevania',NULL,NULL,'Serie','Un cazador de vampiros trata de defender una ciudad frente a un ejército de bestias malignas liderado por el mismísimo Drácula. Inspirada en los legendarios videojuegos.','https://image.tmdb.org/t/p/500w/46ThFmdl8P8QRbgC2OcZ4UyFG3P.jpg','https://image.tmdb.org/t/p/original/ubDtIBwdS9b29sBofAkqWz3PqkT.jpg','0000-00-00'),
	(71411,'El Chapo',NULL,NULL,'Serie','Una mirada a la vida del capo de la droga notorio, El Chapo, desde sus primeros días en la década de 1980 que trabajan para el Cártel de Guadalajara, a su llegada al poder de durante los años 90 y su caída final en 2016.','https://image.tmdb.org/t/p/500w/4kp7ZwgminnWqgFwO5QEiWS5BNa.jpg','https://image.tmdb.org/t/p/original/2ClXk4PoOGmkk676y4q6T26GJOb.jpg','0000-00-00'),
	(71446,'La casa de papel',NULL,NULL,'Serie','Un enigmático personaje llamado el Profesor planea algo grande: llevar a cabo el mayor atraco de la historia. Para ello recluta una banda de ocho personas que reúnen un único requisito, ninguno tiene nada que perder. Cinco meses de reclusión memorizando cada paso, cada detalle, cada probabilidad… y por fin, once días de encierro en la Fábrica Nacional de Moneda, rodeados de cuerpos de policía y con decenas de rehenes en su poder para saber si su apuesta suicida será todo o nada.','https://image.tmdb.org/t/p/500w/xGexTKCJDkl12dTW4YCBDXWb1AD.jpg','https://image.tmdb.org/t/p/original/dQtiDcc8N1joORj3E6oWC8vZVCb.jpg','0000-00-00'),
	(71453,'Servir y Proteger',NULL,NULL,'Serie','Ambientada en una comisaría de policía situada en un barrio del sur de Madrid, los casos policiales se mezclan con las tramas personales de lo protagonistas, intentando mostrar el lado más humano de los agentes de policía y cómo es su vida.','https://image.tmdb.org/t/p/500w/4TrXFH8IpCmSFfaewSaOpGJIhR5.jpg','https://image.tmdb.org/t/p/original/i3xlA3ruLL7VdGJLCX1ZBwHwipF.jpg','0000-00-00'),
	(71578,'Atípico',NULL,NULL,'Serie','Cuando un adolescente con un trastorno autista decide buscar novia, su petición de más independencia provoca profundos cambios en su familia.','https://image.tmdb.org/t/p/500w/9OkuEgUebqBFJKyQu9cxUd4dd4B.jpg','https://image.tmdb.org/t/p/original/w5rPpdoWk3MM8ZId93FOKFzT4mm.jpg','0000-00-00'),
	(71663,'Black Lightning',NULL,NULL,'Serie','Jefferson Pierce es un hombre que lucha con un secreto. Hace nueve años, Jefferson pasaba la mayoría de su tiempo vigilando que las calles de Nueva Orleans fueran seguras, gracias a su super poder de controlar la electricidad. Sin embargo, tras pasar tanto tiempo en la calle vigilando que todo fuera seguro, dejó su sus aventuras de superhéroe para dedicarle más tiempo a su familia. Pese a que él pensaba que los días como superhéroe habían llegado a su fin, ahora tendrá que volver a usar sus poderes para luchar contra una banda local, Los 100, para proteger a su familia y a su ciudad.','https://image.tmdb.org/t/p/500w/kv0vCJOoGyWQdDPK9vFnyvqqDHt.jpg','https://image.tmdb.org/t/p/original/tM3i08Xs5I1bg5DB6sa9H0Zpt9e.jpg','0000-00-00'),
	(71712,'The Good Doctor',NULL,NULL,'Serie','Un cirujano joven y autista que padece el síndrome del sabio empieza a trabajar en un hospital prestigioso. Allá tendrá que vencer el escepticismo con el que sus colegas lo reciben.','https://image.tmdb.org/t/p/500w/iDbIEpCM9nhoayUDTwqFL1iVwzb.jpg','https://image.tmdb.org/t/p/original/bdlGjwPWpE45CKbcP4i3A7du9CP.jpg','0000-00-00'),
	(71728,'El joven Sheldon',NULL,NULL,'Serie','En esta serie derivada de \'Big Bang\', Sheldon Cooper tiene 9 años y se salta cuatro cursos para entrar directamente a la secundaria junto con su hermano mayor, menos listo que él. La vida en ella no será fácil, ya que sus compañeros, sus padres, su hermana melliza, su abuela y sus vecinos no entienden a Sheldon.','https://image.tmdb.org/t/p/500w/nlDBlCtorM7nx130wYnfR5ZmyLX.jpg','https://image.tmdb.org/t/p/original/lhtjPLgGMroHq01FprHULtv5PmA.jpg','0000-00-00'),
	(71740,'40 y 20',NULL,NULL,'Serie','40 y 20 cuenta la hostoria de Paco (Jorge “Burro” Van Rankin), un cuarentón divorciado que con una gran inestabilidad emocional a prueba de balas, comparte su inmadurez con su hijo Fran.','https://image.tmdb.org/t/p/500w/9WqwZQUDfzFmN8A0VaWKzyNBnv4.jpg','https://image.tmdb.org/t/p/original/lFI0ypuXn2UbUrrR2ePcmMTt8pq.jpg','0000-00-00'),
	(71789,'SEAL Team',NULL,NULL,'Serie','La serie sigue las vidas de los SEAL, soldados de élite de la Marina de los Estados Unidos mientras entrenan, planean y ejecutan las misiones más peligrosas y de alto riesgo.','https://image.tmdb.org/t/p/500w/6lOtF3yx8iurvaBVz1ZVhwcRgmD.jpg','https://image.tmdb.org/t/p/original/v0G8cbPtGoiTBFb4HW1hAJJFMol.jpg','0000-00-00'),
	(71790,'S.W.A.T.',NULL,NULL,'Serie','La serie sigue a Daniel \"Hondo\" Harrelson, un teniente S.W.A.T. que se ve dividido entre la lealtad a las calles y el deber con sus compañeros oficiales, cuando el agresivo y confiado líder del equipo 10-David SWAT, Jeff Mumford, lo asigna para dirigir una unidad altamente capacitada de la policía, que estará encargada de detener los crímenes en Los Ángeles.','https://image.tmdb.org/t/p/500w/AuY5Wuiwgc2CeuzM0I2poSe4E0x.jpg','https://image.tmdb.org/t/p/original/ttzrYMdsKWR8PTRLw7uo4noqaOJ.jpg','0000-00-00'),
	(71886,'Siren',NULL,NULL,'Serie','Esta serie nos lleva al corazón de Bristol Cove, una ciudad costera conocida por la leyenda que afirma que un día fue hogar de las sirenas. Cuando la llegada de una misteriosa joven prueba que el mito podría ser cierto, la batalla entre los hombres y el mar da un peligroso giro desde el momento en el que estas depredadoras criaturas vuelven para reclamar sus derechos. Todo comienza cuando Ben, un brillante biólogo marino, se encuentra con Ryn, una joven misteriosa recién llegada que esconde un oscuro secreto. Todo el mundo en la ciudad sospecha de ella, incluida Maddie, la bióloga que trabaja con Ben, Xander, un pescador de altura decidido a desvelar el misterio y Helen, una excéntrica vecina que sabe más de sirenas de lo que aparenta.','https://image.tmdb.org/t/p/500w/uZNhVUocfi44FuyR3FmHOFLwio4.jpg','https://image.tmdb.org/t/p/original/jYwhgaPwDbgC1MneMsAZTkcPcLJ.jpg','0000-00-00'),
	(71912,'The Witcher',NULL,NULL,'Serie','Geralt, un brujo que se dedica a cazar monstruos genéticamente modificados, busca su lugar en un mundo donde a menudo los humanos demuestran ser peores que las bestias.','https://image.tmdb.org/t/p/500w/s56eyXy8rADp5DpZknfe2HXq4u4.jpg','https://image.tmdb.org/t/p/original/fKbM6dldhGgf7lQZaYfWLAxqFuy.jpg','0000-00-00'),
	(72002,'Dinastía',NULL,NULL,'Serie','Los Carrington y los Colby se disputan el control de su fortuna (y de sus hijos) en este remake actualizado del gran clásico de la televisión.','https://image.tmdb.org/t/p/500w/4zjCDtFoVNFtlWvCsCd1dcJmKbo.jpg','https://image.tmdb.org/t/p/original/rVQ35erLIoV8hyh7lIKAMiChmOO.jpg','0000-00-00'),
	(72305,'Kakegurui',NULL,NULL,'Serie','A diferencia de muchas escuelas, asistir a la Academia Privada Hyakkaou prepara a los estudiantes para su tiempo en el mundo real. Dado que muchos de los estudiantes son hijos de las personas más ricas del mundo, la academia tiene sus peculiaridades que la separan de todas las demás. Por el día, es una escuela normal, que educa a sus alumnos en historia, idiomas y similares. Pero por la noche, se convierte en una sala de juego, educándolos en el arte de tratar con el dinero y manipular a las personas. Dinero es poder; los que salen en la cima de los juegos están en la parte superior de la escuela. Yumeko Jabami, una estudiante de transferencia aparentemente ingenua y hermosa, está lista para probar el currículo especial de Hyakkaou. A diferencia del resto, ella no juega para ganar, sino por la emoción de la apuesta, y su forma de juego insana puede traer demasiadas cartas nuevas a la mesa.','https://image.tmdb.org/t/p/500w/8KKp4x0AMzPFbPSnYrNdkJuA71H.jpg','https://image.tmdb.org/t/p/original/h1MUwcwNjK3nkXFzeFowUqfy0Qw.jpg','0000-00-00'),
	(72306,'La piloto',NULL,NULL,'Serie','Esta telenovela está basada en el testimonio real de Yolanda Cadena, una azafata mexicana que siendo muy joven aprendió a pilotear avionetas y helicópteros, realizando viajes ilegales, sin saber que transportaba droga y dólares. Fue su novio John Lucio, un astuto narcotraficante, quien la mete en el negocio, pero que al sentirse traicionado por Yolanda, planea su venganza y la entrega a su peor enemigo: el Coronel Santamaría. Pero esto sólo será el comienzo para convertirse en una temeraria líder. Sólo con la ayuda del agente de la DEA Dave Mejía, Yolanda podrá encontrar redención y el amor.','https://image.tmdb.org/t/p/500w/qzQDnYp8ARXktdlCF4PzaS2Tzjm.jpg','https://image.tmdb.org/t/p/original/upX2fGyD4tPjJJLIOuJlB3yp2OK.jpg','0000-00-00'),
	(72705,'Marvel Spider-Man',NULL,NULL,'Serie','Un adolescente inteligente llamado Peter Parker es mordido por una araña radiactiva en una escuela a Oscorp y esta le dado poderes.? Se convierte en un héroe llamado Spider-Man después de la muerte de su tío Ben y debe adaptarse a este nuevo modo de vida.','https://image.tmdb.org/t/p/500w/atkOOO7Ct4qqeSx4EHWCWkFy4ns.jpg','https://image.tmdb.org/t/p/original/dKdcyyHUR5WTMnrbPdYN5y9xPVp.jpg','0000-00-00'),
	(73347,'Azucarado salado',NULL,NULL,'Serie','En este programa cultural de verano diario con entrevistas e informes, el anfitrión y las estrellas invitadas observan lo que está sucediendo en la vibrante escena artística y cultural de Montreal (en Canadá).','https://image.tmdb.org/t/p/500w/pWTP8mJ6mQgfRUlsGmLlKkVISIP.jpg','https://image.tmdb.org/t/p/original/cPvXh1UmjZY93Kck3WFW55mb1km.jpg','0000-00-00'),
	(74016,'The Resident',NULL,NULL,'Serie','Un joven e idealista médico comienza su primer día ansioso por salvar vidas. Bajo la supervisión de un duro y brillante residente senior, pronto descubrirá que su profesión no es lo que él imaginaba y que las líneas éticas suelen ser borrosas. \"The Resident\" es un nuevo y provocativo drama médico que revela la verdad de lo que ocurre en los hospitales.','https://image.tmdb.org/t/p/500w/9oVp0xfKW2igxDEo5wr3JTMQBub.jpg','https://image.tmdb.org/t/p/original/m5E9GrO7cT3zkNQVUQu8C8cS7Tk.jpg','0000-00-00'),
	(74428,'Rosario Tijeras',NULL,NULL,'Serie','La serie cuenta la historia de una guerrera de uno de los barrios más pobres y peligrosos en Ciudad de México. Su belleza y nobleza contrasta con el ambiente gris y desolado donde creció. Ella es temida por sus enemigos y adorada por sus amigos.','https://image.tmdb.org/t/p/500w/hsSw3DuG2ah2wgaZeDTwyv5FPh3.jpg','https://image.tmdb.org/t/p/original/q03eQL8AUx49lVH6IT3IlmWzhQu.jpg','0000-00-00'),
	(75006,'The Umbrella Academy',NULL,NULL,'Serie','Un grupo disuelto de superhéroes se reúne después de que su padre adoptivo, quien los entrenó para salvar el mundo, muere.','https://image.tmdb.org/t/p/500w/qJxzjUjCpTPvDHldNnlbRC4OqEh.jpg','https://image.tmdb.org/t/p/original/hfHCRAUWuATAA2q9PmBoyXDMT0i.jpg','0000-00-00'),
	(75219,'9-1-1',NULL,NULL,'Serie','Drama basado en hechos reales que explora la ajetreada profesión y vida del personal que opera detrás de la línea de emergencia 911. A través de ella, policías, paramédicos y bomberos reciben llamadas de urgencias diarias por las que rápidamente deben acudir y poner en riesgo su vida para salvar la de otros.','https://image.tmdb.org/t/p/500w/1KxLxLcMZbtR3Jf32s2jhvZzA6r.jpg','https://image.tmdb.org/t/p/original/kizLmQSemkvA5ozGV4NVoS7ZSff.jpg','0000-00-00'),
	(75450,'Titanes',NULL,NULL,'Serie','Después de lanzarse a actuar por su cuenta, el excompañero de Batman se encuentra con una serie de jóvenes héroes con problemas que necesitan desesperadamente un mentor.','https://image.tmdb.org/t/p/500w/uRIiWJ0MrdNjykxl4mp8mXEi308.jpg','https://image.tmdb.org/t/p/original/dZcFbRFhUW7MB7L5gZb7QG9fdRd.jpg','0000-00-00'),
	(76121,'Darling in the FranXX',NULL,NULL,'Serie','En un futuro lejano, cuando la Tierra está en ruinas y la humanidad ha establecido una ciudad-fortaleza móvil bautizada como “Plantación”, unos pilotos viven en Mistilteinn, la “Jaula de pájaros”. Los niños viven allí sin conocer el mundo exterior ni la libertad. Su vida consiste en luchar y superar misiones contra unas formas de vida gigantes y misteriosas conocidas como Kyouryuu. Para enfrentarse a ellos, utilizan los robots Franxx. Un chico llamado Hiro está bautizado como Code:016 y, una vez, fue considerado un prodigio. No obstante, se ha quedado atrás y su existencia parece innecesaria. No pilotar un Franxx es igual a no existir. Un día, una chica misteriosa conocida como “Zero Two” aparece ante él y dos cuernos surgen de su cabeza.','https://image.tmdb.org/t/p/500w/tKh3pc5MEjCIGV7hSJX76qi8aGA.jpg','https://image.tmdb.org/t/p/original/wwk3zyeXdyCx68oJ7ncjDkLNkU9.jpg','0000-00-00'),
	(76231,'Mayans M.C.',NULL,NULL,'Serie','Ambientada después de Sons of Anarchy, Mayans MC se enfoca en las luchas de Ezekiel \"EZ\" Reyes, un prospecto en la carta de MC Maya en la frontera de California / México. EZ es el hijo dotado de una orgullosa familia latina, cuyo sueño americano fue sofocado por la violencia del cártel. Ahora, su necesidad de venganza lo conduce hacia una vida que nunca tuvo la intención y de la que nunca podrá escapar.','https://image.tmdb.org/t/p/500w/9XUIsRUB7V3iEoLSKxZCqPvbKKW.jpg','https://image.tmdb.org/t/p/original/gaKhfksFK24N19bjlFpJxamYZ02.jpg','0000-00-00'),
	(76479,'The Boys',NULL,NULL,'Serie','La serie tiene lugar en un mundo en el que los superhéroes representan el lado oscuro de la celebridad y la fama. Un grupo de vigilantes que se hacen llamar \"The Boys\" decide hacer todo lo posible por frenar a los superhéroes que están perjudicando a la sociedad, independientemente de los riesgos que ello conlleva.','https://image.tmdb.org/t/p/500w/mGVrXeIjyecj6TKmwPVpHlscEmw.jpg','https://image.tmdb.org/t/p/original/22cq85ZsAA0UzLq2uRf9MXf4OIx.jpg','0000-00-00'),
	(76669,'Élite',NULL,NULL,'Serie','Las Encinas, un exclusivo colegio privado al que la élite social del país envía a sus hijos. Pero en el centro son admitidos tres adolescentes de familias humildes después de que un terremoto destruyera el colegio público en el que estudiaban. El choque de clases genera diversos problemas que se agravan hasta que, de repente, se produce un asesinato.','https://image.tmdb.org/t/p/500w/pMkjcQEdqSlVSjngH5TLEBS2TN.jpg','https://image.tmdb.org/t/p/original/1aQY4oYX5XOMN0vMDqwzS7hfPIt.jpg','0000-00-00'),
	(76773,'Estación 19',NULL,NULL,'Serie','Tras un fatídico incendio en el Grey Sloan Memorial, un equipo de bomberos es el encargado de salvar al famoso hospital en Seattle de las llamas. La actitud heroica de estos hombres y mujeres ante una situación en la que deben arriesgar sus vidas es el punto de partida del nuevo spin-off de la serie insignia Anatomía de Grey. Desde el alto cargo hasta el último recluta son los protagonistas de este drama en el que se explora la rutina, casi siempre peligrosa, de estos profesionales.','https://image.tmdb.org/t/p/500w/qPO43E0tnw9Gjh9EzkNmc3AKlE3.jpg','https://image.tmdb.org/t/p/original/apvr0s7sLvlPgNGtfuvM5EOJJMO.jpg','0000-00-00'),
	(76949,'La resistencia',NULL,NULL,'Serie','Cada noche de lunes a jueves, David Broncano se enfrenta a un late late night que ha supuesto todo un fenómeno televisivo al crear una nueva forma de hacer televisión. Con su peculiar humor, las cosas puedan tomar rumbos insospechados.','https://image.tmdb.org/t/p/500w/4OeX0dKmalJ7EUBats8NpV0YMD1.jpg','https://image.tmdb.org/t/p/original/bx7bsmO0AoJGQcQyFUEKDDYQJ89.jpg','0000-00-00'),
	(77169,'Cobra Kai',NULL,NULL,'Serie','Secuela de Karate Kid, 30 años después de los acontecimientos del film original y con el mismo reparto repitiendo los papeles principales.','https://image.tmdb.org/t/p/500w/gL8myjGc2qrmqVosyGm5CWTir9A.jpg','https://image.tmdb.org/t/p/original/aka4N0LikehdRw690ymEVympK9Z.jpg','0000-00-00'),
	(77240,'Captain Tsubasa',NULL,NULL,'Serie','Cuenta la historia de Tsubasa Oozora, un niño de 11 años cuyos sueños giran en torno al fútbol. Tsubasa empezó a jugar al fútbol desde muy pequeño y aunque sus amigos lo ven como un entretenimiento, para él es una obsesión. Nueva serie basada en el manga \"Oliver y Benji\", de Yōichi Takahashi','https://image.tmdb.org/t/p/500w/dSvRkislUYBu8jWpqRpUsfNFNcr.jpg','https://image.tmdb.org/t/p/original/34hMi7fnXUrfQ3AP59AZnXZKBx2.jpg','0000-00-00'),
	(79242,'Las escalofriantes aventuras de Sabrina',NULL,NULL,'Serie','La magia y las diabluras se dan la mano cuando Sabrina, mitad humana, mitad bruja, navega por dos mundos: el de los mortales y el de su familia, la Iglesia de la Noche.','https://image.tmdb.org/t/p/500w/aPsyg7Q9xSUy3AshffqwWPc69Ir.jpg','https://image.tmdb.org/t/p/original/icIYzCqe5EYlgI8A4mDFWgQU1LJ.jpg','0000-00-00'),
	(79250,'Verdades ocultas',NULL,NULL,'Serie','Laura Flores (Marcela Medel) es una mujer de buen corazón, la cual tiene dos hijas: Rocío de siete años y Rosita (Carmen Luz Zabala) de tres años. Lamentablemente, debido a su situación de extrema pobreza, Laura no tiene otra opción que vender a su hija menor Rosita a Rodolfo Mackenna (Osvaldo Silva), un exitoso empresario de clase alta dueño de una cadena de restaurantes. Rodolfo va a buscar a la niña mientras ambas estaban solas en la casa, haciéndole creer a Rocío que Rosita fue robada por este, para que así nunca sepa la verdad. Esto provocará que desde ese instante Rocío cargue con el dolor de haber perdido a Rosita y la culpa por no poder haber hecho nada por su hermana mientras veía como se la llevaban. En el caso de Laura, ésta vivirá con un enorme arrepentimiento y dolor por haber vendido a su hija.','https://image.tmdb.org/t/p/500w/9b6oND8sUhJT9WESAHg4kufvUry.jpg','https://image.tmdb.org/t/p/original/bp7tyY5mAKJ9VSmLv3tX0RaYeig.jpg','0000-00-00'),
	(79460,'Legacies',NULL,NULL,'Serie','En un lugar donde jóvenes brujas, vampiros y hombres lobo son educados para ser lo mejor de sí mismos a pesar de sus peores impulsos, la hija de Klaus Mikaelson, Hope Mikaelson de 17 años, las gemelas de Alaric Saltzman, Lizzie y Josie Saltzman, entre otros de edad en héroes y villanos en la Escuela Salvatore para Jóvenes y Dotados.','https://image.tmdb.org/t/p/500w/fRYwdeNjMqC30EhofPx5PlDpdun.jpg','https://image.tmdb.org/t/p/original/qTZIgXrBKURBK1KrsT7fe3qwtl9.jpg','0000-00-00'),
	(79501,'Doom Patrol',NULL,NULL,'Serie','Reimaginación de uno de los grupos de superhéroes más emblemáticos de DC: Robotman, Negative Man, Elasti-Girl y Crazy Jane, liderados por el científico loco Dr. Niles Caulder. Los miembros de esta peculiar patrulla rememoran las circunstancias que les llevaron a obtener sus habilidades sobrehumanas, causando toda clase de cicatrices y desfiguraciones que les impiden llevar una vida normal. Desesperados, proponen a su Caulder defender el planeta Tierra de los mayores peligros que jamás se hayan conocido. Siguiendo con los acontecimientos que tienen lugar en \"Titans\", la patrulla recibe un encargo de Cyborg que no podrán rechazar, aunque cumplirlo implica que sus vidas nunca volverán a ser como antes.','https://image.tmdb.org/t/p/500w/b7unxzWSFfj7i6UVmuPixxxXFOF.jpg','https://image.tmdb.org/t/p/original/nVN7Dt0Xr78gnJepRsRLaLYklbY.jpg','0000-00-00'),
	(79611,'Embrujadas',NULL,NULL,'Serie','Ubicada en la ficticia ciudad universitaria de Hilltowne, Charmed sigue la vida de tres hermanas, Macy, Mel y Maggie Vera, quienes, después de la trágica muerte de su madre, descubren que son tres de las brujas más poderosas de todos los tiempos.','https://image.tmdb.org/t/p/500w/9CV2kagVJIRqwojOSJymIGwfz9b.jpg','https://image.tmdb.org/t/p/original/dYAEVaJArOVZIENP29lQjMbT6PZ.jpg','0000-00-00'),
	(79696,'Manifest',NULL,NULL,'Serie','Cuando el vuelo 828 de Montego Air aterriza de manera segura después de un vuelo turbulento pero de rutina, la tripulación y los pasajeros se sienten aliviados. Sin embargo, aunque para ellos han pasado pocas horas, el mundo ha envejecido cinco años y sus amigos, familias y colegas, después de llorar su pérdida, han perdido la esperanza y están intentando seguir adelante. Ahora, frente a lo imposible, a todos se les da una segunda oportunidad. Pero, a medida que se aclaran sus nuevas realidades, se enfrentan a un misterio más profundo y algunos de los pasajeros pronto se dan cuenta de que pueden estar destinados a algo más grande de lo que alguna vez creyeron posible.','https://image.tmdb.org/t/p/500w/ts1EU1JlIATorwTbUQGnDO6xm3B.jpg','https://image.tmdb.org/t/p/original/oRM98LENegR9LfPpLH5BaWH1tjz.jpg','0000-00-00'),
	(79744,'The Rookie',NULL,NULL,'Serie','Comenzar de nuevo no es fácil, especialmente para el chico de una ciudad pequeña John Nolan que, después de un incidente que cambia su vida, está persiguiendo su sueño de ser un oficial de policía de Los Ángeles. Como el novato más viejo de la fuerza, se ha encontrado con el escepticismo de algunos de los superiores que lo ven como una crisis ambulante.','https://image.tmdb.org/t/p/500w/Aof7R1if9jKhHCk6M7UGyEQWQSk.jpg','https://image.tmdb.org/t/p/original/8HW55HY8fWSgjgZrfo4hP02h2o7.jpg','0000-00-00'),
	(80006,'Good Trouble',NULL,NULL,'Serie','Spin-off de \"Familia de acogida\" (\"The Fosters\") en la que Callie y Mariana se trasladan a Los Ángeles tras graduarse. Las hermanas disfrutan del amor, el sexo y de las complicadas relaciones que conlleva vivir en una ciudad nueva para unas veinteañeras.','https://image.tmdb.org/t/p/500w/hBYvHCcZX4dyvXeM0NTBh5uJIk3.jpg','https://image.tmdb.org/t/p/original/rVv5scER55WM2GABJZmL8K4vwsv.jpg','0000-00-00'),
	(80020,'Dragon Ball Heroes',NULL,NULL,'Serie','Comienza con Trunks del Futuro viajando al pasado para entrenar nuevamente con Goku y Vegeta, pero misteriosamente se desvanece en medio del viaje. El hijo de Bulma se despierta en una prisión situada en un recóndito lugar del Universo, encerrado por el mismísimo Fu. Al estar escondido es muy posible que incluso Bills no conozca este lugar.\n\nPero por suerte Goku y sus amigos se enteran de esto y emprenden el viaje a rescatar a Trunks. Este sitio también adelanta que el enemigo Fu también posee sus propias Esferas del Dragón. Además de otras reliquias que servirán para poder salir de ese planeta.','https://image.tmdb.org/t/p/500w/xlKKD1TXJvh0YYlVPqqQ3g3ZUjM.jpg','https://image.tmdb.org/t/p/original/8jq6xv5c1WK7KAPOXCsodm8eUxp.jpg','0000-00-00'),
	(80240,'La Reina del Flow',NULL,NULL,'Serie','La serie se desarrolla en el seductor ambiente del reggaeton, género que se ha tomado al mundo. Esta es la historia de Yeimy Montoya, una talentosa joven compositora que paga una injusta condena en una prisión de Nueva York tras ser engañada por Charly, el hombre que ama y que posteriormente le roba sus canciones, con las que logra alcanzar la fama y convertirse en una estrella. El único deseo de Yeimy es salir a cobrar venganza contra todos aquellos que acabaron con su vida y su familia.','https://image.tmdb.org/t/p/500w/pnyT1foDmmXTsho2DfxN2ePI8ix.jpg','https://image.tmdb.org/t/p/original/fuVuDYrs8sxvEolnYr0wCSvtyTi.jpg','0000-00-00'),
	(80350,'New Amsterdam',NULL,NULL,'Serie','Inspirado por Bellevue, el hospital público más antiguo de Estados Unidos, este drama médico único sigue al brillante y encantador Dr. Max Goodwin, el director médico más nuevo de la institución, que se propone romper la burocracia y brindar una atención excepcional.','https://image.tmdb.org/t/p/500w/kXdfhKazlnRhnyc687DDdZJPaoJ.jpg','https://image.tmdb.org/t/p/original/7O4hmyDSQBnVKM1Om4BszRhBYbU.jpg','0000-00-00'),
	(80623,'Baki',NULL,NULL,'Serie','El protagonista, Baki Hanma, entrena enfocado en superar a su padre, Yujiro Hanma, el luchador más fuerte del mundo. Cinco de los presos más violentos y brutales, se reúnen para enfrentar a Baki. Su objetivo es probar la derrota. Su fuerza y habilidad inigualable, los han llevado a aburrirse de la vida misma, y ahora buscan a Baki con la esperanza de que pueda abrumarlos y aplastarlos por completo. En esta crisis, otros guerreros de artes marciales subterráneos se reúnen para luchar al lado de Baki: Kaoru Hanayama, Gouki Shibukawa, Retsu Kaioh y Doppo Orochi. ¡Inicia un enfrentamiento épico entre los condenados a muerte y Baki y sus amigos!','https://image.tmdb.org/t/p/500w/yQjO3CqZSbby6U7y3NfzrLB32rq.jpg','https://image.tmdb.org/t/p/original/diySGgcj1xikHU7ACEugcvW88WQ.jpg','0000-00-00'),
	(80743,'Insatiable',NULL,NULL,'Serie','Patty Bladell (Debby Ryan) es una adolescente que ha sufrido acoso en el colegio por ser gorda, encuentra años después en los concursos de belleza, reconvertida en una atractiva joven, un modo de vengarse de sus antiguas compañeras.','https://image.tmdb.org/t/p/500w/n6d8iZXaYAftfnJdVNpXvVejfTA.jpg','https://image.tmdb.org/t/p/original/diN0c6j4mkvk4xuiTpQoZ50f5Lo.jpg','0000-00-00'),
	(80748,'FBI',NULL,NULL,'Serie','La unidad de élite de la oficina del FBI en Nueva York ofrece todos sus talentos, intelecto y experiencia técnica en casos importantes para mantener a salvo a Nueva York y el país.','https://image.tmdb.org/t/p/500w/stD2BtJHwc8xolJVtglrETEjD57.jpg','https://image.tmdb.org/t/p/original/7aWmC7BjwBFgIKA77VqrXyRPicJ.jpg','0000-00-00'),
	(80752,'See',NULL,NULL,'Serie','Un virus ha acabado con la población de todo el mundo y los únicos supervivientes han quedado ciegos. La naturaleza ha recuperado los antiguos espacios urbanos, así que la civilización vive ahora en bosques, desarrollando su vida sin vista. Pero todo cambia cuando nacen dos bebés capaces de ver —hijos, además, de Baba Voss, lo que desata una guerra entre \"tribus\" para impedir que estos niños puedan adquirir los conocimientos que permitan a los humanos reconstruir el mundo tal como era antes.','https://image.tmdb.org/t/p/500w/oKxrDdG0SfmWRtJYmreK4rjDMUo.jpg','https://image.tmdb.org/t/p/original/g3JsScc7mQCfc3e5e5rXwu7xVVP.jpg','0000-00-00'),
	(80968,'Narcos: México',NULL,NULL,'Serie','La historia empezará en una época donde el mundo del narcotráfico mexicano era una estructura desorganizada de productores y traficantes independientes. La serie mostrará el nacimiento del cártel de Guadalajara en los años 80, cuando Félix Gallardo (Luna) toma el mando, unificando a los traficantes para construir un imperio. Cuando el agente de la DEA, Kiki Camarena (Peña), se traslada con su mujer y su hijo pequeño de California a Guadalajara para asumir un nuevo cargo, enseguida se da cuenta de que su tarea será más desafiante de lo que jamás hubiera imaginado. A medida que Kiki va recopilando información sobre Félix y se involucra más en su caso, se desarrollan una serie de acontecimientos que afectarán al tráfico de drogas y a la guerra contra las mismas en los años venideros.','https://image.tmdb.org/t/p/500w/AhG90SeoMJ0xCI4ye21ru7Cr9we.jpg','https://image.tmdb.org/t/p/original/yCid4sQkaVzfa2y4yQWs5E0TES9.jpg','0000-00-00'),
	(80986,'Stargirl',NULL,NULL,'Serie','Courtney Withmore es una estudiante de instituto que ayuda a un grupo de jóvenes héroes a acabar con los villanos del pasado. La serie se centra en Stargirl y el primer grupo de superhéroes: la Sociedad de la Justicia de América.','https://image.tmdb.org/t/p/500w/pXjpqrx65mlQskf9mfTWSszYODn.jpg','https://image.tmdb.org/t/p/original/ogntmK9hwBomhajqYrHXUAaqkd7.jpg','0000-00-00'),
	(81329,'Crónicas del Sol',NULL,NULL,'Serie','Tras 17 años de ausencia, Claire regresa a su ciudad natal en Montpellier con su hijo de 16 años, Théo. Ella huyó de su pasado y de sus padres después del suicidio de su hermana y vivió sola con su hijo en África, donde trabajó como enfermera.','https://image.tmdb.org/t/p/500w/aizbHLcKVWvJ7jxkflJzTu5Z8GE.jpg','https://image.tmdb.org/t/p/original/m1z5FCcnKWBl2dEt8J81RmQnqmr.jpg','0000-00-00'),
	(81354,'Ratched',NULL,NULL,'Serie','En 1947, Mildred llega a Carolina del Norte en busca de empleo en un hospital psiquiátrico donde nuevos e inquietantes experimentos han iniciado con la mente humana. En una misión clandestina, Mildred se presenta como la imagen perfecta de lo que una enfermera dedicada debería de ser.\n\nMientras la vida da muchas vueltas, ella comienza a infiltrarse en el sistema de cuidado de la salud mental, el estilizado exterior de Mildred esconde una creciente oscuridad que se ha mantenido escondida por mucho tiempo, revelando que los verdaderos monstruos se hacen, no nacen.','https://image.tmdb.org/t/p/500w/zx3m4iW6CsM7yuMEUyvSkvbwaip.jpg','https://image.tmdb.org/t/p/original/cDNxOIm6K5D2W21QyJWZ95sJzQt.jpg','0000-00-00'),
	(81356,'Sex Education',NULL,NULL,'Serie','Como el inseguro de Otis (Asa Butterfield) tiene respuesta para cualquier duda sobre sexo gracias a que su madre (Gillian Anderson) es sexóloga, una compañera lo anima a abrir una \"clínica\" en el instituto.','https://image.tmdb.org/t/p/500w/7UKgB00W2zFeNQl42SJ3XkJXtql.jpg','https://image.tmdb.org/t/p/original/oOEOg8rawAtc1nRbgGkf5fYcMB4.jpg','0000-00-00'),
	(82739,'Seishun Buta Yarou wa Bunny Girl Senpai no Yume wo',NULL,NULL,'Serie','Existe un rumor sobre un fenómeno misterioso llamado \"síndrome de pubertad\". Por ejemplo, Sakuta Azusagawa es una estudiante de secundaria que de repente ve a una conejita aparecer frente a él. La niña es Mai Sakurajima, la chica de clase superior de Sakuta y también una actriz famosa que se ha apartado de la industria del entretenimiento. Por alguna razón, la gente alrededor de Mai no puede ver su figura de conejita. Sakuta se propone resolver este misterio y, a medida que pasa tiempo con Mai, aprende sus sentimientos secretos. Otras heroínas que tienen \"síndrome de pubertad\" comienzan a aparecer frente a Sakuta.','https://image.tmdb.org/t/p/500w/5J4f4XDeRg7c7bHcXK26e1gkb0t.jpg','https://image.tmdb.org/t/p/original/lq3HcsmM005htHUVL4fcjalCUrq.jpg','0000-00-00'),
	(82809,'Falsa Identidad',NULL,NULL,'Serie','La historia de Isabel y Diego, dos extraños que deben huir de su pasado para escapar de sus enemigos. Diego dejó a su familia después de que su padre murió y su madre se volvió a casar. En un acto de rebelión, Diego se involucró en el mundo del crimen, vendiendo combustible al traficante de drogas más poderoso de la ciudad, Gavino Gaona. Isabel se casó con Porfirio “El Corona”, miembro de una banda norteña, cuando tenía 15 años y enfrenta una vida de abuso doméstico.Estos dos extraños que huyen de su pasado deben asumir nuevas identidades para hacerse pasar por una pareja felizmente casada y así escapar de sus enemigos y sobrevivir.','https://image.tmdb.org/t/p/500w/vwsXyOGWOTVACbAjKOfKlQFO2OX.jpg','https://image.tmdb.org/t/p/original/A8NqOX6Tol9srq9pS740q2ktgzH.jpg','0000-00-00'),
	(82856,'The Mandalorian',NULL,NULL,'Serie','En el anárquico período tras el hundimiento del Imperio Galáctico, un cazarrecompensas con armadura conocido solo como El Mandaloriano emprende una misión bien remunerada aunque enigmática.','https://image.tmdb.org/t/p/500w/9ijMGlJKqcslswWUzTEwScm82Gs.jpg','https://image.tmdb.org/t/p/original/iLg3DzrwCDsHNovNaWx5JnQAsiV.jpg','0000-00-00'),
	(82883,'The Act',NULL,NULL,'Serie','The Act se centra en Gypsy Blanchard, una niña que intenta escapar de la relación tóxica que tiene con su madre sobreprotectora, Dee Dee. Su búsqueda de la independencia acaba abriendo la caja de Pandora, lo que al final resulta en un asesinato.','https://image.tmdb.org/t/p/500w/1yhQGQH7pfKdIY2xJSYNdp8ReD6.jpg','https://image.tmdb.org/t/p/original/vb1sQLC2MqfCPOFqHd8SyVsyDVB.jpg','0000-00-00'),
	(83097,'The Promised Neverland‬‏',NULL,NULL,'Serie','Por mucho que los niños la quieran, ella no es su madre. Viven juntos, pero no son familiares de sangre. Grace Field es un hogar al que son enviados los niños que no tienen padres. Un hogar irreemplazable para los 38 niños que allí viven felices su día a día, como si fueran hermanos, aunque al inicio fueran completos desconocidos. Al menos así era hasta que cierto descubrimiento cambió sus vidas por completo...','https://image.tmdb.org/t/p/500w/uAjMQlbPkVHmUahhCouANlHSDW2.jpg','https://image.tmdb.org/t/p/original/8RWcKSmCbwsN8porFyTOB5e2cDG.jpg','0000-00-00'),
	(83111,'Jenni Rivera: Mariposa de Barrio',NULL,NULL,'Serie','Este drama sigue la improbable transformación de Jenni Rivera, una adolescente embarazada y mujer maltratada que se convirtió en estrella de la música mexicana.','https://image.tmdb.org/t/p/500w/5YmCFHVy2WQy8VxGAOyBfVc5QHH.jpg','https://image.tmdb.org/t/p/original/ei0o8LMjW5NKP4rUD2DTB8STlzu.jpg','0000-00-00'),
	(83121,'Kaguya-sama wa Kokurasetai Tensai-tachi no Renai Z',NULL,NULL,'Serie','¡Todo vale en el amor y en la guerra! Dos genios. Dos cerebros. Dos corazones. Una batalla. ¡¿Quién declarará primero su amor?! Kaguya Shinomiya y Miyuki Shirogane son dos prodigios de gran inteligencia y quienes controlan el consejo de estudiantes de su prestigiosa academia, lo que las convierte en la crème de la crème de la élite. Pero claro, estar en la cima es algo que incluye una buena dosis de soledad como extra, y ambos acaban enamorándose el uno del otro. ¿El problema? Que ambos son demasiado orgullosos como para admitir que están enamorados, así que el primero que lo admita, ¡será el perdedor! Comienza su batalla diaria para intentar forzar al otro a declararse primero.','https://image.tmdb.org/t/p/500w/dJ8yrSokdTMnhKJw06MllSfCegb.jpg','https://image.tmdb.org/t/p/original/xxdu5VfiQLN4ZhA4VMw3tJ1Pi6T.jpg','0000-00-00'),
	(83639,'Girl from Nowhere',NULL,NULL,'Serie','Nanno es una chica inteligente y misteriosa que va de un instituto a otro sacando a la luz los secretos más oscuros tanto de alumnos como de profesores.','https://image.tmdb.org/t/p/500w/pBHXMfeNWVMR7stjnCaSOZLOV7I.jpg','https://image.tmdb.org/t/p/original/7s1VshVFh7zbN5pcBJRXvcxF04l.jpg','0000-00-00'),
	(84669,'Las Quintillizas',NULL,NULL,'Serie','Fuutarou Uesugi es un estudiante de segundo año de preparatoria/instituto cuya familia siempre ha sido muy pobre. Un día recibe una suculenta oferta de trabajo como tutor a medio tiempo... ¡pero sus estudiantes resultan ser unas chicas de su propia clase! Para complicar más las cosas, son quintillizas... Las cinco hermanas son todas muy atractivas, pero no es lo único que tienen en común: todas odian estudiar y sus calificaciones siempre están al límite de la catástrofe. Tendrá que conseguir que las cinco estudien, pero primero tendrá que estudiar él cómo ganarse su confianza.','https://image.tmdb.org/t/p/500w/dwEkNoGFZJWqiwJrnzVfmtmVhfU.jpg','https://image.tmdb.org/t/p/original/zIBfMBcV7ENjEfuFx93xJYnOtLs.jpg','0000-00-00'),
