	(89393,'9-1-1: Lone Star',NULL,NULL,'Serie','Este spin-off de 9-1-1, se centra en Owen Strand, un sofisticado bombero de Nueva York que se muda a Austin, Texas, con su hijo. En esta nueva vida tiene que encontrar el equilibrio entre salvar a los más vulnerables o resolver sus propios problemas personales.','https://image.tmdb.org/t/p/500w/T80u5F022x4HbH5YOxQdHXN2ez.jpg','https://image.tmdb.org/t/p/original/vE1iYEM52EHkhZSzcEnQP1Uvei8.jpg','0000-00-00'),
