	(90239,'El juego de las llaves',NULL,NULL,'Serie','Ocho amigos, todos en una relación estable, deciden aventurarse en un juego de descubrimiento sexual intercambiando parejas mientras intentan liberarse de su rutina diaria y agregar un toque picante a su vida amorosa.','https://image.tmdb.org/t/p/500w/2dFNC3tuX88FMw4WVzLJAhooPDy.jpg','https://image.tmdb.org/t/p/original/4YUbBV3sOACNZaitBGnqRuUihKN.jpg','0000-00-00'),
	(90461,'Monstruos a la obra',NULL,NULL,'Serie','Tylor Tuskmon se ha graduado en Monstruos University como mejor alumno de su promoción y se incorpora a Monstruos S. A. para cumplir su sueño de trabajar como asustador... o no. En su primer día allí, se entera de que ya no buscan asustadores, sino bromistas, y lo reasignan temporalmente al departamento de Mantenimiento de Instalaciones Fijas y Temporales. Este cambio da al traste con los planes de Tylor, pero él se fija una nueva meta: convertirse en bromista.','https://image.tmdb.org/t/p/500w/2O3ZRECju00Jod6LrVB3uRgZMXK.jpg','https://image.tmdb.org/t/p/original/hb49zHGP6kUwqsR2wfPdTT6U27J.jpg','0000-00-00'),
	(90660,'Kengan Ashura',NULL,NULL,'Serie','En la historia del manga, mercaderes y hombres de negocios apuestan grandes cantidades de dinero en combates entre hombres desarmados que ellos mismos contratan. El ganador se lo queda todo en estas competiciones Kengan que se originaron durante el periodo Edo. Los mercaderes usan las peleas como una forma de resolver sus disputas entre ellos. El misterioso y fuerte Oma Tokita, conocido como Ashura, se introduce en ese mundo. El presidente Hideki Nogi del Grupo Nogi es quien se encuentra a Ashura por primera vez. Cuando Ashura entra a ese mundo, comienzan a desarrollarse los eventos.','https://image.tmdb.org/t/p/500w/wJtrctuWTKgIi45zLw9tTjWQFY3.jpg','https://image.tmdb.org/t/p/original/u6MpSEaUlDEv7KCn49aHhtTQ43L.jpg','0000-00-00'),
