	(94305,'The Walking Dead: World Beyond',NULL,NULL,'Serie','La serie, ambientada en Nebraska diez años después del inicio del apocalipsis zombi, presenta a dos jóvenes protagonistas femeninas y se centra en \"la primera generación de jóvenes en alcanzar la mayoría de edad en medio del apocalipsis sin que tengan conocimiento de cómo era el mundo antes de la aparición de los caminantes. Algunos se convertirán en héroes. Algunos se convertirán en villanos. Al final, todos ellos cambiarán para siempre. Adultos y cimentados en sus identidades, tanto buenas como malas\".','https://image.tmdb.org/t/p/500w/pLVrN9B750ehwTFdQ6n3HRUERLd.jpg','https://image.tmdb.org/t/p/original/SCFz5ZkSg7Z11e7GrMjeT7YnkS.jpg','0000-00-00'),
