	(96316,'Rent-a-Girlfriend',NULL,NULL,'Serie','Kinoshita Kazuya es un estudiante universitario que acaba de ser abandonado por su novia, ella se fue con otro hombre. Sintiéndose deprimido, y con la intención de mejorar su ánimo, decide usar una aplicación llamada Diamond para contratar a Mizuhara Chizuru, una novia de alquiler. Desde su primer encuentro, ella parece ser la chica ideal, pero ¿hay algo más en ella de lo que se ve a simple vista? ¿Y cómo se desarrollará su no muy típica relación?','https://image.tmdb.org/t/p/500w/ftpjln5qa8xAqnDGamIHtYweRHY.jpg','https://image.tmdb.org/t/p/original/tqOd55KFyXFsWAODhpXbNVCY9rx.jpg','0000-00-00'),
	(96580,'Resident Alien',NULL,NULL,'Serie','La historia sigue a Harry, un extraterrestre que aterriza en la Tierra y se hace pasar por un médico humano de un pequeño pueblo. Al llegar con una misión secreta para matar a todos los humanos, Harry comienza a vivir una vida simple… Pero las cosas se ponen un poco difíciles cuando se ve obligado a resolver un asesinato local y se da cuenta de que necesita asimilarse a su nuevo mundo. Mientras lo hace, comienza a luchar con el dilema moral de su misión y a plantearse las grandes preguntas de la vida como: “¿Vale la pena salvar a los seres humanos?” y “¿Por qué doblan la pizza antes de comerla?”','https://image.tmdb.org/t/p/500w/fPF6h8LLtZ40NRqkHfx2DvFbmkW.jpg','https://image.tmdb.org/t/p/original/bG5aqfT5lTHuSbcQofNHtH0RyyP.jpg','0000-00-00'),
