	(96716,'El Míster',NULL,NULL,'Serie','Después de ser expulsado de la NCAA por lanzarle una silla al árbitro, Marvyn Korn, un entrenador de baloncesto masculino, empieza a trabajar en Westbrook, un elitista colegio de chicas y su única opción para salvar lo que queda de su carrera y reputación. Al principio, Marvyn enfoca su nuevo empleo como un alto en el camino de su vuelta al baloncesto universitario. Además, las chicas no se toman en serio el equipo. El impasible Marvyn pronto descubre que las adolescentes son seres humanos complejos, que no solo viven de mano dura y días de entrenamiento doble, sino que necesitan a alguien que las oriente y se preocupe por ellas. Mientras aprende a forjar vínculos con sus jugadoras y a ser más empático, el entrenador se empieza a convertir en la persona que siempre ha querido ser y en el padre que nunca tuvo. Las chicas, por su parte, aprenden a tomarse más en serio a sí mismas, a dar la calidad que Marvyn exige y a encontrar su lugar, tanto dentro como fuera de la cancha.','https://image.tmdb.org/t/p/500w/bhtvmyFHLBhmoUoo3evgsfjCTAs.jpg','https://image.tmdb.org/t/p/original/fINynHDdBNtDXamaCsIqOPNROm2.jpg','0000-00-00'),
	(97175,'Destino: La saga Winx',NULL,NULL,'Serie','Sigue el día a día de cinco hadas que empiezan a estudiar en Alfea, un internado en el que aprenderán a dominar sus poderes mágicos además de enfrentarse a problemas más terrenales como el amor, la rivalidad y unos monstruos que amenazan su existencia.','https://image.tmdb.org/t/p/500w/pwyMoXQbqJdmpjjl23KaaQLOv6S.jpg','https://image.tmdb.org/t/p/original/mtnBValRpmrQVM0XE6eEXFFIAvs.jpg','0000-00-00'),
