	(97186,'Con amor, Victor',NULL,NULL,'Serie','Basada en la novela para jóvenes de Becky Albertalli \'Simon vs. the Homo Sapiens Agenda\', que inspiró el largometraje \'Love, Simon\'. \'Love, Victor\' sigue a Victor, un nuevo estudiante de Creekwood High School en su autodescubrimiento, enfrentándose a problemas en casa, adaptándose a una nueva ciudad y descubriendo su orientación sexual. Cuando todo se le está haciendo difícil, se acerca a Simon para que le ayude a lidiar con los altibajos de su vida.','https://image.tmdb.org/t/p/500w/xGygIzPf8UDr9IiJozMoKXa6fkE.jpg','https://image.tmdb.org/t/p/original/o6lrlXMgOKdkoZZbaXK6ENJxnkB.jpg','0000-00-00'),
	(97513,'El internado: Las Cumbres',NULL,NULL,'Serie','En un colegio ubicado junto a un antiguo monasterio en un lugar inaccesible entre las montañas, los alumnos son chicos problemáticos y rebeldes que vivirán bajo la estricta y severa disciplina que impone el centro para reinsertarlos a la sociedad. El bosque circundante alberga antiguas leyendas, amenazas que siguen vigentes y que les sumergirán en aventuras trepidantes y terroríficas.','https://image.tmdb.org/t/p/500w/8OrceoLR3ARlthFw0daqW7saXit.jpg','https://image.tmdb.org/t/p/original/kl07N07l4XNjXF48oujzWXs40Dw.jpg','0000-00-00'),
	(97525,'To Your Eternity',NULL,NULL,'Serie','Una criatura inmortal es enviada a la Tierra, donde conoce a un chico que pasa los días solo, en medio de la tundra helada. Esta entidad puede robar la apariencia de cualquier otro ser moribundo, siempre y cuando su «ímpetu» sea más fuerte que el anterior. ¿Qué tipo de experiencias y aventuras le esperan a un ser cuya historia se escribirá durante toda la eternidad?','https://image.tmdb.org/t/p/500w/qmeC99iX9YPbxi3Dwsw5VvxIbCC.jpg','https://image.tmdb.org/t/p/original/54ivU8Mua9p6dkMPVhZM5NrCAOA.jpg','0000-00-00'),
	(97546,'Ted Lasso',NULL,NULL,'Serie','Un ingenuo entrenador de fútbol americano (Jason Sudeikis) decide probar suerte en un club de fútbol inglés, pero su inexperiencia despierta recelo y desdén entre jugadores y aficionados. ¿Logrará conquistarlos con sus peculiares métodos?','https://image.tmdb.org/t/p/500w/wImNeqxKsqmJ5OBw8j3I37GNFN3.jpg','https://image.tmdb.org/t/p/original/39rtdG2QoPIOISmS6KNdJDes8vy.jpg','0000-00-00'),
	(97754,'Young Rock',NULL,NULL,'Serie','Mientras Dwayne Johnson se postula para presidente en 2032, echa una mirada cómica a su extraordinaria vida a través de las escandalosas historias de su familia y su juventud que lo convirtieron en el hombre que es hoy. Explora sus años de infancia viviendo en medio de influyentes íconos de la lucha libre mientras su padre saltó a la fama en el negocio, sus rebeldes años de adolescencia asistiendo a la escuela secundaria en Pensilvania y sus años de fútbol junto con jugadores poderosos en la Universidad de Miami. En su relato, Johnson explica que si bien sus experiencias han sido más grandes que la vida, sigue siendo un tipo con los pies en la tierra que todavía se relaciona con el pueblo estadounidense.','https://image.tmdb.org/t/p/500w/dI4BnzgBj05mm61qWU4cpPSU1D3.jpg','https://image.tmdb.org/t/p/original/hUmSMg5KHJkgeOk9AvbTINYOuEf.jpg','0000-00-00'),
	(98986,'Uzaki-chan Wants to Hang Out!',NULL,NULL,'Serie','El único deseo de Sakurai Shinichi es un poco de paz y tranquilidad. Pero Uzaki Hana, su animada y bien dotada compañera de instituto, tiene otros planes. Todo lo que ella quiere es pasar el rato y gastarle bromas. Con la ayuda de su encanto y su persistencia, ¡este podría ser el comienzo de una hermosa relación!','https://image.tmdb.org/t/p/500w/pTz974Rlwcaqos8Y4KKDIa7Kol1.jpg','https://image.tmdb.org/t/p/original/ynGX83rPx9yQkzqwSEnaNbyf5uV.jpg','0000-00-00'),
	(99053,'Médicos, línea de vida',NULL,NULL,'Serie','El Instituto de Especialidades Médicas es uno de los hospitales más prestigiosos, y ocupados, que tiene el país, por la cantidad de urgencias que atiende y porque también alberga a las mentes más experimentadas de cada una de las ramas de la medicina. La historia comienza cuando durante una gran emergencia, el Doctor Lara, director del Instituto, niega la admisión de un paciente. Esta decisión es el inicio de una serie de acontecimientos fatídicos, pues el paciente fallece y uno de sus familiares decide vengarse del director Ante la necesidad de un nuevo director, el mejor candidato es el Doctor Gonzalo Olmedo, un reconocido Neurocirujano que ha dedicado su vida a brindar salud y tratamientos a la gente que lo necesita. El nombramiento de Gonzalo no es del agrado del Doctor René Castillo, el Director Administrativo del Instituto, pues él solía sacar ventaja personal a través de negocios turbios con proveedores y laboratorios, entre otros actos de corrupción. En cuanto Gonzalo toma la ','https://image.tmdb.org/t/p/500w/rdbobph13U9CHSgcnwbCiv1a89O.jpg','https://image.tmdb.org/t/p/original/zH5Qx1etw2b61zoQkQ1egMGlIfO.jpg','0000-00-00'),
