	(102903,'Control Z',NULL,NULL,'Serie','Sofía, una chica asocial pero observadora, intenta descubrir quién es el hacker que está aireando los secretos de los alumnos por toda la escuela.','https://image.tmdb.org/t/p/500w/mPZkTtOlZp1IB43zTSPYLfrU0J3.jpg','https://image.tmdb.org/t/p/original/fl6S0hvaYvFeRYGniMm9KzNg3AN.jpg','0000-00-00'),
	(102966,'100 días para enamorarnos',NULL,NULL,'Serie','Cuando Connie se harta de que su marido la ignore y nunca haga nada en casa, acuerdan separarse 100 días para ver si así surge de nuevo la chispa entre ellos.','https://image.tmdb.org/t/p/500w/xVt9ADgKoJMzQ7eVXiFYMbXU85E.jpg','https://image.tmdb.org/t/p/original/r13t1ohRQAlZpsjxgTKY7ypkWPc.jpg','0000-00-00'),
	(103157,'The Hidden Dungeon Only I Can Enter',NULL,NULL,'Serie','La Mazmorra Oculta es un lugar legendario repleto de tesoros y objetos muy poco comunes. Nor, el tercer hijo de una ahora en decencia familia noble y que ha perdido el único trabajo que tenía, tiene la suerte de escuchar hablar de esta mazmorra. Es entonces cuando adquiere una habilidad que le permite crear, usar y editar habilidades... y para poder usarla debe acumular puntos cumpliendo tareas como comer cosas deliciosas o dedicarse a hacer cosas eróticas a miembros del sexo opuesto.','https://image.tmdb.org/t/p/500w/3g7XI4IuwGiXipyBbreJDpc0fwN.jpg','https://image.tmdb.org/t/p/original/58YKpuGSk8hj4cmThJpUT8Vt1mG.jpg','0000-00-00'),
	(103768,'Sweet Tooth: El niño ciervo',NULL,NULL,'Serie','Un cataclismo ha devastado el mundo. Gus, mitad chico y mitad ciervo, se une a una variopinta familia de niños híbridos como él para buscar respuestas a lo ocurrido.','https://image.tmdb.org/t/p/500w/y0zAjgCghA8XXMk5O7rIJMybXBt.jpg','https://image.tmdb.org/t/p/original/a7FioKNA7z0Dl1EMn14bxCyUUpp.jpg','0000-00-00'),
	(103962,'Megami-ryou no Ryoubo-kun',NULL,NULL,'Serie','Kōshi Nagumo, un niño de 12 años se encuentra sin hogar, sin dinero y sin familiares que lo cuiden. Mientras yace en la calle, lo recogen para convertirse en la “cuidadora” de un dormitorio lleno de estudiantes universitarias con problemas. Rodeada de mujeres mayores y complicadas, Kōshi comienza una “nueva vida con algo de ecchi”.','https://image.tmdb.org/t/p/500w/m8b8pxZVIMu13E6GEX0ySlXJegl.jpg','https://image.tmdb.org/t/p/original/tB4Fd8D8GT7dGFKckPSpa5KEhKa.jpg','0000-00-00'),
	(104157,'Katla',NULL,NULL,'Serie','Un año después de la erupción de un volcán subglacial, misteriosos elementos prehistóricos emergen del hielo derretido, lo que acarrea consecuencias imprevistas.','https://image.tmdb.org/t/p/500w/mF25LlPgSek0Wgv6NUKSlzLLQBQ.jpg','https://image.tmdb.org/t/p/original/vRPDQP51i1Z2RuoIQaxVSj7Pd5R.jpg','0000-00-00'),
	(104699,'Shaman King',NULL,NULL,'Serie','Yoh Asakura es un Shaman. Su talento natural le permite hablar con espíritus y valerse de su ayuda para lograr sus objetivos. Con su novia, Anna, Yoh entrena para el próximo evento deportivo Shaman: Shaman Fight en Tokyo. Un torneo que se hace cada 500 años y define al Shaman King que definirá a su antojo el futuro de la humanidad y tendrá contacto con el Gran Espíritu. Lo malo para Yoh es que todos y cada uno de los Shamans del planeta quieren el mismo premio.','https://image.tmdb.org/t/p/500w/sAaGHo7ww5QMw6lk1ZWYrSPcgI7.jpg','https://image.tmdb.org/t/p/original/5O1ovLYTkJvisM6d8PgbKq0nQGO.jpg','0000-00-00'),
	(104711,'Edens Zero',NULL,NULL,'Serie','A bordo de Edens Zero, un chico solitario con el poder de controlar la gravedad se embarca en una aventura para encontrar a una legendaria diosa espacial.','https://image.tmdb.org/t/p/500w/fPEozMHi64rDQUMJFtojBcCvbrm.jpg','https://image.tmdb.org/t/p/original/zwj3sFZksoFsKqYPMmqGB95H3XJ.jpg','0000-00-00'),
	(104877,'Love is in the air',NULL,NULL,'Serie','Concentrando todas las esperanzas de su vida en su educación, Eda se encuentra cara a cara con Serkan Bolat, el prestigioso arquitecto que le retiró su beca de estudios en el extranjero y la llevó a abandonar la universidad. Serkan Bolat se ofrece a devolverle la beca a Eda si finge estar comprometida con él durante dos meses.\n\nEda en principio rechaza la oferta de este hombre al que odia, pero cuando las circunstancias cambian, tiene que aceptarla. Mientras fingen estar comprometidos, Serkan y Eda comienzan a tener una relación apasionada y desafiante que les hará olvidar todo lo que saben. Porque el amor es duro. Y por eso es asombroso.','https://image.tmdb.org/t/p/500w/sVmEr2z1kD2H5lhi4G9qQoVLLsD.jpg','https://image.tmdb.org/t/p/original/zTjNzf2Ad5nFTzJ4zWI6jWaCDqH.jpg','0000-00-00');
INSERT INTO `multimedia` (`id`, `titulo`, `nota`, `clasificacion`, `tipo`, `sinopsis`, `imagen`, `imagenPortada`, `estreno`)
VALUES
	(105009,'Tokyo Revengers',NULL,NULL,'Serie','Takemichi es un desempleado de 26 años que descubre que la chica con la que salió en secundaria, la que fue su única novia, ha muerto. Tras eso sufre un accidente del cual, al despertar, descubre que se ha transportado a sus años de secundaria. Con ello Takemichi jura que cambiará el futuro y salvará a la chica, y para hacerlo necesita llegar a ser el líder de la banda de delincuentes más salvaje y brutal de Kanto.','https://image.tmdb.org/t/p/500w/1VZ8gN6tPoAd7EdfCzVPmtDczhD.jpg','https://image.tmdb.org/t/p/original/kzDHRAkFjeed0lJpjE1eKJDcowS.jpg','0000-00-00'),
	(105214,'Oscuro deseo',NULL,NULL,'Serie','Alma, una mujer casada, vive una escapada de fin de semana que enciende una pasión, desencadena una desgracia y la hace dudar de su círculo más íntimo.','https://image.tmdb.org/t/p/500w/vmVeGFUTXEKwAUpFH9bZwow9zIk.jpg','https://image.tmdb.org/t/p/original/kz1Yca2m8tfCJxfj4gTfrwEOgte.jpg','0000-00-00'),
	(105476,'Meikyuu Black Company',NULL,NULL,'Serie','Kinji Ninomiya nunca trabajó un día en su vida hasta que fue transportado a un mundo de fantasía donde se ve obligado a trabajar en las minas de cristal.','https://image.tmdb.org/t/p/500w/ze7zvs2SVCbE2e5NpaNzSnfqAYo.jpg','https://image.tmdb.org/t/p/original/coAkyVOGFTTkNQeUilbzNP57nGP.jpg','0000-00-00'),
	(105971,'La Remesa Mala',NULL,NULL,'Serie','Sigue a los Clones experimentales y de élite de Bad Batch mientras encuentran su camino en una galaxia que cambia rápidamente después de las Guerras Clon.','https://image.tmdb.org/t/p/500w/sjxtIUCWR74yPPcZFfTsToepfWm.jpg','https://image.tmdb.org/t/p/original/fdgGfu6A3T8wMFrzzJgqI99J2Pu.jpg','0000-00-00'),
	(106480,'Fena: Pirate Princess',NULL,NULL,'Serie','La historia se centra en Fena Houtman, una huérfana que creció en una isla donde no hay esperanza de convertirse en otra cosa que un objeto, utilizado y descartado por los soldados del Imperio Británico. Sin embargo, Fena es mucho más que una esclava indefensa. Es por eso que, cuando resurge su pasado, decide romper las cadenas de sus opresores para lograr sus objetivos: forjar una nueva identidad, sin esclavitud y buscar un lugar donde pueda pertenecer verdaderamente y descubrir los verdaderos misterios detrás la palabra \"Edén\".','https://image.tmdb.org/t/p/500w/xBYfKcbDY0NktGn9f7QW8qaV96g.jpg','https://image.tmdb.org/t/p/original/4YdYbOSVMdTgJno7Y7wsY3hDWJm.jpg','0000-00-00'),
	(107001,'Heion Sedai no Idaten-tachi',NULL,NULL,'Serie','Hace 800 años, los dioses después de una lucha feroz y muchos sacrificios finalmente lograron librar al mundo de los demonios. Dado que el mundo está relativamente tranquilo a pesar de las pequeñas guerras entre humanos, seguimos las peregrinaciones de Hayato, un joven dios de 80 años, y sus amigos en todo el mundo para evitar el regreso de demonios.','https://image.tmdb.org/t/p/500w/p0F2nVd9oLZQnZrP2bswqOI6NCp.jpg','https://image.tmdb.org/t/p/original/jTm4BaPKoMw9vALgHREtP2qKLcA.jpg','0000-00-00'),
	(107124,'Animaniacs',NULL,NULL,'Serie','Los hermanos Warner, Yakko y Wakko, y Dot, se lo pasan genial causando estragos y caos en las vidas de todos los que conocen. Después de regresar a su amada casa, Warner Bros. Water Tower, los Animaniacs no pierden tiempo en causar caos y confusión cómica mientras corren sueltos por el estudio y más allá, convirtiendo el mundo en su patio de recreo personal. Junto a Yakko, Wakko y Dot, los personajes favoritos de los fans, Pinky and the Brain, también regresarán para continuar su búsqueda de la dominación mundial.','https://image.tmdb.org/t/p/500w/dcdPgvIlOh7PAPuuVlbEmVwld2v.jpg','https://image.tmdb.org/t/p/original/bYHu47S3yBPbWvlh4YbIYJ5e8X1.jpg','0000-00-00'),
	(110070,'Horimiya',NULL,NULL,'Serie','Kyouko es una alumna modélica y popular que al llegar a casa se convierte en una chica hogareña muy discreta. Miyamura, su compañero de clase, es un tipo del montón con cierto aire de friki que en sus ratos libres se transforma en un chico muy atractivo con piercings y mucho estilo. ¿Qué ocurriría si Izumi y Kyouko descubrieran la cara oculta el uno del otro?','https://image.tmdb.org/t/p/500w/4u64tHtUkna1y4OkJcrXLEhhLLy.jpg','https://image.tmdb.org/t/p/original/utZ3U6VihNIUd5u7DFCy1hCkoKU.jpg','0000-00-00'),
	(112162,'Pacific Rim: Tierra de nadie',NULL,NULL,'Serie','Hubo un tiempo en que los kaijus emergieron de la Cuenca del Pacífico para enfrentarse a los jaegers, unos robots gigantescos diseñados para contraatacar. Eso ocurrió hace tiempo. Ahora, Australia está arrasada, y todo el continente ha sido evacuado. Atrás han quedado dos hermanos adolescentes, Taylor y Hayle, que con un destartalado jaeger buscan a sus padres y luchan por su supervivencia.','https://image.tmdb.org/t/p/500w/o56X5GUWgzkGJ90QDWn6NNkGEN7.jpg','https://image.tmdb.org/t/p/original/s3mOpPwrcKCPVkSWGqEwOah4jdX.jpg','0000-00-00'),
	(112616,'Night Head 2041',NULL,NULL,'Serie','Dos hermanos han estado encarcelados en una instalación científica de máxima seguridad durante los últimos quince años debido a sus habilidades paranormales. Sin embargo, ahora han escapado y se dirigen a la ciudad más cercana en donde conocerán la terrible realidad del mundo exterior.','https://image.tmdb.org/t/p/500w/1E1n0ZMsgvGHBnMLggaZCe7IVrR.jpg','https://image.tmdb.org/t/p/original/mJ7t9wyD43H32E9Sv22mMrVmkLo.jpg','0000-00-00'),
	(112888,'Belleza Verdadera',NULL,NULL,'Serie','Im Joo-Kyeong es un estudiante de secundaria. Desde que era pequeña, ha tenido un complejo sobre su apariencia. Para ocultar su rostro desnudo, Im Joo-Kyeong siempre usa maquillaje. Sus excelentes dotes de maquillaje la hacen bonita y oculta su rostro desnudo frente a los demás. Ella se involucra con 2 hombres; Lee Soo-Ho y Han Seo-Joon.','https://image.tmdb.org/t/p/500w/31N42LhrxltHtS1bHYfZghjPDNB.jpg','https://image.tmdb.org/t/p/original/gaCOvKGG2qEnsijNHEAigYcQ1U3.jpg','0000-00-00'),
	(112940,'Deatte 5-byou de Battle',NULL,NULL,'Serie','Personas aleatorias de todo el mundo son secuestradas y reciben una \"habilidad especial\", y luego son forzadas a participar en algún tipo de \"experimento\" retorcido. Lo que se encuentra al final de este experimento no está claro, como lo que sucederá con aquellos que \"fallen\".','https://image.tmdb.org/t/p/500w/xOi6lRbJh3fBFur8QuxTyGzOqiH.jpg','https://image.tmdb.org/t/p/original/h0xPgHz0EM24PNBB15g5aCLxSFf.jpg','0000-00-00'),
	(113036,'American Horror Stories',NULL,NULL,'Serie','Una serie de antología de episodios independientes que profundizan en los mitos, leyendas y tradiciones del terror.','https://image.tmdb.org/t/p/500w/r2ogqivZ9dwpU4ya7EKHA9kMcrL.jpg','https://image.tmdb.org/t/p/original/jLhQ6P95ENHafPNisx0kQuNYCfO.jpg','0000-00-00'),
	(113137,'Kanojo mo Kanojo',NULL,NULL,'Serie','Naoya, es un estudiante de primer año de preparatoria que luego de declarársele a Saki, el amor de su vida, consigue al fin que sea su novia. En el pináculo de su felicidad, Naoya es llamado por otra hermosa chica, Nagisa. Quien repentinamente le insiste a Naoya que salga con ella, declarándole su amor. ¡La gran personalidad y gentileza de Nagisa hacen dudar a Naoya, quien se ve forzado a tomar una decisión!','https://image.tmdb.org/t/p/500w/fmdDkTWvjrCYyOD9Xgqc3AbQcZr.jpg','https://image.tmdb.org/t/p/original/hVxmYEeWkVwJLTHV1nN7oU4UGjm.jpg','0000-00-00'),
	(113622,'Sísifo',NULL,NULL,'Serie','Un inexplicable incidente lleva a un genio de la ingeniería a descubrir peligrosos secretos del mundo y embarcarse en un viaje junto con una mujer del futuro.','https://image.tmdb.org/t/p/500w/mnCFpbPXSoJVqOJ4t0ShwCrFTCE.jpg','https://image.tmdb.org/t/p/original/yzN80xtaDGjsmyBfKcs3IjF7Frp.jpg','0000-00-00'),
	(114503,'Socios y Sabuesos',NULL,NULL,'Serie','La vida del joven y meticuloso agente judicial Scott Turner se pone patas arriba cuando hereda a Hooch, un perro baboso y desobediente. Su nueva mascota le hace la vida imposible, pero tiene una habilidad especial para ayudarle a atrapar criminales y a encontrar el amor. Incluso puede que le ayude a resolver el misterio del último caso de su padre.','https://image.tmdb.org/t/p/500w/gMNDllBAxn3SuW12qZU0tIZaeY3.jpg','https://image.tmdb.org/t/p/original/vaqEb62ktPjy6PQwbcXkBLcsy1O.jpg','0000-00-00'),
	(114695,'Leyendas de Marvel Studios',NULL,NULL,'Serie','Vuelve a visitar a los héroes, villanos y momentos épicos de todo el MCU en preparación para las historias que aún están por venir. Cada segmento dinámico se alimenta directamente de la próxima serie, lo que prepara el escenario para eventos futuros. Esta serie entrelaza los muchos hilos que constituyen el incomparable Universo Cinematográfico de Marvel.','https://image.tmdb.org/t/p/500w/wAEWZm2pSopAbqE5dQWE0ET8aR5.jpg','https://image.tmdb.org/t/p/original/apFUonh1wVE3LWxbAjJC2zJqZOC.jpg','0000-00-00'),
	(114868,'Record of Ragnarok',NULL,NULL,'Serie','Los humanos mortales deben vencer a los dioses todopoderosos en siete rondas... o su existencia terminará para siempre. ¡Que comiencen las batallas de Ragnarok!','https://image.tmdb.org/t/p/500w/iq5L971DFW1SwLJdvl7OpPI1QeZ.jpg','https://image.tmdb.org/t/p/original/ygE1AEV6pXFuCzbjS9ts59LxDm5.jpg','0000-00-00'),
	(115004,'Mare of Easttown',NULL,NULL,'Serie','Una detective de un pequeño pueblo de Pensilvania investiga un asesinato local mientras trata de evitar que su vida se desmorone.','https://image.tmdb.org/t/p/500w/whWHhs6p1YVMKDsH9yuvF2KR64d.jpg','https://image.tmdb.org/t/p/original/6ZutgKZZfCstXKm3hifLHWz9cWf.jpg','0000-00-00'),
	(115857,'Madre solo hay dos',NULL,NULL,'Serie','Después de darse cuenta de que sus bebés fueron intercambiados al nacer, dos mujeres desarrollan un plan para adaptarse a sus nuevas vidas, creando una familia única y peculiar.','https://image.tmdb.org/t/p/500w/eAZtz2ydxBaHtJw3J42Gdy2DSpc.jpg','https://image.tmdb.org/t/p/original/9MjMifYYvufMe7BOrp7j4hUytfH.jpg','0000-00-00'),
	(116386,'Doom at Your Service',NULL,NULL,'Serie','Dong Kyung ha estado trabajando duro desde que sus padres fallecieron. Su vida parece estabilizarse tras trabajar como editora de novelas web durante 6 años, pero un día le diagnostican un cáncer cerebral. Ella culpa a su desafortunada vida y desea maldecir todo para que desaparezca, lo que involuntariamente hace aparecer a Myul Mang, un mensajero entre los humanos y los dioses. Él dice que puede concederle sus deseos. Como última esperanza, hace un contrato con Myul Mang por cien días para vivir como ella quiera, arriesgándolo todo.','https://image.tmdb.org/t/p/500w/mSTVrQNrnAdmXbRN0j7Et5U1eU2.jpg','https://image.tmdb.org/t/p/original/9szerhScQy1QVNgkTmAwsF62nGo.jpg','0000-00-00'),
	(116479,'Anupama',NULL,NULL,'Serie','Anupama tuvo que sacrificar mucho para convertirse en una esposa, nuera y madre ideales. Después de una amarga comprensión, se propone vivir en sus propios términos.','https://image.tmdb.org/t/p/500w/2748H9LoK2oQd9L7ofze8VjCGhS.jpg','https://image.tmdb.org/t/p/original/9R4Qtm01pNh0CzdoIyvHKefe5RL.jpg','0000-00-00'),
	(116724,'Shiroi Suna no Aquatope',NULL,NULL,'Serie','El historia tiene lugar en el acuario Gama Gama, un pequeño acuario en Okinawa, a una hora en autobús de Naha. Kukuru Misakino es una estudiante de secundaria de 18 años que trabaja allí y conoce el \"secreto\" del acuario: a veces puedes ver cosas misteriosas. Un día, Kukuru se encuentra con Fuuka, parada frente a un tanque de agua con el pelo suelto y una lágrima rodando por su mejilla. Fuuka ha renunciado a su sueño de convertirse en idol y se ha escapado de Tokio a Okinawa. Queriendo encontrar un lugar al que pertenecer, Fuuka pide seriamente trabajar en el acuario. El anime sigue a Kukuru y Fuuka mientras lidian con los problemas del secreto del acuario y una crisis inminente de su posible cierre.','https://image.tmdb.org/t/p/500w/5ryyuEncPn7hBW4YvTT9EZ4KWSG.jpg','https://image.tmdb.org/t/p/original/zVyLvchDYj1gYkAH7y1SRS0Ko30.jpg','0000-00-00'),
	(116944,'La delgada línea azul',NULL,NULL,'Serie','Serie dramática sueca sobre agentes de policía en Malmö, su trabajo agotador y las dificultades para mantener separada su vida personal y profesional.','https://image.tmdb.org/t/p/500w/x7EugVeJxVDdVMZKXXNeCW8kuDM.jpg','https://image.tmdb.org/t/p/original/k6sI2DNyo8Nxbv7qmBZ2N6CyeG6.jpg','0000-00-00'),
	(117023,'Sky Rojo',NULL,NULL,'Serie','Tras un desgraciado giro del destino, tres mujeres atormentadas por el pasado huyen de un burdel y arriesgan la vida para escapar de un proxeneta y sus secuaces.','https://image.tmdb.org/t/p/500w/eindfDG2l77gBGqaspGvzn8DOTF.jpg','https://image.tmdb.org/t/p/original/uTFX9V2dct1nKjG6zhNiThPm8Tp.jpg','0000-00-00'),
	(117581,'Ginny y Georgia',NULL,NULL,'Serie','La independiente Georgia y sus dos hijos, Ginny y Austin, se mudan al norte en busca de una nueva vida... pero descubren que empezar de cero puede ser complicado.','https://image.tmdb.org/t/p/500w/hVMoqvXs5j9ffun56tZ5YhliSD9.jpg','https://image.tmdb.org/t/p/original/e4aqizYQ8eeTGNZMq6WiFfqoZbz.jpg','0000-00-00'),
	(118541,'Tensura Nikki Tensei Shitara Slime Datta Ken',NULL,NULL,'Serie','La historia narra la vida diaria de Rimuru Tempest en compañía de sus amigos dentro de la Federación de Jura Tempest.','https://image.tmdb.org/t/p/500w/boeZP8zaXTDBkKPpdAojS6uYKdt.jpg','https://image.tmdb.org/t/p/original/llVoiS61Mw9h84rmzfpQs2GAKBl.jpg','0000-00-00'),
	(119181,'Physical',NULL,NULL,'Serie','Sheila Rubin es una ama de casa silenciosamente atormentada en el San Diego de los 80. Detrás de puertas cerradas, lucha contra demonios personales extremos y una voz interior viciosa. Pero las cosas cambian cuando descubre los aeróbicos, lo que inicia un viaje hacia el empoderamiento y el éxito.','https://image.tmdb.org/t/p/500w/g7dUj2TTXht4bQ4yxc9r5o0Yntq.jpg','https://image.tmdb.org/t/p/original/4QsIsQhU4l54wXiEHhezAg2FtkF.jpg','0000-00-00'),
	(119243,'iCarly',NULL,NULL,'Serie','Un grupo de mejores amigos creando un webcast mientras lidia con problemas y aventuras cotidianas.','https://image.tmdb.org/t/p/500w/thuQmpI9OZNEUTqkkNsNZVDsgNP.jpg','https://image.tmdb.org/t/p/original/s5k4GqTUGXeUdScNrjpYfiQLKHI.jpg','0000-00-00'),
	(119279,'Solos',NULL,NULL,'Serie','Serie antológica de siete partes que explora el significado más profundo de la conexión humana a través de la visión individual de sus protagonistas.','https://image.tmdb.org/t/p/500w/vVJUOPi13perEscPewGPAUXMujN.jpg','https://image.tmdb.org/t/p/original/szoC8f6wAXGmgn0aiSDroRx7Ngs.jpg','0000-00-00'),
	(120168,'¿Quién mató a Sara?',NULL,NULL,'Serie','Tras 18 años de encarcelamiento injusto, Alex Guzmán es liberado con el plan perfecto para descubrir quién mató a su hermana Sara y por qué la familia Lazcano lo culpó del crimen. Lo que no sabe, es que la búsqueda de pruebas lo llevará por un desvío mucho más peligroso de lo que imaginaba. Cuando finalmente se enfrente al verdadero culpable, Alex deseará no haber buscado su venganza.','https://image.tmdb.org/t/p/500w/dYvIUzdh6TUv4IFRq8UBkX7bNNu.jpg','https://image.tmdb.org/t/p/original/hG1wscoTZO59gQ0jqWtYYZGQQ7l.jpg','0000-00-00'),
	(120968,'D_Cide Traumerei the Animation',NULL,NULL,'Serie','La historia tiene lugar en Shibuya y se centra en Ryuuhei Oda. De niño, admiraba a su hermano mayor a quien vio morir ante sus ojos en un misterioso incidente. Ahora es un alegre estudiante de secundaria que no muestra signos externos del accidente y pasa la mayor parte de su tiempo libre practicando kick boxing. Un día, mientras práctica su arte marcial, es mordido por una criatura llamada Tris, lo que lo sumerge en un extraño sueño.','https://image.tmdb.org/t/p/500w/d6gnJNnev8Wop9388tD2vvylFLT.jpg','https://image.tmdb.org/t/p/original/z5BEjsn820bDzwQz8lPThCHAHkq.jpg','0000-00-00'),
	(123446,'Jahy-Sama Wa Kujikenai!',NULL,NULL,'Serie','Jahy-sama es una existencia que se debe temer y respetar en todo el Reino Demoníaco. Bueno, era la segunda más fuerte del reino. Ahora está ocupada con las tareas de la casa y el trabajo ... ¡En el reino humano! Su cena es solo brotes de fréjol, todo por culpa de una chica mágica, ¡Pero no se desanimará!','https://image.tmdb.org/t/p/500w/clsLGcG4OWy1FMywOS0yUXWLWVE.jpg','https://image.tmdb.org/t/p/original/mKFbCRdGz0JF3uc2CFGlqeq1qVz.jpg','0000-00-00'),
	(124124,'Café con aroma de mujer',NULL,NULL,'Serie','Como todos los años, Gaviota y su mamá llegan a la Hacienda Casablanca a recoger el café de la segunda cosecha del año, pero este octubre tienen esperanza de que sea el último, pues a partir de ahora serán dueñas de su propia tierra. Sin embargo, el destino tiene otros planes.','https://image.tmdb.org/t/p/500w/nlor5UKEkOuARd6YcltbeVyOgUz.jpg','https://image.tmdb.org/t/p/original/ztyJqTdS7RApGgl6ZXmFdGZX3g0.jpg','0000-00-00'),
	(124396,'Sonny Boy',NULL,NULL,'Serie','El 16 de agosto, a mitad de las que parecen unas interminables vacaciones de verano, el estudiante de tercero de secundaria Nagara, la misteriosa nueva estudiante Nozomi y compañeros de clase como Mizuho o Asakaze, son repentinamente transportados de sus vidas cotidianas a una escuela perdida en una dimensión alterna. Allí deben sobrevivir con los superpoderes que han despertado en su interior.','https://image.tmdb.org/t/p/500w/smj3Qr0ubJfAchgDRTDT1r2nPZo.jpg','https://image.tmdb.org/t/p/original/wjTSU1Kb30CdcARpJC3uMKhYXLy.jpg','0000-00-00'),
	(124416,'Hit & Run',NULL,NULL,'Serie','En busca de la verdad sobre la muerte de su esposa, un hombre se ve atrapado en una peligrosa red de secretos que se extienden desde Nueva York hasta Tel Aviv.','https://image.tmdb.org/t/p/500w/1yvyMxmnZq9zrYSwpcBfNd6AdEZ.jpg','https://image.tmdb.org/t/p/original/6qiKrLdGQRUp2vgmkpOR3fwmzA.jpg','0000-00-00'),
	(126120,'La muchacha que limpia',NULL,NULL,'Serie','Rosa necesita juntar una importante suma de dinero para operar a su hijo en el extranjero, por ello mantiene dos trabajos: uno en una fábrica de químicos y otro como personal de limpieza en la casa de los Valladares, una de las familias más ricas de la ciudad. Será este empleo el que la ponga en el lugar y momento equivocado, dejándola atrapada en un mundo sórdido, oscuro y peligroso.','https://image.tmdb.org/t/p/500w/cmwfwN6QnYybL7z0sS3eamZPIrf.jpg','https://image.tmdb.org/t/p/original/caHPX2aaWTzhcvjO877IO4c2yer.jpg','0000-00-00'),
	(126280,'Sexo/Vida',NULL,NULL,'Serie','El atrevido pasado sexual de una mujer choca con su presente de casada con hijos cuando el ex chico malo con el que no puede dejar de fantasear vuelve a entrar en su vida.','https://image.tmdb.org/t/p/500w/9nBVkNBe4x9HKDAzxjxlIqecxCW.jpg','https://image.tmdb.org/t/p/original/7xKl8dPErKtu3wY41dWPnF2IhmC.jpg','0000-00-00'),
	(126386,'Somos.',NULL,NULL,'Serie','La vida de los habitantes del pueblo de Allende queda a merced de un poderoso cartel, y la tragedia no tarda en llegar. Inspirada en hechos reales no contados antes.','https://image.tmdb.org/t/p/500w/8GjdLwzbfr5fnIvXAZHe11fcIJO.jpg','https://image.tmdb.org/t/p/original/opHopqkLzkftwUl4jTLcwckjuu.jpg','0000-00-00'),
	(126525,'Élite historias breves: Carla Samuel',NULL,NULL,'Serie','Con un gran gesto romántico en el aeropuerto, Samuel intenta convencer a Carla de que no se vaya a Londres.','https://image.tmdb.org/t/p/500w/lucFMV4qxvpsti5xnN6paUxCbAn.jpg','https://image.tmdb.org/t/p/original/xTcID7kgEa932O0BBqsJxRO67za.jpg','0000-00-00'),
	(127571,'Guerra de vecinos',NULL,NULL,'Serie','Cuando dos familias antagónicas terminan viviendo al lado en un vecindario elegante, las matriarcas provocan una guerra a gran escala de consecuencias no deseadas.','https://image.tmdb.org/t/p/500w/pdhFFkr0GJxKkV7TWisnDKRpsPF.jpg','https://image.tmdb.org/t/p/original/kSYqh4RqhFKDSH8ER6SMxykSN96.jpg','0000-00-00'),
	(127635,'Spidey y su superequipo',NULL,NULL,'Serie','Sigue a Peter Parker, Gwen Stacy y Miles Morales y sus aventuras mientras los jóvenes héroes se unen a Hulk, Ms. Marvel y Black Panther para derrotar a enemigos como Rhino, Doc Ock y Green Goblin y aprender..','https://image.tmdb.org/t/p/500w/dZH60ElHGGdMUbSDstDqGlTz6dV.jpg','https://image.tmdb.org/t/p/original/dA4S18rnLx4sWW8agmLLKUvRM7n.jpg','0000-00-00'),
	(127651,'The Witch\'s Diner',NULL,NULL,'Serie','Hee-ra es la dueña del Witch\'s Diner, donde el empleado Jin y el interno Gil-yong trabajan con ella. Los invitados son bienvenidos al Witch\'s Diner, donde venden sus almas para que sus deseos se hagan realidad.','https://image.tmdb.org/t/p/500w/8yPn4zKVLaDmrvbi6NQG1044iXB.jpg','https://image.tmdb.org/t/p/original/jTGLM3RLXuDy99rgJMwLyMLVRqT.jpg','0000-00-00'),
	(128009,'CHIVAS: El Rebaño Sagrado',NULL,NULL,'Serie','Serie documental que narra el presente del equipo Chivas de Guadalajara de la liga mexicana de fútbol.','https://image.tmdb.org/t/p/500w/tt4kGLa1PX3mB8TcbnN8PXHQXt1.jpg','https://image.tmdb.org/t/p/original/zUSCkkPFC1gc79UdUSz6ZA1zUbH.jpg','0000-00-00'),
	(128250,'Sexy a lo bestia',NULL,NULL,'Serie','Hartos de superficialidades, estos solteros esconden su aspecto real bajo capas de maquillaje y prótesis para poner a prueba la química en una cita genuinamente a ciegas.','https://image.tmdb.org/t/p/500w/sNCRv1Loqt2u7FLpahcxBFGoH8R.jpg','https://image.tmdb.org/t/p/original/d6PnWnOAh5279AWu1cQjlVleVwi.jpg','0000-00-00'),
	(128252,'El cartel de los sapos: El origen',NULL,NULL,'Serie','A lo largo de cuatro décadas, dos hermanos de Cali que compaginan la familia con las relaciones y los negocios ilícitos pasan de ser unos niños pobres a capos de la coca.','https://image.tmdb.org/t/p/500w/aGULNElJVpSru19WP2pUjopPX1U.jpg','https://image.tmdb.org/t/p/original/A17Rt6BLHno0puR1QXbsSKhBfA4.jpg','0000-00-00'),
	(129035,'The Walking Dead: Origins',NULL,NULL,'Serie','The Walking Dead: Origins es una serie de especiales que exploran los viajes de los personajes más famosos de la serie. Cada episodio traza la historia del apocalipsis zombi desde el punto de vista de un solo personaje y presenta nuevas entrevistas y narraciones de los actores que retratan a estos personajes icónicos, entretejidos con clips de los momentos más cruciales de sus viajes hasta ahora.','https://image.tmdb.org/t/p/500w/mFAiusk8yF0GeBK0xIcte4GdWWE.jpg','https://image.tmdb.org/t/p/original/6stEKYqgLBhSieTRnnZ5ShE5ZPS.jpg','0000-00-00'),
	(129203,'Los hijos de la familia Qiao',NULL,NULL,'Serie','Treinta años de alegrías y tristezas siguen a los cinco hijos de la familia Qiao. A pesar de su complicada historia, confían el uno en el otro durante los momentos difíciles para finalmente marcar el comienzo de un período de calidez y esperanza.','https://image.tmdb.org/t/p/500w/zN8vBX1jDRxIDqFQ2ARcodTHhdt.jpg','https://image.tmdb.org/t/p/original/dLUJGSrFWA1h3pnAqygAHK7ShVb.jpg','0000-00-00'),
	(159211,'The Haunting of Helena',NULL,NULL,'Pelicula','Tras su divorcio, Sophia decide trasladarse a Latina, al sur de Italia, junto con la pequeña Helena. La nueva casa está situada en un edificio austero de la era fascista, y oculta un misterioso armario de oscuros secretos. Después de la pérdida del primer diente de leche de Helena, empieza la pesadilla. Helena se ha obsesionado con el hada de los dientes y su madre asiste impotente a los acontecimientos que cada vez van a peor.','https://image.tmdb.org/t/p/original/uEWCi9fc89m9qS5SNshlvxkSsLJ.jpg','https://image.tmdb.org/t/p/original/iB8rf8FYHGlrbmLybCo6Mpg8hNt.jpg','2013-01-14'),
	(299536,'Vengadores: Infinity War',NULL,NULL,'Pelicula','El todopoderoso Thanos ha despertado con la promesa de arrasar con todo a su paso, portando el Guantelete del Infinito, que le confiere un poder incalculable. Los únicos capaces de pararle los pies son los Vengadores y el resto de superhéroes de la galaxia, que deberán estar dispuestos a sacrificarlo todo por un bien mayor. Capitán América e Ironman deberán limar sus diferencias, Black Panther apoyará con sus tropas desde Wakanda, Thor y los Guardianes de la Galaxia e incluso Spider-Man se unirán antes de que los planes de devastación y ruina pongan fin al universo. ¿Serán capaces de frenar el avance del titán del caos?','https://image.tmdb.org/t/p/original/lmZFxXgJE3vgrciwuDib0N8CfQo.jpg','https://image.tmdb.org/t/p/original/rDLmMzkaFMFWF1UnnlboMfifVXM.jpg','2018-04-25'),
	(315635,'Spider-Man: Homecoming',NULL,NULL,'Pelicula','Peter Parker comienza a experimentar su recién descubierta identidad como el superhéroe Spider-Man. Después de la experiencia vivida con los Vengadores, Peter regresa a casa, donde vive con su tía. Bajo la atenta mirada de su mentor Tony Stark, Peter intenta mantener una vida normal como cualquier joven de su edad, pero interrumpe en su rutina diaria el nuevo villano Vulture y, con él, lo más importante de la vida de Peter comenzará a verse amenazado.','https://image.tmdb.org/t/p/original/tTlAA0REGPXSZPBfWyTW9ipIv1I.jpg','https://image.tmdb.org/t/p/original/yJfPC6pjSJ5VOsVyXhx5PXBe0mR.jpg','2017-07-05'),
	(335983,'Venom',NULL,NULL,'Pelicula','Eddie Brock (Tom Hardy) es un consolidado periodista y astuto reportero que está investigando una empresa llamada Fundación Vida. Esta fundación, dirigida por el eminente científico Carlton Drake (Riz Ahmed), está ejecutando secretamente experimentos ilegales en seres humanos y realizando pruebas que involucran formas de vida extraterrestres y amorfas conocidas como simbiontes. Durante una visita furtiva a la central, el periodista quedará infectado por un simbionte. Comenzará entonces a experimentar cambios en su cuerpo que no entiende, y escuchará una voz interior, la del simbionte Venom, que le dirá lo que tiene que hacer. Cuando Brock adquiera los poderes del simbionte que le usa como huésped, Venom tomará posesión de su cuerpo, convirtiéndole en un despiadado y peligroso súpervillano.','https://image.tmdb.org/t/p/original/VuukZLgaCrho2Ar8Scl9HtV3yD.jpg','https://image.tmdb.org/t/p/original/jMBTJQiHAyGlZR05J2sq5coA6ew.jpg','2018-09-28'),
	(337404,'Cruella',NULL,NULL,'Pelicula','Ambientada en el Londres de los años 70, en plena revolución del punk rock, muestra a una joven estafadora llamada Estella, una chica inteligente y creativa, decidida a convertirse en una exitosa diseñadora de moda, que se asocia con un par de ladrones para sobrevivir en las calles de la capital británica. Pero cuando su talento para la moda llama la atención de la legendaria diseñadora, la Baronesa von Hellman, Estella cambia el rumbo de su vida hasta que una serie de acontecimientos y revelaciones que harán que Estella asuma su lado malvado y se convierta en la estridente, moderna y vengativa Cruella de Vil.','https://image.tmdb.org/t/p/original/6MKr3KgOLmzOP6MSuZERO41Lpkt.jpg','https://image.tmdb.org/t/p/original/5bsApWAUqb0jeXtHPjKQ6MZOtZJ.jpg','2021-05-26'),
	(379686,'Space Jam: nuevas leyendas',NULL,NULL,'Pelicula','Secuela de la cinta original de 1996, Space Jam, protagonizada por Michael Jordan. En esta segunda parte, la super estrella de la NBA es LeBron James, quien queda atrapado junto a su hijo Dom en un extraño lugar, un espacio digital de una fuerza todopoderosa y malvada conocida como A.I. Para volver a casa y poner a salvo a su hijo, el jugador de baloncesto deberá unir fuerzas con Bugs Bunny, Lola Bunny y el resto de personajes de los Looney Tunes para enfrentarse en un partido de baloncesto a los campeones digitalizados por inteligencia artificial.','https://image.tmdb.org/t/p/original/8s4h9friP6Ci3adRGahHARVd76E.jpg','https://image.tmdb.org/t/p/original/i6E8fx8lAEI0PGGCUlaA2Ap1gWi.jpg','2021-07-08'),
	(384018,'Fast & Furious: Hobbs & Shaw',NULL,NULL,'Pelicula','Desde que Hobbs, agente del Servicio de Seguridad Diplomática de Estados Unidos, y el británico Shaw, proscrito sin ley, se enfrentaron por primera vez, solo han intercambiado bofetadas y malas palabras. Pero cuando las despiadadas acciones de Brixton, un anarquista cibergenéticamente mejorado, amenazan el futuro de la humanidad, ambos se unen para derrotarlo.','https://image.tmdb.org/t/p/original/qAhedRxRYWZAgZ8O8pHIl6QHdD7.jpg','https://image.tmdb.org/t/p/original/5REralbYRALUnTpICY3TBMyXYGW.jpg','2019-08-01'),
	(385128,'Fast & Furious 9',NULL,NULL,'Pelicula','Dom Toretto lleva una vida tranquila con Letty y su hijo, el pequeño Brian, pero saben que el peligro siempre acecha. Esta vez, esa amenaza obligará a Dom a enfrentarse a los pecados de su pasado si quiere salvar a quienes más quiere. El equipo se vuelve a reunir para impedir un complot a escala mundial, liderado por uno de los asesinos más peligrosos y mejor conductor a los que se han enfrentado; un hombre que además es el hermano desaparecido de Dom, Jakob. Novena entrega de la famosa franquicia.','https://image.tmdb.org/t/p/original/xXHZeb1yhJvnSHPzZDqee0zfMb6.jpg','https://image.tmdb.org/t/p/original/TX1T3c3CDBN0y8iDNvlQbtiA5Z.jpg','2021-05-19'),
	(399566,'Godzilla vs. Kong',NULL,NULL,'Pelicula','Godzilla y Kong, dos de las fuerzas más poderosas de un planeta habitado por todo tipo de aterradoras criaturas, se enfrentan en un espectacular combate que sacude los cimientos de la humanidad. Monarch (Kyle Chandler) se embarca en una misión de alto riesgo y pone rumbo hacia territorios inexplorados para descubrir los orígenes de estos dos titanes, en un último esfuerzo por tratar de salvar a dos bestias que parecen tener las horas contadas sobre la faz de la Tierra.','https://image.tmdb.org/t/p/original/inJjDhCjfhh3RtrJWBmmDqeuSYC.jpg','https://image.tmdb.org/t/p/original/yJTk4eqQd9Yo5REpFbTSOMkbSgn.jpg','2021-03-24'),
	(410113,'Una casa de locos: La película',NULL,NULL,'Pelicula','La aventura trata del viaje de la familia Loud a Escocia, donde descubren que son descendientes de la realeza escocesa. La familia se entrega rápidamente a la gran vida y descubre que el hogar de sus ancestros es un castillo.','https://image.tmdb.org/t/p/original/9p3bwHTpX5Axpyp4gxqmDxWaau0.jpg','https://image.tmdb.org/t/p/original/mab5wPeGVjbMyYMzyzfdKKnG9cl.jpg','2021-08-20'),
	(423108,'Expediente Warren: Obligado por el demonio',NULL,NULL,'Pelicula','Los investigadores paranormales Ed y Lorraine Warren se encuentran con lo que se convertiría en uno de los casos más sensacionales de sus archivos. La lucha por el alma de un niño los lleva más allá de todo lo que habían visto antes, para marcar la primera vez en la historia de los Estados Unidos que un sospechoso de asesinato reclamaría posesión demoníaca como defensa.','https://image.tmdb.org/t/p/original/qi6Edc1OPcyENecGtz8TF0DUr9e.jpg','https://image.tmdb.org/t/p/original/ghMQALCyytc6W0wlOlMIKiMSRKV.jpg','2021-05-25'),
	(429617,'Spider-Man: Lejos de casa',NULL,NULL,'Pelicula','Peter Parker decide irse junto a Michelle Jones, Ned y el resto de sus amigos a pasar unas vacaciones a Europa después de los eventos ocurridos en Vengadores: EndGame. Sin embargo, el plan de Parker por dejar de lado sus superpoderes durante unas semanas se ven truncados cuándo es reclutado por Nick Fury para unirse a Mysterio (un humano que proviene de la Tierra 833, una dimensión del multiverso, que tuvo su primera aparición en Doctor Strange) para luchar contra los elementales (cuatro entes inmortales que vienen de la misma dimensión y que dominan los cuatro elementos de la naturaleza, el fuego, el agua, el aire y la tierra) . En ese momento, Parker vuelve a ponerse el traje de Spider-Man para cumplir con  su labor.','https://image.tmdb.org/t/p/original/8XiTPU1zfy41Xgg96TCHXj4uQJf.jpg','https://image.tmdb.org/t/p/original/iKVR1ba3W1wCm9bVCcpnNvxQUWX.jpg','2019-06-28'),
	(436969,'El escuadrón suicida',NULL,NULL,'Pelicula','Un grupo de super villanos se encuentran encerrados en Belle Reve, una prisión de alta seguridad con la tasa de mortalidad más alta de Estados Unidos. Para salir de allí harán cualquier cosa, incluso unirse al grupo Task Force X, dedicado a llevar a cabo misiones suicidas bajo las órdenes de Amanda Waller. Fuertemente armados son enviados a la isla Corto Maltese, una jungla repleta de enemigos.','https://image.tmdb.org/t/p/original/jlGmlFOcfo8n5tURmhC7YVd4Iyy.jpg','https://image.tmdb.org/t/p/original/fPJWlhXA2VXf4MlQ3JenVsz1iba.jpg','2021-07-28'),
	(449406,'Vivo',NULL,NULL,'Pelicula','Narra la vida de Vivo, un kinkajú («oso de la miel» de la selva tropical) dotado de un brillante talento para la música, que busca la forma de viajar desde La Habana hasta Miami para entregarle una canción al antiguo amor de su adorado dueño.','https://image.tmdb.org/t/p/original/2BftdeCkD7uf68KUxaKRBxtsmZZ.jpg','https://image.tmdb.org/t/p/original/eRLlrhbdYE7XN6VtcZKy6o2BsOw.jpg','2021-07-30'),
	(451048,'Jungle Cruise',NULL,NULL,'Pelicula','Principios del siglo XX. Frank (Dwayne Johnson) es el carismático capitán de una peculiar embarcación que recorre la selva amazónica. Allí, a pesar de los peligros que el río Amazonas les tiene preparados, Frank llevará en su barco a la científica Lily Houghton (Emily Blunt) y a su hermano McGregor Houghton (Jack Whitehall). Su misión será encontrar un árbol místico que podría tener poderes curativos. Claro que su objetivo no será fácil, y en su aventura se encontrarán con toda clase de dificultades, además de una expedición alemana que busca también este árbol con propiedades curativas. Esta comedia de acción y aventuras está basada en la atracción Jungle Cruise de los parques de ocio de Disney.','https://image.tmdb.org/t/p/original/7WJjFviFBffEJvkAms4uWwbcVUk.jpg','https://image.tmdb.org/t/p/original/esgrxpxrQufea2A3iHJUquG4mdz.jpg','2021-07-28'),
	(458576,'Monster Hunter',NULL,NULL,'Pelicula','Tras nuestro mundo hay otro: un mundo de monstruos peligrosos y poderosos que gobiernan sus dominios con una ferocidad mortal. Cuando la teniente Artemis y sus leales soldados son transportados de nuestro mundo al nuevo mundo, la imperturbable teniente recibe el golpe de su vida. En su desesperada batalla por sobrevivir contra enormes enemigos con poderes increíbles y ataques imparables y repugnantes, Artemis se unirá a un hombre misterioso que ha encontrado la forma de defenderse.','https://image.tmdb.org/t/p/original/z8TvnEVRenMSTemxYZwLGqFofgF.jpg','https://image.tmdb.org/t/p/original/okpAhCoflQKY2OqQqEwGuNGyIKb.jpg','2020-12-03'),
	(459151,'El bebé jefazo 2: Negocios de familia',NULL,NULL,'Pelicula','Los hermanos Templeton se han convertido en adultos y se han alejado el uno del otro, pero un nuevo jefe bebé con un enfoque de vanguardia está a punto de unirlos nuevamente e inspirar un nuevo negocio familiar.','https://image.tmdb.org/t/p/original/gX5UrH1TLVVBwI7WxplW43BD6Z1.jpg','https://image.tmdb.org/t/p/original/3XYeAnIdjTiHZehtKcNzsyBwtcz.jpg','2021-07-01'),
	(460465,'Mortal Kombat',NULL,NULL,'Pelicula','Un boxeador fracasado descubre un secreto familiar que lo lleva a un torneo místico llamado Mortal Kombat donde se encuentra con un grupo de guerreros que luchan hasta la muerte para salvar los reinos del malvado hechicero Shang Tsung.','https://image.tmdb.org/t/p/original/9yBVqNruk6Ykrwc32qrK2TIE5xw.jpg','https://image.tmdb.org/t/p/original/t2GbiMJfO8txoihdJC8RsfK1ds7.jpg','2021-04-07'),
	(464052,'Wonder Woman 1984',NULL,NULL,'Pelicula','En 1984, en plena guerra fría, Diana Prince, conocida como Wonder Woman se enfrenta al empresario Maxwell Lord y a su antigua amiga Barbara Minerva / Cheetah, una villana que posee fuerza y agilidad sobrehumanas.','https://image.tmdb.org/t/p/original/srYya1ZlI97Au4jUYAktDe3avyA.jpg','https://image.tmdb.org/t/p/original/jIIjsExCEv6lsfQGHTXDPk3Q0M5.jpg','2020-12-16'),
	(475557,'Joker',NULL,NULL,'Pelicula','Arthur Fleck es un hombre ignorado por la sociedad, cuya motivación en la vida es hacer reír. Pero una serie de trágicos acontecimientos le llevarán a ver el mundo de otra forma. Película basada en Joker, el popular personaje de DC Comics y archivillano de Batman, pero que en este film toma un cariz más realista y oscuro.','https://image.tmdb.org/t/p/original/n6bUvigpRFqSwmPp1m2YADdbRBc.jpg','https://image.tmdb.org/t/p/original/v0eQLbzT6sWelfApuYsEkYpzufl.jpg','2019-10-02'),
	(482373,'No Respires 2',NULL,NULL,'Pelicula','El ciego se ha estado escondiendo durante años en una cabaña aislada y ha acogido y criado a una niña que perdió a sus padres en un incendio en una casa. Su tranquila existencia se hace añicos cuando un grupo de secuestradores aparece y se lleva a la niña, lo que obliga al Ciego a dejar su refugio seguro para rescatarla.','https://image.tmdb.org/t/p/original/pUc51UUQb1lMLVVkDCaZVsCo37U.jpg','https://image.tmdb.org/t/p/original/etYHukMKWSIBX0YkHarCEpOb0fE.jpg','2021-08-12'),
	(495764,'Aves de presa (y la fantabulosa emancipación de Ha',NULL,NULL,'Pelicula','Después de separarse del Joker, Harley Quinn y otras tres heroínas (Canario Negro, Cazadora y Renée Montoya) unen sus fuerzas para salvar a una niña del malvado rey del crimen, Máscara Negra.','https://image.tmdb.org/t/p/original/jiqD14fg7UTZOT6qgvzTmfRYpWI.jpg','https://image.tmdb.org/t/p/original/khEpbg6Vh9bB0jnNpIWDOCsvfWJ.jpg','2020-02-05'),
	(497698,'Viuda negra',NULL,NULL,'Pelicula','Natasha Romanoff, alias Viuda Negra, se enfrenta a las partes más oscuras de su historia cuando surge una peligrosa conspiración con vínculos con su pasado. Perseguida por una fuerza que no se detendrá ante nada para acabar con ella, Natasha debe enfrentarse a su historia como espía y a las relaciones rotas que dejó a su paso mucho antes de convertirse en una Vengadora.','https://image.tmdb.org/t/p/original/dq18nCTTLpy9PmtzZI6Y2yAgdw5.jpg','https://image.tmdb.org/t/p/original/qjAsDcMlHXxJSfNDQGK9hs13US0.jpg','2021-07-07'),
	(503736,'Ejército de los muertos',NULL,NULL,'Pelicula','Un grupo de mercenarios decide llevar a cabo el mayor atraco que jamás se haya realizado en la ciudad de Las Vegas, Nevada justo después de que se produzca una epidemia de muertos vivientes. Para ello tendrán que adentrarse en una zona de cuarentena, con los riesgos que ello conlleva.','https://image.tmdb.org/t/p/original/c0izdYdnTe4uMRifHgvTA85wPz0.jpg','https://image.tmdb.org/t/p/original/4h1Uc13QPjHTTUX0bikICWUxTSV.jpg','2021-05-14'),
	(508943,'Luca',NULL,NULL,'Pelicula','Ambientada en un precioso pueblo costero de la Riviera italiana, narra la historia sobre el paso a la edad adulta de un chico que vive un verano inolvidable lleno de helados, pasta e infinitos paseos en scooter. Luca comparte estas aventuras con su nuevo mejor amigo, pero toda la diversión se ve amenazada por un secreto muy profundo: él es un monstruo marino de un mundo que yace bajo la superficie del agua.','https://image.tmdb.org/t/p/original/620hnMVLu6RSZW6a5rwO8gqpt0t.jpg','https://image.tmdb.org/t/p/original/j93NHWoTjdsL4sdz058M3AvKrMy.jpg','2021-06-17'),
	(520763,'Un lugar tranquilo 2',NULL,NULL,'Pelicula','Tras los fatales acontecimientos sucedidos en la primera parte, la familia Abbot debe enfrentarse a los peligros del mundo exterior mientras luchan en silencio por sobrevivir. Forzados a aventurarse en lo desconocido, pronto se dan cuenta de que las criaturas que cazan orientadas por el sonido no son la única amenaza que acecha más allá del camino de arena. Secuela de la exitosa producción \"Un lugar tranquilo\" (A Quiet Place, 2018).','https://image.tmdb.org/t/p/original/z2UtGA1WggESspi6KOXeo66lvLx.jpg','https://image.tmdb.org/t/p/original/6uRb5axnwAd17h4ak4ENHcJqHVr.jpg','2021-05-21'),
	(522241,'El espía inglés',NULL,NULL,'Pelicula','Durante la Guerra Fría entre Estados Unidos y Rusia, el ingeniero Greville Wynne (Benedict Cumberbatch) se infiltra como espía en el MI6, servicio de inteligencia británico. Cuando la crisis de los misiles cubanos promete inclinar la balanza a favor del país soviético, Wynne comenzará a trabajar con la CIA para filtrar información sobre el plan que tienen en marcha los rusos y así evitar una catástrofe.','https://image.tmdb.org/t/p/original/3pIqd1hgZ2xqzWEyiYp4blqE9Fi.jpg','https://image.tmdb.org/t/p/original/2vgvbxnN72CjTvmvXforxGFLjBV.jpg','2021-03-18'),
	(522444,'Abismo',NULL,NULL,'Pelicula','La película sigue a una pareja amante de la aventura, que convence a sus amigos para explorar un sistema de cuevas en un alejado bosque del norte de Australia. Con una tormenta acercándose, se precipitan a la boca de la cueva, la cual comienza a inundarse, lo que implica que se verán amenazados por una manada de hambrientos cocodrilos...','https://image.tmdb.org/t/p/original/fRrpOILyXuWaWLmqF7kXeMVwITQ.jpg','https://image.tmdb.org/t/p/original/tA3k9LyE2togmIuNnOgw6SmzWus.jpg','2020-07-09'),
	(522478,'Peter Rabbit 2: A la fuga',NULL,NULL,'Pelicula','A pesar de sus esfuerzos, Peter parece que no puede sacudir su reputación de travieso entre los otros conejos. Una vez que sale del jardín, Peter se encuentra en un mundo donde aprecian las travesuras están bien vistas y toleradas, pero su familia viene a buscarlo para traerlo de vuelta a casa.','https://image.tmdb.org/t/p/original/5HjzYTihkH7EvOWSE7KcsF6pBMM.jpg','https://image.tmdb.org/t/p/original/7qb6u23jMucfMlJ4MCSFo8djka1.jpg','2021-03-25'),
	(525660,'Dynasty Warriors',NULL,NULL,'Pelicula','Dynasty Warriors es una próxima película de acción y fantasía de Hong Kong basada en la franquicia japonesa de videojuegos del mismo título.','https://image.tmdb.org/t/p/original/iJ2HVOZT9Kjayrhy21pbGIJs9ey.jpg','https://image.tmdb.org/t/p/original/1w0AkplNn51VZZ9ehA9I0hqJzLs.jpg','2021-04-29'),
	(527774,'Raya y el último dragón',NULL,NULL,'Pelicula','Raya, una niña de gran espíritu aventurero,  se embarca en la búsqueda del último dragón del mundo con el objetivo de devolver el equilibrio a Kumandra, un lejano y recóndito territorio habitado por una civilización milenaria.','https://image.tmdb.org/t/p/original/hJuDvwzS0SPlsE6MNFOpznQltDZ.jpg','https://image.tmdb.org/t/p/original/hbjOtofNpvFvhzBUUoZGAjkjjsl.jpg','2021-03-03'),
	(529106,'Igor Grom contra el Doctor Peste',NULL,NULL,'Pelicula','El jefe de policía, Igor Grom, es conocido en San Petersburgo por su carácter incisivo y su actitud irreconciliable hacia los criminales. Pero todo cambia con la aparición de una persona con la máscara del Plague Doctor que asesina a gente que ha escapado de la justicia por dinero o estatus social.','https://image.tmdb.org/t/p/original/pVNXmfZvQKFdUKVYNJxZAiy69DC.jpg','https://image.tmdb.org/t/p/original/zI4yOVjcC51FNI1K3H5poIfm8Wn.jpg','2021-04-01'),
	(529203,'Los Croods: Una nueva era',NULL,NULL,'Pelicula','Después de salir de su cueva, los Croods se encuentran con su mayor amenaza desde que se fueron: otra familia llamada Betterman, quienes afirman y demuestran ser mejores y evolucionados. Grug empieza a sospechar de los padres de Betterman, Phil y Hope, ya que planean en secreto separar a su hija Eep con su amado novio Guy para asegurarse de que su hija Dawn tenga un compañero amoroso e inteligente que la proteja.','https://image.tmdb.org/t/p/original/fmIp40ev4VGquK2bMo52PQgaV2d.jpg','https://image.tmdb.org/t/p/original/5uMWKEmegf5aTJnp1u98JF4QerP.jpg','2020-11-25'),
	(550205,'El dragón de los deseos',NULL,NULL,'Pelicula','Din es un adolescente que ansía volver a ver a su mejor amiga de la infancia. Un dragón que concede deseos le mostrará la magia de las posibilidades.','https://image.tmdb.org/t/p/original/4kIRrW1AlHP5Idne8CPHeQt8nR5.jpg','https://image.tmdb.org/t/p/original/uBSOVabHjh9vbfnA6B2u1C7vIq1.jpg','2021-01-15'),
	(550988,'Free Guy',NULL,NULL,'Pelicula','Un hombre descubre que en realidad es un personaje dentro de un videojuego. Guy (Ryan Reynolds) trabaja como cajero de un banco, es un tipo alegre y solitario al que nada la amarga el día. Incluso si le utilizan como rehén durante un atraco a su banco, él sigue sonriendo como si nada. Pero un día se da cuenta de que Free City no es exactamente la ciudad que él creía. Guy va a descubrir que en realidad es un personaje no jugable dentro de un brutal videojuego. Ahora que sabe que es un personaje de videojuego, Guy, acompañado por Molotov Girl (Jodie Comer), decidirá enfrentarse a todos los villanos que asolan la ciudad.','https://image.tmdb.org/t/p/original/j28p5VwI5ieZnNwfeuZ5Ve3mPsn.jpg','https://image.tmdb.org/t/p/original/suaooqn1Mnv60V19MoGxneMupJs.jpg','2021-08-11'),
	(566525,'Shang-Chi y la leyenda de los Diez Anillos',NULL,NULL,'Pelicula','Shang-Chi debe enfrentarse al pasado que pensó que había dejado atrás cuando se ve atraído por la red de la misteriosa organización de los Diez Anillos.','https://image.tmdb.org/t/p/original/nDLylQOoIazGyYuWhk21Yww5FCb.jpg','https://image.tmdb.org/t/p/original/lE8Pet7FMzOFUBMToH7l7g1XAny.jpg','2021-09-01'),
	(567189,'Sin remordimientos',NULL,NULL,'Pelicula','Un comando SEAL de élite descubre una conspiración internacional mientras busca hacer justicia por el asesinato de su mujer en Sin remordimientos, de Tom Clancy. El explosivo origen del héroe de acción John Clark, uno de los personajes más populares del universo Jack Ryan, del escritor Tom Clancy.','https://image.tmdb.org/t/p/original/fPGeS6jgdLovQAKunNHX8l0avCy.jpg','https://image.tmdb.org/t/p/original/3A2owG58gqx8fzRWhVOMAO6lbWq.jpg','2021-04-29'),
	(568620,'Snake Eyes: El origen',NULL,NULL,'Pelicula','G.I. JOE: Snake Eyes es protagonizada por Henry Golding. Snake Eyes es un solitario y tenaz guerrero que se une a al antiguo clan japonés de los Arashikage luego de salvarle la vida al heredero del clan. Al llegar a Japón, los Arashikage le enseñan a Snake Eyes los caminos del guerrero ninja y le dan algo que siempre quiso tener: un hogar. Pero, al revelarse los secretos sobre su pasado, pondrán a prueba el honor y la lealtad de Snake Eyes, incluso si eso significa perder la confianza de los más cercanos a él.','https://image.tmdb.org/t/p/original/aO9Nnv9GdwiPdkNO79TISlQ5bbG.jpg','https://image.tmdb.org/t/p/original/dxe2P2lSyr3I2rS14lQHOwQd7G8.jpg','2021-07-22'),
	(573164,'Un rescate de huevitos',NULL,NULL,'Pelicula','Toto y Di son los padres de dos hermosos huevos: Uly y Max.','https://image.tmdb.org/t/p/original/uHmvk8FnoxpgujDU0RIXLkv2fNt.jpg','https://image.tmdb.org/t/p/original/wrlQnKHLCBheXMNWotyr5cVDqNM.jpg','2021-08-12'),
	(579047,'Reminiscencia',NULL,NULL,'Pelicula','En un futuro cercano, Nicolas Bannister (Hugh Jackman) tiene un negocio que consiste en que sus clientes puedan revivir cualquier recuerdo que deseen. Su vida cambia cuando conoce a Mae (Rebecca Ferguson), una mujer que sólo acude a la consulta para poder recordar dónde dejó sus llaves. Pero este encuentro, pronto se convierte en un apasionado romance. Sin embargo, un día Mae desaparece sin razón y Nick se queda desolado. Hará todo lo posible por encontrarla, lo que implicará volver al pasado para descubrir la verdad sobre la mujer de la que se ha enamorado.','https://image.tmdb.org/t/p/original/8yhWlFcJ8zCqjfCvLy3lWFuawR1.jpg','https://image.tmdb.org/t/p/original/rDNw3PUbdslsctcJ6Db32g4A4FA.jpg','2021-08-19'),
	(580489,'Venom: Habrá Matanza',NULL,NULL,'Pelicula','Secuela de la película \"Venom\", el villano principal de la película será Carnage','https://image.tmdb.org/t/p/original/AhFRV5YxJamUZ4oZdxv6PI0ythi.jpg','https://image.tmdb.org/t/p/original/jNd6tx7FL2h7wtZgLUsLvzD0kFN.jpg','2021-09-15'),
	(581387,'Alerta roja',NULL,NULL,'Pelicula','El volcán en la montaña Baekdu hace erupción repentinamente, causando varios terremotos tanto en Corea del Norte como en el Sur. El caos reina en la península de Corea cuando se predicen más erupciones. Para prevenir un desastre mayor, Jeon Yoo-kyung (Jeon Hye-jin) planea una operación basada en la teoría del profesor Kang Bong-rae (Ma Dong-seok), quien ha estudiado la montaña Baekdu y sus posibles erupciones. Jo In-chang (Ha Jung-woo) es el capitán del equipo de fuerzas especiales y es asignado a la operación que mantiene el destino de ambas Coreas en la balanza. Él contacta a Lee Joon-pyeong (Lee Byung-hun), un espía norcoreano para realizar la operación conjuntamente. Mientras, su esposa embarazada, Choi Ji-young (Bae Suzy), está sola en Seúl intentando sobrevivir en medio del desastre.','https://image.tmdb.org/t/p/original/h9DIlghaiTxbQbt1FIwKNbQvEL.jpg','https://image.tmdb.org/t/p/original/A3BP44EvnJIIhyNVwPT0IpvNAoc.jpg','2019-12-19'),
	(581644,'Ladrones de élite',NULL,NULL,'Pelicula','Después de ser reclutado por un grupo de ladrones poco convencionales, el renombrado criminal Richard Pace se ve envuelto en un elaborado atraco de oro que promete tener implicaciones de gran alcance en su vida y en la vida de muchos otros.','https://image.tmdb.org/t/p/original/6FzuNrApEc71aJ3CwwkpadbNled.jpg','https://image.tmdb.org/t/p/original/ifuKZivA7SKhFpUH8g5vk2UmVd0.jpg','2021-06-10'),
	(581726,'Infinito',NULL,NULL,'Pelicula','Evan McCauley tiene habilidades que nunca aprendió y recuerdos de lugares que nunca ha visitado. Automedicado y al borde de un colapso mental, un grupo secreto que se hace llamar \"Infinitos\" acuden a su rescate, revelando que sus recuerdos son reales.','https://image.tmdb.org/t/p/original/wjQXZTlFM3PVEUmKf1sUajjygqT.jpg','https://image.tmdb.org/t/p/original/niw2AKHz6XmwiRMLWaoyAOAti0G.jpg','2021-06-10'),
	(585083,'Hotel Transilvania: Transformanía',NULL,NULL,'Pelicula','Drac y la pandilla vuelven, como nunca los habías visto antes en Hotel Transilvania: Transformanía. Volveremos a encontrarnos con nuestros monstruos favoritos en una aventura completamente nueva en la que Drac se enfrentará a una de las situaciones más aterradoras vividas hasta el momento. Cuando el misterioso invento de Van Helsing, el \"Rayo Monstrificador\", se vuelve totalmente fuera de control, Drac y sus monstruosos amigos se transforman en humanos, ¡y Johnny se convierte en un monstruo!','https://image.tmdb.org/t/p/original/7QabKu8tizoqy8qCZJXljdSpP4A.jpg','https://image.tmdb.org/t/p/original/pwSlzCAynIF6aEP7oxWddo7Kng2.jpg','0000-00-00'),
	(586047,'Seobok',NULL,NULL,'Pelicula','Ki Hun es un ex agente de la agencia de inteligencia. Seo Bok es el primer clon humano y posee el secreto para la vida eterna. Ki Hun se involucra en situaciones peligrosas debido a varias fuerzas que quieren tomar posesión de Seo Bok.','https://image.tmdb.org/t/p/original/yC4DRg5aGgNpkHpUDpLtBqzownS.jpg','https://image.tmdb.org/t/p/original/abLFmMoTEfgrHjZLx6fxZOEsDop.jpg','2021-04-12'),
	(587807,'Tom y Jerry',NULL,NULL,'Pelicula','Tom el gato y Jerry el ratón son expulsados de su casa y se trasladan a un elegante hotel de Nueva York, donde una empleada descuidada llamada Kayla perderá su trabajo si no puede desalojar a Jerry antes de una boda de clase alta en el hotel. ¿Su solución? Contratar a Tom para deshacerse del molesto ratón.','https://image.tmdb.org/t/p/original/9ns9463dwOeo1CK1JU2wirL5Yi1.jpg','https://image.tmdb.org/t/p/original/orzPlWUbf0S5HeWmpP3TeHvduwn.jpg','2021-02-11'),
	(587996,'Bajocero',NULL,NULL,'Pelicula','Invierno. Bajo cero. Noche cerrada. En mitad de una carretera despoblada, un furgón blindado es asaltado durante un traslado de presos. Alguien busca a uno de los presos y no parará hasta sacarlo. Su plan no tiene fisuras, no le importan las consecuencias, nada le va a detener. Pero Martín, el conductor del furgón, consigue atrincherarse dentro del cubículo blindado con los reclusos, convirtiéndose en su único obstáculo. Obligado a entenderse con sus enemigos naturales, Martín tratará de sobrevivir y cumplir con su deber en una larga noche de pesadilla que acabará haciendo que ponga en duda todos sus principios.','https://image.tmdb.org/t/p/original/6TPZSJ06OEXeelx1U1VIAt0j9Ry.jpg','https://image.tmdb.org/t/p/original/mnz14c3avoGVaGwo6pbMItrjWdJ.jpg','2021-01-29'),
	(588228,'La guerra del mañana',NULL,NULL,'Pelicula','Un día el mundo se paraliza cuando un grupo de viajeros en el tiempo se transporta desde el año 2051 para entregar un mensaje urgente: La humanidad está perdiendo la guerra mundial contra una especie alienígena letal. La única esperanza de supervivencia es que los soldados y los ciudadanos del presente sean transportados al futuro y se unan a la lucha. Entre los reclutados está el profesor de instituto y padre de familia Dan Forester (Chris Pratt) quien, decidido a salvar el mundo por su hija, se une a una brillante científica (Yvonne Strahovski) y a su padre (J.K. Simmons) en una búsqueda desesperada por reescribir el destino del planeta.','https://image.tmdb.org/t/p/original/yizL4cEKsVvl17Wc1mGEIrQtM2F.jpg','https://image.tmdb.org/t/p/original/tzp6VzED2TBc02bkYoYnQa6r2OK.jpg','2021-06-30'),
	(591273,'La calle del terror - Parte 1: 1994',NULL,NULL,'Pelicula','En 1994, un grupo de adolescentes descubre que los terribles sucesos que han asolado su ciudad durante generaciones están conectados y que pueden ser los próximos objetivos.','https://image.tmdb.org/t/p/original/5C8bfwglg91uZhc2fbfpSjNGamV.jpg','https://image.tmdb.org/t/p/original/xGf1snRLGQpiUkWvJSGwiSXW9sR.jpg','2021-06-28'),
	(592350,'My Hero Academia: el despertar de los héroes',NULL,NULL,'Pelicula','Un nuevo villano, llamado Nine, está buscando a Tomura Shigaraki. Para ello, decide atacar la isla de Nabutō. Segunda película de la serie anime \"My Hero Academia\".','https://image.tmdb.org/t/p/original/9guoVF7zayiiUq5ulKQpt375VIy.jpg','https://image.tmdb.org/t/p/original/vH5stD5pTogbZVXadIKQyMSKzTt.jpg','2019-12-20'),
	(597433,'Beckett',NULL,NULL,'Pelicula','Beckett (John David Washington), un estadounidense de vacaciones en Grecia, se convierte en víctima de una persecución tras un brutal accidente. Mientras emprende una huida desesperada por Grecia para salvar el pellejo, llegar a la embajada de Estados Unidos y lavar su nombre, la tensión va en aumento a medida que las autoridades estrechan el cerco, el malestar político aumenta, y Beckett se va adentrando más y más en una peligrosa e intrincada conspiración.','https://image.tmdb.org/t/p/original/lzLzKXq2C0kL5Pu7VW5sNl5KV6L.jpg','https://image.tmdb.org/t/p/original/fBJducGBcmrcIOQdhm4BUBNDiMu.jpg','2021-08-04'),
	(602223,'La Purga: Infinita',NULL,NULL,'Pelicula','Para los miembros de un movimiento clandestino, ya no es suficiente una noche anual de anarquía y asesinatos, así que deciden devolver a Estados Unidos el caos y las masacres sin fin, donde nadie volverá a estar a salvo... jamás. Adela y su esposo Juan viven en Texas, donde él trabaja como peón en un rancho para la adinerada familia Tucker. En la mañana después de la tradicional purga, una banda de asesinos enmascarados ataca violenta e ilegalmente a la familia Tucker. Tras este hecho, la familia texana se ve obligada a unirse con Juan y su esposa para enfrentar un país entero a punto de colapsar, que se hunde en un mar de caos y de sangre. Quinta y última entrega de la saga \'The Purge\'.','https://image.tmdb.org/t/p/original/tehpKMsls621GT9WUQie2Ft6LmP.jpg','https://image.tmdb.org/t/p/original/zWiXxOTM3NeYcj3dzbtoGqIIJPz.jpg','2021-06-30'),
	(607259,'Ser padre',NULL,NULL,'Pelicula','Un viudo convertido en papá lidia con las dudas, los miedos, el dolor y los pañales sucios mientras trata de criar a su hija solo. Inspirada en una historia real.','https://image.tmdb.org/t/p/original/miOnymJ0dN2psWBB8Vleo3fUyrc.jpg','https://image.tmdb.org/t/p/original/2hRAvXdpCMDm9WDOMFksY7nZAhl.jpg','2021-06-18'),
	(615457,'Nadie',NULL,NULL,'Pelicula','Hutch Mansell, un padre de familia que aguanta con resignación y sin defenderse los golpes de la vida. Un don nadie.  Una noche, cuando dos ladrones entran en su casa, Hutch decide no actuar y no trata de defenderse ni al él mismo ni a su familia, convencido de que solo así evitará una escalada de violencia. Tras el ataque, su hija adolescente Blake no oculta su decepción, y su esposa Becca se aleja todavía más.','https://image.tmdb.org/t/p/original/uWeffFhprUohUL5GO3YfQqdsVrI.jpg','https://image.tmdb.org/t/p/original/ddO5a3tMPpQutSDQO1bESgLWadB.jpg','2021-03-18'),
	(615658,'Disomnia',NULL,NULL,'Pelicula','Tras un suceso global repentino que acaba con todos los dispositivos electrónicos y con la capacidad para dormir de la humanidad, el caos comienza a consumir el mundo rápidamente. Solo Jill, un exsoldado con un pasado problemático, podría tener la clave de la cura en su propia hija. La cuestión es ¿podrá Jill entregar a su hija de manera segura y salvar al mundo antes de que ella misma pierda la cabeza?','https://image.tmdb.org/t/p/original/3RMbkXS4ocMmoJyAD3ZsWbm32Kx.jpg','https://image.tmdb.org/t/p/original/r8kmQ1lBmeC5oLztNKQUBB6xh8i.jpg','2021-06-09'),
	(617502,'Jolt',NULL,NULL,'Pelicula','Una chica dura con tendencias ligeramente homicidas y que no controla la ira se da descargas con un chaleco de electrodos para volver a la normalidad si le entran las ganas de matar. Cuando asesinan al primer hombre del que se ha enamorado, empieza un desenfreno vengativo para encontrar al asesino, al mismo tiempo que la policía va tras ella porque la considera sospechosa.','https://image.tmdb.org/t/p/original/wPjtacig0kIkVcTQmXoNt6jbMwo.jpg','https://image.tmdb.org/t/p/original/gYZAHan5CHPFXORpQMvOjCTug4E.jpg','2021-07-15'),
	(619297,'Sweet Girl',NULL,NULL,'Pelicula','Un marido destrozado jura llevar ante la justicia a los responsables de la muerte de su mujer, a la vez que protege a la única familia que le queda, su hija.','https://image.tmdb.org/t/p/original/nprqOIEfiMMQx16lgKeLf3rmPrR.jpg','https://image.tmdb.org/t/p/original/72KBb61fPaUDJWd2W8gG6xDhzzp.jpg','2021-08-18'),
	(631843,'Tiempo',NULL,NULL,'Pelicula','Thriller sobre una familia que, estando de vacaciones en un paraíso tropical, descubre que la recóndita playa elegida para relajarse unas horas está haciéndoles envejecer rápidamente... reduciendo toda su vida a un único día.','https://image.tmdb.org/t/p/original/iTgM25ftE7YtFgZwUZupVp8A61S.jpg','https://image.tmdb.org/t/p/original/ggXWPAIPz0LciOc4hwKIctP4xV2.jpg','2021-07-21'),
	(632357,'Ruega por nosotros',NULL,NULL,'Pelicula','Se centra en un periodista caído en desgracia que descubre una serie de aparentes milagros acaecidos en un pequeño pueblo de Nueva Inglaterra, aplicándolos para devolver su carrera al estrellato. Lo que desconoce es que estos milagros esconden una cara mucho más oscura de lo que él cree.','https://image.tmdb.org/t/p/original/jw6ASGRT2gi8EjCImpGtbiJ9NQ9.jpg','https://image.tmdb.org/t/p/original/hPoOn553ARmSQl0ChKTlGDvYq9x.jpg','2021-03-31'),
