	(634649,'Spider-Man: No Way Home',NULL,NULL,'Pelicula','Peter Parker está desenmascarado y ya no puede separar su vida normal de las altas apuestas de ser un superhéroe. Cuando le pide ayuda al Doctor Strange, lo que está en juego se vuelve aún más peligroso, lo que lo obliga a descubrir lo que realmente significa ser Spider-Man.','https://image.tmdb.org/t/p/original/iMM6K3cdHYIVToqKSnLp9DNa1m3.jpg','https://image.tmdb.org/t/p/original/5JKuuCscQuKE9R8YF776qHQbojK.jpg','2021-12-15'),
	(635302,'Guardianes de la Noche: Tren infinito',NULL,NULL,'Pelicula','Tanjiro y sus compañeros se unen al Pilar de las Llamas Kyojuro Rengoku para investigar una misteriosa serie de desapariciones que han ocurrido dentro del “Tren Infinito”. Poco saben que Enmu, uno de los miembros de las Doce Lunas Demoníacas, también está a bordo y les ha preparado una trampa.','https://image.tmdb.org/t/p/original/xPpXYnCWfjkt3zzE0dpCNME1pXF.jpg','https://image.tmdb.org/t/p/original/3f4ETSwknZs74lmUYC7ENIMRBMP.jpg','2020-10-16'),
	(637649,'Despierta la furia',NULL,NULL,'Pelicula','H (Jason Statham) es el misterioso tipo que acaba de incorporarse como guardia de seguridad en una compañía de blindados. Durante un intento de atraco a su camión, sorprende a sus compañeros mostrando habilidades de un soldado profesional, dejando al resto del equipo preguntándose quién es realmente y de dónde viene. Pronto se hará claro el verdadero motivo por el cual H está buscando un ajuste de cuentas.','https://image.tmdb.org/t/p/original/9DZlZvgh9dIGcri79hv3KtHiq5K.jpg','https://image.tmdb.org/t/p/original/emM894kjspdQsHyTAF7sjRNlbTr.jpg','2021-04-22'),
	(637693,'Spirit - Indomable',NULL,NULL,'Pelicula','La vida de Lucky Prescott cambia para siempre cuando se muda de su casa en la gran ciudad a un pequeño pueblo fronterizo en el que entabla amistad con un caballo salvaje llamado Spirit.','https://image.tmdb.org/t/p/original/vqEjXzWdzPbV2DZ7bk29weDFiDl.jpg','https://image.tmdb.org/t/p/original/efvHUZdBHDN7e4n1Ll3fn55GLA4.jpg','2021-05-20'),
	(649409,'Ni un paso en falso',NULL,NULL,'Pelicula','Detroit, año 1954. Unos delincuentes de poca monta son contratados para robar lo que ellos creen que es un simple documento y será un trabajo fácil. Cuando su plan no sale como ellos esperaban, emprenden la búsqueda de quien los contrató y del propósito real para el que fueron contratados.','https://image.tmdb.org/t/p/original/ok7RdHhVngnwkvKj09tvtOvypG.jpg','https://image.tmdb.org/t/p/original/g6Ifj8RJY39luVKweFvhP9hDOfo.jpg','2021-06-24'),
	(659940,'El efecto Marcus: Los casos del Departamento Q',NULL,NULL,'Pelicula','Cuando Marco, un niño gitano de 14 años sin hogar, es arrestado en el control de fronteras danés por posesión del pasaporte de un funcionario público desaparecido, el inspector de policía Carl Mørck y su equipo del Departamento Q tienen la tarea de encontrar la conexión. El caso anterior contiene varios elementos sospechosos: el servidor público fue acusado de pedofilia poco antes de su desaparición, y su caso se cerró inusualmente rápido. Pero el silencioso y traumatizado Marco se niega a hablar con ellos y no pasa mucho tiempo antes de que esté huyendo de aquellos que pretenden matarlo por lo que él sabe.','https://image.tmdb.org/t/p/original/b8cduNIEf75tBSFXDwBJfNAQMFP.jpg','https://image.tmdb.org/t/p/original/3DRK68IyqtfnPjVuaHffubYAPKo.jpg','2021-05-27'),
	(672322,'Kenshin, el guerrero samurái: El principio',NULL,NULL,'Pelicula','Kenshin Himura inicia la búsqueda de un misterioso traficante de armas llamado Enishi Yukishiro que controla el bajo mundo de China. Durante su misión se desvelará también el secreto de \"Jujishou\", un elemento íntimamente ligado al propio Himura.','https://image.tmdb.org/t/p/original/heMC3jAjQPNSlr1n9mZKUQ58EOE.jpg','https://image.tmdb.org/t/p/original/a7cWay8MBxGbgvFI8HN5FhJsPAX.jpg','2021-06-04'),
