	(675445,'La Patrulla Canina: La película',NULL,NULL,'Pelicula','La patrulla canina está en racha. Cuando Humdinger, su mayor rival, se convierte en alcalde de la cercana Ciudad Aventura y empieza a causar estragos, Ryder y los heroicos cachorros se ponen en marcha para enfrentarse a este nuevo desafío. Mientras uno de los cachorros debe enfrentarse a su pasado en Ciudad Aventura, el equipo encuentra ayuda en una nueva aliada, la inteligente perrita salchicha Liberty. Juntos y armados con nuevos y emocionantes artefactos y equipos, la patrulla canina lucha por salvar a los ciudadanos de Ciudad Aventura.','https://image.tmdb.org/t/p/original/w2jm8I0K83aZzHcI4Acl8DtuXCt.jpg','https://image.tmdb.org/t/p/original/2Y5OZsWBksmEl2Dggfx46DfRkFO.jpg','2021-08-09'),
