	(726684,'El Mundo Miraculous: Shanghái, la leyenda de LadyD',NULL,NULL,'Pelicula','Para unirse a Adrien en Shanghai, Marinette va a visitar a su tío Wang, quien celebra su cumpleaños. Pero tan pronto como llega a China, ¡le roban su bolso con Tikki!, lo que no le permite convertirse en una Ladybug en secreto! Privada y sola en la gran ciudad, Marinette acepta la ayuda de una joven muy ingeniosa, Fei. Las dos chicas se harán amigas y descubrirán la existencia de una nueva joya mágica, los Prodigios, que Hawk Moth, también presente en Shanghai, ha estado buscando durante mucho tiempo...','https://image.tmdb.org/t/p/original/rlNnwObbMu5G2FaOUlacnUIdIIA.jpg','https://image.tmdb.org/t/p/original/r6zthVPVoq1urTOsLgofPGel89d.jpg','2021-04-04'),
	(727745,'Mi primer beso 3',NULL,NULL,'Pelicula','Es el verano antes de que Elle se dirija a la universidad y tiene que tomar una decisión secreta. Elle ha sido aceptada en Harvard, donde se está matriculando su novio Noah, y también en Berkeley, donde se dirige su mejor amiga Lee. ¿Qué camino debería elegir?','https://image.tmdb.org/t/p/original/7BkkPaXnYo82T2pLSJP7GRyhD2S.jpg','https://image.tmdb.org/t/p/original/jdD6Rd8XMXPFZmCXLKWPthd1HsV.jpg','2021-08-11'),
