	(791373,'La Liga de la Justicia de Zack Snyder',NULL,NULL,'Pelicula','Con la determinación de asegurar que el sacrificio definitivo de Superman no fue en vano, Bruce Wayne une fuerzas con Diana Prince para reclutar a un equipo de metahumanos que protejan el mundo de una amenaza inminente de proporciones catastróficas. La tarea es más difícil de lo que Bruce imaginaba, ya que cada uno de los reclutas deberá enfrentarse a sus propios demonios para trascender aquello que los detenía, para unirse y formar de manera definitiva una liga de héroes sin precedentes. Ahora unidos, Batman, Wonder Woman, Aquaman, Cyborg y Flash deberán salvar al planeta de la amenaza de Steppenwolf, DeSaad y Darkseid, antes de que sea demasiado tarde.','https://image.tmdb.org/t/p/original/pcDc2WJAYGJTTvRSEIpRZwM3Ola.jpg','https://image.tmdb.org/t/p/original/rkuvJnamPl3xW9wKJsIS6qkmOCW.jpg','2021-03-18'),
	(792657,'Safer at Home',NULL,NULL,'Pelicula','Tras dos años de pandemia, un grupo de amigos organiza una salvaje fiesta online. Después de tomar éxtasis, las cosas salen terriblemente mal y la seguridad de sus hogares se vuelve más aterradora que el caos de fuera.','https://image.tmdb.org/t/p/original/2kmAwtw3RqFX0vJq7hKrIkGth1L.jpg','https://image.tmdb.org/t/p/original/rVI6MI4tcpoS5xeww9Fl0chpmkS.jpg','2021-02-26'),
