	(805051,'Los Olchis',NULL,NULL,'Pelicula','Los Ogglies buscan un nuevo hogar, pero nunca se sienten bienvenidos en ningún sitio. Apestan y la mayoría de los humanos no les quieren. Cuando Firebottom, el dragón de la familia, aterriza en el vertedero de Smelliville, los Ogglies se sienten como en casa. Y es aquí donde quieren quedarse.','https://image.tmdb.org/t/p/original/2nU5H8XIgtMkJrxsryP6nJuAHQ.jpg','https://image.tmdb.org/t/p/original/aUcSXIrKEVOwUZVzAYinIFBEyMr.jpg','2021-01-01'),
