	(813258,'Mascotas monstruosas: Un corto de Hotel Transilvan',NULL,NULL,'Pelicula','En ‘Mascotas Monstruosas’, Pipis, el adorable cachorro de Drac, del tamaño de un monstruo, tiene más energía que nunca y ¡sólo quiere jugar a la pelota! Desafortunadamente, Drac está demasiado ocupado haciendo malabares con sus deberes en el hotel, por lo que está decidido a encontrar una mascota monstruo como compañero para su enorme y peludo amigo. Después de una serie de desajustes, el plan de Drac acaba mal cuando Pipis elige un compañero muy dudoso.','https://image.tmdb.org/t/p/original/c7dFSqZQYqNNJVpacpIGZe3gkLW.jpg','https://image.tmdb.org/t/p/original/tuzkEyCPwf5O56fDjGNerIA8hxT.jpg','2021-04-02'),
	(817451,'Especies en Peligro de Extincion',NULL,NULL,'Pelicula','Jack Halsey lleva a su esposa, a sus hijos adultos y a un amigo a unas vacaciones de ensueño en Kenia. Pero cuando se aventuran solos a un parque salvaje, su furgoneta de safari es volcada por un rinoceronte enojado, dejándolos heridos y desesperados. Luego, cuando dos de ellos van en busca de rescate, un encuentro sangriento y cruel con un leopardo y un clan de hienas incita a una lucha desesperada por la supervivencia.','https://image.tmdb.org/t/p/original/A0xW7GgeFQoQmPOn7HcHkBQ5nlb.jpg','https://image.tmdb.org/t/p/original/ccsSqbpEqr2KK9eMvoeF8ERFCd5.jpg','2021-05-27'),
	(834404,'Teen Titans Go! See Space Jam',NULL,NULL,'Pelicula','Los Jóvenes Titanes son visitados por los Nerdlucks, los villanos de Space Jam que intentaron capturar a Michael Jordan y los Looney Tunes. Asombrado de descubrir que sus compañeros Titanes nunca han visto Space Jam, Cyborg organiza una fiesta de observación exclusiva. Por supuesto, si los Titanes están viendo una película, no espere que el silencio sea dorado. Raven y Starfire brindan el comentario, Cyborg presenta los hechos divertidos, Beast Boy señala los tiros a tope y Robin, pero Robin no confía en sus nuevos amigos alienígenas. ¿Están los Nerdlucks aquí para asistir a una fiesta de vigilancia inocente, o tienen motivos más siniestros bajo la manga?','https://image.tmdb.org/t/p/original/x9p2syPxeK2OYCpz35fsg0EFjlG.jpg','https://image.tmdb.org/t/p/original/rMoVOCw6DF3zC6hS76ZhQMWiXNX.jpg','2021-06-20'),
	(839440,'Hotel De Dinosaurios',NULL,NULL,'Pelicula','Sienna está desesperada por ganar un gran premio en efectivo en un programa de juegos clandestino. Sin embargo, los dinosaurios comienzan a cazarla para el entretenimiento de los ricos y adinerados. ¿Podrá ser la última en sobrevivir a la horrible noche para ganar el premio.','https://image.tmdb.org/t/p/original/mG4IdVQoMSOrjYGGTbxSD2WCz7d.jpg','https://image.tmdb.org/t/p/original/6dCPmtO7URN1HpqGO91hs9iOHHM.jpg','2021-06-11'),
	(846214,'Los Simpson: La buena, el malo y Loki',NULL,NULL,'Pelicula','Loki es desterrado de Asgard una vez más y debe enfrentarse a sus oponentes más duros hasta el momento: Los Simpson y los héroes más poderosos de Springfield. El Dios del engaño se une a Bart Simpson en el evento crossover definitivo que rinde homenaje al universo cinematográfico de superhéroes y villanos de Marvel”','https://image.tmdb.org/t/p/original/zsH3iW60T1t2HBTtrSKzzxJ406J.jpg','https://image.tmdb.org/t/p/original/u10ZfFwbCMB4UrFy7OlHq08fBRr.jpg','2021-07-07'),
	(847981,'La isla negra',NULL,NULL,'Pelicula','Los oscuros secretos de una isla aparentemente pacífica amenazan con devorarse a un estudiante cuando se acerca demasiado a su misteriosa profesora nueva.','https://image.tmdb.org/t/p/original/nra5QKexNv7yaIDseJiK1uo2mY4.jpg','https://image.tmdb.org/t/p/original/32TobOReMpk8c4rYSJmKCKVIiLh.jpg','2021-08-18'),
	(857910,'Lokillo: nada es igual',NULL,NULL,'Pelicula','Mediante canciones y bromas, el comediante Lokillo Florez analiza con humor cómo los latinoamericanos se han adaptado a un mundo donde abrazar no está permitido.','https://image.tmdb.org/t/p/original/bNiuvw5cZBAUZ7OtH7ZtHycWJlT.jpg','https://image.tmdb.org/t/p/original/bAdokq9itL5WDRsMu52NnJTTyQz.jpg','2021-08-12');
