VALUES
	(2,'Mark Hamill','1951-09-25','Mark Hamill es mejor conocido por su interpretación de Luke Skywalker en la trilogía original de Star Wars: La guerra de las galaxias (1977), El imperio contraataca (1980) y El retorno del Jedi (1983), un papel que repitió en Star Wars : El despertar de la fuerza (2015) y Star Wars: Los últimos Jedi (2017). También protagonizó y coprotagonizó las películas Correrías de verano (1978), Uno Rojo: División de choque (1980) y Kingsman: Servicio secreto (2014). El extenso trabajo de actuación de voz de Hamill incluye un papel de larga data como el Joker, comenzando con Batman (1992).\n\nHamill nació en Oakland, California, de Virginia Suzanne (Johnson) y William Thomas Hamill, capitán de la Marina de los Estados Unidos. Se especializó en teatro en Los Angeles City College e hizo su debut como actor en The Bill Cosby Show (1969). Luego desempeñó un papel recurrente (Kent Murray) en la telenovela Hospital General (1963) y coprotagonizó la serie de comedia Cosas de chicos (1974).\n\nLanzado el 25 de mayo de 1977, La guerra de las galaxias (1977) fue un enorme éxito inesperado y tuvo un gran impacto en la industria del cine. Hamill también apareció en The Star Wars Holiday Special (1978) y luego protagonizó las exitosas secuelas El imperio contraataca (1980) y El retorno del Jedi (1983). Para ambas secuelas, Hamill fue honrado con el Premio Saturno al Mejor Actor otorgado por la Academia de Ciencia Ficción, Fantasía y Películas de Terror. Repitió el papel de Luke Skywalker para las dramatizaciones de radio de \"Star Wars\" (1981) y \"The Empire Strikes Back\" (1983), y luego en un papel protagonista en Star Wars: Los últimos Jedi (2017). Para la dramatización por radio de \"El retorno del Jedi\" (1996), el papel fue interpretado por un actor diferente.\n\nExpresó el nuevo Chucky en Muñeco diabólico (Juego de niños) (2019), reemplazando a Brad Dourif.','https://image.tmdb.org/t/p/original/zMQ93JTLW8KxusKhOlHFZhih3YQ.jpg'),
	(32,'Robin Wright','1966-04-08','Robin Gayle Wright (8 de abril de 1966) es una actriz y directora estadounidense. Es famosa en el mundo principalmente por sus interpretaciones de Buttercup en The Princess Bride, Jenny Curran en Forrest Gump y Claire Underwood en la serie House of Cards.\n\nSe hizo conocida al interpretar a Kelly Capwell en la serie Santa Barbara de la cadena NBC, entre 1984 y 1988, siendo nominada a tres Premios Daytime Emmy por su trabajo. Sus participaciones en el cine incluyen, además de las mencionadas, las películas Toys (1992), Message in a Bottle (1999), El protegido (2000), Nueve vidas (2005), Moneyball (2011) y Wonder Woman (2017).\n\nDesde 2013 protagoniza la serie House of Cards de Netflix junto a Kevin Spacey. Su trabajo le ha otorgado tres nominaciones a los Primetime Emmy en la categoría de mejor actriz de serie dramática, y ganó un Globo de Oro en la categoría de mejor actriz de serie de televisión - drama.','https://image.tmdb.org/t/p/original/lj5o0pvHfWCEaPX3rzeGQkfIQzj.jpg'),
	(33,'Gary Sinise','1955-03-17','','https://image.tmdb.org/t/p/original/ngYV91xYfCu0JNcSxJ4yQ7tzOna.jpg'),
	(35,'Sally Field','1946-11-06','','https://image.tmdb.org/t/p/original/36qWnokCU1VOdSyrmGbTxzGou44.jpg'),
	(63,'Milla Jovovich','1975-12-17','Milla Jovovich (nacida el 17 de diciembre de 1975) es una actriz, supermodelo, músico y diseñadora de moda estadounidense nacida en Ucrania. A lo largo de su carrera, ha aparecido en una serie de películas de ciencia ficción y de acción, por lo que el canal de música VH1 se ha referido a ella como la \"reina reinante del kick-butt\".\n\nHa aparecido en la portada de más de un centenar de revistas, y también ha protagonizado películas como The Fifth Element (1997), Ultraviolet (2006) y la franquicia \'Resident Evil\'. Jovovich comenzó a modelar a los once años, cuando Richard Avedon la presentó en los anuncios de Revlon \"Las mujeres más inolvidables del mundo\", y continuó su carrera con otras campañas para cosméticos L\'Oréal, Banana Republic, Christian Dior, Donna Karan y Versace.\n\nEn 1988, tuvo su primer papel como actriz profesional en la película para televisión The Night Train to Kathmandu, y más tarde ese año apareció en su primer largometraje, Two Moon Junction. Después de más apariciones en televisión pequeñas como \"Fair Exchange\" (1989) y un papel de 1989 como una chica francesa (tenía 14 años en ese momento) en un episodio de Married with Children y papeles en películas, ganó notoriedad con la película romántica Return. a la Laguna Azul (1991). Apareció en Dazed and Confused de 1993 junto a Ben Affleck y Matthew McConaughey. Jovovich luego actuó junto a Bruce Willis en la película de ciencia ficción The Fifth Element (1997), y luego interpretó el papel principal en The Messenger: The Story of Joan of Arc (1999). En 2002, protagonizó la adaptación del videojuego Resident Evil, que generó tres secuelas: Resident Evil: Apocalypse (2004), Resident Evil: Extinction (2007) y Resident Evil: Afterlife (2010).\n\nAdemás de su carrera como modelo y actriz, Jovovich lanzó un álbum musical, The Divine Comedy en 1994. Continúa lanzando demos de otras canciones en su sitio web oficial y también contribuye a bandas sonoras de películas; Jovovich aún tiene que lanzar otro álbum. En 2003, ella y la modelo Carmen Hawk crearon la línea de ropa Jovovich-Hawk, que dejó de operar a principios de 2008. En su tercera temporada antes de su desaparición, las piezas se podían encontrar en Fred Segal en Los Ángeles, Harvey Nichols y más de 50 años. tiendas de todo el mundo.','https://image.tmdb.org/t/p/original/usWnHCzbADijULREZYSJ0qfM00y.jpg'),
	(99,'Amanda Plummer','1957-03-23','','https://image.tmdb.org/t/p/original/joHGUtEmXzJkH6ogEliiUKT9MNa.jpg'),
	(103,'Mark Ruffalo','1967-11-22','Mark Alan Ruffalo (Kenosha, Wisconsin, 22 de noviembre de 1967) es un actor de cine, productor, escritor y cineasta estadounidense. Cuenta con tres nominaciones al Premio Óscar.\n\nRuffalo inició su carrera como actor de teatro en la obra Avenue A, en el teatro The Cast, ubicado en Los Ángeles.​ Su debut cinematográfico fue en la película de suspense Mirror, Mirror 2: Raven Dance en 1994. Tres años más tarde, su participación en la obra Betrayal by Everyone le permitió ganarse la aprobación de la crítica. Pero el mundo teatral no le ayudaba a subsistir económicamente, por lo que tuvo que dedicarse a la labor de barman. Durante esta época realizó varias audiciones en todo tipo de papeles.\n\nRuffalo tuvo pequeñas participaciones en películas como The Dentist (1996), la comedia de crimen Safe Men y la película de la Guerra Civil estadounidense aclamada por la crítica Ride with the Devil (1999) del director Ang Lee. Sin embargo, la suerte llamó a su puerta cuando estaba a punto de dejarlo todo. Es así que convenció al director Kenneth Lonergan para que le realizara una audición para la obra teatral This Is Our Youth donde fue elegido como parte del elenco. Poco después persuadiría a Lonergan para que lo tomase en cuenta en su primer proyecto de cine independiente titulado You Can Count on Me, donde consiguió el papel del hermano problemático de Laura Linney, llamado Terry.​ La película de Lonergan obtuvo dos nominaciones al premio Óscar en el año 2000 por mejor actriz y mejor director. Ruffalo recibió críticas favorables por su actuación en la película, y hasta llegó a ser comparado con el actor Marlon Brando, mereciéndole varios premios por su interpretación, como el de mejor actor en el Festival Internacional de Cine de Montreal y \"La Asociación Crítica de Filmes de Los Ángeles\".','https://image.tmdb.org/t/p/original/z3dvKqMNDQWk3QLxzumloQVR0pv.jpg'),
	(131,'Jake Gyllenhaal','1980-12-19','Jacob «Jake» Benjamin Gyllenhaal, (19 de diciembre de 1980) es un actor y productor de cine estadounidense, hijo del director Stephen Gyllenhaal y de la guionista Naomi Foner.​\n\nComenzó a actuar a la edad de diecinueve años. Su primer papel protagonista fue en la película Cielo de octubre (1999), a la cual le siguieron la película independiente de culto Donnie Darko, en la que daba vida a un adolescente con problemas psicológicos y en la que compartía reparto con la actriz Maggie Gyllenhaal, su hermana en la cinta y en la vida real, y The Day After Tomorrow (2004), una película del tema catastrófico del enfriamiento global que supuso su debut en el cine de gran presupuesto y en el que interpretaba a un estudiante, hijo de Dennis Quaid. El año 2005 fue seguramente cuando se produjo su consagración como actor ante el gran público, gracias a su interpretación de un marine frustrado en Jarhead y, sobre todo, al personaje del vaquero Jack Twist en Brokeback Mountain, de Ang Lee, donde compartía protagonismo junto a Heath Ledger. El trabajo de Gyllenhaal, al igual que el de Ledger, fue aclamado por la crítica, que ya en su día había alabado su interpretación en Donnie Darko.\n\nSe ha convertido en un activista político, promoviendo diversas causas políticas y sociales. En los últimos años, ha aparecido en la publicidad de la campaña Rock the Vote, ha prestado públicamente su apoyo al Partido Demócrata de los Estados Unidos en las elecciones de 2004 y ha promovido distintas causas ambientales y en favor de la Unión Estadounidense por las Libertades Civiles.​','https://image.tmdb.org/t/p/original/j2Yahha9C0zN5DRaTDzYA7WtdOT.jpg'),
	(134,'Jamie Foxx','1967-12-13','Eric Marlon Bishop (nacido el 13 de diciembre de 1967), conocido profesionalmente como Jamie Foxx, es un actor, cantante, compositor, comediante y presentador de radio estadounidense. Como actor, su trabajo en la película Ray le valió el Premio de la Academia y el Premio BAFTA al Mejor Actor, así como el Premio Globo de Oro al Mejor Actor en un musical / comedia. También es un músico ganador del Premio Grammy, produciendo dos álbumes que han tenido una gran calificación en el Billboard 200: Unpredictable, que encabezó la lista, e Intuition.\n\nFoxx fue abandonado siete meses después del nacimiento, y posteriormente fue adoptado y criado en Terrell por los padres adoptivos de su madre, Estelle y Mark Talley. Foxx tuvo una estricta educación bautista y comenzó las clases de piano a la edad de cinco años por orden de su abuela. A menudo ha reconocido la influencia de su abuela en su vida como una de las principales razones de su éxito. Cuando descubrió que las comediantes solían ser llamadas primero para actuar, cambió su nombre a Jamie Foxx, sintiendo que era un nombre lo suficientemente ambiguo como para no permitir sesgos. Eligió su apellido como homenaje al comediante Redd Foxx.\n\nDe 1996 a 2001, Foxx protagonizó su propia comedia The Jamie Foxx Show, y en 1992 debutó en el cine en Toys, una comedia dirigida por Barry Levinson. Después de Toys, su primer papel dramático llegó en la película de 1999 de Oliver Stone, Any Given Sunday, donde interpretó a un jugador de fútbol americano de fiesta. Desde entonces, Foxx se ha convertido en un respetado actor dramático. Foxx apareció como el taxista Max Durocher en la película Colateral junto a Tom Cruise, por la cual recibió críticas sobresalientes y una nominación al Premio de la Academia al Mejor Actor de Reparto. Sin embargo, su actuación destacada fue su interpretación de Ray Charles en la película biográfica Ray (2004), por la que ganó el Premio de la Academia al Mejor Actor y el Premio BAFTA al Mejor Actor en un Papel Principal. Foxx es el segundo hombre en la historia en recibir dos nominaciones a los Oscar en el mismo año por dos películas diferentes, Colateral y Ray.\n\nEn septiembre de 2007, Foxx recibió una estrella en el Paseo de la Fama de Hollywood.','https://image.tmdb.org/t/p/original/hPwCMEq6jLAidsXAX5BfoYgIfg2.jpg'),
	(140,'Lucy Liu','1968-12-02','Lucy Alexis Liu Yu Ling (2 de diciembre de 1968) es una actriz estadounidense.\n\nCreció en Queens, Nueva York, con sus padres inmigrantes de Pekín y Shanghái, y estudió en la Universidad de Nueva York durante un año, siendo transferida a la Universidad de Míchigan, donde se graduó en Lenguas y Culturas Asiáticas.','https://image.tmdb.org/t/p/original/9nbtjqsx3De7hO2XDtrBQ7M9VCH.jpg'),
