	(204,'Kate Winslet','1975-10-05','Kate Elizabeth Winslet (nacida el 5 de octubre de 1975) es una actriz inglesa y cantante ocasional. Ella ha recibido multiples premios y nominaciones. Es la persona más joven en acumular seis nominaciones al Premio de la Academia y ganó el Premio de la Academia a la Mejor Actriz por The Reader (2008).\n\nWinslet ha sido aclamado por su trabajo dramático y cómico en proyectos que van desde películas de época hasta películas contemporáneas, y desde las principales producciones de Hollywood hasta películas independientes menos publicitadas. Ha ganado premios del Screen Actors Guild, la Academia Británica de Artes Cinematográficas y de Televisión y la Asociación de Prensa Extranjera de Hollywood, entre otros, y ha sido nominada para un premio Emmy por actuación en televisión. Criada en Berkshire, Winslet estudió teatro desde la infancia y comenzó su carrera en la televisión británica en 1991.\n\nHizo su debut cinematográfico en Heavenly Creatures (1994), por la que recibió sus primeros elogios notables de la crítica. Consiguió reconocimiento por su trabajo posterior en un papel secundario en Sense and Sensibility (1995) y por su papel principal en Titanic (1997), la película más taquillera en ese momento. Desde 2000, las actuaciones de Winslet han seguido recibiendo comentarios positivos de los críticos de cine, y ha sido nominada a varios premios por su trabajo en películas como Quills (2000), Iris (2001), Eternal Sunshine of the Spotless Mind (2004), Finding Neverland (2004), Little Children (2006), The Reader (2008) y Revolutionary Road (2008). Su actuación en este último hizo que la revista New York la describiera como \"la mejor actriz de cine de habla inglesa de su generación\". La comedia romántica The Holiday y la película animada Flushed Away (ambas de 2006) estuvieron entre los mayores éxitos comerciales de su carrera.\n\nWinslet recibió un premio Grammy por Mejor Álbum de Palabras Habladas para Niños en 2000. Ha sido incluida como vocalista en algunas bandas sonoras de obras en las que ha actuado, y el sencillo \"What If\" de la banda sonora de Christmas Carol: The Movie ( 2001), fue un sencillo de éxito en varios países europeos. Winslet tiene una hija con su exmarido, Jim Threapleton, y un hijo con su segundo esposo, Sam Mendes, de quien está separada. Vive en la ciudad de Nueva York. Descripción arriba del artículo de Wikipedia Kate Winslet, con licencia CC-BY-SA, lista completa de colaboradores en Wikipedia,','https://image.tmdb.org/t/p/original/lC788o4YaEsa8tf0RoiYgJKgCd8.jpg'),
	(205,'Kirsten Dunst','1982-04-30','Kirsten Caroline Dunst (Point Pleasant, 30 de abril de 1982)1​ es una actriz, modelo y cantante estadounidense. Debutó en el medio cinematográfico con Oedipus Wrecks, un cortometraje de Woody Allen perteneciente a la antología cinematográfica Historias de Nueva York (1989). A los doce años fue reconocida por su interpretación de la vampiresa Claudia en Entrevista con el vampiro (1994), papel por el cual fue nominada al Globo de Oro como mejor actriz de reparto.3​ Ese mismo año actuó en la película Mujercitas, lo que contribuyó al aumento de su popularidad.\n\nAlcanzó la fama internacional con su participación en la trilogía de Spider-Man, en la cual interpretó a Mary Jane Watson, y por su actuación en la primera entrega recibió el Premio Empire a la mejor actriz. Por este papel fue nominada a galardones como el Premio MTV.4​ Desde entonces ha aparecido en películas como la comedia romántica Wimbledon (2004), el drama de ciencia ficción Eternal Sunshine of the Spotless Mind (2004) y la tragicomedia de Cameron Crowe, Elizabethtown (2005). Además, desempeñó el papel protagónico en Marie Antoinette (2006), dirigida por Sofia Coppola, y protagonizó la comedia How to Lose Friends & Alienate People (2008).\n\nEn 2001, la actriz hizo su debut como cantante en el filme Get Over It, en el cual interpretó dos canciones. También contribuyó con la melodía de jazz After You\'ve Gone para los créditos finales del filme The Cat\'s Meow (2001).5​ A principios de 2008, Dunst confirmó que padecía de depresión y que asistía a un centro de tratamiento,6​ pero en marzo experimentó mejoría y reanudó su carrera artística. En 2011 obtuvo el Premio del Festival de Cannes a la mejor actriz, el galardón más importante de su carrera, por su actuación en el film Melancholia, del director danés Lars von Trier.\n\n*Fuente de los datos, Wikipedia.','https://image.tmdb.org/t/p/original/5dI5s8Oq2Ook5PFzTWMW6DCXVjm.jpg'),
	(227,'William Hurt','1950-03-20','William Hurt es un actor de teatro, cine y televisión estadounidense, formado en la Juilliard School, Manhattan, Nueva York, EE. UU. Por su papel principal en el largometraje \"El beso de la mujer araña\", recibió un premio de la Academia en 1986, seguido de 3 nominaciones más para papeles en las películas \"Hijos de un Dios menor\", \"Broadcast News\" y \"A Historia de la violencia \".','https://image.tmdb.org/t/p/original/j3mjmuHLBW4XQSw53C8Sh0Lh3ZQ.jpg'),
	(228,'Ed Harris','1950-11-28','Ed Harris es un actor de teatro, cine y televisión, escritor, productor y director estadounidense, mejor conocido por interpretar personajes secundarios en largometrajes como \"Apollo 13\", \"A Beautiful Mind\" y \"The Truman Show\", además de muchos papeles recurrentes y protagonistas en programas de televisión, entre ellos la interpretación de El hombre de negro en \"Westworld\" de HBO. Tiene un BFA en Drama del California Institute of the Arts, Valencia, EE. UU.','https://image.tmdb.org/t/p/original/ryF0KkljweLhPkQ70x6w3u9Qjjj.jpg'),
