	(335,'Michael Shannon','1974-08-07','Michael Corbett Shannon nació y se crió en Lexington, Kentucky, hijo de Geraldine Hine, abogada, y Donald Sutherlin Shannon, profesor de contabilidad en la Universidad DePaul. Su abuelo fue el entomólogo Raymond Corbett Shannon.\n\nShannon comenzó su carrera profesional en Chicago. Su primer papel como actor fue en \"Winterset\" en el Centro de Teatro de Illinois. Durante los siguientes años, continuó trabajando en el escenario con compañías como Steppenwolf, The Next Lab y Red Orchid Theatre. Posteriormente se mudó a Londres por un año y actuó en el escenario del West End de Londres en producciones como \"Woyzeck\", \"Killer Joe\" y \"Bug\".\n\nMientras estaba en Chicago, Shannon también se mantuvo ocupada frente a las cámaras de cine y televisión, sobre todo en el proyecto de pantalla grande Chicago Cab (1997), basado en la larga obra de teatro \"Hellcab\". Canguro Jack, trinca y brinca (2003) marcó la tercera producción de Jerry Bruckheimer en la que Shannon ha aparecido. También apareció en Dos policías rebeldes II (2003), dirigida por Michael Bay y protagonizada por Will Smith y Martin Lawrence, y en Ayúdame con el muerto (2003), con Johnny Knoxville y Christina Applegate.\n\nAdemás, Shannon apareció en Pearl Harbor (2001), también dirigida por Bay. Sus otros créditos cinematográficos también incluyen 8 millas (2002) de Curtis Hanson; Cameron Crowe\'s Vanilla Sky (2001) con Tom Cruise; Toda la verdad de Carl Franklin (2002) con Morgan Freeman; Cecil B. Demente (2000) de John Waters, y Tigerland (2000), el drama de guerra de Joel Schumacher.','https://image.tmdb.org/t/p/original/6mMczfjM8CiS1WuBOgo5Xom1TcR.jpg'),
