	(454,'Michael Peña','1976-01-13','Peña nació y se crió en Chicago, a Nicolasa, una trabajadora social, y Eleuterio Peña, que trabajaba en una fábrica de botones. Sus padres eran originarios de México. Después de graduarse de la escuela secundaria, acudió a una convocatoria de casting abierto para la película de Peter Bogdanovich Rebelión en las aulas 2 (1996), y para su sorpresa, venció a cientos de otros jóvenes por un papel. Después de mudarse a Los Ángeles, Peña rápidamente reservó una sucesión de roles en características como Star Maps, Mis queridos compatriotas (1996) (junto a Jack Lemmon y James Garner), La cucaracha (1998) (ganador del premio a la Mejor película en el Festival de cine de Austin) , Bellyfruit (1999) y Disney / Jerry Bruckheimer cuentan con 60 segundos (2000). Michael reside en Los Ángeles, donde toca el bajo con su banda, juega golf y cajas para relajarse.','https://image.tmdb.org/t/p/original/4ZwGDhtZq6emoYLPEHFCXQubPCE.jpg'),
	(478,'Jamie Bell','1986-03-14','','https://image.tmdb.org/t/p/original/xAfNYOJYOy5ee9PHbBF8Y6xzZ9I.jpg'),
	(502,'Miranda Otto','1967-12-16','Miranda Lin Otto (16 de diciembre de 1967) es una actriz australiana reconocida mundialmente por el papel de la doncella guerrera Éowyn en la trilogía de El Señor de los Anillos, dirigida por Peter Jackson y por su papel como Zelda Spellman en la serie Chilling Adventures of Sabrina (Netflix). Siendo de una familia de actores, Otto comenzó a actuar a la edad de 19 años, y desde entonces ha aparecido en una amplia variedad de películas de bajo presupuesto, así como en proyectos de grandes estudios.\n\nSu primera actuación notable la representó en Emma\'s War (1986), en la que interpretó a una adolescente que se muda a Australia durante la Segunda Guerra Mundial. Tras una década de papeles aclamados por la crítica australiana, atrajo la atención de Hollywood al aparecer en dos papeles secundarios, en La delgada línea roja (1998) y What Lies Beneath (2000). No obstante, su interpretación más famosa la llevó a cabo en 2002, cuando se integró en el elenco de las películas de El Señor de los Anillos.\n\nEn 2008, protagonizó la serie de televisión estadounidense Cashmere Mafia (que se canceló a mediados de ese año). En cuanto a su vida privada, la actriz ha estado relacionada sentimentalmente con los actores Richard Roxburgh y Peter O\'Brien, lo cual ha sido comentado varias veces en los medios de comunicación.','https://image.tmdb.org/t/p/original/szME1IBVTLgiKrO5D5wvOGnvUDW.jpg'),
	(517,'Pierce Brosnan','1953-05-16','','https://image.tmdb.org/t/p/original/dzXVwwJLPwiZeXOnf7YxorqVEEM.jpg'),
	(518,'Danny DeVito','1944-11-17','Daniel Michael \"Danny\" DeVito, Jr. (Neptune, Nueva Jersey, Estados Unidos, 17 de noviembre de 1944) es un actor, director y productor estadounidense. Premiado con los premios Globo de Oro y Emmy por su participación en la comedia de situación Taxi. Destacado por su trabajo en los filmes Twins, La guerra de los Rose, Hoffa, Erin Brockovich, Batman Returns y Man on the Moon, entre otras.\n\nDeVito es descendiente de italianos. con una apariencia muy reconocible y con un humor muy punzante que llega fácilmente al público. Es muy conocido en su país por ser Louie De Palma en la serie Taxi (1980), a pesar de haber actuado en películas como Alguien voló sobre el nido del cuco y La fuerza del cariño.\n\nSu participación en las comedias Los gemelos golpean dos veces, La guerra de los Rose, y Batman Regresa lo hicieron mundialmente famoso y lo encasillaron en ese género. DeVito luchó contra esta etiqueta haciendo interpretaciones muy respetadas en películas como L.A. Confidential, Heist, y The Big Kahuna.\n\nEn 1999, produjo y coprotagonizó Man on the Moon, una película protagonizada por Jim Carrey ambientada en la inusual vida del cómico estadounidense Andy Kaufman. Actuó en Batman Regresa, Mars Attacks! y Big Fish -las tres dirigidas por Tim Burton.\n\nEn 1996 interpretó a un verdadero mal ejemplo de padre en la película Matilda, donde aparece como Harry Wormwood, un chabacano y deshonesto estafador que trabaja en un taller vendiendo autos que construye con refacciones robadas y en mal estado, y que por esa única razón, los autos que vende, nunca funcionan bien.\n\nEn 2004 apareció en Friends.\n\nEn el 2012, participó en el papel de Frank Reynolds en la serie It\'s Always Sunny in Philadelphia. También en la película Lorax. En busca de la trúfula perdida poniendo su voz en el personaje El Lorax, y en la versión hispana también, es decir que participó tanto en la versión original como en su doblaje.\n\nEn octubre de 2014 tuvo una participación especial en el video de One Direction \"Steal My Girl\".\n\nEn 2015 actuó en la comedia Deadbite en la cual también actúa su hija Lucy DeVito.','https://image.tmdb.org/t/p/original/uLW4Y9yjtwxtVmcJfwHZ7sKJai4.jpg'),
	(529,'Guy Pearce','1967-10-05','Guy Edward Pearce (Ely, Cambridgeshire, 5 de octubre de 1967) es un actor australiano nacido en el Reino Unido. Su primer éxito en el cine fue actuando como travestí en Las aventuras de Priscilla, reina del desierto en 1994, a partir de ese momento empezó actuar en muchas producciones estadounidenses, incluyendo L.A. Confidential, Memento, The Count of Monte Cristo y The Time Machine. A la vez sigue actuando en obras de teatro en Australia y en películas. Actualmente vive en Melbourne, Australia.\n\nPearce nació en Ely, Cambridgeshire, Inglaterra, Reino Unido. Hijo de Anne Cocking, profesora de economía y costura y originaria del condado de Durham, y de Stuart Pearce, un piloto de pruebas neozelandés que falleció cuando Pearce tenía nueve años. A los tres años de edad se mudó junto a su familia a Geelong, Australia, donde su madre administraba una granja de ciervos.\n\nAsistió a la preparatoria The Geelong College y fue miembro de la compañía de teatro GSODA Junior Players. Desde los 16 hasta los 42 años practicó fisicoculturismo y participó en un concurso como representante de Victoria donde obtuvo el título Mr. Natural.\n\nPearce siempre estuvo interesado en actuar, por lo tanto empezó de niño en algunas obras, y luego, en 1985 fue contratado para la televisión. En la década de 1980 vivió en Blackburn North y trabajó en la serie de televisión australiana Neighbours.\n\nSus aficiones son el body building y la música, es compositor y toca varios instrumentos. Guy Pearce es vegetariano y estuvo casado desde 1997 y hasta 2015 con Kate Mestitz, su novia de largos años. Desde 2015 mantiene una relación con la actriz neerlandesa Carice van Houten, con quien tuvo su primer hijo, Monte Pearce, nacido en 2016.','https://image.tmdb.org/t/p/original/wIUR413lEyzEzitCLgToItwVZBr.jpg'),
	(534,'Mark Boone Junior','1955-03-17','','https://image.tmdb.org/t/p/original/rcncVr356hpfKX9qOrKL3SJlEO7.jpg'),
	(536,'Jorja Fox','1968-07-07','','https://image.tmdb.org/t/p/original/hCRdbNzZjkhYyVoZPmhYF5OqpaX.jpg'),
	(586,'Sean Young','1959-11-20','Sean Young es una actriz estadounidense.\n\nYoung nació en Louisville, Kentucky hija de Donald Young y Lee Guthrie. Modelo y bailarina experimentada, Sean hizo su debut en el cine en 1980 en la película Jane Austen in Manhattan, al que seguirían en 1981 El pelotón chiflado y, sobre todo, la película por la que sería reconocida en todo el mundo: la inolvidable replicante de Blade Runner (1982). Young también haría el casting para interpretar el papel de Marion Ravenwood en En busca del arca perdida, pero finalmente el papel se lo llevó Karen Allen.\n\nDe todas maneras, la década de los 80 y principio de los 90 fue brillante para la carrera de Young, ya que pudo interpretar papeles importantes y de gran calidad. Entre ellos, destacan No hay salida, Dune de David Lynch, Wall Street, Ace Ventura o Baby, el secreto de una leyenda perdida. También perdió grandes oportunidades como la de interpretar el papel que hizo Robin Wright Penn en La princesa prometida, el papel de Vicki Vale en Batman, papel que interpretaría Kim Basinger y en Batman returns, el papel de Catwoman, que también perdería en favor de Michelle Pfeiffer.\n\nEn los últimos años, Young ha estado ocupada con una variedad de películas independientes así como participaciones en televisión. Más recientemente ha estado cuatro meses en Rusia filmando la miniserie en la que interpreta a la bailarina Isadora Duncan.','https://image.tmdb.org/t/p/original/Ap2c6qruZtr2JJ1lbXwBG8HSqId.jpg'),
	(587,'Edward James Olmos','1947-02-24','Edward James Olmos es un actor y director estadounidense. Fue notablemente conocido a mediados-finales de los años 1980 por interpretar al Teniente Castillo, en la serie de televisión estadounidense Miami Vice; y más recientemente por interpretar el papel de William Adama, comandante de la flota en la versión reimaginada de la serie de televisión Battlestar Galactica.','https://image.tmdb.org/t/p/original/mXnilUrQBIMLHSQkPjQk99mX70x.jpg'),
