	(658,'Alfred Molina','1953-05-24','Alfred Molina (24 de mayo de 1953) es un actor inglés, es mayormente conocido por su papel del Doctor Octopus en la película de 2004 Spider-Man 2. También ha participado en otras películas como El código Da Vinci, The Pink Panther 2, El Aprendiz de Brujo, Prince of Persia, Frida entre otras. También hizo acto de presencia en la serie Law & Order: Los Angeles bajo el papel de Ricardo Morales.','https://image.tmdb.org/t/p/original/nJo91Czesn6z0d0pkfbDoVZY3sg.jpg'),
