	(880,'Ben Affleck','1972-08-15','Actor, guionista, productor y director norteamericano, nacido en Berkeley, California. Obtuvo un Oscar de la Academia de Hollywood por su guión de la película El indomable Will Hunting (1997), compartido con Matt Damon. Comenzó a hacerse conocido en la película Mallrats, de 1995, para saltar casi a continuación a la fama con la actuación en, El indomable Will Hunting. Atrás quedaban diversas participaciones en otras películas de poca trascendencia, incluyendo el rol principal en Chasing Amy, de 1997. Se pudo situar entonces como actor de papeles centrales de películas de alto presupuesto, tales como Armageddon (1998) Pearl Harbor (2001), Al límite de la verdad (2002), Pánico nuclear (2002) y Daredevil (2003). Junto a su amigo de la infancia, el también actor y director Matt Damon, fundaron una empresa de producción de películas llamada LivePlanet. Su estilo como actor ha pasado por los más variados registros, desde comedias románticas a películas patrióticas, desde un personaje unidimensional como el de la serie de Tom Clancy, el espía Jack Ryan, interpretado anteriormente por Harrison Ford, hasta la compleja elaboración del amigo del genio, aquél que se da cuenta que nunca en su vida podrá salir del suburbio pobre en el que vive. Su debut como director, con la película Adiós pequeña, adiós (2007), con guión del escritor Dennis Lehane, tuvo buenos comentarios de la crítica.','https://image.tmdb.org/t/p/original/u525jeDOzg9hVdvYfeehTGnw7Aa.jpg'),
	(883,'Will Patton','1954-06-14','','https://image.tmdb.org/t/p/original/iDW1L8HAbj8y6L9GlEMWPeI1zpK.jpg'),
	(884,'Steve Buscemi','1957-12-13','','https://image.tmdb.org/t/p/original/lQKdHMxfYcCBOvwRKBAxPZVNtkg.jpg'),
	(887,'Owen Wilson','1968-11-18','Owen Cunningham Wilson (18 de noviembre de 1968) es un actor de cine, humorista y guionista estadounidense.  Conocido principalmente por sus papeles en Zoolander y Shanghai Noon. Como guionista estuvo nominado al Óscar al mejor guion original por el guion de la película The Royal Tenenbaums, escrito junto a Wes Anderson, con quien ha colaborado como actor en varias de sus películas. También ha colaborado con Ben Stiller en varias películas entre ellas podemos mencionar la trilogía de Night at the Museum, Los padres de ella y Zoolander, entre otras.','https://image.tmdb.org/t/p/original/op8sGD20k3EQZLR92XtaHoIbW0o.jpg'),
	(934,'Russell Crowe','1964-04-07','Russell Ira Crowe (Wellington, Nueva Zelanda, 7 de abril de 1964) es un actor, director, productor de cine y músico neozelandés.\n\nCrowe captó la atención internacional por su papel como el general romano Maximus Decimus Meridius en la histórica película épica Gladiador (2000), dirigida por Ridley Scott, film por el que Crowe ganó un Óscar al mejor actor, un Premio de la Asociación de Críticos de Cine al Mejor Actor, un Premio Empire al Mejor Actor, un London Film Critics Circle Award por Mejor Actor y más de 10 candidaturas a mejor actor. Interpretó a Jeffrey Wigand en la película The Insider (El Dilema) (1999), por la que recibió cinco premios como mejor actor y siete nominaciones en la misma categoría. También, la representación de Crowe del matemático y Premio Nobel John Forbes Nash en la película biográfica A Beautiful Mind (Una mente maravillosa) (2001) le trajo numerosos premios, incluyendo un premio BAFTA al Mejor Actor en un papel principal, un Globo de Oro al Mejor Actor en una Película de Drama y un Premio del Sindicato de Actores al Mejor Actor.\n\nOtras películas destacables de Crowe son Romper Stomper (1992), Virtuosity (1995),L. A. Confidential (1997), Proof of Life (Prueba de vida) (2000),Master and Commander: Al otro lado del mundo (2003), Cinderella Man ​​(2005), American Gangster (2007), La sombra del poder (2009), Robin Hood (2010), Los próximos tres días (2010), Les Misérables (2012), El hombre de los puños de hierro (2012), El hombre de acero (2013), Noé (2014) y El maestro del agua (2014). Las obras fílmicas de Crowe le ha valido varios reconocimientos durante su carrera, incluyendo una estrella en el Paseo de la fama de Hollywood, tres consecutivas nominaciones de la Academia de Artes y Ciencias Cinematográficas (1999-2001), uno de los premios Globo de Oro al mejor actor, un BAFTA y un Premio de la Academia.','https://image.tmdb.org/t/p/original/mGTtPuwE8OR00tkJGmVLJmt8KpW.jpg'),
	(935,'Connie Nielsen','1965-07-03','Connie Inge-Lise Nielsen (3 de julio de 1965) es una actriz, bailarina y cantante danesa.\n\nAdemás del danés, habla fluidamente el alemán, inglés, sueco, francés e italiano.','https://image.tmdb.org/t/p/original/lvQypTfeH2Gn2PTbzq6XkT2PLmn.jpg'),
	(938,'Djimon Hounsou','1964-04-24','Djimon Gaston Hounsou (24 de abril de 1964) es un actor, y modelo beninés, nacionalizado estadounidense, de cine y televisión. Es conocido por participar en películas como Gladiator, La Isla, Diamantes de sangre y In America, habiendo sido nominado al Óscar por las dos últimas películas en la categoría de mejor actor de reparto.','https://image.tmdb.org/t/p/original/hco0KMbrxACYTmBfAkSzCf23CXV.jpg'),
	(976,'Jason Statham','1967-07-26','Jason Statham (Derbyshire, 26 de Julio de 1967)​ es un actor de cine y modelo inglés.\n\nEs mundialmente famoso por sus papeles en películas de acción y aventura como Lock and Stock (1998), Snatch: cerdos y diamantes (2000), Revólver (2005), La carrera de la muerte (2008) y Blitz (2011), así como por interpretar a Chev Chelios en la película Crank (2006) y su secuela Crank: High Voltage (2009), a Arthur Bishop en las películas The Mechanic (2011) y su secuela Mechanic: Resurrection (2016), por protagonizar la trilogía de Transporter como Frank Martin, a Lee Christmas en la serie películas de The Expendables y a Deckard Shaw en la serie de películas de Fast & Furious. Con su aspecto de tipo duro, Jason Statham ha sabido hacerse un hueco en el cine, siendo su especialidad el género de acción, afianzando que los papeles de riesgo son lo suyo. Por lo general realiza sus propias escenas de acción sin dobles​ y destaca por ser encasillado como un antihéroe en sus personajes.','https://image.tmdb.org/t/p/original/lldeQ91GwIVff43JBrpdbAAeYWj.jpg'),
