	(1125,'Ewen Bremner','1972-01-23','Ewen Bremner (23 de enero de 1972) es un actor escocés, cuyas interpretaciones más conocidas son: Red Winkle en la película Pearl Harbor, Spud en la película Trainspotting y en su secuela T2: Trainspotting y Shawn Nelson en la película Black Hawk Down.','https://image.tmdb.org/t/p/original/gge4f8Smr6nTjh6XscnmeRTa297.jpg'),
