	(1229,'Jeff Bridges','1949-12-04','Jeffrey Leon Bridges (4 de diciembre de 1949), mejor conocido como Jeff Bridges, es un actor, músico, productor, fotógrafo, dibujante, narrador y viticultor estadounidense ganador del premio Óscar, del Globo de Oro, del Premio del Sindicato de Actores y del Premio Cecil B. DeMille por su trayectoria profesional. Es hijo del legendario actor Lloyd Bridges.','https://image.tmdb.org/t/p/original/xms1RAY6q7Lzp7wNeRCB0kzhucn.jpg'),
	(1230,'John Goodman','1952-06-20','','https://image.tmdb.org/t/p/original/yyYqoyKHO7hE1zpgEV2XlqYWcNV.jpg'),
	(1231,'Julianne Moore','1960-12-03','Julie Anne Smith (3 de diciembre de 1960), más conocida por su nombre artístico Julianne Moore, es una actriz y productora estadounidense de origen escocés, quien es una de las pocas actrices que ha ganado los cuatro premios más importantes de la industria cinematográfica: el Premio Óscar, los Globos de Oro, el Premio BAFTA y el Premio del Sindicato de Actores por sus interpretaciones en diversos papeles.​ También ha sido galardonada con un premio Primetime Emmy, la Copa Volpi a la mejor actriz, el Premio del Festival de Cannes a la mejor actriz y el Oso de plata del Festival Internacional de Cine de Berlín.\n\nEs conocida por su participación en películas como The Lost World: Jurassic Park (1997), Boogie Nights (1997), Magnolia (1999), Hannibal (2001), Las horas (2002), Far from Heaven (2002), Children of Men (2006), A Single Man (2009), The Kids Are All Right (2011), Carrie (2013), Maps to the Stars (2014), Still Alice (2014), Los juegos del hambre: sinsajo - Parte 1 (2014), Sinsajo - Parte 2 (2015) y Freeheld (2015).','https://image.tmdb.org/t/p/original/3YF19rWusxWfEI59ZM33dFhasRq.jpg'),
	(1236,'Mark Pellegrino','1965-04-09','','https://image.tmdb.org/t/p/original/aYlypQrn0LLd1KjHWZDBYcWRvTl.jpg'),
	(1245,'Scarlett Johansson','1984-11-22','Scarlett Johansson, es una actriz, modelo y cantante estadounidense. Hizo su debut cinematográfico en North (1994) y más tarde fue nominada para el premio Independent Spirit a la mejor protagonista femenina por su actuación en Manny & Lo (1996), obteniendo más aclamación y prominencia con papeles en The Horse Whisperer (1998) y Ghost. Mundo (2001). Pasó a papeles adultos con sus actuaciones en Girl with a Pearl Earring (2003) y Lost in Translation (2003) de Sofia Coppola, por la que ganó un premio BAFTA a la Mejor Actriz en un Papel Protagónico; ambas películas también le valieron nominaciones al Globo de Oro.\n\nUn papel en A Love Song for Bobby Long (2004) le valió a Johansson su tercera nominación al Globo de Oro a la Mejor Actriz. Johansson obtuvo otra nominación al Globo de Oro a la Mejor Actriz de Reparto con su papel en Match Point de Woody Allen (2005). Ha interpretado al personaje del cómic de Marvel Black Widow / Natasha Romanoff en Iron Man 2 (2010), The Avengers (2012) y Captain America: The Winter Soldier (2014), Avengers: Age of Ultron (2015), Captain America: Civil War (2016), Avengers: Infinity War (2018), Avengers: Endgame (2019) y Black Widow (2020). La reposición de Broadway en 2010 de A View From the Bridge, de Arthur Miller, le valió a Johansson el premio Tony a la mejor interpretación de una actriz destacada en una obra de teatro. Como cantante, Johansson ha lanzado dos álbumes, Anywhere I Lay My Head y Break Up.\n\nJohansson fue nominada a dos premios de la Academia en 2020 por su trabajo en Marriage Story (2019) y Jojo Rabbit (2019). Su padre, Karsten Johansson, es un arquitecto nacido en Dinamarca, y su abuelo paterno, Ejner Johansson, fue guionista y director. Su madre, Melanie Sloan, productora, proviene de una familia judía Ashkenazi del Bronx. Johansson tiene una hermana mayor, Vanessa, que es actriz; un hermano mayor, Adrian; un hermano gemelo, Hunter (que apareció en la película Manny & Lo con Scarlett); y un medio hermano, Christian, del nuevo matrimonio de su padre.','https://image.tmdb.org/t/p/original/mODcczqQyKuphfFAoBZGhxgnNfs.jpg'),
