	(1371,'David Wenham','1965-09-21','David Wenham (Marrickville, Nueva Gales del Sur; 21 de septiembre de 1965) es un actor de cine y televisión australiano, que alcanzó la fama en su país con la película The Boys en 1998, y la internacional en 2002 por su papel de Faramir en la trilogía de El Señor de los Anillos de Peter Jackson.','https://image.tmdb.org/t/p/original/F7CWSqUE75HtrcdqIQ7UMZ9aTX.jpg'),
	(1372,'Karl Urban','1972-06-07','Karl Heinz Urban (7 de junio de 1972) es un actor neozelandés, famoso por papeles cinematográficos como el de Éomer en la trilogía de El Señor de los Anillos o el de Pathfinder, u otros televisivos como el de Julio César en la serie de televisión Xena: la princesa guerrera; y más recientemente por encarnar al doctor Leonard McCoy en Star Trek y al juez Dredd en la película británica Dredd 3D (2012).','https://image.tmdb.org/t/p/original/noh94S1b6t8JIEBC1KMdoh3DPB3.jpg'),
	(1381,'John Noble','1948-08-20','John Noble (nacido el 20 de agosto de 1948, altura 5\' 11¾\" (1,82 m)) es un actor de cine y televisión australiano, y director de teatro de más de 80 obras.  Nació en Port Pirie, Australia del Sur, Australia, y actualmente está protagonizando como científico Walter Bishop en la serie de televisión Fringe de J. J. Abrams.\n\nHizo apariciones ocasionales en la serie de televisión Todos los Santos.  Es conocido internacionalmente por su actuación como Denethor en la trilogía El Señor de los Anillos.  Su última película es Una noche con el rey.  Interpretó al cónsul ruso Anatoly Markov en la sexta temporada de la serie televisiva estadounidense 24.  En 2011 será protagonista como agente inmobiliario en el videojuego de Rockstar L.A. Noire.','https://image.tmdb.org/t/p/original/hYBf3SVAySRrVsjCjhdypqedqk0.jpg'),
