	(1532,'Bill Murray','1950-09-21','William James \"Bill\" Murray (21 de septiembre de 1950) es un actor y humorista estadounidense. Obtuvo reconocimiento en el programa de humor Saturday Night Live, actuación que le valió obtener un premio Emmy, y más tarde protagonizó películas cómicas como Caddyshack (1980), Los Cazafantasmas (1984) y Groundhog Day (1993). Obtuvo elogios de la crítica por su actuación en películas como Lost in Translation (2003), por la cual fue nominado al Óscar, y en producciones dirigidas por Wes Anderson como Rushmore (1998), The Royal Tenenbaums (2001) y The Life Aquatic with Steve Zissou (2004).\n\nHa sido nominado al Globo de Oro por sus papeles en Los Cazafantasmas, Rushmore (1998), Hyde Park on Hudson (2012), St. Vincent (2014) y en la miniserie de HBO Olive Kitteridge (2014), por la que ganó su segundo premio Primetime Emmy. También recibió el premio Mark Twain en 2016 en honor a su carrera como comediante.​ Su estilo de comedia es reconocido como humor seco, presentado sin variación de emociones o lenguaje corporal.','https://image.tmdb.org/t/p/original/nnCsJc9x3ZiG3AFyiyc3FPehppy.jpg'),
	(1542,'Willie Garson','1964-02-20','','https://image.tmdb.org/t/p/original/lsODqbgT4mpzXHxf8MWCYOZGULc.jpg'),
	(1620,'Michelle Yeoh','1962-08-06','','https://image.tmdb.org/t/p/original/wPI2wn6WJEtJr1oAMTLBLh92Ryc.jpg'),
	(1639,'Emily Watson','1967-01-14','Siempre había estado interesada en la actuación y aunque su primera solicitud para ingresar a la escuela de actuación fue rechazada, siguió perseverando y pasó varios años en obras de teatro de la Royal Shakespeare Company donde trabajó entre 1990-96.\n\nLa primera aparición de Watson en la pantalla grande fue en 1996 en la película Breaking the Waves, dirigida por el danés Lars von Trier. En Breaking the Waves Watson interpretó a Bess McNeil, una mujer ciegamente enamorada de su marido hasta el punto de someterse a cualquier cosa con tal de demostrar su amor. Este drama le valió dos nominaciones como mejor actriz para el Globo de Oro y el Oscar.\n\nEn 1997 Watson regresó al cine con The Mill on the Floss, The Boxer y Metroland. En 1999, otra vez como en 1996, Watson fue nominada para un Oscar como mejor actriz por su interpretación de la chelista británica Jacqueline du Pré en la película Hilary and Jackie. En 1999 actuó en Cradle Will Rock, estrenada en España como Abajo el telón, dirigida por Tim Robbins, y Las cenizas de Ángela, adaptación de la novela Angela\'s Ashes escrita por Frank McCourt y ganadora de un Premio Pulitzer.\n\nA lo largo de su carrera Watson ha alternado filmes de directores de culto, como Robert Altman (Gosford Park) y Alan Parker (Las cenizas de Ángela), con otros más comerciales, de directores como Tim Burton (Corpse Bride) y Steven Spielberg (War Horse). En 2002 intervino en Red Dragon, filme perteneciente a saga fílmica sobre el personaje de Hannibal Lecter.\n\nEn 2010, encarnando a la trabajadora social Margaret Humphreys en Oranges and Sunshine1​recibió varios premios por su labor. Watson se casó con Jack Waters, en 1995 y su hija Juliet, nació en 2005 seguida por Dylan en 2008. Watson recibió el Premio Donostia en la edición de 2015 del Festival de Cine de San Sebastián en reconocimiento a su carrera.','https://image.tmdb.org/t/p/original/mxdvFzjhKrRUhpZLdrwp3u00dP6.jpg'),
	(1640,'Stellan Skarsgård','1951-06-13','Stellan John Skarsgård (13 de junio de 1951) es un actor sueco de cine, televisión y teatro. Ganó el Oso de Plata del Festival de Berlín de 1982, entre otros.\n\nAlgunos de sus papeles más conocidos son el del profesor Lambeau, en El indomable Will Hunting; el de Bill Anderson, en la película Mamma Mia!; el de Bill «Bootstrap» Turner, en la saga «Piratas del Caribe», y el del Dr. Erik Selvig, en las películas Thor (2011), The Avengers (2012), Thor: The Dark World (2013) y Avengers: Age of Ultron (2015).','https://image.tmdb.org/t/p/original/x78BtYHElirO7Iw8bL4m8CnzRDc.jpg'),
