	(1812,'Michelle Williams','1980-09-09','Michelle Ingrid Williams (9 de septiembre de 1980) es una actriz estadounidense.\n\nSaltó a la fama por su interpretación de Jennifer Lindley en la serie de televisión Dawson\'s Creek. Por su participación en las películas Brokeback Mountain y Manchester by the sea recibió nominaciones de los Premios Óscar a la mejor actriz de reparto, y por las películas Blue Valentine y My Week with Marilyn recibió una nominación a mejor actriz.','https://image.tmdb.org/t/p/original/sXTP6wlqIDz1tDGLU3DFbklSTpq.jpg'),
	(1817,'Linda Cardellini','1975-06-25','Linda Edna Cardellini (nacida el 25 de junio de 1975) es una actriz de cine y televisión estadounidense. Es más conocida por sus papeles como estudiante de secundaria Lindsay Weir en Freaks and Geeks, como Velma Dinkley en las películas de Scooby-Doo y como Samantha Taggart en Urgencias (ER).','https://image.tmdb.org/t/p/original/bcycvynDprC1rrhBNrnBjn5uOUd.jpg'),
	(1892,'Matt Damon','1970-10-08','Matthew Paige Damon (Cambridge, Massachusetts; 8 de octubre de 1970) es un actor, guionista y filántropo estadounidense. Su carrera se inició a raíz del éxito de la película Good Will Hunting (1997), a partir de un guion escrito con su amigo Ben Affleck. Fue ganador del premio Óscar al mejor guion original por Good Will Hunting y nominado a mejor actor por el mismo trabajo.\n\nDamon desde entonces ha participado en películas de éxito comercial como Saving Private Ryan (1998) o dando vida a Jason Bourne.\n\nMatt Damon nació en Cambridge (Massachusetts), hijo de Kent Telfer Damon, agente inmobiliario y excorredor de bolsa, y de Nancy Carlsson-Paige, maestra infantil y profesora en la Universidad de Lesley y tiene un hermano, Kyle, que es un escultor y artista','https://image.tmdb.org/t/p/original/cQanDcd6nNz2hIlJRib126feqZE.jpg'),
	(1894,'Scott Caan','1976-08-23','Scott Andrew Caan (23 de agosto de 1976) es un actor estadounidense. Es mejor conocido por su papel como Danny Williams en la serie de televisión Hawaii Five-0, por el que fue nominado para un Globo de Oro. Es hijo del actor James Caan.\n\nEn cuanto al cine, formó parte del elenco de la trilogía compuesta por Ocean\'s Eleven, Ocean\'s Twelve y Ocean\'s Thirteen. También participó en la película Into the Blue, junto a Paul Walker, Jessica Alba y Ashley Scott. En 2009 protagonizó junto a Chris Pratt y Brendan Hines la comedia Deep in the Valley.','https://image.tmdb.org/t/p/original/67V8YrMglGzvuTOZGpqygDhNK1z.jpg'),
	(1896,'Don Cheadle','1964-11-29','Donald Frank Cheadle (29 de noviembre de 1964) es un actor y productor de cine y televisión estadounidense. Ganador del Globo de Oro al mejor actor de reparto - Serie, miniserie o telefilme y dos veces ganador del Premio del Sindicato de Actores al mejor reparto.\n\nCandidato a los Premios Óscar, Emmy y BAFTA.1​ Conocido por sus intervenciones en películas como Boogie Nights (1997), Traffic (2000), Ocean\'s Twelve (2004), Hotel Rwanda (2004), Crash (2004), El vuelo (2012).\n\nEs conocido por interpretar a Teniente Coronel James «Rhodey» Rhodes en las películas del Universo cinematográfico de Marvel Iron Man 2 (2010), Iron Man 3 (2013), Avengers: Age of Ultron (2015), Capitán América: Civil War (2016), Avengers: Infinity War (2018) y Avengers: Endgame (2019).','https://image.tmdb.org/t/p/original/b1EVJWdFn7a75qVYJgwO87W2TJU.jpg'),
	(1906,'Scott L. Schwartz','1959-03-16','','https://image.tmdb.org/t/p/original/osZ4griKNjwe7zSee2xcV89qBcU.jpg'),
	(1909,'Conchata Ferrell','1943-03-28','Conchata Galen Ferrell (28 de marzo de 1943 - 12 de octubre de 2020) fue una actriz estadounidense.\n\nEs reconocida por su papel de Berta, el ama de llaves, en la comedia televisiva Two and a Half Men, por la cual recibió dos nominaciones a los premios Emmy (en 2005 y 2007) como mejor actriz de reparto en una serie cómica. También fue nominada en 1992 como mejor actriz de reparto en una serie dramática por su papel como Susan Bloom en L.A. Law.','https://image.tmdb.org/t/p/original/1CuSudlDbvrhFSpXPckzlMfzLiJ.jpg'),
	(1920,'Winona Ryder','1971-10-29','Winona Laura Horowitz (29 de octubre de 1971), más conocida como Winona Ryder, es una actriz estadounidense dos veces nominada al Óscar y ganadora de un Globo de Oro. Aunque su debut fue en Lucas (1986), su primer rol importante fue interpretando a Lydia, una adolescente de estética gótica, en la película Beetlejuice (1988).\n\nDespués de varias apariciones en la televisión y en la radio, apareció en el filme Escuela de jóvenes asesinos, en un papel tan criticado como aclamado. En 2000 recibió una estrella en el Paseo de la fama de Hollywood, California.','https://image.tmdb.org/t/p/original/5yteOSY2lgGOgSWmRTlxqfY59MS.jpg'),
	(1925,'Vincent Cassel','1966-11-23','','https://image.tmdb.org/t/p/original/ykBEiVh6YQ9UmMAYUiQkZBH3VV4.jpg'),
