	(1951,'Elisabeth Shue','1963-10-06','Elisabeth Judson Shue (nacida el 6 de octubre de 1963) es una actriz estadounidense, mejor conocida por sus papeles protagonizados en las películas The Karate Kid (1984), Aventuras de niñeras (1987), Cocktail (1988), Regreso al futuro Parte 2 ( 1989), Regreso al futuro Parte3I (1990), Soapdish (1991), Leaving Las Vegas (1995), The Saint (1997), Hollow Man (2000) y Piranha 3D (2010). Ha ganado varios premios de actuación y ha sido nominada para un Premio de la Academia, un Globo de Oro y un BAFTA. Interpretó a Julie Finlay en el drama criminal forense de procedimiento de CBS CSI: Crime Scene Investigation de 2012 a 2015. Más recientemente tuvo papeles secundarios en Batalla de sexos (2017) y Death Wish (2018). También fue una serie regular en la primera temporada de la serie de Amazon The Boys (2019). Descripción anterior del artículo de Wikipedia Elisabeth Shue, licenciada bajo CC-BY-SA, lista completa de contribuyentes en Wikipedia.','https://image.tmdb.org/t/p/original/oYSPh5yw1t8biktENTGS8X7n4zg.jpg'),
