	(2037,'Cillian Murphy','1976-05-25','Cillian Murphy (25 de mayo de 1976) es un actor de cine, teatro y televisión irlandés mayormente conocido por dar vida a Thomas Shelby de la serie de televisión inglesa Peaky Blinders y a El Espantapájaros en Batman Begins. Ha participado en varias películas dirigidas por Danny Boyle y Christopher Nolan, dos de los directores británicos con mayor proyección internacional.','https://image.tmdb.org/t/p/original/i8dOTC0w6V274ev5iAAvo4Ahhpr.jpg'),
