	(2219,'Tobey Maguire','1975-06-27','Tobias Vincent Maguire ( 27 de junio de 1975) es un actor y productor de cine estadounidense. Ha interpretado a Peter Parker en la primera trilogía de la serie de películas de Spider-Man.\n\nComenzó su carrera con papeles menores en series de televisión y telefilmes. En 1997 tuvo un papel de reparto en La tormenta de hielo, de Ang Lee y en Deconstructing Harry de Woody Allen. Ya en la década de 2000, trabajó en Wonder Boys (2000), las tres películas basadas en el cómic Spider-Man y en la candidata al Premio Óscar a la mejor película, Seabiscuit (2003). Concluida la trilogía de Spider-Man, fue aclamado por la crítica debido a su interpretación en Brothers (2009), donde actuó junto a Jake Gyllenhaal y Natalie Portman. Por su trabajo, Maguire recibió una nominación al Premio Globo de Oro como mejor actor dramático. En 2013, protagonizó la película El gran Gatsby junto a Leonardo DiCaprio.\n\nEs vegano, y en 2002 la organización Personas por el Trato Ético de los Animales lo nombró «vegetariano más sexy del mundo».','https://image.tmdb.org/t/p/original/kOJelnLSb89SeivbOCt1l94Hz2d.jpg'),
