	(2224,'Christian Slater','1969-08-18','Christian Michael Leonard Slater es un actor estadounidense. Asistió al prestigioso Dalton School y al Professional Children School. Su debut en el cine fue en 1985, en la película The Legend of Billie Jean.','https://image.tmdb.org/t/p/original/6ww3uweEEXMlvtNjTlgBHxLErPF.jpg'),
	(2227,'Nicole Kidman','1967-06-20','Nicole Mary Kidman (20 de junio de 1967), más conocida como Nicole Kidman, es una actriz y productora australiana nacida en los Estados Unidos. Ganadora de un Óscar, cuatro Globos de Oro, dos Emmy y un Bafta. Entre 2006 y 2009 se convirtió en la actriz mejor pagada de la industria cinematográfica.\n\nDespués de hacer varias apariciones en teatro, cine y televisión, Kidman obtuvo el papel que la precipitó a la fama en el thriller de 1989 Calma total. Sus actuaciones en varias películas, tales como Todo por un sueño (1995), Moulin Rouge!, Los otros (2001), y Las horas (2002), han recibido alabanzas por parte de la crítica y en la década de 2000 sería considerada una de las mejores actrices del mundo. En 2003, Kidman recibió su estrella en el Paseo de la Fama de Hollywood en Hollywood, California. Kidman es también embajadora de buena voluntad del Fondo de Desarrollo de las Naciones Unidas para la Mujer (Unifem) y Unicef. El 21 de octubre de 2009 la actriz pidió una respuesta integral a la violencia que padecen las mujeres ante el Congreso de los Estados Unidos.\n\nEn 2006, Kidman recibió el honor civil más importante de Australia, siendo condecorada como dama compañera de la Orden de Australia.','https://image.tmdb.org/t/p/original/xuZ6ngMoFcAVJhqpbUZPKr1RMUs.jpg'),
	(2229,'Catherine Keener','1959-03-23','','https://image.tmdb.org/t/p/original/n4CTwGszs6cwS1wJRlDQ5Mlh7Ex.jpg'),
	(2231,'Samuel L. Jackson','1948-12-21','Samuel Leroy Jackson (Washington D. C., 21 de diciembre de 1948), conocido simplemente como Samuel L. Jackson, es un actor y productor de cine, televisión y teatro estadounidense.\n\nCandidato al Óscar, a los Globos de Oro y al Premio del Sindicato de Actores y ganador de un BAFTA al mejor actor de reparto. Es conocido por sus intervenciones en películas como Coming to America (1988), Goodfellas (1990), Jurassic Park (1993), Pulp Fiction (1994), Die Hard: With a Vengeance (1995), A Time to Kill (1996), Unbreakable (2000), Changing Lanes (2002), S.W.A.T. (2003), Django Unchained (2012), en el Universo cinematográfico de Marvel como el director de S.H.I.E.L.D., Nick Fury, en la saga Star Wars como el maestro Mace Windu (1999, 2002 y 2005) y en The Hateful Eight (2015) como el mayor Marquis Warren, El Cazarrecompensas. Jackson también es conocido por interpretar la voz del superhéroe Frozono en The Incredibles (2004), la de Whiplash en Turbo (2013), ZOG en Astro Boy (2009) y el sargento Frank Tenpenny en el exitoso videojuego sandbox Grand Theft Auto San Andreas (2004).','https://image.tmdb.org/t/p/original/mXN4Gw9tZJVKrLJHde2IcUHmV3P.jpg'),
	(2232,'Michael Keaton','1951-09-05','Michael John Douglas (5 de septiembre de 1951), conocido como Michael Keaton, es un actor de cine y televisión estadounidense, ganador de un Globo de Oro al mejor actor de comedia o musical y candidato al Premio del Sindicato de Actores al mejor actor de televisión - Miniserie o telefilme.​ Es conocido por su vasta carrera e intervenciones en películas como Beetlejuice (1988), Batman (1989), Batman Returns (1992), Multiplicity (1996), Jackie Brown (1997), Jack Frost (1999), White Noise (2005) Toy Story 3 (2010), Birdman (2014), Spotlight (2015), The Founder (2016) y Spider-Man: Homecoming (2017). En 2008 dirigió su primera película, en la que también actuó, The Merry Gentleman.','https://image.tmdb.org/t/p/original/baeHNv3qrVsnApuKbZXiJOhqMnw.jpg'),
