	(2387,'Patrick Stewart','1940-07-13','Sir Patrick Stewart es un actor británico de cine y televisión, conocido principalmente por sus papeles en obras de teatro de William Shakespeare y, especialmente, por ser el Capitán Jean-Luc Picard de la serie La Nueva Generación de la saga de Star Trek (Viaje a las Estrellas) y el Profesor Xavier en las películas de X-Men.\n\nStewart ha sido nombrado oficial de la Orden del Imperio Británico en la lista honorífica de año nuevo de 2001.','https://image.tmdb.org/t/p/original/wEy5qSDT5jT3ZASc2hbwi59voPL.jpg'),
