	(2524,'Tom Hardy','1977-09-15','Edward Thomas \"Tom\" Hardy (15 de septiembre de 1977) es un actor inglés. Ha trabajado, entre otras, en las películas Bronson, Star Trek: némesis o Inception. Ha interpretado también a Tommy Riordan en Warrior, a Bane en The Dark Knight Rises, a Max Rockatansky, protagonista de Mad Max: Fury Road, y al simbionte Venom en la película homónima.\n\nEn 2011 recibió el BAFTA a la estrella emergente. Por su interpretación de John Fitzgerald en El renacido, recibió una nominación a los premios Óscar, al mejor actor de reparto en 2016.','https://image.tmdb.org/t/p/original/sGMA6pA2D6X0gun49igJT3piHs3.jpg'),
