	(2692,'Robert Sean Leonard','1969-02-28','Robert Sean Leonard es un actor estadounidense. Entre sus papeles más populares se encuentran el de Neil en la película El club de los poetas muertos (1989), Claudio en Mucho ruido y pocas nueces (1993), Peter en Rebeldes del Swing (1993) y del oncólogo James Wilson en la serie House M. D. (2004-2012).\n\nNació en Westwood (Nueva Jersey), aunque creció en Ridgewood. Hijo de una enfermera y de un profesor de español, Robert fue al instituto de Ridgewood. Después fue a la Universidad de Fordham y a la de Columbia. Está casado con una Jockey llamada Gabriella Salick, que también es directora ejecutiva de los Jinetes activos de la Costa Oeste. Ambos son padres de una niña nacida en 2009.\n\nEl gran salto en su carrera se produjo cuando fue escogido como uno de los actores protagonistas de la película El club de los poetas muertos. Además de interpretar al mejor y único amigo del doctor House, James Wilson, Leonard ha actuado a las órdenes de Christopher Reeve en In the gloaming y en producciones de Broadway como Candida (1993), The iceman cometh, Brighton beach memoirs, Breaking the code Long Day\'s Journey into Night (2003) o The invention of Love.','https://image.tmdb.org/t/p/original/nlDEfUE4GH6UVEQS5v7NG9sXY8X.jpg'),
