	(2882,'Diane Lane','1965-01-22','Diane Colleen Lane (22 de enero de 1965) es una actriz estadounidense.\n\nHa sido nominada a los Óscar, Globos de Oro, Premios del Sindicato de Actores y Emmy.1​ Conocida por sus intervenciones en películas como Judge Dredd (1995), La tormenta perfecta (2000), Unfaithful (2002), Bajo el sol de la Toscana (2003), Hollywoodland (2006) y Nights in Rodanthe (2008).','https://image.tmdb.org/t/p/original/tUPAKAtstqeQrAKhkQge9jV7Owz.jpg'),
	(2954,'Jeffrey Wright','1965-12-07','Jeffrey Wright (7 de diciembre de 1965) es un actor y productor de cine y televisión estadounidense. Ganador del Globo de Oro al mejor actor de reparto - series, miniserie o telefilme y del Emmy al mejor actor de reparto - miniserie o telefilme; y candidato al Premio del Sindicato de Actores.​ Conocido por sus intervenciones en películas y series de televisión como Angels in America (2003), The Manchurian Candidate (2004) y su participación en las películas de James Bond Casino Royale (2006) y Quantum of Solace (2008) como Felix Leiter.','https://image.tmdb.org/t/p/original/npJjOiFiAP4wiRDNjKsO8ho03Mg.jpg'),
