	(2960,'Amr Waked','1973-04-12','Amr Waked (12 de abril de 1973) es un actor de cine, televisión y actor de teatro. Él es mejor conocido para el público internacional y en Hollywood por su papel en la película de 2005 Syriana. Otras destacadas interpretaciones incluyen a un Jeque yemení llamado Muhammad en Pesca del Salmón en el Yemen, y Pierre Del Río en Lucy del director Luc Besson.','https://image.tmdb.org/t/p/original/5rMQibz1vTvs8nfNQOvd4gpQvCX.jpg'),
	(2963,'Nicolas Cage','1964-01-07','Nicolas Kim Coppola (7 de enero de 1964),​ más conocido como Nicolas Cage, es un actor y productor estadounidense. Es ganador de los premios Óscar, Globo de Oro y SAG por su papel en Leaving Las Vegas (1995), y nominado al Óscar al mejor actor por su papel en Adaptation (2002).','https://image.tmdb.org/t/p/original/ar33qcWbEgREn07ZpXv5Pbj8hbM.jpg'),
