	(2983,'Mark Strong','1963-08-05','Mark Strong (5 de agosto de 1963) es un actor británico, que interpretó a Jim Prideaux en la nueva versión de 2011 de Tinker Tailor Soldier Spy (2011), a menudo es considerado como un villano frío y calculador.  Pero antes de convertirse en un actor famoso, tenía la intención de seguir una carrera en derecho. Aunque los estadounidenses están más familiarizados con los roles de Strong como Sinestro en Green Lantern (2011), el jefe de la mafia Frank D\'Amico en Kick-Ass (2010) y Lord Blackthorn en Sherlock Holmes (2009), el público británico lo conoce por su larga historia como Un actor de televisión. También protagonizó numerosas producciones teatrales británicas, incluidas obras en el Royal National Theatre y el RSC. Sus partes de televisión más destacadas incluyen Prime Suspect 3 (1993) (TV) y Prime Suspect 6: The Last Witness (2003) (TV) como Inspector Larry Hall, y papeles protagónicos en los dramas de la BBC Dos \"Nuestros amigos en el norte\" ( 1996) y \"The Long Firm\" (2004), la última de las cuales le valió a Strong una nominación al BAFTA.','https://image.tmdb.org/t/p/original/pw6AvwaBbr44Nje9JQMBBwhchiu.jpg'),
	(3035,'Jerry O\'Connell','1974-02-17','','https://image.tmdb.org/t/p/original/p2zcFeDIKUrPrbT5ODqoLifdN3Q.jpg'),
	(3061,'Ewan McGregor','1971-03-31','Ewan Gordon McGregor nació el 31 de marzo de 1971 en Perth, Perthshire, Escocia, hijo de Carol Diane (Lawson) y James Charles McGregor, ambos maestros. Su tío es el actor Denis Lawson. Fue criado en Crieff. A los 16 años, dejó la Academia Morrison para unirse al Perth Repertory Theatre. Sus padres lo alentaron a abandonar la escuela y perseguir sus objetivos de actuación en lugar de ser infeliz. McGregor estudió drama durante un año en Kirkcaldly en Fife, luego se matriculó en la Guildhall School of Music and Drama de Londres para un curso de tres años. Estudió junto a Daniel Craig y Alistair McGowan, entre otros, y se fue justo antes de graduarse después de engancharse al papel del soldado privado Mick Hopper en la serie de cuatro partes Lipstick on Your Collar de Dennis Potter (1993). Su primer papel notable fue el de Alex Law en Tumba abierta (1994), dirigida por Danny Boyle, escrita por John Hodge y producida por Andrew Macdonald. Esto fue seguido por The Pillow Book (1996) y Trainspotting (1996), este último lo llamó la atención del público.\n\nAhora es uno de los actores más aclamados por la crítica de su generación, y retrata a Obi-Wan Kenobi en los primeros tres episodios de Star Wars. McGregor está casado con la diseñadora de producción francesa Eve Mavrakis, a quien conoció mientras trabajaba en la serie de televisión Kavanagh QC (1995). Se casaron en Francia en el verano de 1995 y tienen cuatro hijas. McGregor formó una compañía de producción, con sus amigos Jonny Lee Miller, Sean Pertwee, Jude Law, Sadie Frost, Damon Bryant, Bradley Adams y Geoff Deehan, llamada \"Natural Nylon\", y esperaba que hiciera películas innovadoras que no se ajustaran a los estándares de Hollywood. . McGregor y Bryant dejaron la compañía en 2002. Fue galardonado con el Oficial de la Orden del Imperio Británico en la Lista de Honores de Año Nuevo de la Reina 2013 por sus servicios de teatro y caridad.\n\nEwan hizo su debut como director con Pastoral americana (2016), una adaptación del libro de Philip Roth, en el que también protagonizó Ewan.\n\nEn 2018 McGregor ganó un Globo de Oro por su trabajo en la serie de televisión Fargo.','https://image.tmdb.org/t/p/original/aEmyadfRXTmmR7UW7OXsm5a6smS.jpg'),
	(3075,'Rory McCann','1969-04-24','Rory McCann (nacido el 24 de abril de 1969) es un actor de cine y televisión escocés.','https://image.tmdb.org/t/p/original/meEHyiCRXTTCiYQMzP4VEdvEuD0.jpg'),
	(3129,'Tim Roth','1961-05-14','','https://image.tmdb.org/t/p/original/qSizF2i9gz6c6DbAC5RoIq8sVqX.jpg'),
	(3141,'Marisa Tomei','1964-12-04','Marisa Tomei (4 de diciembre de 1964) es una actriz de cine, teatro y televisión estadounidense. Tras su trabajo en As the World Turns, Tomei se hizo conocida como integrante del reparto de la secuela de The Cosby Show, A Different World, en 1987. Después de trabajar en un par de películas, su carrera se catapultó en 1992 con la comedia Mi primo Vinny, por la cual ganó el premio Óscar como mejor actriz de reparto.\n\nHabiendo actuado en varias películas a lo largo de los años, sus cintas más exitosas comercialmente son What Women Want (2000), Anger Management (2003) y Wild Hogs (2007).​ Recibió elogios por parte de la crítica por sus actuaciones en Unhook the Stars (1996), Slums of Beverly Hills (1998), Before the Devil Knows You\'re Dead (2007) y fue nominada al Oscar por In the Bedroom (2001) y El luchador (2008).','https://image.tmdb.org/t/p/original/pP0J79KUzPPjW4QO42iF4KKM7C6.jpg'),
	(3197,'Tom Sizemore','1961-11-29','Thomas Edward \"Tom\" Sizemore, Jr. (29 de septiembre de 1961), es un actor estadounidense. Es conocido por sus papeles en películas como Saving Private Ryan, Black Hawk Down, Heat, Días extraños y Pearl Harbor. También ha interpretado roles secundarios en True Romance, Natural Born Killers, The Relic, Devil in a Blue Dress y Wyatt Earp.','https://image.tmdb.org/t/p/original/soINOuacuiThRb2LyPD4tTWve7C.jpg'),
	(3223,'Robert Downey Jr.','1965-04-04','Robert John Downey Jr. (4 de abril de 1965) es un actor, productor y cantante estadounidense, ganador de dos Globos de Oro y un BAFTA. Con cuatro décadas en el mundo del espectáculo, ha rodado más de 80 películas. Ha sido nominado dos veces a los Óscar: la primera en 1993 por su papel en Chaplin y la segunda en 2009 por Tropic Thunder.\n\nHa participado en películas tales como: Golpe al sueño americano (1987), Natural Born Killers (1994), Wonder Boys (2000), Kiss Kiss Bang Bang (2005), Fur: An Imaginary Portrait of Diane Arbus (2006), Zodiac (2007), Iron Man (2008),The Incredible Hulk(2008), Sherlock Holmes (2009), Iron Man 2 (2010), Sherlock Holmes: juego de sombras (2011), The Avengers (2012), Iron Man 3 (2013), The Judge (2014), Avengers: Age of Ultron (2015), Capitán América: Civil War (2016) Spider-Man: Homecoming (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019).  Downey ha protagonizado 6 películas que recaudaron más de 500 millones de dólares cada una en todo el mundo. Tres de esas películas; The Avengers, Iron Man 3 y Avengers: Age of Ultron, obtuvieron más de mil millones de dólares cada una. Ha encabezado la lista de Forbes de los actores mejor pagados de Hollywood con unos ingresos de aproximadamente 75 millones de dólares entre junio de 2012 y junio de 20131​ y junio 2015 a 2016.','https://image.tmdb.org/t/p/original/5qHNjhtjMD4YWH3UP0rm4tKwxCL.jpg'),
	(3266,'Joe Mantegna','1947-11-13','Joseph Anthony Mantegna, Jr. (n. Chicago, Illinois; 13 de noviembre de 1947), más conocido como Joe Mantegna, es un actor, guionista, productor y director estadounidense. Es famoso, principalmente, por interpretar papeles relacionados con la mafia, como su personaje de Joey Zasa en la tercera entrega de El Padrino o como su personaje de Edgar \"Eddie\" Mauser en la película Baby\'s Day Out. También es reconocido por su doblaje del personaje Fat Tony en la serie The Simpsons. Recientemente, es conocido por su papel de David Rossi en la serie de CBS, Mentes criminales.','https://image.tmdb.org/t/p/original/hFE8VNAykfZnvZjRhatVwjVXkZv.jpg'),
	(3272,'Drake Bell','1986-06-27','Jared Drake Bell (27 de junio de 1986) es un actor, cantautor y músico estadounidense. Comenzó su carrera como actor en la década de 1990, en la sitcom Home Improvement y en varios comerciales para televisión. Se hizo conocido entre el público juvenil por su papel como Drake Parker en la serie Drake & Josh de Nickelodeon, que protagonizó junto a Josh Peck. Ganó un total de siete premios Kids Choice Awards por su participación en Drake & Josh y un Teen Choice Awards a Actor revelación en una película por Superhero Movie. También ha protagonizado para Nickelodeon una trilogía de películas basadas en la serie animada Los padrinos mágicos, A Fairly Odd Movie: Grow Up, Timmy Turner!, A Fairly Odd Christmas y A Fairly Odd Summer\n\nBell también se ha dedicado a la música. Coescribió e interpretó el tema principal de Drake & Josh, titulado \"I Found a Way\", y en 2005 publicó su primer álbum independiente, Telegraph. Su segundo álbum, It\'s Only Time, publicado en 2006 por Universal Motown Records, debutó en el número 81 del Billboard 200, con más de 23 000 copias vendidas en la primera semana.','https://image.tmdb.org/t/p/original/6KxFiHrqiniS3oxV4NCz0sYNTuo.jpg'),
	(3293,'Rachel Weisz','1970-03-07','Rachel Weisz es una actriz y modelo inglesa, ganadora del Óscar, el Globo de Oro, el SAG, el Premio Laurence Olivier, el Independent Spirit Awards y otros premios cinematográficos. Ganó reconocimiento público por su interpretación de Evelyn «Evy» Carnahan-O’Connell en la serie cinematográfica La momia. En 2005 su actuación en El jardinero fiel (2005) le mereció el Premio Óscar de la Academia. Está considerada como una de las musas del cine independiente, trabajando en películas de reputados directores como Paolo Sorrentino o Yorgos Lanthimos.','https://image.tmdb.org/t/p/original/3QbFXeiUzXUVUrJ7fdiCn7A7ReW.jpg'),
