	(3967,'Kate Beckinsale','1973-07-26','Kathrin Romany \"Kate\" Beckinsale (Londres, 26 de julio de 1973), es una actriz inglesa. Después de algunos papeles en la televisión de menor importancia, hizo su debut cinematográfico en Much Ado About Nothing (1993) cuando todavía era estudiante en la Universidad de Oxford. Luego apareció en dramas británicos, como por ejemplo; Prince of Jutland (1994), Cold Comfort Farm (1995), Emma (1996), y el The Golden Bowl (2000), además de varias producciones teatrales y de radio. Comenzó a buscar trabajo en los cines de Estados Unidos a finales de 1990 y, después de aparecer en dramas pequeños The Last Days of Disco (1998) y Brokedown Palace (1999), tuvo un año de estrellato en el 2001 con papeles protagónicos en la película de guerra, Pearl Harbor y la comedia romántica Serendipity. Terminó de construir su éxito con apariciones en la película biográfica El aviador (2004) y la comedia Click (2006).\n\nBeckinsale es parte de la serie de películas de Underworld y ha protagonizado muchas películas de acción, entre ellos Van Helsing (2004), Whiteout (2009), así como Contraband y Total Recall (todas en 2012). También hizo apariciones ocasionales en proyectos dramáticos más pequeños como Snow Angels (2007), Winged Creatures (2008), Nothing but the Truth (por la que ganó el Critic\'s Choice Award en 2008), y Everybody\'s Fine (2009).','https://image.tmdb.org/t/p/original/1mdRhTJGqFwo9Xuul7XO6oXpzhb.jpg'),
	(3972,'Wentworth Miller','1972-06-02','Wentworth Earl Miller III (2 de junio de 1972) es un actor y guionista. Alcanzo la fama interpretando a Michael Scofield en la serie de televisión Prison Break. También es conocido por su papel de Chris Redfield en Resident Evil: Afterlife y por haber sido Leonard Snart/Capitán Frío en las series The Flash y DC\'s Legends of Tomorrow.','https://image.tmdb.org/t/p/original/1apvr7onOG9OuGjQqlBytBEEY1n.jpg'),
