	(4491,'Jennifer Aniston','1969-02-11','Jennifer Joanna Aniston (Los Ángeles, California, 11 de febrero de 1969), conocida artísticamente como Jennifer Aniston, es una actriz de cine y televisión estadounidense. También ejerce de directora y productora de cine. En en la década de 1990 se ganó el reconocimiento mundial interpretando a Rachel Green en la serie de televisión Friends, papel que le hizo ganar un Premio Emmy, un Premio Globo de Oro y un Premio del Sindicato de Actores, y que además, cobrara en las dos últimas temporadas un millón de dólares por capítulo.​ Su significativa presencia mediática en la serie de televisión también debido a su icónico corte de cabello, conocido como The Rachel, el cual causó furor y fue muy popular entre las mujeres de la época,quienes imitarían su peinado por varios años y que además la revista Rolling Stone lanzara como «El mejor pelo de Estados Unidos».','https://image.tmdb.org/t/p/original/shIlZZpOu2L4sT2ohKlBMp9MUWG.jpg'),
