	(4785,'Jeff Goldblum','1952-10-22','Jeffrey Lynn Goldblum (22 de octubre de 1952), más conocido como Jeff Goldblum, es un actor y músico estadounidense.  Su carrera comenzó a mediados de la década de 1970 y desde entonces se ha destacado en películas taquilleras como La mosca (1986), Parque Jurásico (1993), Independence Day (1996), El mundo perdido (1997), Jurassic World: El reino caído (2018), entre otras.  Entre 2009 y 2010 interpretó al detective Zach Nichols en la serie Law & Order: Criminal Intent. En 1996 fue nominado a los Premios Óscar por su dirección en el cortometraje Little Surprises.','https://image.tmdb.org/t/p/original/m8p62pvkVtPxkfAIJhb5AgGw8kA.jpg'),
	(4808,'Giancarlo Esposito','1958-04-26','Giancarlo Giuseppe Alessandro Esposito (26 de abril de 1958), conocido como Giancarlo Esposito, es un actor y director de cine y televisión danés-estadounidense, conocido sobre todo por su papel como Gustavo «Gus» Fring en las series Breaking Bad y Better Call Saul.','https://image.tmdb.org/t/p/original/t8hlrcfKDI8Kl5yyiXoh6VWGlIg.jpg'),
