	(4886,'Norman Reedus','1969-01-06','Norman Mark Reedus (6 de enero de 1969) es un actor y modelo estadounidense. Se le conoce principalmente por su papel de Daryl Dixon en la serie de televisión The Walking Dead y por encarnar al personaje de Murphy MacManus en la película The Boondock Saints (1999). También ha dirigido varios vídeos y ha posado para varios diseñadores de moda. Además, protagonizó el videojuego de Hideo Kojima, Death Stranding (2019) interpretando a Sam.','https://image.tmdb.org/t/p/original/x0VtaRWYKPEegZJv7cxqKtB9k98.jpg'),
