	(4987,'Omar Epps','1973-07-20','Omar Epps (Brooklyn, 20 de julio de 1973) es un actor, músico y cantante de hip hop principalmente reconocido por su interpretación del Dr. Eric Foreman en la serie televisiva House M.D.. Estudió en el Instituto de Música y Artes Dramáticas de Nueva York. Desde que obtuvo su primer papel en la película “Juice” en 1992 no ha dejado de trabajar para la pequeña y gran pantalla. Era miembro de un grupo de hip hop llamado Da Wolfpack y bailarín del elenco de Queen Latifah. Ha participado con papeles secundarios en diversos filmes y series de televisión.','https://image.tmdb.org/t/p/original/yc9JiSiIykY4jbWrMqccneYBvIi.jpg'),
