	(5293,'Willem Dafoe','1955-07-22','William James \"Willem\" Dafoe (22 de julio de 1955) es un actor estadounidense de cine y teatro, coproductor y miembro fundador de la compañía teatral The Wooster Group.\n\nNominado al premio Oscar una vez como mejor actor y en tres ocasiones como mejor actor de reparto. Ha tenido papeles en películas como To Live and Die in L.A., Platoon, Nacido el 4 de julio, La última tentación de Cristo, Mississippi Burning, Wild at Heart, The Boondock Saints, El paciente inglés, Inside Man, The Life Aquatic with Steve Zissou, Spider-Man, El aviador, American Psycho, Anticristo y le prestó su voz a personajes de Fantastic Mr. Fox, Buscando a Nemo y a Nathan Dawkins en el videojuego Beyond: Two Souls; en este último también se utilizó su rostro para la caracterización del personaje.','https://image.tmdb.org/t/p/original/nbv4rIpJnw0OvowBZgwEWVriH9V.jpg'),
	(5294,'Chiwetel Ejiofor','1977-07-10','Chiwetel Ejiofor (10 de julio de 1977) es un actor y director británico que estuvo nominado al Óscar por su interpretación en la película 12 años de esclavitud.','https://image.tmdb.org/t/p/original/kq5DDnqqofoRI0t6ddtRlsJnNPT.jpg'),
