	(5367,'Zach Braff','1975-04-06','Zachary Israel \"Zach\" Braff (6 de abril de 1975) es un actor, director, productor, guionista, y actor de voz estadounidense.\n\nEs principalmente conocido por su papel como el Dr. John \"J.D.\" Dorian en Scrubs.','https://image.tmdb.org/t/p/original/wUAj6juL6HErqEJ1GtuI63rbVea.jpg'),
	(5374,'Jim Parsons','1973-03-24','James Joseph Parsons (24 de marzo de 1973), más conocido como Jim Parsons, un actor estadounidense de televisión, teatro y cine.\n\nReconocido con múltiples premios debido a su peculiar forma de actuar, incluidos el de Television Critics Association, el National Association of Broadcasters, cuatro Premios Emmy y también un Premio Globo de Oro por mejor actor de comedia en serie de televisión.\n\nSu papel más conocido es el de Sheldon Cooper, un físico teórico, uno de los personajes principales de la serie televisiva The Big Bang Theory dirigida por Chuck Lorre, de gran éxito en Estados Unidos. Por este papel, obtuvo el Premio Emmy a mejor actor protagonista de comedia en 2010, 2011, 2013, 2014 y el Globo de Oro, también como mejor actor protagonista de comedia en 2011.','https://image.tmdb.org/t/p/original/4D5oAUeM2wlejSwJJ6TmKoM9Abn.jpg'),
	(5376,'Jean Smart','1951-09-13','Jean E. Smart (nacida el 13 de septiembre de 1951) es una actriz de cine, televisión y teatro estadounidense. Es conocida por sus papeles cómicos, uno de los más conocidos es su papel como Charlene Frazier Stillfield en la serie de la CBS Designing Women. Más tarde obtuvo el reconocimiento de la crítica por su trabajo dramático, con su interpretación de Martha Logan a los 24 años. Smart apareció recientemente como Regina Newly en la comedia de ABC Samantha Who? de 2007 a 2009, otro papel cómico que le valió a la actriz un premio Emmy en 2008, y fue elegida como Gobernadora de Hawaii Pat Jameson en la primera temporada del remake de CBS-TV de Hawaii Five-0.','https://image.tmdb.org/t/p/original/gOvEAOtrtedfgS7oQvPgHuJV4F8.jpg'),
