	(5916,'Rosario Dawson','1979-05-09','Rosario Dawson (n. Nueva York; 9 de mayo de 1979) es una actriz y escritora estadounidense, que ha trabajado en películas como Sin City y Men in Black II.\n\nDawson comienza muy joven su carrera como actriz de modo casual, tras aceptar la propuesta de Larry Clark —quien se fijó en ella en las calles de su ciudad natal— de participar en su primera película Kids, en 1995. Dos años más tarde, el director Spike Lee la unió a Denzel Washington en He Got Game, y su carrera despegó. Pero no ha sido un camino fácil. \"Me he encontrado con racismo\", comentó Rosario al Daily Mail, \"pero los tiempos están cambiando. Conocí a algunos directores de casting cuando estaba en Londres, y si eres un gran actor en el Reino Unido, se obtiene el papel.\"2​\n\nTiene la intención de producir una película basada en un cómic creado por ella, \"The Occult Crimes Taskforce\", protagonizado por Sophia Ortiz, una policía encargada de investigar crímenes sobrenaturales.2​\n\nHa producido una película llamada Descenso, en la que interpreta a una víctima violada tratando de componer su vida nuevamente. En éste, como en otros proyectos, Rosario hace uso del cine para mostrar a las mujeres que normalmente no tienen voz.2​\n\nHa sabido combinar actuaciones tanto en películas comerciales como en otras dentro del cine más independiente, trabajando con directores como Robert Rodríguez, Kevin Smith, Oliver Stone o Spike Lee.\n\nParte de su tiempo lo dedica a obras de caridad, como Global Cool, que hace campaña para la concienciación sobre el cambio climático, y es particularmente activa en Voto Latino, un grupo que co-fundó para alentar a los jóvenes Latinos de Estados Unidos a registrarse y votar.2​\n\nA partir de la década de 2010 ha ganado fama además por interpretar el rol de Claire Temple / Night Nurse en las series de Marvel producidas en la plataforma online Netflix, siendo estas: Daredevil (2015-2016), Jessica Jones (2015), Luke Cage (2016), Iron Fist (2017) y The Defenders (2017).','https://image.tmdb.org/t/p/original/8OTmgBzz6NzaOypUxUhfD1gsHZr.jpg'),
