	(6161,'Jennifer Connelly','1970-12-12','Jennifer Lynn Connelly (12 de diciembre de 1970) es una actriz estadounidense ganadora del Óscar y el Globo de Oro por su papel en A Beautiful Mind. Asimismo, es reconocida por sus interpretaciones en películas como Labyrinth (1986), Requiem for a Dream (2000), Dark City (1998), Hulk (2003), Casa de arena y niebla (2003) y Diamante de sangre (2006).','https://image.tmdb.org/t/p/original/p17ymzw1sb9eo2SOp88jnwyryan.jpg'),
	(6162,'Paul Bettany','1971-05-27','Paul Bettany (27 de mayo de 1971) es un actor de cine, televisión y teatro y guionista inglés. Fue candidato al BAFTA al mejor actor de reparto. Es conocido por su participación en películas como A Knight\'s Tale (2001), A Beautiful Mind (2001), Master and Commander: The Far Side of the World (2003), Wimbledon (2004), El código Da Vinci (2006), The Secret Life of Bees (2008) y en Legion (2009) y además por su participación como Visión y J.A.R.V.I.S (voz) en el Universo cinematográfico de Marvel.\n\nSus películas más exitosas comercialmente han sido Avengers: Infinity War con más de 2000 millones, Los Vengadores (2012) con 1500 millones de dólares a nivel mundial, la secuela Avengers: Age of Ultron (2015) con 1400 millones, Iron Man 3 (2013) con 1200 millones y El código Da Vinci con 758 millones de dólares en todo el mundo.','https://image.tmdb.org/t/p/original/vcAVrAOZrpqmi37qjFdztRAv1u9.jpg'),
