	(6574,'Clancy Brown','1959-01-05','Clarence J. \"Clancy\" Brown III (5 de enero de 1959) es un actor estadounidense conocido por su papel de El Kurgan en el clásico de culto Highlander.\n\nEn 1992 protagonizó la película de terror Pet Sematary Two en el papel del sheriff Gus Gilbert. También se le recuerda por haber interpretado a personajes como el duro e imponente celador Byron Hadley en la premiada Cadena perpetua/Sueño de fuga, el Hermano Justin Crowe en la aclamada serie de HBO Carnivàle o el sargento Zim en Starship Troopers. También trabaja frecuentemente como actor de voz en series de televisión animadas, de entre las cuales destaca su papel como Eugene H. Cangrejo en la serie Bob Esponja.\n\nInterpreta al sheriff August Corbin en la serie de televisión estadounidense Sleepy Hollow. En el 2002 participó en el episodio \"Encrucijada en el desierto\" de la serie Star Trek Enterprise. En el 2016 participó como parte del reparto de la superproducción estadounidense Warcraft encarnando el personaje de Puño Negro.','https://image.tmdb.org/t/p/original/tiuVx3mDJwWieFqNadrtyOhhMBN.jpg'),
