	(6714,'Mädchen Amick','1970-12-12','Mädchen E. Amick (12 de diciembre de 1970) es una actriz estadounidense.\n\nEs mejor conocida por su papel de Shelly Johnson en la serie de televisión de culto Twin Peaks y como Tanya Robertson en Sleepwalkers de Stephen King (1992). Amick también ha protagonizado I\'m Dangerous Tonight (1990), Twin Peaks: Fire Walk With Me (1992), Gossip girl (2008),Dream Lover (1993), Love, Cheat & Steal (1993), y Trapped in Paradise (1994). Repitió su papel como Shelly en Twin Peaks en 2017 y actualmente interpreta a Alice Cooper en Riverdale.','https://image.tmdb.org/t/p/original/Af47IaCUF9BYzmGBycZiKjqIwYf.jpg'),
