	(6861,'Andre Braugher','1962-07-01','Andre Braugher (1 de julio de 1962) es un actor estadounidense, más conocido por sus papeles como el detective Frank Pembleton en la serie Homicide: Life on the Street, Owen Thoreau Jr. en Men of a Certain Age y el Capitán Ray Holt en la comedia Brooklyn Nine-Nine.','https://image.tmdb.org/t/p/original/erHQWSAjuMG4hy3nkuNTosxKReA.jpg'),
	(6862,'Freddy Rodríguez','1975-01-17','Freddy Rodriguez (nacido el 17 de enero de 1975 de dos padres puertorriqueños) es un actor estadounidense conocido por interpretar a los personajes Hector Federico \"Rico\" Díaz en Six Feet Under de HBO y El Wray en Planet Rodriguez Terror de Robert Rodriguez. Recientemente, fue un miembro del elenco recurrente en la serie Ugly Betty como Giovanni \"Gio\" Rossi.','https://image.tmdb.org/t/p/original/lxBSNLtNmIuRAMhmLF2TBYEgLl9.jpg'),
	(6885,'Charlize Theron','1975-08-07','Charlize Theron (Benoni, Sudáfrica, 7 de agosto de 1975) es una actriz y modelo sudafricana nacionalizada estadounidense. Alcanzó la fama después de participar en varias producciones cinematográficas estadounidenses en la década de los noventa, entre las que destacan The Devil\'s Advocate (1997), Mi gran amigo Joe/Joe (1998) y The Cider House Rules (1999). En el año 2003 fue acreedora del Óscar a la mejor actriz por su interpretación de la asesina en serie Aileen Wuornos en la película Monster, lo que la convirtió en la primera africana en recibir el premio en esa categoría. Dos años después recibió por segunda vez una nominación al Óscar por su actuación en North Country. Desde 2007 Theron es ciudadana estadounidense, aunque aún conserva su ciudadanía sudafricana.','https://image.tmdb.org/t/p/original/gd7ShD0yt4bsR2STeQ19KQ6hvXL.jpg'),
