	(6968,'Hugh Jackman','1968-10-12','Hugh Michael Jackman (12 de octubre de 1968) es un actor, cantante y productor de cine australiano.\n\nSu papel más reconocido es Wolverine en la serie de películas de X-Men, así como por sus papeles principales; en la romántica comedia Kate & Leopold (2001), la película de acción-terror Van Helsing (2004), el drama mágico-temático The Prestige (2006), el drama romántico Australia (2008), el drama de ciencia ficción Acero puro (2011), la versión cinematográfica de Los Miserables (2012), el thriller Prisioneros (2013) y El gran showman (2017).\n\nSu trabajo en Les Misérables le valió su primera nominación al premio de la Academia en la calidad de Mejor Actor y su primer Globo de Oro al Mejor actor de Comedia o Musical, en 2013. En teatro, ganó un premio Tony por su papel en The Boy From Oz.Estuvo nominado al Globo de Oro a Mejor actor de comedia o musical por la película El gran showman.\n\nHa sido el presentador de los Premios Tony en cuatro ocasiones, obteniendo un premio Emmy por dicha función, así como dirigió la gala de los Premios Óscar en 2009,3​ mismo año desde que goza de una estrella en el Paseo de la Fama de Hollywood.​ En 2013 recibió el Premio Donostia por su trayectoria cinematográfica en la 61 edición del Festival de San Sebastián.','https://image.tmdb.org/t/p/original/5Dxx0j9jOAczsTQzZ0OkA5iJBhp.jpg'),
