	(7447,'Alec Baldwin','1958-04-03','Alexander Rae \"Alec\" Baldwin III (3 de abril de 1958), es un actor estadounidense de cine y televisión, siendo el mayor de los Hermanos Baldwin, una familia que ha estado presente en cine y televisión durante las últimas dos décadas y en la que también destacan Daniel Baldwin, William Baldwin y Stephen Baldwin. Ha trabajado tanto en papeles secundarios como protagónicos, y en numerosas películas incluyendo Beetlejuice y La caza del Octubre Rojo, además de El aviador y The Departed de Martin Scorsese.\n\nHa sido nominado a los premios Óscar, Globo de Oro y Screen Actors Guild por su papel en la película The Cooler (2003). Alec Baldwin interpretó a Jack Donaghy en la serie 30 Rock (2006-2013), un papel por el cual ha ganado dos Emmy, tres Globo de Oro y siete Screen Actors Guild Awards.\n\nBaldwin también ha sido presentador de Saturday Night Live en 17 ocasiones.','https://image.tmdb.org/t/p/original/hzKy7x574eeUS3wt1R3yvWBRpeR.jpg'),
