	(7624,'Stan Lee','1922-12-28','Stanley Martin Lieber (Manhattan, Nueva York; 28 de diciembre de 1922), más conocido como Stan Lee, es un escritor y editor de cómics estadounidense, además de productor y ocasional actor de cine. Es principalmente conocido por haber creado personajes icónicos del mundo del cómic tales como Spider-Man, Hulk, Iron Man, Los 4 Fantásticos, Thor, Los Vengadores, Daredevil, Doctor Strange, X-Men y Bruja Escarlata, entre otros muchos superhéroes, casi siempre acompañado de los dibujantes Steve Ditko y Jack Kirby. El trabajo de Stan Lee fue fundamental para expandir Marvel Comics, llevándola de una pequeña casa publicitaria a una gran corporación multimedia. Todavía hoy, los cómics de Marvel se distinguen por indicar siempre «Stan Lee presenta» en los rótulos de presentación. También tuvo un programa televisivo en History Channel en donde buscaba superhumanos \"reales\".','https://image.tmdb.org/t/p/original/nGjBAc25C3LT23NqeOfY1pCcax8.jpg'),
	(7685,'Raymond Burr','1917-05-21','','https://image.tmdb.org/t/p/original/diVEYbTdLbvhjRHGiuuQbnLBVKo.jpg'),
