	(8169,'Tyrese Gibson','1978-12-30','Tyrese Gibson (30 de diciembre de 1978) es un actor, cantante de R&B, compositor, rapero, ex modelo y VJ de MTV estadounidense. Después de lanzar varios álbumes, pasó a hacer películas, con varios roles principales en cintas de Hollywood.\n\nDebutó en cine en 2001 con la película Baby Boy, dirigida por John Singleton. Luego actuó en Boyz n the Hood y encarnó a Roman \"Rome\" Pearce en la saga de Fast & Furious. Además, participó en las bandas sonoras de Waist Deep y 2 Fast 2 Furious.','https://image.tmdb.org/t/p/original/jxoy4fbXNKFQtBdK73cLXEz3ufS.jpg'),
	(8171,'Ludacris','1977-09-11','Christopher Brian Bridges (11 de septiembre de 1977), también conocido popularmente como Ludacris, es un rapero, compositor, productor discográfico, filántropo y actor estadounidense y gabonés.','https://image.tmdb.org/t/p/original/d9Sqr6LCxCJ8m5UK5XzSqLTzxzP.jpg'),
