	(8318,'Brian Blessed','1936-10-09','Brian Blessed es actor británico.\n\nHijo de un minero de Yorkshire, tuvo que abandonar la escuela tras un accidente grave sufrido por su padre. Aficionado desde joven al teatro, Blessed tuvo que cumplir su servicio militar –en el Parachute Regiment– antes de poder matricularse en la Bristol Old Vic Theatre School. Entre sus amistades se encontraba Peter O\'Toole, a quien conoció en esa época en una fiesta, después de que Blessed le tumbara a Harold Pinter de un puñetazo.\n\nAventurero y montañero, ha escalado Everest en tres ocasiones, sin llegar a la cima.\n\nEn octubre de 2015 publicó su autobiografía, Absolute Pandemonium.\n\nSe consagró como actor de televisión a principios de la década de 1960 por su papel como policía en el serie de culto de la BBC, Z Cars. Su popularidad aumentó con papeles como Porthos en la serie de la BBC, Los tres mosqueteros (1967) y de nuevo como César Augusto en la miniserie Yo, Claudio (1976), también de la BBC. En 1980, fue Peppone en la serie de la BBC The Little World of Don Camillo (1980), junto con Mario Adorf como Don Camilo y Cyril Cusack como la voz de Cristo. En 1983, actuó en la primera temporada de La víbora negra, creada por Richard Curtis y Rowan Atkinson para BBC One.\n\nEntre sus papeles como actor de cine, actuó en Las troyanas (1971), protagonizada por Katharine Hepburn y Vanessa Redgrave. Fue el príncipe Vultan en Flash Gordon y ha participado en cuatro de las cinco películas basadas en obras de Shakespeare dirigidas por Kenneth Branagh: Enrique V (1989), Mucho ruido y pocas nueces (1993), Hamlet (1996)7 y Como gustéis (2006).','https://image.tmdb.org/t/p/original/3mLIr94V5IOA5ndY6GyqKKcyrX6.jpg'),
	(8335,'Kim Coates','1958-02-21','','https://image.tmdb.org/t/p/original/hf6UgIErtcUyFEThOBo6Vb6mACz.jpg'),
	(8349,'Martin Sheen','1940-08-03','Ramón Antonio Gerardo Estévez (3 de agosto de 1940), conocido como Martin Sheen, es un actor estadounidense, conocido por su intervención en la película Apocalypse Now y por su papel como Josiah Bartlet, el presidente de los Estados Unidos en el drama televisivo El ala oeste de la Casa Blanca. También ha participado en películas como The Amazing Spider-Man, Atrápame si puedes, The Departed, Gandhi, La zona muerta y Wall Street. Con su hijo Emilio Estévez ha trabajado en dos películas, Bobby y The Way.','https://image.tmdb.org/t/p/original/m2Y3Q0uyuW6htrn2W9UWCWMkpZu.jpg'),
	(8537,'Jonathan Hyde','1948-05-21','','https://image.tmdb.org/t/p/original/1jYyW3B5omvMTVfEswqQQBrHN2.jpg'),
	(8602,'Alice Braga','1983-04-15','Alice Braga Moraes (nacida el 15 de abril de 1983) es una actriz brasileña. Ella ha aparecido en varias películas en su Brasil natal, sobre todo como Angélica en la muy aclamada Ciudad de Dios de 2002 y como Karina en la Ciudad baja de 2005. También ha protagonizado las películas de Hollywood I Am Legend (2007), Repo Men y Predators (ambas 2010).','https://image.tmdb.org/t/p/original/ykVmsm3For9dCBfWLRtTL0EU24b.jpg'),
