	(8691,'Zoe Saldana','1978-06-19','Zoe Yadira Saldaña Nazario (19 de junio de 1978), conocida como Zoe Saldana o Zoe Saldaña, es una actriz estadounidense. Ha tenido papeles en las películas Center Stage del año 2000 y Crossroads, de 2002. Más tarde ganó prominencia por su papel de Anamaría en Pirates of the Caribbean: The Curse of the Black Pearl de 2003, como Nyota Uhura en la película Star Trek de 2009, como Neytiri en la película Avatar, de James Cameron, en 2009.  También se la conoce por interpretar a Gamora en las películas del Universo cinematográfico de Marvel Guardianes de la Galaxia (2014), Guardianes de la Galaxia Vol. 2 (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019).','https://image.tmdb.org/t/p/original/iOVbUH20il632nj2v01NCtYYeSg.jpg'),
