	(9048,'Clark Gregg','1962-04-02','Robert Clark Gregg (2 de abril de 1962) es un actor, guionista y director estadounidense.  Es conocido sobre todo por su papel como Phil Coulson en las películas Iron Man (2008), Iron Man 2 (2010), Thor (2011) y The Avengers (2012) y en la serie de televisión Agents of S.H.I.E.L.D., que se transmite por la cadena ABC. También da voz al personaje en la serie de televisión animada Ultimate Spider-Man.  Interpretó a Richard, el exesposo de Christine Campbell en la sitcom de la CBS The New Adventures of Old Christine, serie que debutó en marzo de 2006 y concluyó en mayo de 2010. Además, es conocido por ser el agente especial del FBI Mike Casper en la serie de NBC The West Wing y Cam en la serie de NBC Will & Grace.','https://image.tmdb.org/t/p/original/nbxFbr2SaF4Sdc6HdsF193GInvJ.jpg'),
	(9140,'James Faulkner','1948-07-18','James Faulkner es un actor inglés mejor conocido por sus numerosas participaciones en cine y televisión.\n\nEn 1967 se unió a la escuela \"Central School of Speech and Drama\".\n\nJames está casado con Kate Faulkner con quien tiene dos hijos, los actores Guy Faulkner y Leo Faulkner.','https://image.tmdb.org/t/p/original/wMDpbctF9cAL5nYnSL6AcXUTG5K.jpg'),
