	(9273,'Amy Adams','1974-08-20','Amy Lou Adams (Vicenza, Italia, 20 de agosto de 1974), conocida como Amy Adams, es una actriz de cine y televisión y cantante estadounidense nacida en Italia, ganadora de dos premios Globo de Oro en la categoría de mejor actriz - comedia o musical y de un Premio del Sindicato de Actores al mejor reparto.\n\nAdams comenzó su carrera artística en teatros de cena antes de hacer su debut en pantalla en 1999, en la comedia negra Muérete, bonita. Luego protagonizó la película Encantada de Disney, un éxito crítico y comercial, por la cual recibió una nominación al premio Globo de Oro como mejor actriz - comedia o musical por su interpretación de Giselle.\n\nEl 12 de enero de 2017 Adams recibió la su estrella en el paseo de la fama de Los Angeles.','https://image.tmdb.org/t/p/original/ErcpRbDpYMvtskakR8pklpa7rF.jpg'),
