	(10669,'Timothy Dalton','1946-03-21','Timothy Peter Dalton (21 de marzo de 1946) es un actor británico, del repertorio shakespeariano,​ mundialmente conocido por interpretar a James Bond en dos películas: The Living Daylights (conocida como 007, Alta tensión), y Licencia para matar. La cinta con mayor éxito comercial en la que ha trabajado ha sido The Tourist, con una recaudación mundial de 278 millones de dólares.','https://image.tmdb.org/t/p/original/lpmsHv6YrOlODjNdSgr5DEBH2gJ.jpg'),
