	(10742,'Teri Hatcher','1964-12-08','Teri Lynn Hatcher (8 de diciembre de 1964) es una actriz de cine y televisión estadounidense.\n\nSe ha hecho especialmente conocida por sus papeles como Lois Lane en la serie Lois & Clark: The New Adventures of Superman (1993-1997), como Paris Carver en la película El mañana nunca muere (1997) y como Susan Mayer en la comedia dramática Desperate Housewives (2004-2012).\n\nSus interpretaciones la han hecho acreedora de numerosos premios y reconocimientos , entre ellos tres premios del Sindicato de Actores y un Globo de Oro.','https://image.tmdb.org/t/p/original/rgdIWxYCCe1wK1ycdKiPhMBI9Fs.jpg'),
