	(10859,'Ryan Reynolds','1976-10-23','Ryan Rodney Reynolds (23 de octubre de 1976) es un actor canadiense.\n\nEl éxito y el reconocimiento le llegaron con su participación en la comedia titulada Two Guys and a Girl (1998-2001), antes de que iniciara su carrera de comediante y actor dramático para la industria de cine de Hollywood. Es reconocido por sus intervenciones en producciones como Blade: Trinity (2004), The Amityville Horror (2005), Definitely, Maybe (2008), X-Men Origins: Wolverine (2009), The Proposal (2009), Buried (2010), Linterna Verde (2011) y en la adaptación cinematográfica del cómic Deadpool (2016) y su secuela, Deadpool 2.  En 2010 la revista estadounidense People lo eligió como el hombre más sexy del año.','https://image.tmdb.org/t/p/original/4SYTH5FdB0dAORV98Nwg3llgVnY.jpg'),
	(10862,'Dominic Purcell','1970-02-17','Dominic Haakon Myrtvedt Purcell (17 de febrero de 1970) es un actor australiano nacido en Gran Bretaña, mejor conocido por su papel de Lincoln Burrows en Prison Break, el personaje principal en John Doe, Drácula en Blade: Trinity y Mick Rory en Legends of Tomorrow.','https://image.tmdb.org/t/p/original/30giDZ53c8f72pPbXCLK9xMSAnw.jpg'),
