	(11006,'James Marsden','1973-09-18','James Marsden es un actor, cantante y modelo estadounidense. Es reconocido por sus actuaciones en la trilogía X-Men con el rol de Cyclops (Cíclope) y por sus actuaciones en las películas Superman Returns, Hairspray, Enchanted y 27 Dresses. Fue del grupo de modelos de Versace.\n\nEs hijo de un destacado profesor universitario y una nutricionista que se separaron cuando tenía 9 años. James tiene otros cuatro hermanos.\n\nInició sus estudios de periodismo radiofónico en la Universidad del Estado de Oklahoma pero optó por renunciar a su formación universitaria para probar suerte como actor.\n\nTiene cuatro hermanos: dos hermanas menores, Jennifer y Elizabeth, y dos hermanos, Jeff y Robert.\n\nAsistió a la Escuela Secundaria Hefner y Putnam City North High School, en Oklahoma City, y más tarde asistió a la Oklahoma State University, donde estudió periodismo televisivo.\n\nEra también un miembro de la fraternidad Delta Tau Delta.\n\nActualmente James Marsden vive en Los Ángeles lo cual le ofrece la oportunidad de practicar sus actividades favoritas: el patinaje sobre ruedas, el vóley playa y el baloncesto.','https://image.tmdb.org/t/p/original/mk142GG0saiSXALY6V4wWcmPROW.jpg'),
	(11008,'Rebecca Romijn','1972-11-06','Rebecca Alie Romijn (6 de noviembre de 1972) es una actriz y exmodelo estadounidense. Durante su matrimonio con John Stamos fue conocida como Rebecca Romijn-Stamos.','https://image.tmdb.org/t/p/original/cyZLc4sPd5CsfGUQ7hbpihqqxU9.jpg'),
	(11023,'Shawn Ashmore','1979-10-07','Shawn Robert Ashmore (7 de octubre de 1979​) es un actor canadiense de cine y televisión.\n\nEs reconocido por interpretar a Jake en la serie Animorphs y por su participación como Bobby Drake/Hombre de Hielo en las reconocidas películas de X-Men. Es hermano gemelo de Aaron Ashmore, también actor.','https://image.tmdb.org/t/p/original/tXA1gFtsp9HWnzlQsaZSoZC8L4r.jpg'),
