	(11109,'Nick Frost','1972-03-28','Nicholas John Frost (nacido en Londres el 28 de marzo de 1972) es un actor, comediante y guionista británico conocido por haber actuado en varias películas y series humorísticas junto a su mejor amigo el también actor Simon Pegg. Sus trabajos más destacados hasta la fecha son las películas Shaun of the Dead y Hot Fuzz, aunque también ha aparecido en la película The Boat That Rocked y en la serie televisiva Spaced. Antes de su papel en dicha serie trabajaba como camarero.1​ Actualmente hace el papel de \"Bajie\" en la serie de televisión estadounidense Into the Badlands del canal AMC.','https://image.tmdb.org/t/p/original/2CHS4t6miNGLgMQAjhFqb4fFuKS.jpg'),
	(11111,'Lucy Davis','1973-01-02','Lucy Davis (2 de enero de 1973) es una actriz británica.\n\nEs conocida por interpretar a Dawn Tinsley en la serie de televisión de comedia The Office, transmitida por la BBC. También interpretó a Dianne en la película Shaun of the Dead, a Etta Candy en Wonder Woman, y a Hilda Spellman en la serie de Netflix Chilling Adventures of Sabrina.​','https://image.tmdb.org/t/p/original/A1ymILbxQA5w5TduCNaU0xD9C5a.jpg'),
