	(11160,'Danny Trejo','1944-05-16','Dan \"Danny\" Trejo (Echo Park, Los Ángeles, 16 de mayo de 1944) es un actor estadounidense de origen mexicano. Ha trabajado en múltiples películas de Hollywood, en general haciendo papeles secundarios como antagonista o antihéroe y es conocido por películas como Heat, Con Air, Desperado, Animal Factory, Predators, From Dusk Till Dawn, la tetralogía de Spy Kids y como protagonista en Machete.\n\nHa desarrollado una carrera en el negocio cinematográfico a través de un camino poco común. Desde estar encarcelado a ayudar a los jóvenes a luchar contra la adicción a las drogas, desde la actuación a la producción; el nombre, el rostro y los logros de Danny Trejo han sido bien reconocidos en Hollywood.\n\nTodo empezó cuando el actor se presentó al plató de Runaway Train (El tren del infierno, 1985) para ofrecer asesoramiento a un hombre a quien había estado ayudando. Se le ofreció de inmediato un papel como convicto. Desde entonces, Danny ha aparecido en docenas de películas, contándose entre ellas Blood in Blood Out; Desperado (La balada del pistolero, 1995); toda la trilogía de From Dusk Till Dawn; Heat (1995); Six Days Seven Nights (Seis días y siete noches, 1998); Reindeer Games (Operación reno, 2000); Spy Kids 2 (2001), etc.\n\nEn 2000, Danny fundó su propia compañía de producción, Starburst. Ese mismo año participó como coproductor (junto a su amigo Edward Bunker) y actor en Animal Factory, dirigida por Steve Buscemi y protagonizada por Willem Dafoe, Edward Furlong y Mickey Rourke.\n\nEn el año 2001 trabajó en The Salton Sea. También tuvo papeles secundarios en xXx (2002) y en Once Upon a Time in Mexico (2003). Trejo ha aparecido también en muchos programas televisivos como The District, NYPD Blue (1996 y 1998), The X-Files (2000), Resurrection Blvd. Asimismo ha sido coprotagonista en Ática de Showtime. También participó en un papel de asesino a sueldo en Los renegados del diablo de Rob Zombie.\n\nAparece en 2 episodios de la serie estadounidense Breaking Bad, haciendo de un narco llamado \"Tortuga\". (2009 y 2010 - 1 episodio de la 2.ª y 1 de la 3.er temporada)\n\nAdemás aparece en las 3 ultimas temporadas de la exitosa serie de la Fox Sons of Anarchy, donde tiene uno de los papeles más importantes de la serie, el del cártel Galindo.\n\nLos personajes que interpreta Trejo suelen tener nombres de armas blancas como Machete en Spy Kids, Razor Charlie y Razor Eddie en la serie de películas From Dusk Till Dawn, Navajas en Desperado, y Cuchillo en Predators. En 2010 protagonizó la película Machete, dirigida por Robert Rodriguez, donde interpreta al personaje que lleva el mismo nombre.\n\nEn el videojuego Call of Duty: Black Ops aparece como uno de los personajes principales y manejables con su mismo nombre en el mapa del DLC Escalation: \"Call of the Dead\" del modo Zombies. En Grand Theft Auto Vice City y Grand Theft Auto Vice City Stories dobla al jefe de la mafia cubana Umberto Robina. En Fallout New Vegas dobla al Necrófago Raul Tejada. También forma parte del videojuego Def Jam Fight for NY con su personaje propio.','https://image.tmdb.org/t/p/original/iSZbMYL2vuYtLY86da1TP1ScDTT.jpg'),
	(11180,'David Bradley','1942-04-17','','https://image.tmdb.org/t/p/original/cGGg5PPpSqcotZ6s78SJItrcbd3.jpg'),
	(11181,'Kenneth Branagh','1960-12-10','Actor, director y productor británico, considerado internacionalmente como uno de los actores/directores más relevantes de su generación. Nacido en Belfast, su familia se trasladó a Reading, en Berkshire, cuando él tenía diez años. Estudió en la Royal Academy of Dramatic Arts (RADA) hasta 1981. Su primer compromiso profesional fue para actuar en la obra de Julian Mitchell Another country (Otro país) en el Queen\'s Theatre, Londres, actuación por la que recibió el premio de la Sociedad de teatros del West End al novel más prometedor en 1982. Se incorporó a la Royal Shakespeare Company (RSC) en 1984, y fue aclamada su interpretación como protagonista en Enrique V. Al año siguiente, escribió y dirigió su primera obra, Tell me honestly (Dime la verdad), en el Donmar Warehouse, y en 1986 produjo, dirigió y protagonizó Romeo y Julieta en el Lyric, Hammersmith. En 1987 formó la Renaissance Theatre Company y protagonizó la primera producción, Public enemy (Enemigo público), que también había escrito. La compañía continuó produciendo una serie de obras de Shakespeare y otros clásicos, a menudo protagonizados y dirigidos por Branagh. Su prestigio internacional se confirmó en 1989 cuando dirigió y protagonizó la versión cinematográfica de Enrique V, por la cual recibió dos nominaciones para el Oscar. Desde entonces su carrera ha estado dedicada primordialmente al cine, donde destacan entre otros títulos Morir todavía (1991), Los amigos de Peter (1992), Mucho ruido y pocas nueces (1993), Frankenstein de Mary Shelley (1994) y En lo más crudo de un crudo invierno (1995). En 1992 volvió al escenario para interpretar Hamlet para la Royal Shakespeare Company. Estuvo casado con la actriz Emma Thompson.','https://image.tmdb.org/t/p/original/AbCqqFxNi5w3nDUFdQt0DGMFh5H.jpg'),
	(11207,'David Thewlis','1963-03-20','David Wheeler (20 de marzo de 1963), conocido artísticamente como David Thewlis, es un actor británico de cine, televisión y teatro.\n\nEs conocido por su papel de Remus Lupin​ en las películas de Harry Potter y por su participación en películas como: Naked de Mike Leigh, Total Eclipse de Agnieszka Holland, La isla del doctor Moreau de John Frankenheimer, Siete años en el Tíbet de Jean-Jacques Annaud, War Horse de Steven Spielberg y Wonder Woman de Patty Jenkins. En 2017 desempeñó un papel protagonista en la tercera temporada de la serie de televisión Fargo.','https://image.tmdb.org/t/p/original/sNuYyT8ocLlQr3TdAW9CoKVbCU8.jpg'),
