	(11477,'Ray Liotta','1954-12-18','Raymond Allen Liotta1​ (Newark, Nueva Jersey, 18 de diciembre de 1954), conocido artísticamente como Ray Liotta, es un actor de cine y televisión estadounidense, candidato a los Globos de Oro, a los Premios del Sindicato de Actores y ganador del Emmy al mejor actor invitado en una serie dramática,2​ conocido por sus intervenciones en películas como Algo salvaje (1986), Goodfellas (1990), Falsa seducción (1992), Cop Land (1997), Hannibal (2001) o Identidad (2003) ,3​ y por ser la voz de Tommy Vercetti, personaje principal del clásico videojuego Grand Theft Auto: Vice City.','https://image.tmdb.org/t/p/original/iXKotiB0Xe9iJLCBbjAedHPLb7p.jpg'),
