	(11664,'Zooey Deschanel','1980-01-17','Zooey Claire Deschanel (17 de enero de 1980) es una actriz, comediante, cantante, modelo, productora y compositora estadounidense. Debutó en el cine en 1999, con la película Mumford y más tarde consiguió su papel estelar en la película semi-autobiográfica que Cameron Crowe hizo en 2000, Casi famosos, donde interpretaba a Anita, la joven rebelde hermana mayor del protagonista William Miller. Cuenta con dos nominaciones a los premios Globo de oro.','https://image.tmdb.org/t/p/original/30KQyjsXfrdm4Dcori7bDFTg9Le.jpg'),
