	(11863,'Sarah Michelle Gellar','1977-04-14','Sarah Michelle Gellar, es una actriz, dobladora y productora estadounidense. Es conocida por su personaje Buffy Summers en la serie de televisión Buffy the Vampire Slayer, por la que ganó seis Teen Choice Awards y el Premio Saturn a la Mejor Actriz de Televisión del Género y recibió una nominación a un Premio Globo de Oro. También obtuvo un Premio Daytime Emmy por su papel en la serie All My Children como Kendall Hart, la hija perdida de Erica Kane.  Gellar ha tenido papeles protagonistas en I Know What You Did Last Summer (1997), Cruel Intentions (1999), Scooby-Doo (2002), el remake estadounidense de las película japonesas The Grudge (2004) y The Return (2006). Gellar desempeñó a una ex-estrella porno en la película Southland Tales (2007), y fue parte del elenco de The Air I Breathe (2008). También protagoniza Possession y Veronika Decides to Die (2009) Etc.','https://image.tmdb.org/t/p/original/ysKT3TAytCoVeMxD113b2UuCFL4.jpg'),
