	(11885,'John C. McGinley','1959-08-03','John Christopher McGinley (3 de agosto de 1959) es un actor, productor cinematográfico y guionista estadounidense.\n\nEs conocido por sus papeles como el Sargento Red O\'Neill en Platoon y como Perry Cox en la serie Scrubs.','https://image.tmdb.org/t/p/original/a9Oc7STg83syQh3X22u2TroAifk.jpg'),
	(12052,'Gwyneth Paltrow','1972-09-27','Gwyneth Kate Paltrow​ (27 de septiembre de 1972) es una actriz y cantante estadounidense ganadora de un Óscar, un Globo de Oro y dos Premios del Sindicato de Actores, todos ellos por su interpretación de Viola de Lesseps en la película Shakespeare in Love (1998). Recibió su estrella en el Paseo de la Fama de Hollywood en 2010.\n\nEs actualmente conocida por haber interpretado a Virginia «Pepper» Potts en las películas del Universo cinematográfico de Marvel Iron Man (2008), Iron Man 2 (2010), The Avengers (2012), Iron Man 3 (2013), Spider-Man: Homecoming (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019).','https://image.tmdb.org/t/p/original/slPWN0VvYJtNOEuxlFSsXSNQMaF.jpg'),
