	(12835,'Vin Diesel','1967-07-18','Mark Sinclair Vincent (18 de julio de 1967), más conocido por el nombre artístico de Vin Diesel, es un actor, productor y director de cine estadounidense.\n\nConocido por la interpretación de Dominic Toretto en la saga cinematográfica The Fast and the Furious y por el papel de Richard B. Riddick en la trilogía Las Crónicas de Riddick, también productor de las secuelas de ambas franquicias.\n\nDiesel también ha protagonizado películas como xXx y xXx: Return of Xander Cage (2002 y 2017); A Man Apart (2003); The Pacifier (2005); el 1492 (2006); y El último cazador de brujas (2015). Su trabajo también incluye la actuación de voz en off en las películas El gigante de hierro (1999), los videojuegos spin-offs de la franquicia Las Crónicas de Riddick, y el superhéroe Groot en Guardianes de la Galaxia o en otras películas del Universo Cinematográfico de Marvel. También escribió, dirigió, produjo y protagonizó los cortometrajes Multi-Facial (1995), Strays (1997) y Los chinneses (2004).\n\nDiesel es el fundador de las empresas de producción cinematográfica One Race Films, Racetrack Registros y la empresa de videojuegos Tigon Studios.','https://image.tmdb.org/t/p/original/tEoUF0RJqHnskmBOJiDEQhyN7Ok.jpg'),
	(12836,'Ted Danson','1947-12-29','','https://image.tmdb.org/t/p/original/2QUEYVhrKbOkRKeFEUnc5sJby6a.jpg'),
	(12982,'Peter Capaldi','1958-04-14','Peter Dougan Capaldi (14 de abril de 1958) es un actor, escritor y director escocés. Interpretó a la duodécima encarnación del Doctor en Doctor Who y Malcolm Tucker, el doctor de spinning en The Thick of It, por el cual recibió cuatro nominaciones a los Premios de la Academia Británica de Televisión, ganando Mejor Actuación de Comedia Masculina en 2010.  Cuando repitió el papel en In the Loop, fue honrado con varias nominaciones a los premios de críticos de cine al Mejor Actor de Reparto. En 2012, escribió (con Tony Roche), dirigió y actuó en The Cricklewood Greats, un documental de parodia afectuoso sobre un estudio ficticio de cine, que rastrea desarrollos y tendencias reales a lo largo de la historia del cine británico.  Como director, ganó el Premio de la Academia al Mejor Cortometraje de Acción en vivo y el BAFTA Premio al mejor cortometraje por su cortometraje It\'s a Wonderful Life de Franz Kafka. Luego escribió y dirigió la película dramática Strictly Sinatra y dirigió dos series de comedia Getting On.','https://image.tmdb.org/t/p/original/wcsd1tMVFjgplfZlTUfb7fiD2zP.jpg'),
