	(13240,'Mark Wahlberg','1971-06-05','Mark Robert Michael Wahlberg (Boston, Massachusetts, 5 de junio de 1971) es un actor, modelo, cantante y productor de televisión estadounidense.  Como cantante, integró el grupo de rap Marky Mark & the Funky Bunch, que alcanzó un enorme éxito con el disco Music for the People. Como actor, fue nominado a los Oscar 2006 en la categoría de mejor actor de reparto por la película The Departed. Es hermano del también actor y músico Donnie Wahlberg. Recibió una estrella en el paseo de la fama de Hollywood el 29 de julio de 2010.','https://image.tmdb.org/t/p/original/bTEFpaWd7A6AZVWOqKKBWzKEUe8.jpg'),
	(13242,'Paul Giamatti','1967-06-06','Fecha de nacimiento: 06 junio 1967\n\nLugar de nacimiento: New Haven, EE.UU.\n\nNacionalidad: EE.UU.\n\nSu padre (fallecido en 1989) fue un distinguido profesor universitario de literatura renacentista en la Universidad de Yale. Paul Giamatti puso toda la carne en el asador para seguir sus pasos, motivo por el cual estudió lengua inglesa en la misma universidad, un máster en Bellas Artes y otro en el prestigioso Yale University School of Drama. Fue entonces cuando entendió que el camino de su progenitor no era el suyo, y por eso decidió dedicarse en cuerpo y alma a la interpretación. Después de una larga carrera teatral, Giamatti debuta en el cine en 1992 en el filme Solteros.  Especializado en roles secundarios de gran carácter (Donnie Brasco, El show de Truman, Salvar al soldado Ryan), habrá de tener paciencia y esperar a 2003, año en que una cinta indie de bajo presupuesto, American Splendor le abre al fin las puertas de la popularidad. Giamatti aprovecha la inercia de la corriente y en 2004 triunfa en todo el mundo con Entre copas, en un papel que, según muchos, debería haber sido premiado con el Oscar aquel año. No pudo ser, pero desde entonces es uno de los secundarios más cotizados de Hollywood: Cinderella Man (por la que fue de nuevo candidato a la estatuilla dorada), El ilusionista o La joven del agua confirman su estatus de seguro de vida para cualquier película. En pocos años cuaja como uno de los mejores secundarios (y no solo) del cine anglosajón, encadenando interpretaciones inolvidables en películas como La última estación, El mundo según Barney, Win Win o Los idus de marzo. Brilla igualmente en la serie John Adams, por la que logra el premio Emmy como mejor actor protagonista.  Atrapado en su papel de actor de reparto por antonomasia, Giamatti se ha movido entre todo tipo de géneros durante casi toda su carrera. En los últimos años ha pasado por el drama biográfico ( 12 años de esclavitud), la comedia (Al encuentro de Mr. Banks), las catástrofes (San Andrés) y hasta ha sido villano de cómic (The Amazing Spider-Man 2: El poder de Electro). Con casi 100 títulos a sus espaldas, también podemos verle tocar el romanticismo en la cinta Love and Mercy, donde comparte planos con John Cusack, y en los exitosos films Straight Outta Compton, Madame Bovary y Morgan. Como ya demostró en Turbo, a Giamatti también le gusta el género de animación y se apunta al doblaje de Ratchet y Clank o El Principito, entre otras.','https://image.tmdb.org/t/p/original/wbrVVJRr5TwhDZuvijBgOorzcAb.jpg'),
