	(13922,'Seth Green','1974-02-08','Seth Benjamin Gesshel-Green (nacido el 8 de febrero de 1974) es un actor, comediante, actor de doblaje y productor de televisión estadounidense. Es bien conocido por su papel de Daniel \"Oz\" Osbourne en Buffy the Vampire Slayer, así como por el hijo del Dr. Evil, Scott, en la serie de películas de comedia Austin Powers y Mitch Miller en That \'70s Show. También da voz a los personajes de Chris Griffin en Family Guy, el teniente Gibbs en Titan Maximum, Jeff \"Joker\" Moreau en la serie de videojuegos Mass Effect, y es uno de los creadores y productores de la serie de comedia stop motion Robot Chicken, en la que también da voz a muchos personajes. Green ha aparecido en muchas otras películas, como Rat Race, The Italian Job, Can\'t Hardly Wait, Without a Paddle, y cuando era niño en la película de terror Stephen King\'s It.','https://image.tmdb.org/t/p/original/l4No5Eu6j0U80hCIkaSn17AOWrj.jpg'),
