	(14329,'Dean Norris','1963-04-08','Dean Joseph Norris (8 de abril de 1963) es un actor estadounidense.\n\nEs más conocido por interpretar al agente de la DEA Hank Schrader en la serie Breaking Bad y Better Call Saul, de la cadena AMC y Netflix respectivamente, además de a \"Big Jim\" Rennie en la serie La cúpula, de la CBS.','https://image.tmdb.org/t/p/original/fXbHgZxCEclcTxV8MpeBXhe2OJS.jpg'),
