	(14407,'Matt LeBlanc','1967-07-25','Matthew Steven LeBlanc (n. Newton, Massachusetts; 25 de julio de 1967), más conocido como Matt LeBlanc, es un actor estadounidense, famoso por su papel como Joey Tribbiani en la comedia Friends (1994-2004) y Joey (serie de televisión) (2004-2006).\n\nMatt LeBlanc nació el 25 de julio de 1967 en Newton, Massachusetts. Tanto su padre, Paul LeBlanc, como su madre son de origen francés. Tiene sangre italiana, francesa, irlandesa, inglesa y danesa. Estudió en el centro escolar Newton North High School De pequeño no estuvo interesado en actuar. Desde muy pequeño fue conocido en su barrio como \"primo\". Tras conseguir su primera motocicleta a la edad de 8 años, en el año 1975, LeBlanc comenzó a participar en algunas competiciones de amateurs con esperanzas de correr profesionalmente. Pronto corrió en carreras de obstáculos, pero el empeño de su madre por encontrar otra salida diferente a su talento le obligó a dejarlo.\n\nSe preparó para trabajar en la carpintería, y después de la graduación en el instituto se fue a la ciudad de Nueva York. LeBlanc sabía que una carrera como actor de cine y televisión necesitaba de estudios y experiencia sobre el escenario, así que se puso bajo la tutela de Flo Greenberg, y consiguió papeles en producciones teatrales como Private Wars, Out of Gas On Lover\'s Leap y A Streetcar Named Desire. Pronto, en 1987, saltó a la televisión protagonizando anuncios publicitarios para productos tales como los tejanos Levi\'s 501, Coca-Cola, Doritos (se hace referencia a este comercial en el capítulo 14 de la sexta temporada de Friends), y Milky Way. Ese mismo año recibió un León de Oro en el Festival de Cine de Cannes por un anuncio de Ketchup Heinz en el que aparecía.\n\nEn 1988, empezó formalmente su carrera como actor, y en el período de un año comenzó un papel protagonista en la serie TV 101 y se mudó a Los Ángeles, donde apareció en algunos shows (Red Shoe Diaries y Top of the Heap), antes de su debut cinematográfico en Lookin\' Italian, con Alanis Morissette (cabe destacar que apareció en los videos \"Walk Away\" y \"Plastic\" de dicha cantante), lo que le abrió la puerta para interpretar a Joey Tribbiani en Friends, personaje gracias al cual ganó un premio Emmy. Además de esto, Matt LeBlanc apareció en un episodio de la serie Married... with children como novio fugaz de Kelly Bundy (Christina Applegate donde aparece vestido como un motociclista, típico novio de la chica rubia en esa serie. Tuvo una segunda aparición en la serie en un capítulo especial en el que Al va a visitar a un viejo amigo que vive con su hijo (papel que interpretó LeBlanc) en Nueva York; a quien Al y su amigo, al reconocer el atractivo del muchacho, tratan de promover como modelo en una fiesta de sociedad; luego, en una segunda secuela de esta aventura, el amigo y su hijo le devuelven la visita a Al, donde conoce a Kelly. Cabe destacar que en 2000 Le Blanc apareció de forma rápida y corta en un video de Bon Jovi (Say It Isn\'t So); también participó como personaje principal en el video Miracle interpretado por Jon Bon Jovi.','https://image.tmdb.org/t/p/original/a7Fl1sLUq1UDJ4pHsnwpBdEiDEZ.jpg'),
