	(15735,'Helen Mirren','1945-07-26','Helen Mirren DBE (26 de julio de 1945)​ es una actriz británica.\n\nEs una de las pocas actrices que han ganado los cuatro premios principales dentro del cine por una sola película (The Queen): el Óscar, el BAFTA, el Globo de Oro y el Premio del Sindicato de Actores.\n\nEn dos oportunidades ha sido galardonada con el premio por interpretación femenina en el Festival Internacional de Cine de Cannes: en 1984 por la película Cal y en 1995 por La locura del rey Jorge.','https://image.tmdb.org/t/p/original/1reKRrsdsHXJaRVHVyOEg4oPTcZ.jpg'),
