	(15831,'Frank Welker','1946-03-12','Franklin Wendell \"Frank\" Welker (Denver, 12 de marzo de 1946) es un actor estadounidense que se especializa en voces de personajes animados. Ha interpretado, entre otros, a Fred Jones, de Scooby Doo, a Ray Stantz y Pegajoso, de la serie de televisión The Real Ghostbusters y a Megatron, de Transformers.\n\nEn 2016 recibió un Emmy, en honor a sus logros de toda la vida.','https://image.tmdb.org/t/p/original/xXODQ5AX6pG4my8ieeEIuiAREXs.jpg'),
