	(16478,'Johnny Galecki','1975-04-30','Nació en Bree, Bélgica, donde su padre Richard Galecki estaba al servicio de la Fuerza Aérea de los EE. UU., mudándose a Chicago cuando tenía tres años. Su madre, Mary Lou Galecki, era una consultora de hipotecas. Sus padres son estadounidenses de ascendencia italiana, irlandesa y polaca.\n\nGalecki tiene un hermano menor, Nick, a quien describe como un \"genio de la mecánica\", y una hermana menor, Allison. Galecki creció en Oak Park, Illinois.\n\nCon 17 años comenzó a actuar en producciones teatrales muy prestigiosas como El violinista en el tejado, Pippin y Galileo, junto a Brian Dennehy en el teatro Goodman de Chicago.','https://image.tmdb.org/t/p/original/gkwMiwHX7lmfjORRJi6T6SM3ppo.jpg'),
	(16483,'Sylvester Stallone','1946-07-06','Michael Sylvester Gardenzio Stallone (6 de julio de 1946) es un actor, guionista, productor y director de cine estadounidense, estrella del cine de acción de Hollywood.\n\nHa dado vida a tres personajes icónicos de la historia del cine: a Rocky Balboa, un boxeador de Filadelfia que venció contra todo pronóstico y se convirtió en campeón; a John Rambo, ex boina verde veterano de la guerra de Vietnam, especializado en guerrilla, supervivencia y combate, y a Barney Ross, también un veterano de la Guerra del Vietnam y líder de un grupo de mercenarios veteranos y novatos, contratados para operaciones de espionaje y militares. La cinta Rocky (1976) le valió dos nominaciones al premio Óscar, en la categoría de Mejor Actor y Mejor Guion. En 2016 ganó el Globo de Oro a Mejor actor de reparto por el papel de Rocky Balboa en el spin-off de la saga, Creed (2015), además de ser nominado al Óscar en la misma categoría.\n\nAparte de las sagas de Rocky, Rambo y The Expendables (2010-2014), entre sus cintas más populares se encuentran: Cop Land, Asesinos (1995), Judge Dredd (1995), El especialista (1994), Demolition Man (1993), Cliffhanger (1993), Lock Up (1989), Tango y Cash (1989), Over the Top (1987) y Cobra (1986).','https://image.tmdb.org/t/p/original/qDRGPAcQoW8Wuig9bvoLpHwf1gU.jpg'),
