	(16851,'Josh Brolin','1968-02-12','Josh James Brolin (12 de febrero de 1968) es un actor de cine y televisión estadounidense.  Su primer papel fue en la película Los Goonies en 1985. Desde entonces ha aparecido en varias películas y es conocido por papeles como Llewellyn Moss en No Country for Old Men, el Agente K joven en Hombres de negro III, Thanos en Avengers: Age of Ultron (Cameo), Avengers: Infinity War, Avengers: Endgame, Cable en Deadpool 2, el presidente George W. Bush en W y Dan White en Milk, por la cual recibió nominaciones al Óscar y SAG como mejor actor de reparto. Además, ha tenido papeles en películas como El hombre sin sombra, In the Valley of Elah, American Gangster, True Grit, Sin City: A Dame to Kill For y Hail, Caesar!. Es hijo del actor James Brolin.','https://image.tmdb.org/t/p/original/sX2etBbIkxRaCsATyw5ZpOVMPTD.jpg'),
