	(16940,'Jeremy Irons','1948-09-19','Jeremy John Irons (19 de septiembre de 1948) es un actor británico ganador de los premios Tony, Óscar, Globo de Oro, SAG y Emmy.\n\nEs famoso, principalmente, por sus interpretaciones en proyectos para la televisión y el cine tales como Retorno a Brideshead, La misión, El hombre de la máscara de hierro, La casa de los espíritus, The French Lieutenant\'s Woman, Die Hard with a Vengeance (La jungla de cristal 3 en España, Duro de matar 3: La venganza en Latinoamérica), Reversal of Fortune (El misterio Von Bülow) y más la serie de televisión The Borgias.\n\nEl 17 de octubre de 2011, fue nombrado embajador de Buena Voluntad de la Organización de las Naciones Unidas para la Alimentación y la Agricultura (FAO).','https://image.tmdb.org/t/p/original/jWhutvBrpV09KQK7LqZxSdGSXFk.jpg'),
