	(17051,'James Franco','1978-04-19','James Edward Franco (19 de abril de 1978) es un actor, guionista, pintor, productor y director estadounidense.\n\nInició su carrera interpretativa a finales de la década de 1990, con apariciones en series televisivas como Freaks and Geeks y en películas de adolescentes. En 2001 interpretó el papel de James Dean en la película homónima, actuación que fue premiada con un Globo de Oro al mejor actor de miniserie o telefilme.\n\nAlcanzó la fama internacional por su papel de Harry Osborn en la primera trilogía de Spider-Man. A partir de entonces, sus participaciones en películas han sido muy variadas, incluyendo la película de guerra The Great Raid (2005), el drama romántico Tristán e Isolda, y la película dramática Annapolis (2006), dirigida por Justin Lin, entre otras.\n\nEn 2008 interpretó a Saul Silver en la comedia Pineapple Express, película que le mereció una nominación a los Premios Globo de Oro en la categoría al mejor actor de comedia o musical. Ese mismo año tuvo un papel importante en la película biográfica Milk, donde interpretó a la pareja del político y activista gay Harvey Milk.\n\nEn 2011 fue nominado a los Premios Óscar por su papel de actor principal en la película 127 horas.​ En 2017, la película The Disaster Artist, producida, dirigida y protagonizada por Franco, fue galardonada con la Concha de Oro del Festival Internacional de Cine de San Sebastián.​ También ganó el Globo de Oro al mejor actor Comedia o musical y está nominada al Oscar al mejor guion adaptado','https://image.tmdb.org/t/p/original/pgEe68922Ba20vAwPmAFQFm8U0c.jpg'),
	(17140,'Abigail Breslin','1996-04-14','Abigail Kathleen Breslin (14 de abril de 1996), conocida como Abigail Breslin, es una actriz estadounidense. Es una de las actrices más jóvenes en ser nominada a un Óscar.\n\nSu carrera comenzó a la edad de tres años, cuando apareció en un comercial de televisión de Toys \"R\" Us y actuó en su primera película, Señales (2002), a la edad de cinco años.​ Posteriormente apareció en la película de Disney Chestnut, el héroe de Central Park (2004). Pero el reconocimiento internacional llegó al interpretar a Olive en la comedia Little Miss Sunshine (2006); gracias a esta película, Breslin se convirtió en la cuarta actriz más joven en ser nominada a un Premio Óscar de la Academia; también obtuvo una nominación a los Premios del Sindicato de Actores, en la categoría de Mejor actriz de reparto, y también a los Premios BAFTA, en la misma categoría. Breslin llegó a convertirse en una de las celebridades juveniles e infantiles con mayor éxito, al igual que Dakota Fanning, Daniel Radcliffe, Mary-Kate y Ashley Olsen y Macaulay Culkin, entre otras.\n\nLuego actuó en películas de Hollywood tales como Sin reservas (2007), El último regalo (2007), La isla de Nim (2008), Definitely, Maybe (2008), My Sister\'s Keeper (2009), Zombieland (2009), Rango (2011), New Year\'s Eve (2011), The Call (2013), Maggie y Final Girl (ambas 2015). En septiembre del 2015, comenzó a actuar en la comedia de terror Scream Queens, en Fox, en la que recibió su primer papel regular en una serie de televisión.','https://image.tmdb.org/t/p/original/jlSTX9ZzLdkP9JS75B0diyOppzR.jpg'),
	(17141,'Greg Kinnear','1963-06-17','','https://image.tmdb.org/t/p/original/iJezGc9XjY0DFPs00SypkuKImFK.jpg'),
	(17178,'Patrick Wilson','1973-07-03','Patrick Joseph Wilson (3 de julio de 1973) es un actor y cantante estadounidense.​\n\nDesde 1996 ha participado en varios musicales y ha protagonizado varias obras teatrales en el circuito de Broadway.​ En 2003 trabajó en la serie de televisión Angels in America de la cadena HBO, la cual está basada en la obra homónima de Tony Kushner y donde interpretó a Joe Pitt.​ Como actor de cine se ha destacado en películas como The Alamo, El fantasma de la ópera, Little Children, Watchmen, The A-Team, The Ledge, The Conjuring e Insidious y su secuela.​ En 2011 estelarizó la serie dramática A Gifted Man de la cadena televisiva CBS, donde encarnó el papel de un neurocirujano que ve el espíritu de su difunta esposa.​ En 2015 tuvo un papel protagónico en la segunda temporada de la serie televisiva de la cadena FX Fargo. Ha sido nominado a los premios Tony, a los Emmy y a los Globo de Oro.','https://image.tmdb.org/t/p/original/tc1ezEfIY8BhCy85svOUDtpBFPt.jpg'),
