	(17419,'Bryan Cranston','1956-03-07','Bryan Lee Cranston (Los Ángeles, 7 de marzo de 1956) es un actor, actor de voz, guionista, productor y director estadounidense, reconocido por su interpretación de Hal Wilkerson (el padre de familia de la serie de FOX Malcolm in the middle), de Walter White (en la serie de AMC Breaking Bad) y del doctor Tim Whatley en la comedia de NBC Seinfeld. Este papel le ha convertido en uno de los grandes en el panorama del cine y la televisión habiendo sido galardonado con numerosos premios como los Emmy y los Globos de Oro. En la última década ha pasado de ser un actor de papeles menores a ser uno de los más reconocidos en la industria cinematográfica, llegando a ser nominado a los Premios Óscar el año 2016.','https://image.tmdb.org/t/p/original/7Jahy5LZX2Fo8fGJltMreAI49hC.jpg'),
