	(17605,'Idris Elba','1972-09-06','Idrissa Akuna Elba (6 de septiembre de 1972), conocido como Idris Elba, es un actor británico de televisión, teatro y cine.\n\nInició su carrera en Estados Unidos, siendo su papel más conocido el de Russell \"Stringer\" Bell, traficante de drogas que aspira a convertirse en un hombre de negocios en la serie The Wire. Protagonista a su vez en la serie Luther donde ganó un Globo de Oro al mejor actor de miniserie o telefilme.  Es también un DJ -conocido como DJ Big Driis / Big Driis the Londoner- y un cantante de Hip hop y soul.','https://image.tmdb.org/t/p/original/be1bVF7qGX91a6c5WeRPs5pKXln.jpg'),
	(17628,'Mary Elizabeth Winstead','1984-11-28','Mary Elizabeth Winstead (n. Rocky Mount, Carolina del Norte, 28 de noviembre de 1984) es una actriz, cantante y modelo estadounidense conocida por sus papeles en películas como Sky High, Death Proof, Bobby, Black Christmas, Destino final 3, Live Free or Die Hard y Scott Pilgrim vs. The World, y por su papel protagónico en la serie The Returned. Fue nominada para el Young Artist Award por su actuación en Passions.','https://image.tmdb.org/t/p/original/vQn6IGsClpyhV6KTba9EDqSK7e2.jpg'),
	(17647,'Michelle Rodriguez','1978-07-12','Mayte Michelle Rodriguez (12 de julio de 1978) es una actriz y modelo estadounidense. A raíz de su primer papel protagonista en la película independiente Girlfight (2000), es conocida por sus papeles de la típica chica dura y rebelde en éxitos hollywoodenses como The Fast and the Furious, Resident Evil, S.W.A.T., Avatar, Machete, Battle: Los Angeles, Resident Evil: Retribution, Fast and Furious 6 y Machete Kills, así como por su papel de Ana Lucía Cortez en la serie de televisión Lost.\n\nTambién ha realizado numerosos trabajos de voz en videojuegos como Call of Duty y Halo y prestó su voz para la película animada en 3D Turbo y en la televisión para IGPX.\n\nSus películas han recaudado más de $5 mil millones, y Entertainment Weekly la calificó como \"la actriz latina más exitosa de Hollywood\".','https://image.tmdb.org/t/p/original/hulQAiXNFLq4VDYVxBPgK009njf.jpg'),
