	(17743,'Miranda Cosgrove','1993-05-14','Miranda Taylor Cosgrove (14 de mayo de 1993) es una actriz, cantante, compositora, diseñadora y filántropa estadounidense.\n\nComenzó su carrera cuando tenía solo tres años, haciendo anuncios televisivos, su debut como actriz se produjo en 2002, interpretando a Summer Hathaway en la película musical Escuela de rock. Se hizo conocida en 2003 por su personaje como Megan Parker en la serie original de Nickelodeon, Drake & Josh.​ Luego saltó a la fama internacional por interpretar a Carly Shay en la serie nominada al Emmy, iCarly.​ La serie obtuvo buena recepción y recibió numerosos premios, como los Teen Choice Awards y los Nickelodeon Kids Choice Awards en 2009, 2010, y 2011, respectivamente. Durante el rodaje del programa, recibía un total de hasta US$ 180,000 dólares por cada episodio, por lo que se convirtió en la Actriz infantil mejor pagada y logró entrar en el Libro Guinness de los récords en 2012.','https://image.tmdb.org/t/p/original/xwJxbOTWJc1AKvC33v9PNsuYX6Q.jpg'),
