	(18307,'Daniel Dae Kim','1968-08-09','Daniel Dae Kim (4 de agosto de 1968) es un actor coreano.\n\nEs conocido por interpretar a Jin-Soo Kwon en la serie de televisión Lost , a Jack Kang en la adaptación cinematográfica de la saga superventas Divergente y a Johnny Gat en la serie del videojuego Saints Row. Actualmente ya no interpreta a Chin Ho Kelly en la serie de televisión Hawaii Five-0 por discrepancias con su contrato.','https://image.tmdb.org/t/p/original/aXbTKgL4u6oVumQ459B9VkGTn4A.jpg'),
	(18354,'Bridget Moynahan','1971-04-28','Kathryn Bridget Moynahan (28 de abril de 1971) es una actriz y modelo estadounidense. Se la conoce por sus interpretaciones en las películas Coyote Ugly, Yo, robot, Invasión del mundo: Batalla Los Ángeles y Lord of War. En televisión también es conocida por interpretar a Erin Reagan-Boyle en la serie Blue Bloods (Familia de policías), ayudante del Fiscal e hija del Jefe de la Policía de Nueva York Frank Reagan (Tom Selleck).','https://image.tmdb.org/t/p/original/5y5CRPu9aw5Wx3EwyX1A2RpuLQP.jpg'),
