	(18478,'Rodrigo de la Serna','1976-04-18','Lionel Rodrigo de la Serna Chevalier (18 de abril de 1976), más conocido como Rodrigo de la Serna, es un reconocido actor y músico argentino.  Entre sus interpretaciones más destacadas se encuentran la de Alberto Granado en la película Diarios de motocicleta, el joven marginal Ricardo en Okupas, el barrabrava José María Lombardo en el unitario El Puntero, el libertador José de San Martín en Revolución: El cruce de los Andes, el Papa Francisco en la película biográfica Llámame Francisco y el atracador Palermo en la serie de televisión española La casa de papel.','https://image.tmdb.org/t/p/original/vMuKUJSnEGOmjjLYzVDKGukiaCr.jpg'),
