	(18918,'Dwayne Johnson','1972-05-02','Dwayne Douglas Johnson (2 de mayo de 1972) es un actor y luchador profesional estadounidense, conocido popularmente como The Rock (La Roca​ en español). Se desempeñó como luchador profesional para la WWE hasta su retirada oficial en 2019, con el objetivo de centrarse en su carrera artística.\n\nHa participado en una gran diversidad de películas siendo premiado en muchas de ellas, siendo su papel como Luke Hobbs en The Fast and the Furious uno de los más reconocidos.\n\nEntre sus logros como luchador se destacan diez Campeonatos Mundiales: ocho como Campeón de la WWE y dos como Campeón de la WCW. También fue dos veces Campeón Intercontinental de la WWE y cinco veces Campeón Mundial en Parejas. También fue el ganador del Royal Rumble 2000 todo esto lo vuelve Campeón de las Tres Coronas.\n\nEs famoso por acabar todos sus discursos en el cuadrilátero y al presentarse en escena con la frase: \"If you smell... What The Rock is Cooking?\" que se puede traducir como: ¿Pueden oler... Lo que está cocinando la Roca? Esta frase es una variación de pregunta-respuesta, un modismo de palabras que pretende hacer un juego con el público, en una pregunta, \"¿Si puedes oler?\" y el público responde a modo de coro, \"Lo que la roca está cocinando\", o también usa la Frase: Finally, The Rock is come back.... y da una referencia de la ciudad donde se encuentra.\n\nEl primer papel protagonista de Johnson en una película fue en The Scorpion King en 2002. Por esto, le pagaron $ 5.5 millones, un récord mundial para un actor en su primer papel protagónico. Uno de sus papeles más prominentes es Luke Hobbs en la franquicia The Fast and the Furious. Además organizó y produjo The Hero, una serie de reality shows y desde entonces ha seguido produciendo programas de televisión y películas a través de su productora Seven Bucks Productions.\n\nEn 2013, La revista Forbes nombró a Johnson el No. 25 entre las 100 celebridades más poderosas y ha estado entre los mejores veinte desde entonces. Fue el actor mejor pagado del mundo en el 2016. La revista Time lo nombró una de las 100 personas más influyentes del mundo en 2016. En 2015, La revista Muscle & Fitness lo nombró el \"Hombre del siglo\".','https://image.tmdb.org/t/p/original/cgoy7t5Ve075naBPcewZrc08qGw.jpg'),
	(18973,'Mila Kunis','1983-08-14','Milena Márkovna Kunis (14 de agosto de 1983), más conocida como Mila Kunis, es una actriz ucraniana naturalizada estadounidense.\n\nEs conocida mundialmente por interpretar a Jackie Burkhart en That 70\'s Show, por ser la actriz de voz de Meg Griffin en Padre de familia, y por los papeles cinematográficos de Solara en The Book of Eli, Lily en Black Swan, Jamie en Friends with Benefits, Lori en Ted, la bruja Theodora en Oz: The Great and Powerful, Jupiter Jones en Jupiter Ascending y Amy Mitchell en Bad Moms.','https://image.tmdb.org/t/p/original/811vCRSr9s2MFwCIOo1jWHltu3R.jpg'),
	(18974,'Laura Prepon','1980-03-07','','https://image.tmdb.org/t/p/original/bZj8rZ75QVR9HE4VAhOsjaacvKB.jpg'),
	(18976,'Ashton Kutcher','1978-02-07','Christopher Ashton Kutcher (7 de febrero de 1978) es un actor, productor y ex modelo estadounidense.\n\nEs conocido por interpretar el papel de Michael Kelso en la serie That \'70s Show.  Fue el creador, productor ejecutivo y presentador del programa Punk\'d de MTV donde se realizaban bromas a los famosos. Tuvo papeles en películas como, Dude, Where\'s My Car?, Recién casados, The Butterfly Effect, The Guardian y What Happens in Vegas. También es el productor y co-creador de la serie de televisión Room 401 y el reality show Beauty and the Geek. Reemplazó a Charlie Sheen en la exitosa comedia de situación estadounidense Two and a Half Men.','https://image.tmdb.org/t/p/original/LvIpFJZDNjRKD5Nl9QAaRxYIiv.jpg'),
	(18977,'Ed O\'Neill','1946-04-12','Edward Leonard \"Ed\" O\'Neill, Jr. (12 de abril de 1946) es un actor estadounidense especialmente conocido por su papel de Al Bundy, el personaje principal en la comedia de la Fox Matrimonio con hijos y, desde 2009, por su papel de Jay Pritchett en la serie de ABC Modern Family.','https://image.tmdb.org/t/p/original/uNXhu2ci4R1OwcMUTK9dluYzdQl.jpg'),
