	(18998,'Rosemary Harris','1927-09-19','Rosemary Harris (19 de septiembre de 1927) es una actriz inglesa nominada al premio Oscar y ganadora de un Tony. Es actualmente conocida por su papel en Spider-Man, Spider-Man 2 y Spider-Man 3 como la Tía May.','https://image.tmdb.org/t/p/original/rpSsXg0tB7wWQMffvvMqLzrvZAj.jpg'),
	(18999,'J.K. Simmons','1955-01-09','Jonathan Kimble Simmons (9 de enero de 1955), más conocido como J. K. Simmons, es un actor estadounidense ganador del Óscar, Globo de Oro, BAFTA, Premio del Sindicato de Actores, entre otros premios.  Es conocido por su papel del neonazi Vernon Schillinger en la serie Oz, de HBO, por su papel como J, Jonah Jameson en las películas de Spider-Man, como también sus papeles en dos películas de los hermanos Coen, The Ladykillers y Burn After Reading. Ganó el Óscar a Mejor actor de Reparto por su participación como Terence Fletcher en la película Whiplash, de 2014.','https://image.tmdb.org/t/p/original/7kIiPojgSVNRXb5z0hiijcD5LJ6.jpg'),
	(19024,'Javier Gutiérrez','1971-01-17','Javier Gutiérrez Álvarez (17 de enero de 1971) es un actor de teatro, cine y televisión español, ganador de dos Premios Goya por su papel del detective Juan Robles en la película La isla mínima (2014) y por la película El autor (2017), y también conocido por sus interpretaciones en televisión en series como Estoy vivo, Los Serrano o Águila Roja.','https://image.tmdb.org/t/p/original/xkVnaiiXtYJLjlJRsj8zD9r7k6t.jpg'),
	(19034,'Evangeline Lilly','1979-08-03','Nicole Evangeline Lilly (3 de agosto de 1979),​ conocida artísticamente como Evangeline Lilly, es una actriz y escritora canadiense. Logró popularidad por su papel de Kate Austen en la serie de televisión Lost (2004-2010), por la que obtuvo un Premio del Sindicato de Actores y recibió una nominación al Globo de Oro.​ También es reconocida por sus interpretaciones de Connie James en The Hurt Locker (2008), Hope Van Dyne en Ant-Man and the Wasp (2018), Bailey Tallet en Real Steel (2011) y Tauriel en la serie fílmica de El Hobbit.','https://image.tmdb.org/t/p/original/n8WZuHASdxzympHd6TaJtF4REhp.jpg'),
