	(19149,'Tori Spelling','1973-05-16','Victoria Davey \"Tori\" Spelling (nacida el 16 de mayo de 1973) es una actriz estadounidense y personalidad de la televisión de realidad, y la única hija del famoso magnate de la televisión Aaron Spelling. Se hizo famosa como una de las estrellas de Beverly Hills 90210, el drama adolescente que definió la época producido por su padre, interpretando a la virtuosa buena chica Donna Martin.Mientras el 90210 estaba todavía en el aire, Spelling pasó sus paradas de verano retratando a una serie de mujeres jóvenes en peligro, convirtiéndose en sinónimo del melodrama y del campamento alto involuntario de la cadena Lifetime Movie Network y protagonizando placeres culpables de culto, entre los que se incluyen Death of a Cheerleader and Mother, May I Sleep with Danger?Cuando el 90210 llegó a su fin, Spelling se topó con una serie de largometrajes sorprendentemente aclamados, enviando su propia imagen en un meta cameo en Scream 2 de 1997, y ganando elogios por su fuerte papel de apoyo cómico en películas independientes como The House of Yes y Trick. Pero en la segunda mitad de los años ochenta, la vida personal de Spelling comenzó a eclipsar su trabajo como actriz, con un romance en el escenario con el actor Dean McDermott, lo que provocó que Spelling y McDermott se divorciaran de sus respectivas parejas en ese momento. En el momento de su unión, la historia de la pareja resultó irresistible para personas como TMZ y Pérez Hilton, ambos en sus primeros años, lo que llevó a Spelling a capitalizar su nueva fama de tabloide con una serie de proyectos de reality shows, incluyendo Tori & Dean: Inn Love y True Tori.Mientras que ella continuaría encontrando trabajo de actuación que jugaba con la nostalgia de su apogeo de los 90, incluyendo apariciones en el reinicio del CW 90210 y encabezando la comedia Mystery Girls con su antigua coprotagonista del 90210 Jennie Garth, Spelling se ha hecho más famosa en los últimos años por sus problemas personales, desde sus crónicos problemas financieros y sus disputas con la madre Candy hasta su inclinación por los dramas surrealistas, incluyendo un incidente en el que se precipitó de espaldas sobre una parrilla de hibachas, mientras se alimentaba en el restaurante Benihhana. Ella y McDermott, que se casaron en 2006 y renovaron sus votos matrimoniales en 2010, viven en Los Ángeles con sus cinco hijos.','https://image.tmdb.org/t/p/original/xUPnjmmMcOdAHVhZL5b88MrJi7R.jpg'),
