	(20049,'David Tennant','1971-04-18','David Tennant (18 de abril de 1971) es un actor escocés. Además de su trabajo en el teatro, que incluye a Hamlet, ampliamente elogiado, Tennant es mejor conocido por su papel como la décima encarnación del Doctor en Doctor Who, junto con el papel principal en la serie de televisión de 2005 Casanova y como Barty Crouch, Jr. en la adaptación cinematográfica de 2005, Harry Potter y el cáliz de fuego.','https://image.tmdb.org/t/p/original/9PJteC0a8POnPhqgxvdtWNKHPsD.jpg'),
	(20057,'Michelle Fairley','1963-07-11','Michelle Fairley es una actriz británica de cine, televisión y teatro.\n\nApareció en una gran cantidad de programas de televisión norirlandeses, entre ellos The Bill y Holby City Heartbeat. Una de sus primeras apariciones fue interpretando a la asesina Cathy Michaels en la serie de ITV1, Inspector Morse, en el episodio titulado «The Way Through The Woods».\n\nInterpretó a la señora Granger en la primera parte de Harry Potter y las Reliquias de la Muerte, papel que en Harry Potter y la cámara secreta desempeñó Heather Bleasdale.\n\nEl 19 de marzo de 2010 se anunció que remplazaría a Jennifer Ehle en el papel de Catelyn Stark en la serie de HBO Game of Thrones. También interpreta a la madre de Nathan en la serie británica Misfits. El 4 de junio de 2013 se confirmó que la actriz formaría parte del conjunto de actores de la serie Suits de la cadena USA Network en su tercera temporada desde el primer capítulo. Representa a Ava Hessington, una empresaria británica que dirige una compañía petrolífera. Contacta con Harvey Specter cuando se ve envuelta en un pleito judicial que podría costarle su empresa y varios años en la cárcel.\n\nHa vivido en Londres muchos años de su vida.','https://image.tmdb.org/t/p/original/j8lQfEPHCKWV2QCiJJuH97CnoBX.jpg'),
