	(21089,'Bruce Greenwood','1956-08-12','Bruce Greenwood (12 de agosto de 1956) es un actor canadiense. Desde 1985 está casado con la actriz Susan Devlin, también canadiense, y tienen 1 hija. Interpretó al presidente de los Estados Unidos en tres películas National Treasure: Book of Secrets, Trece días (John F. Kennedy, en esta última) y Kingsman: The Golden Circle. También trabajó en películas como Déjà Vu, Capote (donde interpretó a la pareja del escritor Truman Capote), Yo, robot, Swept Away, Rules of Engagement, Ararat y Star Trek.','https://image.tmdb.org/t/p/original/ndobQyQRbDG3ThbDzS3nI3NkAV7.jpg'),
