	(22970,'Peter Dinklage','1969-06-11','Actor de cine, televisión y teatro estadounidense. Aunque su papel más conocido hasta la fecha es el de Tyrion Lannister en la serie Juego de tronos (HBO), el cual le ha valido dos Emmy y un Globo de Oro, Dinklage ha participado en proyectos como la independiente The Station Agent (2003), Elf (2003), Find Me Guilty (2006), Underdog (2007), Death at a Funeral (2007) y su remake de 2010 o Las crónicas de Narnia: el príncipe Caspian (2008). El actor está casado con Erica Schmidt, con la que es padre de una niña.\n\nEl papel que definitivamente lanzó la carrera de Dinklage fue en la galardonada The Station Agent (2003), donde hizo el papel del protagonista.5​ Por dicho papel recibió nominaciones como Mejor actor en los Independent Spirit Awards y Screen Actors Guild Awards. Ese mismo año, participó en Tiptoes, estrenada directamente en DVD, junto a Gary Oldman. Años antes, había destacado en su rol debut en Living in Oblivion (1995) donde hace el papel de Tito, un desganado actor de cine independiente que cuestiona el trabajo del director de la película. Además de su carrera en el cine, ha trabajado varias veces en producciones teatrales off-Broadway, donde su estatura es menor obstáculo que en Hollywood.\n\nEn Elf, Dinklage interpreta a un pretencioso escritor de cuentos infantiles que golpea al personaje de Will Ferrell después de ser insultado accidentalmente. En 2005, protagonizó la serie de ciencia ficción Threshold y trabajó en la comedia The Baxter como un extravagante organizador de bodas. En 2006, actuó en el drama judicial de Sidney Lumet, Find Me Guilty, junto a Vin Diesel. También hizo de sí mismo en un episodio de la serie de HBO Entourage y tuvo un papel en 30 Rock.\n\nDinklage tuvo un papel en la película británica de 2007, Death at a Funeral. Interpreta el mismo papel en la remake estadounidense del mismo nombre estrenada en 2010. También en 2007, interpretó al villano Simon Bar Sinister en Underdog.\n\nFue elegido por el director Andrew Adamson para el papel de Trumpkin en la película Las crónicas de Narnia: el príncipe Caspian (2008).​ El crítico de cine Bill Gibron describió el papel como un \"estereotipo cursi que Dinklage ha tratado de evitar\". La escritora de cómics, Gail Simone, ha citado a Dinklage como la elección perfecta para interpretar al malvado Doctor Psycho en una posible adaptación filmica de la Wonder Woman.\n\nEl 14 de febrero de 2013, el director de cine Bryan Singer anunció a través de su cuenta de Twitter la incorporación de Peter Dinklage a X-Men: Days of Future Past9​ papel de antagonista principal como Bolivar Trask.\n\nEn 2009, Dinklage fue confirmado para interpretar a Tyrion Lannister en la serie que preparaba la cadena HBO de la heptalogía más conocida de George R. R. Martin: Canción de hielo y fuego.12​ La serie de televisión fue estrenada en 2011 y su actuación recibió excelentes críticas.\n\nFinalmente, ese mismo año, Dinklage consiguió el Emmy como mejor actor de reparto y un año más tarde se haría con un Globo de Oro por el mismo papel.','https://image.tmdb.org/t/p/original/lRsRgnksAhBRXwAB68MFjmTtLrk.jpg'),
	(23119,'Peter Krause','1965-08-12','Peter William Krause (nacido el 12 de agosto de 1965) es un actor y productor de cine y televisión estadounidense. Quizás sea mejor conocido por sus papeles principales como Nate Fisher en Six Feet Under, Adam Braverman en Parenthood y Casey McCall en Sports Night.','https://image.tmdb.org/t/p/original/4p42emuJrU8fFxbBuOhYFFdzmN6.jpg'),
