	(24977,'Karra Elejalde','1960-10-10','Carlos Elejalde Garay, más conocido como Karra Elejalde (Vitoria, Álava, 10 de octubre de 1960) es un actor, director de cine y guionista español.\n\nHijo de un músico y de una ama de casa, hasta los 14 años vivió en Salinas de Léniz (Guipúzcoa). Empezó a estudiar para ser electricista y también cursó estudios de pintura y escultura en la escuela de artes y oficios de Vitoria.Elejalde tiene una trayectoria polifacética que pasa por la fundación de grupos de teatro o su trabajo como actor de cine hasta escribir letras de canciones para conjuntos de rock vasco como Hertzainak o Korroskada.\n\nSegún él mismo ha contado cuando fue a la mili conoció al actor Toño Sampedro que le propuso incorporarse a su grupo y poco después debutó en el espectáculo Adiós, hasta huevo, en el que interpretó a 11 personajes.\n\nCriado artísticamente en el contexto del teatro vasco independiente, enrolado en compañías como Grupo Samaniego, La Farándula, Klacatrak o Ttipi-Ttapa teatro y en distintos tipos de espectáculos teatrales, destacando la trilogía de monólogos Etc, Etc... (1988), La Kabra tira al monte (1997) y La Kabra y Miss Yoe\'s (2006).\n\nEn 1987 debutó en el mundo del cine con el largometraje A los cuatro vientos, si bien será su asociación con los dos grandes emblemas de la nueva generación de cineastas vascos, Juanma Bajo Ulloa y Julio Medem, lo que dispare definitivamente su carrera en el celuloide.\n\nFundamentalmente es actor, aunque ha sido guionista, y director de dos de sus películas: Torapia (2004) y Año mariano (1999). En esta última ha estado en muy estrecha colaboración con Fernando Guillén Cuervo, ya que compartía con él las mismas funciones de director, actor y guionista.\n\nElejalde ha rodado con algunos de los directores más destacados de España, como José Antonio Zorrilla, Julio Médem, Álex de la Iglesia, Juanma Bajo Ulloa e Iciar Bollain, quien le dirige en la película También la lluvia (2010), y le vale el Premio Goya como Mejor actor de reparto por su doble interpretación de Cristóbal Colón y el actor que lo interpreta, Antón, un hombre enfermo y alcohólico. En 2014 volvió a ganar el Goya en la misma categoría por la taquillera Ocho apellidos vascos, de Emilio Martínez-Lázaro.\n\nCarlos Elejalde cursó estudios dramáticos durante su periodo de Formación Profesional, e imparte cursos de interpretación en C. Molinuevo (Vitoria).','https://image.tmdb.org/t/p/original/kHODqgc2c7RaZz9Sp7cedgadvzG.jpg'),
