	(25026,'Cristina Marcos','1963-12-19','Cristina Marcos (Barcelona, 19 de diciembre de 1963) es una conocida actriz española nacida en Barcelona.\n\nNació en Barcelona, pero creció y se educó en Madrid. Con diecisiete años el realizador Manuel Gutiérrez Aragón se fijó en ella para protagonizar junto a Fernando Fernán Gómez la película Maravillas.\n\nFinalizados estos trabajos, Cristina compaginó sus estudios de Arte Dramático en la escuela de Cristina Rota con la carrera universitaria de Filología Hispánica, tras los cuales se presentó a varios cástines.','https://image.tmdb.org/t/p/original/9xE1wX3T9qsrscLpNnPuUFllHEB.jpg'),
