	(26723,'Katheryn Winnick','1977-12-17','Winnick nació en Etobicoke, Ontario. De ascendencia ucraniana, habla con fluidez varios idiomas: ucraniano, ruso, francés, italiano e inglés.\n\nComenzó a entrenarse en artes marciales a los 7 años y logró su primer cinturón negro a los 13. Es cinturón negro (tercer dan) en taekwondo, cinturón negro (segundo dan) en karate, y guardaespaldas con licencia. Gracias a sus escuelas de artes marciales, comenzó a entrenar actores y actrices, lo que le permitió ingresar en el ambiente.','https://image.tmdb.org/t/p/original/vQSqH3ybDWZHZIqX4NZKhOCXAhQ.jpg'),
