	(31167,'Elizabeth Mitchell','1970-03-27','Elizabeth Mitchell (nacida el 27 de marzo de 1970, en Los Ángeles, California) es una actriz estadounidense. Es conocida por su interpretación en el papel de la doctora Juliet Burke en la serie estadounidense de la ABC Lost. También interpretó en el remake de la serie V a Erica Evans, una agente del FBI. La serie fue cancelada durante la segunda temporada. Actualmente interpreta a Rachel Matheson en la nueva serie de J. J. Abrams, Revolution y a Ingrid (Reina de las Nieves) en la serie Once Upon a Time. Participa en la serie The Expanse como Anna.','https://image.tmdb.org/t/p/original/tpagVmiCbOQ8CPiRxF5MuZGfZGV.jpg'),
