	(31514,'Peter Jacobson','1965-03-24','Peter Jacobson es un actor estadounidense, conocido por su papel de Dr. Chris Taub en la serie House M. D.\n\nHa interpretado el papel del abogado Randy Dworkin en la serie Law &amp; Order. Apareció en el episodio Alguien Te Observa (01x18) de la serie Mentes Criminales como el Mánager de Lila. También ha aparecido en la quinta temporada de la serie Scrubs como el Señor Foster. Interpretó al marido de la protagonista principal de The Starter Wife, miniserie estadounidense, en 2007. También interpretó un pequeño fragmento junto a Lisa Edelstein en la película Mejor Imposible, en la que se encontraban los dos sentados en la cafetería y se les identificaba como judíos.\n\nMás recientemente ha aparecido en la serie de televisión House, como Chris Taub, cirujano plástico aspirante a formar parte del equipo de diagnóstico del doctor Gregory House. En octubre de 2007 se confirmó su presencia regular en la serie, y entró a formar parte del equipo permanente del Dr. House. También aparece en la película Transformers como el profesor de Sam Witwicky (Shia LaBeouf).','https://image.tmdb.org/t/p/original/pGi9CnzEG4cLa2viUP89yvlPCyR.jpg'),
