	(32798,'Elisabeth Moss','1982-07-24','Elisabeth Moss es una actriz norteamericana, conocida por su paticipación en varias galardonadas producciones dramáticas, las cuales le llevaron a ser llamada la \"Reina de la Peak TV\" por la revista Vulture. En sus años de adolecente, disfrutó de un papel recurrente como la hija del presidente de los Estados Unidos en el popular drama El Ala Oeste de la Casa Blanca, antes de protagonizar la aclamada serie de AMC Mad Men como Peggy Olson. Años después gano el Globo de Oro por su trabajo en la miniserie Top of the Lake, y luego ganó tanto el Emmy como el Globo de Oro por su papel principal en El Cuento de la Criada.','https://image.tmdb.org/t/p/original/fInsygsYrFzd8ZfoxbKCpzT8Xfa.jpg'),
	(32887,'Christopher Heyerdahl','1963-09-18','','https://image.tmdb.org/t/p/original/pTPZa3TFIkxRbqM5adXYE51a99s.jpg'),
	(33181,'Jimmy Smits','1955-07-09','Jimmy Smits (9 de julio de 1955) es un actor estadounidense. Nació en una familia católica de inmigrantes de Surinam y de Puerto Rico. Su padre era un tipógrafo de Surinam y su madre una enfermera puertorriqueña.\n\nEs ganador de un Globo de oro. Es principalmente conocido por su rol como el congresista demócrata Matt Santos en el drama político The West Wing. Además, ha trabajado en series de televisión como L. A. Law, interpretando a Víctor Sifuentes, NYPD Blue como el detective Boby Simón, Cane, Dexter y Sons of Anarchy como Nero Padilla. Entre sus papeles recientes más conocidos se encuentra el de interpretar al Senador Bail Organa en Star Wars (Episodios II, III y Rogue One) y a Nero Padilla en Sons of Anarchy. También destacó como Cyrus Garza en Outlaw. Apareció en el capítulo 7 de la 4ª temporada de la serie Brooklyn Nine-Nine interpretando al padre de una de las protagonistas. Además, interpretó al senador John Donovan en 24: Legacy.\n\nTambién, en la cuarta temporada de la serie How to Get Away with Murder (\"Como defender a un asesino \") interpretando al psiquiatra Isaac Roa.\n\nAdemás aparece en la Serie \"Bluff city law\" como Elijah Strait. Y sale en la película \"En un barrio de Nueva York\" como Kevin Rosario.','https://image.tmdb.org/t/p/original/yn4g0hjKPhHgZlW2TFzNmlP1zKf.jpg'),
	(33259,'Jennifer Love Hewitt','1979-02-21','Jennifer Love Hewitt (21 de febrero de 1979) es una actriz y cantante estadounidense. Empezó su carrera como actriz cuando era una niña, apareciendo en anuncios de televisión y en la serie de Disney Channel Kids Incorporated. Alcanzó gran popularidad en la cultura adolescente por trabajos en la serie de Fox Party of Five, como Sarah Reeves y en la película de terror I Know What You Did Last Summer y su secuela, I Still Know What You Did Last Summer, ambas como Julie James.\n\nComo cantante ha trabajado con las productoras Medlac Records, Atlantic Records y Jive Records.​ Es conocida principalmente por hacer canciones de estilo pop y por tener una voz soprano (voz femenina aguda). Hasta la fecha, su sencillo más exitoso es «How Do I Deal», que alcanzó en 1999 el puesto 59 en las listas de éxitos musicales de Estados Unidos, y la octava posición en Australia. Además, ha participado también en la promoción de proyectos de actores.\n\nSu apariencia física ha sido tema de atención de muchos medios de comunicación a lo largo de su carrera. Nombrada como la mujer más sexy del mundo en 1999​ y la mujer más sexy de la televisión en 2008,​ ha sido galardonada muchas veces por las publicaciones de revistas como Maxim, TV Guide, FHM y muchos lectores de esos periódicos. En 2007, se publicaron unas fotos paparazzi de ella en una playa, en las cuales estaba pasada de peso, posteriormente se quejó por las críticas que le hicieron, siendo apoyada por otras celebridades y dándole a la revista People cobertura informativa.\n\nAdemás, ha protagonizado muchas películas y varias series de televisión.​ Hasta mayo de 2010 trabajó en la serie de televisión de la CBS Ghost Whisperer como Melinda Gordon, una mujer que puede ver fantasmas y les ayuda a arreglar sus problemas pasados. También protagonizó la serie de televisión The Client List. y participó en la serie Mentes Criminales, como Kate Callahan, una agente especial, en el año 2015. Desde 2018 interpreta a Maddie Buckley en la serie 9-1-1.','https://image.tmdb.org/t/p/original/6Rg9fzsDRv2PpawkLAGKdDGNZ3H.jpg'),
