	(34257,'Anthony Stewart Head','1954-02-20','Anthony Steward Head (20 de febrero de 1954) es un actor y cantante británico que ha trabajado en teatro, televisión y películas.\n\nPrincipalmente, es conocido por sus papeles como Rupert Giles en la serie televisiva estadounidense Buffy la cazavampiros, como el primer ministro en el programa cómico británico Little Britain,y por varios comerciales de café en el Reino Unido y los Estados Unidos. También es conocido por su papel de Uther Pendragon en la serie Merlín.\n\nEn la televisión estadounidense, Head aparece en los créditos con su nombre completo, mientras que en otras producciones suele aparecer como Tony Head.','https://image.tmdb.org/t/p/original/3IKmIaEQFgHtTlUI548eirwIJPP.jpg'),
