	(34408,'Stana Katic','1978-04-26','Stana Katić (26 de abril de 1978)​ es una actriz canadiense de origen yugoslavo, conocida por interpretar a la detective Kate Beckett en la serie de televisión Castle (2009-2016) y a la ex agente del FBI Emily Byrne en la serie Absentia.\n\nEn 2015 fue ganadora del premio People\'s Choice Awards a mejor actriz dramática de televisión.','https://image.tmdb.org/t/p/original/4Kw0xJTzRc4VPfOVlaMr7OTfvN2.jpg'),
