	(34847,'Emma Roberts','1991-02-10','Emma Rose Roberts (10 de febrero de 1991)1​ es una actriz y cantante estadounidense.\n\nObtuvo el papel principal de Chanel Oberlin en la serie de comedia de terror FOX Scream Queens (2015–2016), y ha participado en cinco temporadas de la serie antológica de terror de FX American Horror Story: Coven protagonico, Freak Show protagonico, Cult participacion, Apocalypse protagonico, 1984 protagonico. Después de hacer su debut cinematográfico como Kristina Jung en la película de crimen Blow (2001), ganó reconocimiento con su papel en la serie de Nickelodeon Unfabulous (2004–07). En 2005, lanzó su primer álbum de estudio, Unfabulous and More. Posteriormente, apareció en numerosas películas, incluyendo Nancy Drew (2007), Wild Child (2008), Hotel for Dogs (2009), Valentine\'s Day (2010), It\'s Kind of a Funny Story (2010) y The Art of Getting By (2011).\n\nEn busca de roles más maduros, obtuvo papeles protagónicos en las películas: Lymelife (2009), 4.3.2.1. (2010), Scream 4 (2011), Adult World (2013), We\'re the Millers (2013), Palo Alto (2013), The Blackcoat\'s Daughter (2015) y Nerve (2016), Scream Queens (2015–2016), American Horror Story (2011-presente).','https://image.tmdb.org/t/p/original/87w6fTvmJTQScgKKJFS91hYJ33a.jpg'),
