	(36817,'Juanjo Artero','1965-06-27','Juanjo Artero, (27 de junio de 1965) es un actor español de cine, teatro y televisión.\n\nCon 14 años se dio a conocer interpretando a Javi en la mítica serie Verano azul. También ha participado en series como El comisario interpretando al subinspector Carlos \"Charlie\" Márquez o El barco siendo Ricardo Montero, el capitán del buque-escuela.','https://image.tmdb.org/t/p/original/XdUHzzZsegAmifWmUTo5SqQJ4B.jpg'),
	(37014,'Lauren German','1978-11-29','Lauren German (nacida el 29 de noviembre de 1978) es una actriz estadounidense, conocida por su papel de autoestopista en el remake de 2003 de The Texas Chainsaw Massacre, así como por protagonizar la película Hostel: Part II, en la que interpreta a uno de los personajes principales. También es conocida por su papel en A Walk to Remember, en el que interpreta a una popular y celosa ex-novia llamada Belinda.','https://image.tmdb.org/t/p/original/if1TbO8dSfPiDCMfy52nH7A2D7.jpg'),
