	(37625,'Andrew Garfield','1983-08-20','Andrew Russell Garfield (20 de agosto de 1983) es un actor y productor británico-estadounidense nominado al Premio Óscar. A pesar de nacer en Los Ángeles, se crio en Epsom, Surrey, donde comenzó a actuar en teatros y producciones televisivas. Su debut cinematográfico se produjo en 2007, con el drama dirigido por Robert Redford Leones por corderos. Un año después protagonizó Boy A y por su interpretación ganó un Premio BAFTA.\n\nSaltó a la fama internacional cuando encarnó a Eduardo Saverin en la película The social network, que le valió una nominación al Globo de Oro y BAFTA. Ese año también tuvo un papel secundario en Nunca me abandones, por el cual fue candidato nuevamente al BAFTA y al Premio saturn.\n\nPor lo que respecta al teatro, en 2012 actuó en la producción de Broadway Muerte de un viajante, donde encarnó a Biff y compartió reparto con Philip Seymour Hoffman. Por su interpretación fue candidato al Premio Tony. Su incursión en la producción ocurrió en 2014 con la película de suspense 99 Homes.','https://image.tmdb.org/t/p/original/beO5YvbTjrr5yy8hW26KVDMSr35.jpg'),
