	(38673,'Channing Tatum','1980-04-26','Channing Matthew Tatum (26 de abril de 1980) es un actor, bailarín, productor y modelo estadounidense.\n\nInició su carrera artística como modelo y posteriormente se dedicó a la interpretación. Ha participado en varias películas, entre las que destacan Step Up de 2006, G.I. Joe: The Rise of Cobra de 2009, Dear John de 2010, The Vow, 21 Jump Street y Magic Mike de 2012; 22 Jump Street de 2014 y Jupiter Ascending y Magic Mike XXL de 2015.','https://image.tmdb.org/t/p/original/e5p1xrGtPfpJBQR9Pt3B6W4buZP.jpg'),
