	(41091,'Kristen Wiig','1973-08-22','Kristen Carroll Wiig (22 de agosto de 1973) es una actriz de cine y televisión estadounidense, que formó parte de Saturday Night Live desde 2005 hasta 2012. Wiig fue miembro del grupo The Groundlings, y ha aparecido en varias películas y series de televisión, incluyendo Bridesmaids, MacGruber, Flight of the Conchords, Adventureland y Paul. Sus papeles como actriz de voz incluyen a \"Ruffnut\" en Cómo entrenar a tu dragón y \"Lola Bunny\" en la serie The Looney Tunes Show. Actuó junto a Maddie Ziegler en la presentación de la canción Chandelier de la cantante australiana Sia Furler en los Grammy Awards 2015, usando las dos una peluca haciendo referencia al peinado de la cantante.','https://image.tmdb.org/t/p/original/N517EQh7j4mNl3BStMmjMN6hId.jpg'),
