	(41297,'Alex O\'Loughlin','1976-08-24','Alexander O\'Lachlan, (24 de agosto de 1976), conocido artísticamente como Alexander O\'Loughlin es un actor australiano.\n\nEs un actor reconocido tras interpretar el papel del capitán de fragata Steve McGarrett en la nueva versión de la serie televisiva del canal CBS Hawaii Five-0. Tuvo papeles protagónicos en las películas Oyster Farmer (2004) y The Back-up Plan (2010), así como en series de televisión como Moonlight (2008) y Three Rivers (2009).','https://image.tmdb.org/t/p/original/l3Cd7jD3r3TLkqWaDijmK7GgWxo.jpg'),
	(41419,'Hugh Laurie','1959-06-11','Hugh Laurie, es un actor, humorista, escritor, músico y cantante inglés.\n\nEn televisión, es mundialmente conocido principalmente por su papel de Gregory House, protagonista de la serie de televisión House M. D. (2004-2012), Laurie ha conseguido gracias a éste el premio Globo de Oro al mejor actor dramático en dos años consecutivos (2006 y 2007).\n\nEn cine, es conocido por interpretar al personaje de Frederick Little, en las películas infantiles Stuart Little, Stuart Little 2 y Stuart Little 3, así como interpretar al villano Jasper en la aclamada película de Disney en 1996, 101 dálmatas: ¡Más vivos que nunca!.\n\nEn el mundo musical, forma parte de la banda benéfica Band From TV y en 2011 estrenó su primer trabajo musical Let Them Talk.','https://image.tmdb.org/t/p/original/akArncggHnusP5jxzMBKmJDRrMo.jpg'),
	(41422,'Jesse Spencer','1979-02-12','Jesse Spencer es un actor y músico australiano, conocido principalmente por su personificación del Dr. Robert Chase en la serie televisiva House M. D. y Matthew Casey en la serie televisa Chicago Fire. También es uno de los componentes de la banda benéfica Band From TV.\n\nComenzó su carrera en la actuación en la obra The King and I en el State Theatre en 1991. Al año siguiente participó en la obra Winnie the Pooh presentanda en el Alexander Theatre y en 1993 intervino en Scrooge en el Princess Theatre. Ese mismo año apareció en Time Trax (Warner Brothers) como un joven extraterrestre.\n\nEntre 1994-2000 fue contratado para trabajar en la serie televisiva Neighbours en el papel de Billy Kennedy. También trabajó en obras como Peter Pan y Jack &amp; the Beanstalk fuera de Australia, y participó en Hercules: The Animated Series de Disney.\n\nHa participado en los filmes Lorna Donne (2000), Winning London (2001) con las gemelas Olsen, Stranded (2002]), Swimming Upstream (2003), Uptown Girls (2003), donde interpretó canciones como Molly Smiles, Sheets of Egyptian Cotton y Night of Love, Death in Holy Orders (2003) y Flourish (2006), donde aparece con su compañera de trabajo en la serie House M.D. Jennifer Morrison. Además, participó en el piloto de Fear Itself (2005).\n\nSu papel más destacado en televisión fue en la serie House M.D., donde llevó a cabo el papel del doctor Robert Chase, desde 2004 hasta 2012.\n\nActualmente trabaja en el drama de la NBC, Chicago Fire en un rol protagónico donde lleva a cabo el papel del bombero y teniente Matthew Casey.','https://image.tmdb.org/t/p/original/pjnjfZLbwTtToQyhIVIKkhilyIf.jpg'),
