	(49623,'Jared Padalecki','1982-07-19','Jared Tristan Padalecki (19 de julio de 1982) es un actor estadounidense. Es mayormente reconocido por interpretar a Sam Winchester en la serie Supernatural. Padalecki comenzó a tener interés en la actuación a los 12 años y tras graduarse de la secundaria, se mudó a Los Ángeles, California, donde consiguió contratos y saltó a la fama en el año 2000 con su papel en la serie Gilmore Girls y apareciendo en películas como New York Minute (2004) y El vuelo del Fénix (2004).\n\nEn 2005, fue seleccionado para interpretar a Sam Winchester en la serie Supernatural, la cual se convirtió en un éxito en términos de audiencia y en críticas, hecho que llevó a The CW a extenderla por más de doce temporadas, con lo que se convirtió en el programa de fantasía más largo de la televisión estadounidense y en el más longevo del canal.​ Gracias a su trabajo en dicha serie, ha sido reconocido en los Teen Choice Awards y People\'s Choice Awards.5​ Desde 2010, está casado con la actriz Genevieve Cortese, con quien tiene tres hijos.','https://image.tmdb.org/t/p/original/q2YR6o6MKqO2szOhmmSSAnjs2aC.jpg'),
	(49624,'Jensen Ackles','1978-03-01','Jensen Ross Ackles (1 de marzo de 1978) es un actor y director estadounidense.  Criado en Richardson (Texas), comenzó a tomar clases de actuación durante la secundaria inspirado por su padre, y al cumplir los 18, se mudó a la ciudad de Los Ángeles para buscar contratos en distintos canales. En 1998, ganó reconocimiento en la televisión estadounidense al aparecer en Days of Our Lives, y su trabajo le valió tres nominaciones consecutivas a los Premios Daytime Emmy entre 1998 y el 2000.','https://image.tmdb.org/t/p/original/3DwbC5V1nLK36bpcUZUrYuNrPG1.jpg'),
