	(49961,'Michelle Trachtenberg','1985-10-11','Michelle Christine Trachtenberg (11 de octubre de 1985) es una actriz estadounidense conocida principalmente por sus papeles como Nona F. Mecklenberg en Las aventuras de Pete & Pete (1994–96), Dawn Summers en Buffy the Vampire Slayer (2000–03) y Georgina Sparks en Gossip Girl (2008–12). Ha aparecido en películas como Harriet the Spy (1996), Inspector Gadget (1999), Eurotrip (2004), Ice Princess (2005), Black Christmas (2006), 17 Again (2009), Cop Out (2010), y Killing Kennedy (2013).','https://image.tmdb.org/t/p/original/kFeNatWt3hlrM46Gl1atqD3i9Gk.jpg'),
