	(51329,'Bradley Cooper','1975-01-05','Bradley Charles Cooper (5 de enero de 1975) es un actor, actor de voz, director, productor, guionista, cantante y compositor estadounidense. Inspirado por su padre, comenzó a interesarse por la actuación a temprana edad, y continuó con sus estudios hasta el 2000, cuando obtuvo su Máster en Bellas Artes en The New School, en Nueva York. Posteriormente, desempeñó roles menores en numerosas películas y series de televisión, entre estas Alias y Wedding Crashers (2005).\n\nCooper saltó a la fama con su papel en The Hangover (2009), que se convirtió en un éxito crítico y comercial, extendiéndose por dos secuelas igualmente exitosas lanzadas en 2011 y 2013.​ Su racha de filmes aclamados y taquilleros continuó con Silver Linings Playbook (2012), American Hustle (2013) y American Sniper (2014), con los cuales recibió nominaciones a los premios Óscar por su actuación. Asimismo, prestó su voz para dar vida al personaje de Rocket Raccoon en el Universo cinematográfico de Marvel.​ Además del cine, Cooper interpretó a Joseph Merrick en la obra de teatro El hombre elefante. En 2018, protagonizó, dirigió, produjo y escribió la película A Star Is Born, que también fue un éxito crítico y comercial, y le valió tres nominaciones a los Óscar.​ Su banda sonora, la cual grabó en conjunto con Lady Gaga, alcanzó la primera posición de los álbumes más vendidos en 21 países, además de haber sido el cuarto disco más vendido del 2018 con 1.9 millones de copias.\n\nCooper ha sido uno de los actores mejores pagados del cine desde 2013, y ha sido reconocido por la revista Time como una de las celebridades más influyentes.​ En sumatoria, todas sus películas totalizan una recaudación de más de $11.3 mil millones a nivel mundial, siendo uno de los diez actores más recaudadores de toda la historia del cine.3 Asimismo, Cooper ha ganado un BAFTA, cuatro Critics\' Choice y dos Grammys, además de haber obtenido siete nominaciones al premios Óscar, cinco al Golden Globe y una al Tony. Por otra parte, Cooper ha sido un filántropo activo desde los inicios de su carrera y ha apoyado a fundaciones que combaten enfermedades como el cáncer y el alzheimer.​ Desde 2015 hasta 2019, mantuvo una relación con la modelo Irina Shayk, con quien tiene una hija.','https://image.tmdb.org/t/p/original/pLD2XvxqHueLWOuqXoFngJU3A5H.jpg'),
