	(51391,'Frankie Muniz','1985-12-05','Francisco \"Frankie\" Muniz IV (5 de diciembre de 1985)​ es un actor, músico, escritor, productor, piloto de automovilismo y mánager de banda estadounidense. Es más conocido por interpretar el personaje del título en la comedia de televisión familiar de FOX, Malcolm in the Middle, que le valió una nominación al Premio Emmy y dos nominaciones al Globo de Oro.\n\nEn 2003, fue considerado \"uno de los adolescentes más rentables de Hollywood\".​ En 2008, puso su carrera como actor en espera para seguir una carrera en las carreras de monoplaza. Él compitió en el Atlantic Championship. De 2012 a 2014, fue baterista en la banda Kingsfoil.','https://image.tmdb.org/t/p/original/tBckW8eJHv4vz8B3DJYH1rLAtyN.jpg'),
