	(51663,'Sean Gunn','1974-05-22','Sean Gunn (22 de mayo de 1974) es un actor y guionista estadounidense. Es más conocido por su papel de Kirk Gleason en la serie de televisión Gilmore Girls. También es conocido por interpretar el personaje de Kraglin en las películas del Universo Cinematográfico Marvel Guardianes de la Galaxia, Guardianes de la Galaxia Vol. 2 y en Avengers: Infinity War.\n\nEs el hermano del director y productor James Gunn, del actor y escritor Matt Gunn, del actor, productor y escritor Brian Gunn y primo del guionista y productor Mark Gunn.','https://image.tmdb.org/t/p/original/upccFtrr7BMkXCs0tOZ6oqkdMJn.jpg'),
	(51684,'Mehcad Brooks','1980-10-25','Mehcad Brooks (25 de octubre de 1980) es un actor y modelo estadounidense. Es conocido por su papel de Jimmy Olsen en la serie Supergirl.','https://image.tmdb.org/t/p/original/etlE8YdFgYk6Nbe3uRQcc5uF0t2.jpg'),
	(51797,'Nathan Fillion','1971-03-27','Nathan Fillion (27 de marzo de 1971) es un actor canadiense.\n\nEntre sus papeles más conocidos se encuentran el del escritor Richard Castle en la serie Castle y el del capitán Malcolm Reynolds en la serie Firefly y la película Serenity, pero también ha doblado a personajes de videojuegos como Halo 3: ODST , Halo 5: Guardians y al Carismático Exo Cayde-6 en Destiny y Destiny 2.\n\nTambién es reconocido por sus apariciones en las revistas People y Entertainment Weekly. Además, Fillion es el cofundador de la organización Kids Need to Read (Los niños necesitan leer), que se dedica a conseguir más libros para las bibliotecas con fondos insuficientes.','https://image.tmdb.org/t/p/original/aW6vCxkUZtwb6iH2Wf88Uq0XNVv.jpg'),
	(51798,'Katee Sackhoff','1980-04-08','Kathryn Ann Sackhoff (8 de abril de 1980), más conocida como Katee Sackhoff, es una actriz estadounidense.\n\nInterpretó a la capitán Kara \"Starbuck\" Thrace en la serie de ciencia ficción Battlestar Galactica (2004–2009) de la cadena Sci Fi. Fue nominada a cuatro Saturn Awards por su trabajo en la serie y ganó en la categoría de Mejor Actriz Secundaria en Televisión en 2005.','https://image.tmdb.org/t/p/original/p8jMvubKMUE8thuRMZK5T6w1KbP.jpg'),
