	(51992,'Odette Annable','1985-05-10','Odette Juliette Annable . Está casada con el también actor Dave Annable, conocido por su papel en Brothers &amp; Sisters.\n\nSu madre se llama Lydia y es cubana. Su padre se llama Víctor y es un colombiano de ascendencia italiana y francesa que nació en Bogotá. Por estos orígenes, Odette habla un fluido español: «Aprendí español en casa, ya que la mitad de mi familia no hablaba inglés. Es mi primer idioma.» Se graduó en Woodcrest Christian High School (Riverside, California) y tras ello, pensó en titularse en Financiación de empresas, pero en último momento decidió ser actriz.\n\nA pesar de que su primer papel en el cine fue a los cuatro años en Kindergarten Cop (1990), más tarde participó en series como October Road y South Beach. En 2007 protagonizó la película para televisión Reckless Behavior: Caught on Tape y un año más tarde protagonizó Cloverfield, dirigida por J. J. Abrams. Prestó su voz también a Amata en Fallout 3.\n\nGeneró polémica en Internet el póster promocional de La semilla del mal (2009), pues se creía que se estaba explotando el físico de la actriz, protagonista de la película. Ese mismo año participó en el video musical de If You\'re Wondering If I Want You To, de los estadounidenses Weezer.\n\nConsiderada la octogésima octava mujer más sexy del mundo según FHM en 2008, fue novia de Trevor Wright y prometida del también actor Nicolas Ivan Yu.','https://image.tmdb.org/t/p/original/38dKFKg1L8BLPxV0wBHxLV1uRdP.jpg'),
