	(53256,'Terry Crews','1968-07-30','Terrence Alan Crews (30 de julio de 1968), más conocido como Terry Crews, es un actor, comediante, actor de doblaje y exjugador de fútbol americano estadounidense, conocido por su participación en películas de acción y comedia como: White Chicks, Norbit, Dueños de la calle, Los indestructibles y Deadpool 2. Desde 2013 forma parte del reparto principal de Brooklyn Nine-Nine interpretando el papel del Teniente Terry Jeffords.','https://image.tmdb.org/t/p/original/mmmnIKDPeNuXcQDOl6nQDuh63nV.jpg'),
