	(53280,'Tyler Posey','1991-10-18','Tyler Garcia Posey (18 de octubre de 1991) es un actor y músico estadounidense.\n\nEs mayormente conocido por su rol como Scott McCall en la serie de televisión Teen Wolf. También toca el bajo en una banda poco reconocida llamada Lost in Kostko.​ Si bien su papel en Teen Wolf ha sido el más relevante, ha desarrollado otros papeles importantes como Raul Garcia en la serie Doc y Ty Ventura en Maid in Manhattan.\n\nHa ganado en los Saturn Awards en dos ocasiones y en los Teen Choice Awards en una ocasión, además de haber sido nominado otras dos veces.​ También ha sido ganador en los ALMA Awards.','https://image.tmdb.org/t/p/original/eXeus5vixCYfehHFUA0zgQfiqN6.jpg'),
