	(53650,'Anthony Mackie','1979-09-23','Anthony D. Mackie (23 de septiembre de 1978) es un actor estadounidense conocido por su papel como el sargento JT Sanborn en la película The Hurt Locker, ganadora en los Premio Oscar a la Mejor Película.\n\nEs conocido por interpretar a Sam Wilson / Falcon en las películas del Universo cinematográfico de Marvel Captain America: The Winter Soldier (2014), Avengers: Age of Ultron (2015), Ant-Man (2015), Capitán América: Civil War (2016), Avengers: Infinity War (2018), Avengers: Endgame (2019).\n\nHa aparecido en otras películas y series de televisión, así como en los escenarios de Broadway.','https://image.tmdb.org/t/p/original/skjDC80Kno8I25Ne2HtvfOL4q5T.jpg'),
