	(53862,'Kaley Cuoco','1985-11-30','Kaley Christine Cuoco (30 de noviembre de 1985, Camarillo, California, Estados Unidos), más conocida como Kaley Cuoco, es una actriz estadounidense conocida principalmente por el papel de Penny en la comedia The Big Bang Theory y por el de Billie Jenkins en la serie Charmed.','https://image.tmdb.org/t/p/original/c01Ma8Jrr2OJ6uoikPwDK34Y8eK.jpg'),
