	(54693,'Emma Stone','1988-11-06','Emily Jean «Emma» Stone (Scottsdale, Arizona, 6 de noviembre de 1988) es una actriz y cantante estadounidense. Ha recibido numerosos premios, entre ellos: un Óscar, un BAFTA, un SAG y un Globo de Oro, a mejor actriz, por su interpretación en la cinta La La Land. Adicionalmente ha ganado la Copa Volpi. Además es considerada como una de las mejores actrices de su generación.\n\nComenzó su carrera apareciendo en obras teatrales en el Valley Youth Theatre de Phoenix como Las aventuras de Alicia en el país de las maravillas y Joseph and the Amazing Technicolor Dreamcoat, y debutó en televisión en The New Partridge Family (2005), sin embargo, solo se produjo un episodio piloto.​ Su primer papel en cine se dio en la comedia de Greg Mottola Superbad (2007), junto a Michael Cera y Jonah Hill.​ Obtuvo reconocimiento por sus trabajos posteriores en producciones como easy A (2010) y The Help (2011) en las cuales fue protagonista y que determinaron excelentes críticas para la actriz.\n\nCon The Amazing Spider-Man en 2012, —junto a Andrew Garfield— la actriz alcanzó la fama mundial, al convertirse en su película más taquillera.​ Mientras que con la siguiente entrega del filme titulado The Amazing Spider-Man 2: Rise of Electro en 2014, recibió buenas críticas por parte de los especialistas. Luego con Birdman al lado de Michael Keaton, significó una de sus mejores interpretaciones en toda su carrera,​ y por la cual obtuvo su primera nominación a los Óscar, como actriz de reparto,​ Sin embargo es con La La Land junto a Ryan Gosling, con la cual alcanzó la aclamación mundial, ganando diversos premios y recibió elogios de los críticos.\n\nAdemás de su vocación como actriz, también ha incursionado en la escena musical, al protagonizar la obra teatral Cabaret como Sally Bowles.​ Incluso ha participado en las bandas sonoras de algunas películas en donde ha aparecido, como la de La La Land, donde interpretó seis temas.','https://image.tmdb.org/t/p/original/2hwXbPW2ffnXUe1Um0WXHG0cTwb.jpg'),
	(54697,'Dave Franco','1985-06-12','David John \"Dave\" Franco (12 de junio de 1985) es un actor estadounidense, más conocido por sus papeles en 21 Jump Street, Charlie St. Cloud, Now You See Me, Warm Bodies, Nerve y en la serie Scrubs.','https://image.tmdb.org/t/p/original/lgzjs56hk0ucf2rwQnSG5U3Q49i.jpg'),
