	(55089,'Evan Peters','1987-01-20','Evan Peters (20 de enero de 1987) es un actor estadounidense. Es más conocido por participar en la serie de FX, American Horror Story. Eventualmente, y entre sus roles más destacados, ha personificado a Peter Maximoff/Quicksilver en la película X-Men: días del futuro pasado, y su sucesora y en la serie de Disney+ WandaVision, a Alex en Adult World; y en series como Phil of the Future e Invasión a Seth Wosmer y Jesse Varon, respectivamente. En 2004 se hizo acreedor del premio a la mejor actuación revelación en el Phoenix Film Festival, por su papel protagonista de Adam Sheppard en Clipping Adam.','https://image.tmdb.org/t/p/original/h6APDrk1KbpXDT8R5OKShRJsnbz.jpg'),
