	(55638,'Kevin Hart','1979-07-06','Kevin Darnell Hart (6 de julio de 1979) es un actor y comediante estadounidense.\n\nNacido y criado en Filadelfia, comenzó su carrera ganando varios concursos de comedia amateur en clubes de Nueva Inglaterra, que culminó en su primer descanso real en 2001, cuando fue elegido por Judd Apatow para un papel recurrente en la serie de televisión Undeclared. La serie duró solo una temporada, pero pronto obtuvo otros papeles en películas como Paper Soldiers (2002), Scary Movie 3 (2003), Soul Plane (2004), In the Mix (2005) y Little Fockers (2010).\n\nSu reputación cómica continuó creciendo con el lanzamiento de su primer álbum de pie I\'m a Grown Little Man (2008), y actuaciones en las películas Think Like a Man (2012), Grudge Match (2013), Ride Along (2014) y su secuela Ride Along 2 (2016), About Last Night (2014), Get Hard (2015), Central Intelligence (2016), The Secret Life of Pets (2016), Captain Underpants: The First Epic Movie (2017), Jumanji: Welcome to the Jungle (2017) y Night School (2018).\n\nTambién lanzó cuatro álbumes de comedia más, Seriously Funny en 2010, Laugh at My Pain en 2011, Let Me Explain en 2013 y What Now? en 2016. En 2015, la revista Time nombró a Hart una de las 100 personas más influyentes del mundo en su lista anual. Actuó como él mismo en el papel principal de Real Husbands of Hollywood.','https://image.tmdb.org/t/p/original/7OwsFfoxNGIfWwSmdORyB7v8XNj.jpg'),
