	(55755,'Richard T. Jones','1972-01-16','Richard Timothy Jones (altura 1,88 m) nacido el 16 de enero de 1972) es un actor de cine y televisión estadounidense. Jones nació en Kobe, Japón y se crió en Carson, California. Él es el hijo de Lorene. analista informático, y Clarence Jones, jugador profesional de béisbol e instructor de bateo de los Indios de Cleveland. También tiene un hermano mayor llamado Clarence Jones Jr., que ahora trabaja como entrenador. Sus padres se divorciaron más tarde. Jones se graduó de Bishop Montgomery High Escuela en Torrance, California.','https://image.tmdb.org/t/p/original/hdko2C45Wr5G03Z8JwGjWMynP84.jpg'),
