	(56730,'Cole Sprouse','1992-08-04','Cole Mitchell Sprouse (4 de agosto de 1992) es un actor estadounidense, y hermano gemelo de Dylan Sprouse.​\n\nEs conocido por su papel como Cody Martin en la serie de Disney Channel, The Suite Life of Zack & Cody y su spin-off, The Suite Life on Deck. Interpreta a Jughead Jones en la serie de The CW, Riverdale y a Will Newman en la película, Five Feet Apart.','https://image.tmdb.org/t/p/original/aJxTvZjse8hAljcvljqTaH45eaB.jpg'),
	(56734,'Chloë Grace Moretz','1997-02-10','En ocasiones acreditada como Chloë Moretz, es una actriz de cine y modelo estadounidense. Sus primeras actuaciones las realizó a los 7 años en series y películas como The Amityville Horror (2005), (500) días con ella (2009), El diario de Greg, Mujeres desesperadas o Dirty Sexy Money. Con estas producciones fue nominada a varios Premios Young Artist.  Recibió reconocimiento mundial por su primer protagónico como Hit-Girl en la película Kick-Ass de 2010 al igual que en otras producciones como: Déjame entrar y Hugo (2011),5​ consagrando su carrera artística.\n\nChloë Moretz nació en Atlanta, Georgia, el 10 de febrero de 1997. Su madre, Teri, es enfermera, y su padre, McCoy Lee Moretz, es cirujano plástico.6​7​ Tiene cuatro hermanos mayores; Brandon, Trevor (siendo este su representante), Colin e Ethan.​ Su carrera en Hollywood comenzó cuando la familia se mudó a Los Ángeles en 2004.\n\nSu primer papel cinematográfico fue el de Molly en la película Heart of the Beholder. No fue hasta 2005 cuando actuó en el remake de The Amityville Horror donde logró un mayor reconocimiento internacional siendo nominada a los Premios Young Artist.​ Esta producción supuso un despegue de su carrera y recibió ofertas para actuar como artista invitada en varias series televisivas y películas de múltiples géneros como Big Momma\'s House 2 y The Poker House donde compartió cartel con Selma Blair y Jennifer Lawrence.\n\nEn 2010, Chloë aparece como Hit-Girl en la película Kick-Ass del director Matthew Vaughn y basada en el cómic homónimo de Mark Millar y John Romita, Jr., papel aclamado extensamente por la crítica. Para este papel, estuvo entrenando con el equipo de especialistas de Jackie Chan durante tres meses.​ Otra película destacada fue Let Me In de Matt Reeves, remake del film sueco Låt den rätte komma in donde interpretaba a Abby, una joven vampiresa.​ Su interpretación la llevó a ganar varios premios.​ A finales del 2010 Chloë interpretó a Ann Sliger en el thriller Texas Killing Fields, protagonizado por Sam Worthington y Jeffrey Dean Morgan, cuyo estreno tuvo lugar el 14 de octubre de 2011.​\n\nEn 2011 protagonizó la película Hick, basada en la novela de Andrea Portes y dirigida por Derick Martini.​  A finales de 2011 actuó bajo la dirección de Martin Scorsese en Hugo interpretando a Isabelle,​ papel por el cual ganó distintos premios, entre ellos el People\'s Choice Awards.','https://image.tmdb.org/t/p/original/6TCmNihIf3Gf2DTgmGXqYj8QAKZ.jpg'),
