	(57409,'Ana de la Reguera','1977-04-08','Anabell Gardoqui de la Reguera, conocida como Ana de la Reguera, es una actriz mexicana de cine, teatro y televisión. Ha participado en varias telenovelas y en el cine, incluidas algunas películas de Hollywood.\n\nHija de Augusto Gardoqui y de su esposa Nena de la Reguera, periodista y personalidad de televisión que fue Miss Veracruz.\n\nAna de la Reguera empezó sus estudios de cine y artes en el Instituto Veracruzano de Cultura y fue anfitriona de Pasarela en Televisa Veracruz. Más tarde estudió con Rosa María Bianchi, Patricia Reyes Spíndola, Hugo Argüelles, Odin Dupeyron y Rafael López Miarnau, entre otros más en el Centro de Educación Artística Eugenio Cobo (CEA) de Televisa.','https://image.tmdb.org/t/p/original/nEacV1wuUHV6eUyErGBhniJ85JY.jpg'),
