	(57755,'Woody Harrelson','1961-07-23','Tras su graduación se trasladó a Nueva York y comenzó a estudiar en el Biloxi Blues de Neil Simon. En 1985 fue elegido para el papel de Woody Boyd, el ingenuo y cordial camarero de la serie de televisión Cheers, con el que ganó un Emmy, entre otros premios. Su primera actuación en el cine fue en la película Gatos salvajes de 1986 junto a Goldie Hawn. Continuó trabajando con pequeños papeles en el cine hasta el enfrentamiento amoroso que protagonizó con Michael J. Fox en la película de 1991, Doc Hollywood.\n\nPosteriormente Harrelson trabajó en películas como Asalto al tren del dinero, La cortina de humo, White Men Can\'t Jump, Vaqueros de Nueva York, Indecent Proposal, Hi-Lo Country y Natural Born Killers de Oliver Stone de 1994, donde interpreta a un despiadado asesino.\n\nEn 1996 protagonizó la controvertida película The People vs. Larry Flynt, que narra la vida del empresario Larry Flynt, y por la cual fue nominado al Oscar al mejor actor. En 2001 volvió a la televisión durante siete episodios de la comedia Will & Grace de la NBC. Interpretó a una prostituta travesti en la película Anger Management, protagonizada por Adam Sandler y Jack Nicholson, y al agente del FBI Stan Lloyd en El gran golpe.\n\nEn 2006 intervino en A Prairie Home Companion, y en Una mirada en la oscuridad. El film dramático The Messenger fue estrenado en el Festival de Sundance en el año 2009, consiguiendo en el Festival de Berlín el Oso de plata al mejor guion. Tras una década recobró notoriedad con No Country for Old Men, filme de los hermanos Coen que ganó cuatro Premios Óscar principales en 2008. En 2009 participó en la película 2012 como Charlie Frost, un locutor de radio. En el mismo año protagonizó la película Zombieland como Tallahassee, un cazador de zombies. En el 2012, interpretó a Haymitch Abernathy, el mentor borracho de los protagonistas en la película Los juegos del hambre; interpretó al mismo personaje durante las siguientes tres películas de la saga.\n\nEn 2014 se estrenó la serie de televisión True Detective protagonizada por Harrelson como un detective de Luisiana detrás de un asesino en serie. En 2015 protagonizó el videoclip \"Song for Someone\" de la banda U2 junto a su hija Zoe.','https://image.tmdb.org/t/p/original/igxYDQBbTEdAqaJxaW6ffqswmUU.jpg'),
