	(59192,'Emmanuelle Chriqui','1975-12-10','Emmanuelle Sophie Anne Chriqui (10 de diciembre de 1975)​ es una actriz canadiense de origen marroquí sefardita, que ha actuado tanto en cine como en televisión.\n\nSu papel en la serie Entourage de la HBO como Sloan y Unscripted como ella misma, junto con dos apariciones en The O.C como Jodie han aumentado su visibilidad y su popularidad en el mundo del espectáculo. En mayo de 2006, la revista Maxim la situó en el puesto 37 en su lista anual Hot 100.','https://image.tmdb.org/t/p/original/tFnpUJLzbIoMj4F3fLAe3oqkexG.jpg'),
