	(59817,'Jaimie Alexander','1984-03-12','Jaimie Lauren Tarbush (12 de marzo de 1984) es una actriz estadounidense concida con el nombre artístico de Jaimie Alexander. Es conocida por su papel en la serie de televisión, Kyle XY, donde interpreta a Jessi XX y a la guerrera asgardiana Sif en las películas de Thor. Desde 2015 hasta 2020, protagonizó la serie de NBC, Blindspot.','https://image.tmdb.org/t/p/original/hO8ADSA0sKnO3VkPjwA7MZE7r5W.jpg'),
	(60073,'Brie Larson','1989-10-01','Actriz, directora y cantante estadounidense. Educada en casa antes de estudiar actuación en la American Conservatory Theater. Comenzó su carrera como actriz en televisión, apareciendo en la comedia Raising Dad de 2001, por la cual fue nominada para un Premio Joven Artista.\n\nCuando era adolescente, tuvo breves papeles en distintas películas. Su actuación en la película de comedia Hoot (2006) fue elogiada, y posteriormente interpretó papeles secundarios en las películas Greenberg (2010), Scott Pilgrim vs. the World (2010), 21 Jump Street (2012) y Don Jon (2013) . De 2009 a 2011, apareció como un adolescente rebelde en la serie de televisión Estados Unidos de Tara.\n\nSu papel decisivo llegó con Short Term 12 (2013), por el que recibió elogios de la crítica. El éxito adicional llegó en 2015 cuando protagonizó Room. Ganó varios premios por su interpretación de una madre con problemas de secuestro de la víctima en la película, incluyendo el Premio de la Academia, el Premio BAFTA, el Premio Critic\'s Choice, el Premio Globo de Oro, el Premio del Gremio de Actores de Pantalla y el Premio de la Pantalla Canadiense a la Mejor Actriz. En 2017, actuó como fotógrafa de guerra en la película de aventuras Kong: Skull Island, su lanzamiento más taquillero.\n\nEn 2019 se unio al Universo cinematografico de Marvel al interpretar a Carol Danvers en Capitana Marvel.','https://image.tmdb.org/t/p/original/80DH2zWgZiXHehH7TLe6HKDldyl.jpg'),
