	(62561,'Tessa Thompson','1983-10-03','Tessa Lynne Thompson (3 de octubre de 1983)1​ es una actriz estadounidense. Se hizo conocida por su rol en la película del 2009 Mississippi Damned. Obtuvo un mayor reconocimiento por sus papeles protagónicos como Nyla Adrose en la película dramática For Colored Girls (2010), la activista por los derechos civiles Diane Nash en la película de drama histórico Selma (2014), Bianca en la película de drama deportivo Creed (2015), Josie Radek en la película de terror de ciencia ficción Annihilation (2018) y la Agente M en Men in Black: International (2019).\n\nEs conocida por interpretar a Valkyrie en las películas del Universo cinematográfico de Marvel Thor: Ragnarok (2017) y Avengers: Endgame (2019).','https://image.tmdb.org/t/p/original/t7p0xFHeK4qP6UmPiNe8wJvrNiQ.jpg'),
