	(63522,'Sofía Vergara','1972-07-10','Sofía Margarita Vergara Vergara (10 de julio de 1972) es una actriz y modelo colombiana, ganadora de múltiples premios SAG, nominada al Globo de Oro, al Emmy, a los Premios Satellite y poseedora de un People\'s Choice Award, entre otros.\n\nLa revista ASKMen.com la considera una de las mujeres más sensuales del mundo. Gracias a su trabajo en la serie televisiva Modern Family, es considerada una de las mejores actrices cómicas de la televisión estadounidense. ​Es la actriz mejor pagada de la televisión estadounidense siéndolo durante varios años consecutivos sumando 43 millones de dólares por sus numerosas campañas con Pepsi y Covergirl. En el año 2014, la revista Forbes da a conocer la lista de las 100 mujeres más poderosas del mundo, ubicando a Sofía Vergara en el puesto 32.','https://image.tmdb.org/t/p/original/l79eVtn6bSOaiq7R0UGu60foMrK.jpg'),
