	(66743,'Matt Bomer','1977-10-11','Matthew Staton Bomer (11 de octubre de 1977), más conocido como Matt Bomer, es un actor de cine, teatro y televisión estadounidense. Entre sus papeles más destacados se encuentra la personificación del exconvicto Neal Caffrey en la serie White Collar de USA Network y cuyo estreno fue en 2009.\n\nSu primera intervención en la pantalla pequeña fue en la serie Guiding Light de 2001 y comenzó a tener popularidad tras interpretar a Bryce Larkin en la serie Chuck de NBC.​ Ha participado en varios papeles secundarios como en la película de suspense Flightplan de 2005, la película de ciencia ficción In Time de 2011 y la tragicomedia Magic Mike de 2012. En 2011 formó parte del elenco de la obra teatral 8, escrita por Dustin Lance Black, y que se presentó en Broadway y en el Wilshire Ebell Theater de Los Ángeles. En 8 encarnó a Jeff Zarrillo, uno de los demandantes del referéndum Proposición 8, que eliminaba el derecho de contraer matrimonio a las parejas del mismo sexo en el estado de California.','https://image.tmdb.org/t/p/original/jvYzsP08M9H76eHu0k1ALdmNnoM.jpg'),
