	(69718,'Jon Cryer','1965-04-16','Jonathan Niven \"Jon\" Cryer (6 de abril de 1965) es un actor, guionista y productor de cine estadounidense.\n\nEs hijo de la actriz y cantante Gretchen Cryer. Hizo su debut en la comedia romántica de 1984 No Small Affair, pero ganó mayor fama como \"Duckie\" en la película de 1986 de John Hughes Pretty in Pink. En 1998, terminó de escribir y producir la película independiente Went to Coney Island on a Mission from God ... Be Back by Five.  En 2003, fue elegido como Alan Harper en la exitosa serie de comedia Two and a Half Men de la CBS, junto a Charlie Sheen, por la cual ganó un Premio Primetime Emmy en 2009.\n\nRecibió tres nominaciones anteriores al Premio Emmy al Mejor actor de reparto en una serie de comedia por su trabajo en el espectáculo.','https://image.tmdb.org/t/p/original/z2LPFc4oLDaDOYipKTAzZ9rARQ5.jpg'),
