	(70456,'Emily Browning','1988-12-07','Emily Jane Browning (nacida el 7 de diciembre de 1988) es una actriz y cantante australiana.\n\nBrowning hizo su debut cinematográfico en la película australiana The Echo of Thunder (El eco del trueno); posteriormente, desempeñó papeles recurrentes en los programas de televisión australianos Blue Heelers y Something in the Air (Algo en el aire). Su papel decisivo fue en la película de terror Ghost Ship de 2002, que la presentó a un público más amplio. En 2005, Browning ganó el Premio Internacional al Mejor Actriz del Australian Film Institute por su interpretación de Violet Baudelaire en la película Lemony Snicket\'s A Series of Unfortunate Events (2004).\n\nBrowning también es conocida por sus papeles en la película de terror The Uninvited (2009), la película de acción Sucker Punch (2011) y el drama independiente Sleeping Beauty (2011). Fue nombrada la mejor intérprete del año por el Festival Internacional de Cine de Hamptons en 2011 por su papel en La Bella Durmiente. Sus otras películas incluyen The Host (2013), Pompeya (2014) y Legend (2015). Actualmente está protagonizada por Laura Moon en American Gods.\n\nDescripción anterior del artículo de Wikipedia Emily Browning, licenciada bajo CC-BY-SA, lista completa de colaboradores en Wikipedia.','https://image.tmdb.org/t/p/original/xRyqiVRZ004AxhI3fSYIAt7oMRz.jpg'),
