	(71189,'Cobie Smulders','1982-04-03','Jacoba Francisca Maria (3 de abril de 1982) conocida como Cobie Smulders,​ es una actriz y modelo canadiense, conocida por su papel de Robin Scherbatsky en la comedia de situación estadounidense Cómo conocí a vuestra madre.\n\nEs conocida por interpretar a Maria Hill en el Universo cinematográfico de Marvel en la películas The Avengers (2012), Captain America: The Winter Soldier (2014), Avengers: Age of Ultron (2015), Avengers: Infinity War (2018), Avengers: Endgame (2019), Spider-Man: Lejos de casa (2019).','https://image.tmdb.org/t/p/original/z0YEBbTfHaOF7j2o4eNG7j0FmSl.jpg'),
	(71198,'Christian Kane','1974-06-27','Christian Kane (27 de junio de 1974) es un actor y cantante/compositor estadounidense. Protagonizó la serie de TNT Leverage como Elliot Spencer. Es conocido por sus papeles en el programa Angel e Into the West, y las películas Just Married y Secondhand Lions.\n\nEs el cantante de la banda country Kane; su álbum, The House Rules, fue lanzado el 7 de diciembre de 2010. El primer sencillo del álbum, también titulado \"The House Rules\", debutó en el número 54 en Country Songs.','https://image.tmdb.org/t/p/original/bHQDqGBW2yCEsHlNMkmJpQA9lDr.jpg'),
