	(71580,'Benedict Cumberbatch','1976-07-19','Benedict Timothy Carlton Cumberbatch (19 de julio de 1976) es un actor inglés de cine, televisión y teatro. Sus papeles más aclamados incluyen: Stephen Hawking en el drama de la BBC \"Hawking\" (2004); William Pitt en la película histórica \"Amazing Grace\" (2006); Stephen Ezard en el thriller de miniserie \"The Last Enemy\" (2008); Paul Marshall en \"Expiación\" (2007); Bernard en \"Small Island\" (2009); Sherlock Holmes en la moderna serie de adaptación de la BBC \"Sherlock\" (2010) y Stephen Strange en Doctor Strange (2016).\n\nEs hijo de los actores Timothy Carlton (Timothy Carlton Congdon Cumberbatch) y Wanda Ventham.','https://image.tmdb.org/t/p/original/fBEucxECxGLKVHBznO0qHtCGiMO.jpg'),
