	(73457,'Chris Pratt','1979-06-21','Christopher Michael Pratt (21 de junio de 1979), conocido simplemente como Chris Pratt, es un actor, actor de voz y productor estadounidense. Aunque nació en Virginia, creció en la ciudad de Lake Stevens y desde temprana edad tuvo problemas con su sobrepeso. Tras terminar la secundaria en 1997, abandonó sus estudios para mudarse a Maui (Hawái), donde vivió sin un hogar hasta que fue descubierto por la actriz Rae Dawn Chong mientras trabajaba como mesero a los 19 años.\n\nGracias a su carisma, Pratt vio éxito en la televisión durante la década del 2000 con las series Everwood, The O. C. y Parks and Recreation. Sin embargo, logró gran reconocimiento a nivel mundial en 2014 protagonizando la película Guardianes de la Galaxia con el personaje de Peter Quill / Star-Lord y se convirtió en un personaje recurrente del Universo cinematográfico de Marvel al repetir su papel en Guardianes de la Galaxia Vol. 2 (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019), películas que fueron aclamadas por la crítica y son de las más recaudadoras de la historia. El actor también vio éxito protagonizando la película Jurassic World (2015) y su secuela Jurassic World: Fallen Kingdom (2018). Como actor de voz, ha prestado su voz para la película animada The Lego Movie (2014) y su secuela The Lego Movie 2: The Second Part (2019), así como Onward (2020).\n\nA lo largo de su carrera, el actor ha ganado un Premio Saturn, dos MTV Movie & TV Awards y dos Teen Choice Awards, además de haber obtenido su estrella en el Paseo de la fama de Hollywood por sus contribuciones e impacto en el cine. Por otra parte, Pratt tiene un hijo con la actriz Anna Faris, y desde 2019 está casado con la autora Katherine Schwarzenegger.','https://image.tmdb.org/t/p/original/gXKyT1YU5RWWPaE1je3ht58eUZr.jpg'),
