	(73968,'Henry Cavill','1983-05-05','Henry William Dalgliesh Cavill (5 de mayo de 1983) es un actor británico de cine y televisión. Inició su carrera profesional en la película Laguna en 2001. Al año siguiente participó en el filme The Count of Monte Cristo, basado en la novela de Alexandre Dumas y donde personificó a Albert de Morcerf.\n\nEn 2007 actuó en la película de fantasía Stardust. Es conocido por su interpretación de Charles Brandon, primer duque de Suffolk, en la serie de televisión The Tudors, que fue producida por Showtime y en la que colaboró desde 2007 hasta el 2010.2​\n\nEn 2013 interpretó a Clark Kent (Superman) en la película Man of Steel del director Zack Snyder, repitiendo este papel en la secuela de 2016 Batman v Superman: Dawn of Justice y posteriormente en la película Liga de la Justicia en 2017, ambas del mismo director. Las dos primeras se convirtieron en las películas de Superman más taquilleras de todos los tiempos.','https://image.tmdb.org/t/p/original/iWdKjMry5Pt7vmxU7bmOQsIUyHa.jpg'),
