	(74568,'Chris Hemsworth','1983-08-11','Chris Hemsworth nació en Melbourne, Australia, de Leonie (van Os), profesora de inglés, y Craig Hemsworth, un consejero de servicios sociales. Sus hermanos son los actores Liam Hemsworth y Luke Hemsworth. Es de ascendencia holandesa (de su abuelo materno inmigrante), irlandés, inglés, escocés y alemán. Su tío, por matrimonio, fue Rod Ansell, el hombre de monte que inspiró la película Cocodrilo Dundee (1986).\n\nChris vio mucho del país en su juventud, después de que su familia se mudara al Territorio del Norte antes de finalmente establecerse en Phillip Island, al sur de Melbourne. En 2004, audicionó sin éxito para el papel de Robbie Hunter en la telenovela australiana Home and Away (1988), pero fue recordado por el papel de Kim Hyde que jugó hasta 2007. En 2006, entró en la versión australiana de Dancing with the Stars (2004) y su popularidad en el jabón le permitieron aguantar hasta el show 7 (Dancing with the Stars: Episode # 5.7 (2006) cuando se convirtió en el quinto participante en ser eliminado.\n\nSu primera aparición en Hollywood fue en Star Trek (2009), pero fue su papel titular en Thor (2011) lo que lo impulsó a la prominencia en todo el mundo. Repitió el personaje en el éxito de taquilla de ciencia ficción Marvel Los vengadores (2012).\n\nEl representante estadounidense de Chris, la compañía de gestión ROAR, también dirige a la actriz Elsa Pataky, y fue a través de ellos que se conocieron, se casaron en 2010. La pareja tiene una hija y dos hijos gemelos.','https://image.tmdb.org/t/p/original/xkHHiJXraaMFXgRYspN6KVrFn17.jpg'),
