	(76110,'Stephen Amell','1981-05-08','Stephen Amell (nacido el 8 de mayo de 1981) es un actor canadiense que interpreta a Oliver Queen, protagonista de la serie Arrow y actor invitado invitado en varios episodios de The Flash y en el primer episodio de DC\'s Legends of Tomorrow. También fue un invitado especial en la serie web Vixen como la voz de Oliver. El primo de Stephen, Robbie Amell, interpreta a Ronnie Raymond, personaje recurrente en la primera temporada de The Flash. Stephen lleva a cabo un entrenamiento físico extremo que ha protagonizado numerosos artículos de internet, describiéndole como un actor que se entrena como un verdadero superhéroe.','https://image.tmdb.org/t/p/original/gN8cpnUaPIzWhVufahmzV0dwOgp.jpg'),
