	(76313,'Daniella Monet','1989-03-01','Daniella Caroline Monet Zuvic (1 de marzo de 1989) es una actriz estadounidense, más conocida por coprotagonizar la serie original de Nickelodeon Victorious en el papel de Trina Vega.​ En 2011 interpretó a Tootie en la película A Fairly Odd Movie: Grow Up, Timmy Turner! al lado de Drake Bell y como Bertha (en lugar de Jennette McCurdy) en Fred 2: Night of the Living Fred y Fred: The Show.','https://image.tmdb.org/t/p/original/5QW1c5SUch81C5KIpfJgclJ4ct5.jpg'),
