	(76793,'Irrfan Khan','1967-01-07','Saahabzaade Irfan Ali Khan, acreditado como Irrfan Khan o simplemente Irrfan, fue un actor de cine indio, conocido por su trabajo predominantemente en el cine hindi, así como por sus trabajos en películas británicas y Hollywood. En una carrera cinematográfica que abarca casi treinta años y que ha aparecido en más de cincuenta películas nacionales, Khan recibió numerosos premios, incluidos un Premio Nacional de Cine y Premios Filmfare en cuatro categorías. Críticos de cine, contemporáneos y otros expertos lo consideran uno de los mejores actores del cine indio por su interpretación versátil y natural. En 2011, recibió el Padma Shri, el cuarto honor civil más alto de la India por su contribución al campo de las artes.\n\nA nivel mundial, Khan trabajó en varios proyectos internacionales como The Warrior (2001), The Namesake (2006), The Darjeeling Limited (2007), la película ganadora del Oscar Slumdog Millionaire (2008), Nueva York, I Love You (2009), The Amazing Spider-Man (2012), Life of Pi (2012), Jurassic World (2015) e Inferno (2016).','https://image.tmdb.org/t/p/original/qkA9PpWJRw3rNjVkWfNZdwLvRZx.jpg'),
