	(78198,'Tyler Hoechlin','1987-09-11','Tyler Lee Hoechlin (11 de septiembre de 1987), es un actor y beisbolista estadounidense.\n\nEs mayormente conocido por su papel como Michael Sullivan Jr. en la película de 2002, Camino a la perdición y como Martin Brewer en la serie 7th Heaven, donde fue protagonista. También se le conoce más recientemente por interpretar a Derek Hale en la serie de MTV, Teen Wolf.​\n\nHa sido ganador en los Saturn Awards y los Premios Phoenix Film Critics Society.​ El sitio web Buddy TV lo nombró el tercer hombre más sexy del 2011. Eventualmente juega béisbol en el equipo de la Universidad de California, y ha dicho que en un futuro cercano planea jugar de manera profesional en ligas mayores.','https://image.tmdb.org/t/p/original/n2hXiC2MABZnZoQKtWLkP73LKWe.jpg'),
