	(78423,'Omar Sy','1978-01-20','Omar Sy (20 de enero de 1978) es un actor, humorista y comediante francés. Conocido por formar el dúo humorístico \"Omar et Fred\" con el también humorista Fred Testot, y por interpretar a Bakari \"Driss\" Basali, uno de los protagonistas de la película francesa Intocable junto al también actor François Cluzet. Esta película obtuvo 21,41 millones de espectadores, el primer puesto en la taquilla francesa en el año 2011, así como el logro de ser la tercera película más vista en la historia de la taquilla francesa.1​ El 24 de febrero de 2012 recibió el premio César al mejor actor por su actuación en Intouchables.','https://image.tmdb.org/t/p/original/o34IwFPlOvE00yJA2E4nvp5RQB7.jpg'),
