	(84497,'Aaron Paul','1979-08-27','Aaron Paul es un actor y productor estadounidense. Nació el 27 de agosto de 1979 en Emmett, Idaho. Cuenta con una carrera de más de 20 años entre cine y televisión. Su papel más conocido es el de Jesse Pinkman en la exitosa serie \'Breaking Bad\', con la que consiguió grandes hitos como el premio a mejor actor de reparto en los Emmys.\n\nSus primeras escenas en la televisión fueron en 1998 en series como \'Even the Losers\' o \'Locust Valley\', en las que se encargaría de papeles secundarios y de poco peso en la trama. En 1999 aparecería en una de las series más conocidas de esa década: \'Beverly Hills, 90210\', aunque no tuvo un rol protagonista. No sería la única ocasión en la que tuviera un papel en una serie icónica. Ese mismo año también salió en un episodio de \'Melrose Place\'. Durante 1999 coleccionó apariciones en diferentes capítulos de muchas series como \'Suddenly Susan\' o \'3rd Rock from the Sun\'.\n\nFue en el año 2000 cuando dio el salto a la gran pantalla con la película \'Whatever It Takes\', protagonizada por James Franco. En 2001 volvió a aparecer en varios episodios de diferentes series. Una de las series más conocidas en las que participó ese año fue en \'Expediente X\' (X-files), donde conoció a la también actriz Samaire Armstrong. Estuvieron saliendo desde principios de ese mismo año pero acabaron cortando la relación.\n\nEn los siguientes años estuvo mezclando apariciones en series y películas. Algunas series tan conocidas como, \'The Guardian\', \'Bones\', \'CSI: Miami\' o \'CSI: Crime Scene Investigation\'. En cuanto a las películas se le pudo ver en \'Misión Imposible 3\' o \'Daydreamer\'.\n\nEn 2008 llegaría su gran oportunidad con ?Breaking Bad?, siendo el papel de Jesse Pinkman el más conocido de la carrera de Aaron Paul. El actor encarnó este personaje desde su estreno en enero de 2008 hasta la finalización de la serie en 2013. Con este papel recibió toda clase de reconocimientos como Critics\' Choice Television Award a mejor actor de reparto en 2014, un Satellite Award por mejor actor de reparto en 2013 y el Emmy a mejor actor de reparto en los años 2010, 2012 y 2014.\n\nEn marzo de 2009 inició una relación que duró apenas un año con la actriz y cantante canadiense Jessica Lowndes. Ese mismo año conoció en el festival de Coachella a Lauren Parsekian, actriz y directora de cine estadounidense. Un año después, en el mismo festival, empezarían a salir. Acabaron comprometiéndose en enero de 2012 y se casaron en marzo de 2013. En febrero de 2018 nació su primera hija, llamada Story Annabelle.\n\nDespués de la finalización de \'Breaking Bad\', protagonizó la película \'Need For Speed\' en marzo de 2014. También ese año comenzó a poner voz al personaje Todd Chavez en la serie de Netflix: \'BoJack Horseman\'. Para la misma plataforma, Netflix, volvió a encarnar su papel en \'Breaking Bad\' de Jesse Pinkman para la película \'El Camino\'. La cinta era una continuación del final de la serie y se estrenó en octubre de 2019. En esta ocasión también fue productor de la cinta.','https://image.tmdb.org/t/p/original/nLM4gmGTLLDmdMDxJsflc0zf5QG.jpg'),
