	(85176,'Bridgit Mendler','1992-12-18','Bridgit Claire Mendler (18 de diciembre de 1992), más conocida como Bridgit Mendler, es una actriz, cantante y modelo estadounidense, conocida por interpretar a Teddy Duncan en la serie original de Disney Channel ¡Buena Suerte, Charlie!.\n\nProtagonizó la película Disney Channel, Lemonade Mouth, en la que su personaje Olivia interpreta numerosas canciones. Dos sencillos fueron lanzados de la banda sonora con la voz de Mendler, ambos en la lista Billboard Hot 100. En 2012, Mendler lanzó su álbum debut Hello My Name Is... del género pop. Debutó en el número 30 en el Billboard 200, y ha vendido más de 74.000 copias a partir de noviembre de 2012. El primer sencillo del álbum, «Ready or Not», se convirtió en un Top 40 éxito internacional, y alcanzó el puesto número 49 en el Billboard Hot 100. Su segundo sencillo fue «Hurricane». El video musical se estrenó el 12 de abril de 2013 y fue filmado en Londres.','https://image.tmdb.org/t/p/original/8ZsU2RQpzUZ8580tkctAgU7nuXI.jpg'),
