	(90496,'Masako Nozawa','1936-10-25','Masako Nozawa (野沢 雅子 Nozawa Masako?, Tokio, 25 de octubre de 1936), nombre de casada Masako Tsukada (塚田 雅子 Tsukada Masako?) es una veterana actriz y seiyū japonesa, conocida por ser la voz de Goku en la saga Dragon Ball.1​ El 1 de abril de 2006, renunció de 81 Produce para establecer Office Nozawa.','https://image.tmdb.org/t/p/original/jxbXdejmPoiKnNoQz7Dkb80qC26.jpg'),
