	(90633,'Gal Gadot','1985-04-30','Gal Gadot Varsano (30 de abril de 1985) es una actriz, productora y modelo Israelí. Nació en Rosh Ha\'ayin, Israel, en una familia judía Ashkenazi.  Sirvió en las Fuerzas de Defensa Israeli como Instructora de Combate durante dos años; comenzó a estudiar derecho y relaciones internacionales en la universidad IDC Herzliya mientras desarrollaba su carrera de modelo y actuación; ganó el título de Miss Israel en 2004 a 18 años de edad.\n\nSu carrera de modelo comenzó cerca del 2000 e hizo su debut cinematográfico en la cuarta película de la franquicia \"Fast and Furious\"; Fast & Furious - Rápidos y Furiosos 4 (2009), como Gisele Yashar, quien era una asociada del villano principal de la película. Fue en esa película donde su popularidad subió mucho.\n\nSu papel se expandió en las secuelas Fast & Furious 5 (2011) y Fast & Furious 6 (2013), en las que su personaje estaba vinculado románticamente con Han Seoul-Oh. En estas películas, Gal realizó sus propias acrobacias.  También apareció en las películas de 2010 Noche Loca (2010), y Noche y Día (2010).  A principios de diciembre de 2013, fue elegida como Wonder Woman en el DC Extended Universe.\n\nGal es una entusiasta de las motocicletas y posee un Ducati Monster-S2R negro 2006. Está casada con Yaron Varsano desde el 28 de septiembre de 2008. Tienen dos hijos.','https://image.tmdb.org/t/p/original/plLfB60M5cJrnog8KvAKhI4UJuk.jpg'),
