	(91606,'Tom Hiddleston','1981-02-09','Thomas William Hiddleston (9 de febrero de 1981) es un actor de cine, televisión y teatro británico. Fue galardonado con el premio Globo de oro por su interpretación en The Night Manager.\n\nEs conocido por haber interpretado a Loki en las adaptaciones cinematográficas de la Trilogía de Thor de Marvel Studios: Thor (2011), Thor: The Dark World (2013) y Thor: Ragnarok (2017), así como también en The Avengers (2012), Avengers: Infinity War (2018) y Avengers: Endgame (2019). El papel de Loki le aseguró la permanencia en el mundo del cine; recibió críticas favorables y en el 2011 fue nominado al premio BAFTA en la categoría \"Mejor Estrella Emergente\".\n\nLas películas más destacables de Hiddleston son: War Horse (2011), de Steven Spielberg; el drama inglés The Deep Blue Sea (2011); la comedia romántica de Woody Allen Midnight in Paris (2011), y en los telefilmes de la BBC Henry IV y Henry V (2012). Además, apareció en un papel principal en el largometraje Crimson Peak (2015) interpretando a Sir Thomas Sharpe. Por último, en el mundo del teatro, obtuvo el premio Evening Standard Theatre Awards al mejor actor de teatro en 2014 por su papel en la obra Coriolanus.','https://image.tmdb.org/t/p/original/mclHxMm8aPlCPKptP67257F5GPo.jpg'),
