	(93285,'Charlyne Yi','1986-01-04','Charlyne Yi es una actriz, cómica, escritora y música estadounidense conocida por su trabajo en la serie de televisión House M. D., en la que encarna a la doctora Chi Park, miembro del equipo de diagnóstico del doctor Gregory House.\n\nYi comenzó actuando en Fontana, California. Desde entonces, ha realizado espectáculos en el Teatro Steve Allen y el Upright Citizens Brigade Theatre de Los Angeles. En 2005 y 2006 actuó en el Festival de Comedia de Nueva York, y en 2007 en el U.S. Comedy Arts Festival de la HBO en Aspen, Colorado.\n\nEl debut cinematográfico de Yi fue el 1 de junio de 2007, en la película Knocked Up de Judd Apatow. En 2008, Yi formó parte del programa de humor Apatow for Destruction Live, incluido en el Festival Just For Laughs de Montreal.\n\nLa película de 2009 Paper Heart supuso un \"documental híbrido\" en el que Yi fue la productora ejecutiva, además de ser la co-guionista e interpretar una versión ficticia de sí misma junto a Michael Cera.','https://image.tmdb.org/t/p/original/x3Stwu5DaUkM7Nw5bKP491xZwdn.jpg'),
