	(101060,'Danielle Nicolet','1973-11-24','Danielle Nicolet (24 de noviembre de 1973) es una actriz estadounidense. Es conocida por interpretar a Jenna en Born Again Virgin y Cecile Horton en The Flash.','https://image.tmdb.org/t/p/original/jUcFFKOiwQzqos9X9cHmSbPbRn2.jpg'),
	(101065,'Michelle Lee','1978-08-02','Michelle Charlene Lee ha aparecido en muchas películas y series de televisión como Piratas del Caribe: En el fin del mundo (2007), Venom (2018) y Black Widow (2020), sólo por nombrar algunas. La capacidad de Michelle para mostrar su fuerza tanto a través de la actuación como de la fisicalidad ha sido reconocida con una nominación del SAG al Mejor Reparto de Conjunto y en la portada de la revista Inside Kung Fu. Michelle es cinturón negro en Wushu y licenciada en economía con especialización en programación informática por la UCLA.\n\nNacida en Los Ángeles, Michelle pasó algún tiempo en Silicon Valley pero actualmente reside de nuevo en Los Ángeles.','https://image.tmdb.org/t/p/original/r6QzFK8IBxO1Kp3zm3GJ3FUuwwR.jpg'),
	(101115,'Irán Eory','1937-10-21','Elvira Teresa Eory Sidi (اِلویرا تِرِه‌سا اِئوری سیدی en persa) (Teherán, Irán, 21 de octubre de 1938 - Ciudad de México, 10 de marzo de 2002), más conocida como Irán Eory (ایران اِئوری en persa), fue una actriz mexicana de origen iraní, conocida por sus papeles en telenovelas y películas.\n\nIrán Eory nació en Teherán, Irán (de donde adoptó su nombre artístico). Fue hija del diplomático austriaco Frederic Emil Eory y de Angela Sidi, oriunda de Turquía con ascendencia judía. Se trasladó muy joven a Marruecos, que por aquel entonces era un protectorado francés, y de ahí a España. A los 16 años, ganó un certamen de belleza en Mónaco. Por esa época inició su carrera en el cine español y en las siguientes tres décadas alternó sus actuaciones dentro del género en Argentina e Italia, además de México donde residió permanentemente hasta su muerte.\n\nSu primera película fue El diablo toca la flauta (1954), a la que le siguieron diversos filmes, aunque destacó más en producciones de comedia.\n\nDurante la década de 1960 intervino en numerosos títulos con destacados cineastas españoles. Organizó su actividad cinematográfica con continuas apariciones en la televisión española en diferentes serieso en espacios que hicieron historia de la televisión como El irreal Madrid, de Valerio Lazarov. Especialmente recordado fue su amago de strip-tease en la sátira de Chicho Ibáñez Serrador Historia de la frivolidad (1967).\n\nEn 1969 llegó a México acompañada de sus padres e invitada por la escritora Yolanda Vargas Dulché para filmar la película Rubí, con Aldo Monti y Carlos Bracho, donde interpretó a una mujer muy bella físicamente, pero sin sentimientos.\n\nEstuvo relacionada sentimentalmente durante muchos años con el actor chileno y mexicano Carlos Monden, a pesar de que no vivieron juntos ni tampoco se casaron. Juntos trabajaron en el teatro y en la televisión. La razón por la cual Irán jamás se casó con Monden, fue a causa de su madre, quien se lo prohibió, ya que nunca vio con buenos ojos a Carlos Monden, porque éste no era judío como ellas, ni tampoco millonario.\n\nIrán Eory murió el domingo 10 de marzo de 2002 a causa de una embolia y hemorragia cerebral.','https://image.tmdb.org/t/p/original/mp2uDZzPzW0KlzQyLgE2wcKzB9y.jpg'),
