	(106817,'Blanca Suárez','1988-10-21','Es una actriz española con estudios de interpretación en la escuela Tritón de Madrid. Empezó su carrera en la película \'Eskalofrío\' de Isidro Ortiz. Fue en la serie \'El internado\' donde se dio a conocer y a partir de ahí la hemos podido ver en \'El barco\' y \'Los nuestros\' entre otros. En el cine la hemos visto en \'La piel que habito\', \'Los amantes pasajeros\' o \'Perdiendo el Norte\'.\n\nEn su vida personal, salió con el actor Javier Pereira desde 2008 a 2010. En 2011 mantuvo una relación de tres años con Miguel Ángel Silvestre. En 2014 tuvo un romance con el cantante Dani Martín.','https://image.tmdb.org/t/p/original/c0V6SxTJAmhhIj7UVBNRUTPn1Iw.jpg'),
	(107290,'Ana Luisa Peluffo','1929-10-10','Ana Luisa de Jesús Quintana Paz Peluffo (Querétaro, 9 de octubre de 1929),​ conocida como Ana Luisa Peluffo, es una actriz mexicana de la llamada Época de Oro del cine mexicano, con una amplia trayectoria en el cine, televisión y teatro.​ Fue una de las primeras estrellas que en México se atrevió a desnudarse frente a las cámaras.','https://image.tmdb.org/t/p/original/70TzTJgZmwYAJCHWyLt3l69LpRs.jpg'),
