	(111512,'Jerry Trainor','1977-01-21','Gerald William \"Jerry\" Trainor1​(21 de enero de 1977) es un actor estadounidense de televisión y cine. A partir de 2007, comenzó a actuar como Spencer Shay en la serie iCarly y como Steve en Drake & Josh, ambas de Nickelodeon.','https://image.tmdb.org/t/p/original/7rZX87iBEYEQ3ZngaNVi3eyxNTT.jpg'),
	(111513,'Yvette Nicole Brown','1971-08-12','Yvette Nicole Brown (12 de agosto de 1971) es una actriz estadounidense. Se le conoce sobre todo por tener uno de los papeles principales en la serie Community, aunque ha aparecido en numerosas ocasiones en anuncios y otros programas de televisión como Malcolm in the middle y That\'s So Raven. Tuvo un papel recurrente como Helen Ophelia Dubois en la serie de Nickelodeon Drake & Josh y realizó una breve aparición en la película La isla como una enfermera. También ha actuado en anuncios para Hamburger Helper, Big Lots, Pine-Sol, Home Depot, Aquapod, Shout, Fiber One Yoplait Yogour, DiGiorno Pizza, Dairy Queen y en algunos spots de la empresa Time Warner, además de tener una aparición en el programa Game Shakers como conductora.','https://image.tmdb.org/t/p/original/tKCNqEQPynScG384Oj80vL6aDQQ.jpg'),
