	(115932,'César Saratxu','1958-12-28','César Saratxu (28 de diciembre de 1958) es un actor español de cine, televisión y teatro.Comenzó haciendo teatro en escenarios del País Vasco. Posteriormente se trasladó a Madrid a ampliar su formación, pero no fue admitido en la Real Escuela Superior de Arte Dramático. En 1986 se traslada a París, donde entra en la escuela de Jacques Lecoq. En esa ciudad conoció a la que sería su mujer, una actriz sueca con la que posteriormente se trasladó a vivir a Estocolmo, donde fue conocido por sus papeles dramáticos en obras de teatro. En 2002 protagonizó el cortometraje Möte med ondskan, de Reza Parsa, y en ocasiones participó en producciones españolas como el cortometraje Expreso nocturno (2003), de Imanol Ortiz.\n\nDesde septiembre de 2005 se le conoce por su papel de Bernardo Marín en la serie de Telecinco Camera Café, en la que trabajó hasta 2009. Anteriormente ya había interpretado a numerosos personajes en la serie Canalone, emitida en Canal+ (2001), o en Los güebones, unas pequeñas piezas para Internet (2004), todo ello dirigido por Luis Guridi. Más recientemente puso su voz al buitre Diógenes en la película El lince perdido (2008) y trabajó en la serie ¡Fibrilando! (2009), spin-off de Camera Café, también dirigido por Luis Guridi.','https://image.tmdb.org/t/p/original/g2yWVI7w4aoeZnvZfKYvT39rrhk.jpg'),
	(116072,'Jesús Castejón','1956-01-01','Jesús Castejón Rosado (n. Barcelona; 1956) es un actor, director escénico y cantante lírico (tenor y barítono) español.\n\nHijo de los actores Pepa Rosado y Rafael Castejón, nació en Barcelona. Cursó estudios de música, canto e interpretación en el Real Conservatorio Superior de Música de Madrid. Debutó en el Teatro Lírico Nacional con El caserío, de Jesús Guridi y bajo la dirección de Roberto Carpio. Permaneció durante ocho temporadas consecutivas como tenor cómico.\n\nEn 1979 estrenó junto a Plácido Domingo la ópera El poeta, de Federico Moreno Torroba, bajo la dirección musical de Luis Antonio García Navarro. Tiene en su repertorio más de noventa zarzuelas, operetas y ópera española. Su primer papel dramático fue en Comedia sin título, de Federico García Lorca, bajo la dirección de Lluís Pasqual.\n\nEn 1990 trabajó en la serie Hasta luego, cocodrilo, de Alfonso Ungría y rodada en 35 mm. Desde entonces apare con regularidad en la pequeña pantalla. Sus apariciones en la pantalla grande incluyen títulos como Hermana, pero ¿qué has hecho?, de Pedro Masó, La lengua de las mariposas, de José Luis Cuerda, Alatriste, de Agustín Díaz Yanes y Siete mesas de billar francés, de Gracia Querejeta.\n\nSu trabajo en teatro incluye obras clásicas y contemporáneas bajo la dirección de directores como Josep Maria Flotats, Gerardo Malla Lluis Pasqual y José Luis Gómez.','https://image.tmdb.org/t/p/original/po1TCQdKdrJDYGiC7GUjgDmUB8J.jpg'),
