	(119407,'Thalía','1971-08-26','Thalía nació en la ciudad de México el 26 de Agosto de 1972. Es la más pequeña de cuatro hermanas (Laura Zapata, Ernestina Sodi, Federica y Gabriela) y en casa la apodaban “Yuya”. La famosa artista mostró talento desde muy pronto, y con tan solo un año de edad, participó en la producción de un comercial de refrescos para la televisión.\n\nThalía sobresale en el mundo del espectáculo por ser una artista multidisciplinaria. A lo largo de su exitosa carrera profesional ha desarrollado varias y distintas facetas: se ha desenvuelto como cantante, actriz, presentadora de programas de radio y televisión, empresaria, diseñadora de moda, editora, compositora, productora y modelo. No solo tiene un gran mérito por ser una artista polifacética, si no por que ha triunfado en todas y cada una de estas facetas, no cualquiera lo logra.\n\nLa carrera de Thalía comienza al integrarse al grupo infantil Din din como vocalista. En 1981, participó junto con la agrupación en el festival de música Juguemos a Cantar, posteriormente, volvió a participar, pero como solista. Unos años más tarde, en 1984, se integra a la comedia musical Vaselina, en la que primero participó como corista y más adelante interpretó a Sandy, uno de los personajes principales. Tras dos años, se integra a la famosa agrupación musical Timbiriche, en la que reemplazó a Sasha Sokol.','https://image.tmdb.org/t/p/original/zV0A90HmQSL3Gn3gNs7fIyWUapr.jpg'),
