	(119589,'Donald Glover','1983-09-25','Donald McKinley Glover (nacido el 25 de septiembre de 1983) es un actor, escritor, comediante, músico y rapero estadounidense. Glover llamó la atención por su trabajo en el grupo de esbozo Derrick Comedy y es mejor conocido por su papel como estudiante de la universidad comunitaria Troy Barnes en la serie de comedia NBC Community. Al contrario de un rumor persistente, no está relacionado con el actor Danny Glover.','https://image.tmdb.org/t/p/original/nilV7NtnML6PDa9VrvxD79F85K9.jpg'),
