	(123846,'Debby Ryan','1993-05-13','Deborah Ann Ryan1​ (13 de mayo de 1993) es una actriz y cantante estadounidense. Comenzó a actuar en teatros profesionales a la edad de siete años; en 2007, apareció en la película de Barney & Friends titulada Barney: Let\'s Go to the Firehouse y luego fue descubierta en una búsqueda nacional por parte de Disney. También es conocida por aparecer en el largometraje de 2008 The Longshots como Edith.  De 2008 a 2011, actuó como Bailey Pickett en The Suite Life on Deck. En 2010, protagonizó la película 16 Wishes, que fue el programa de cable más visto en el día de su estreno en Disney Channel. 16 Wishes presentó a Ryan a nuevas audiencias; la película recibió una alta audiencia en el grupo demográfico de adultos (18–34).​ Poco después, Ryan protagonizó la película independente, What If..., que se estrenó el 20 de agosto de 2010.\n\nDesde 2011 hasta 2015, Ryan actuó como el personaje principal en la serie original de Disney Channel Jessie; también dirigió un episodio de la serie que se emitió el 15 de mayo de 2015.9​ Protagonizó la película para televisión de Disney Channel Radio Rebel, en la que interpretó a Tara Adams, una tímida estudiante de secundaria que adopta el personaje de Radio Rebel.\n\nEn 2013, formó la banda The Never Ending. A partir de julio de 2015, Ryan tocó con The Never Ending como un acto de apertura en el tour de Fifth Harmony Reflection Tour.','https://image.tmdb.org/t/p/original/yqpxtPknFel9TQdb0RUGgptjj9O.jpg'),
