	(128206,'Lea Michele','1986-08-29','Lea Michele Sarfati, (29 de agosto de 1986) conocida como Lea Michele, es una actriz, autora y cantante estadounidense de teatro, cine y televisión. Es conocida por su papel de Rachel Berry en la serie de televisión Glee (2009-15), que le valió dos nominaciones a los Premios Globo de Oro y una a los Premios Emmy.  También ha ganado un Premio Satellite, un Premio del Sindicato de Actores y tres People\'s Choice Awards consecutivos. Luego, interpretó a Hester Ulrich en la serie de televisión Scream Queens (2015-2016). En 2017, interpretó a Valentina Barella en la serie de televisión The Mayor. En 2019, protagonizó la película Same Time, Next Christmas, con el nombre de Olivia, en la ABC.','https://image.tmdb.org/t/p/original/2doXBNh6jGa00x0JOu3kecfzyP.jpg'),
