	(129104,'Melissa Benoist','1988-10-04','Melissa Marie Benoist (4 de octubre de 1988), conocida como Melissa Benoist, es una actriz y cantante estadounidense. Saltó a la fama en 2012 por su papel de Marley Rose en la serie de comedia musical Glee de FOX. Previamente a su popularidad, Melissa ha aparecido en varias series de televisión como Homeland, The Good Wife y Law & Order. Su debut en el cine fue en la película Tennessee.\n\nEn 2014, apareció en la película Whiplash, que ganó varios premios importantes y obtuvo críticas positivas de la prensa. En 2015, participó en la película Danny Collins, que fue estrenada el 20 de marzo de 2015, y la cual cuenta con las actuaciones de Jennifer Garner y Al Pacino. Ese mismo año, se unió al elenco de la serie de televisión Supergirl para interpretar el personaje principal de la serie, emitida por CBS (más tarde en The CW) y estrenada el 26 de octubre de 2015.','https://image.tmdb.org/t/p/original/ypC15woTlwz87q6Ri4FaEzzGqMV.jpg'),
