	(132157,'Ezra Miller','1992-09-30','Ezra Matthew Miller (30 de septiembre de 1992) es un actor, músico, cantante y activista estadounidense. Su debut cinematográfico ocurrió en 2008 con su papel de Robert en Afterschool, mientras que su primer rol importante fue en el drama We Need to Talk About Kevin de 2011.  Un año después, recibió varios galardones por su actuación de Patrick en la película The Perks of Being a Wallflower, adaptación cinematográfica de la novela homónima de Stephen Chbosky. En 2015 coprotagonizó el drama The Stanford Prison Experiment y la comedia Trainwreck. Asimismo, en el 2016 interpretó a Flash, en la película de superhéroes basada en los personajes de DC Comics Batman v Superman: Dawn of Justice, y a Credence Barebone en el largometraje de género fantástico Animales fantásticos y dónde encontrarlos. En el 2017, interpretó a Flash en la película Liga de la Justicia.  Además es baterista y cantante de la banda Sons of an Illustrious Father.','https://image.tmdb.org/t/p/original/hLtxNK8eeWZkFSeaAASFWm15Qv0.jpg'),
