	(134497,'Kerem Bürsin','1987-06-04','Kerem Bürsin es un actor y productor de cine turco. Hollywood-turco pareja producciones turcas en inglés, el idioma ha estado actuando. Bürsin Kanal D, publicado en \"Günesi Beklerken\" comparte el mismo nombre en la matriz denominada \"John Sayer\" y su rostro deformado es conocido por sus papeles en \"Sayer gemela solar\". La película dirigida por Çagan Irmak interpretó a un músico en Whisper, Emmert Tushi. Bürsin, Escocia (Edimburgo), Indonesia (Medan, Yakarta), Emiratos Árabes Unidos (Abu Dhabi, Dubai), Malasia (Kuala Lumpur), Estados Unidos (Texas, Boston, Los Ángeles) vivían en esos países. en 1999, a la edad de doce años, se trasladó a Estados Unidos con su familia. Asumiendo la educación universitaria de actuación se graduó de comunicación de marketing de Emerson College. El concurso de teatro entre escuelas secundarias en toda EE. Sharktopus del productor Roger Corman y apareció en la película Palace of the Damned.','https://image.tmdb.org/t/p/original/6abFV7TBSgaPX7E9tBbx5mrMx3C.jpg'),
