	(135651,'Michael B. Jordan','1987-02-09','Michael Bakari Jordan (9 de febrero de 1987), popularmente conocido como Michael B. Jordan, es un actor y productor estadounidense. Es afamado por interpretar al personaje de Erik Killmonger, el primo y enemigo de T\'Challa, en Black Panther (2018), y a Adonis Creed, hijo del boxeador ficticio Apollo Creed, en Creed (2015).\n\nDentro de sus primeros trabajos se encuentran las series de televisión The Wire y Friday Night Lights. En el cine, coprotagonizó películas como Chronicle (2012), Fruitvale Station (2013), Las novias de mis amigos (2014) y Fantastic Four (2015). También fue el abogado Bryan Stevenson en Just Mercy (2019).','https://image.tmdb.org/t/p/original/hz9AOUWZ2zzS0dpPJ1yQv2grA35.jpg'),
