	(167640,'Mayim Bialik','1975-12-12','Mayim Bialik creció en San Diego y obtuvo su primer trabajo como actriz (Pumpkinhead (1988)) cuando tenía solo 12 años. Siguieron varios papeles en televisión hasta que en 1990 fue elegida para Blossom (1990), el papel que la hizo famosa.\n\nPara 1993, mientras Blossom todavía se estaba emitiendo, ya había ganado un lugar diferido en Harvard y también fue aceptada por Yale, pero al final eligió asistir a UCLA. Obtuvo su licenciatura en 2000 y comenzó a leer un doctorado en neurociencias (estudio del trastorno obsesivo-compulsivo en adolescentes con síndrome de Prader-Willi) que finalmente completó en 2007.\n\nContinuó trabajando a lo largo de sus estudios y fue habitual en las pantallas de televisión de EE. UU., Se convirtió nuevamente en un Prime Time en 2010 cuando comenzó a aparecer como \"amiga de Sheldon y no es su novia\" en la exitosa serie The Big Bang Theory (2007)','https://image.tmdb.org/t/p/original/kPsafWVc5H565iTuwS85LtDvvsf.jpg'),
