	(172069,'Chadwick Boseman','1976-11-29','Chadwick Aaron Boseman (29 de noviembre de 1977) es un actor, guionista y dramaturgo estadounidense. Es mejor conocido por interpretar a Jackie Robinson en 42 (2013) y James Brown en Get on Up (2014). También tuvo papeles en la serie de televisión Lincoln Heights (2008) y en Persons Unkonwn (2010), y las películas The Express (2008) y Draft Day (2014).\n\nEs reconocido por interpretar a T\'Challa / Pantera Negra en el Universo cinematográfico de Marvel en las películas Capitán América: Civil War (2016), Black Panther (2018), Avengers: Infinity War (2018) y Avengers: Endgame (2019).','https://image.tmdb.org/t/p/original/mXxiOTrTMJBRSVRfgaSDhOfvfxU.jpg'),
