	(184460,'Tomoko Kaneda','1973-05-29','Tomoko Kaneda (金田 朋子, Kaneda Tomoko, nacida el 29 de mayo de 1973) es una actriz de doblaje y personalidad de radio japonesa nacida en Yokohama, Japón. Estuvo trabajando para la agencia Aoni Production durante 11 años, tras lo cual, tras un breve período como autónoma, pasó a pertenecer a la agencia Across Entertainment en agosto de 2011. Debido a su voz aguda, suele interpretar papeles de niño pequeño. El 21 de noviembre de 2013 anunció su matrimonio con el actor Wataru Mori.','https://image.tmdb.org/t/p/original/10962V3SirhdpUhJRjvCEOlnyBb.jpg'),
