	(191228,'Victoria Justice','1993-02-19','Victoria Dawn Justice (19 de febrero de 1993) es una actriz y cantante estadounidense.  Salto a la fama gracias al canal Nickelodeon en la década de 2000, donde interpreto a Lola Martínez en Zoey 101 (2005–08) y más tarde a Tori Vega en Victorious (2010–13). También ha aparecido en las películas The Boy Who Cried Werewolf (2010), Fun Size (2012), The First Time (2012) y Naomi and Ely\'s No Kiss List (2015). En 2015, fue protagonista en la serie de MTV Eye Candy.  En la música, Justice ha grabado varias canciones para las bandas sonoras de sus proyectos de actuación, incluyendo Victorious y la película para televisión de Nickelodeon Spectacular!.','https://image.tmdb.org/t/p/original/5L2gbireGntC3SgoL7cyBN8Hp5L.jpg'),
