	(192944,'Tom Ellis','1979-11-17','Thomas John Ellis (17 de noviembre de 1978) es un actor galés, conocido por su papel de Dr. Oliver Cousins en la telenovela de BBC One EastEnders y como Gary Preston en Miranda. Es conocido por el público en los Estados Unidos por dos programas de televisión estadounidenses en la que interpreta a los protagonistas Rush (como William Tell Rush) y Lucifer (como Lucifer Morningstar). También fue Sam en la comedia de BBC Three Pulling.','https://image.tmdb.org/t/p/original/sJkxqJfSgcwussMeywxyrnYxVX.jpg'),
