	(195930,'Jerome Flynn','1963-03-16','Jerome Patrick Flynn (16 de marzo de 1963) es un actor y cantante inglés. Más conocido por sus papeles en las series Soldier Soldier y Ripper Street, alcanzó mucha popularidad interpretando a Bronn en la serie de la HBO Game of Thrones.​ También interpretó a \"Hector\" en el capítulo llamado \"Shut Up and Dance (Black Mirror) de la serie original de Netflix Black Mirror.\n\nViniendo de una familia de actores (su padre Eric Flynn fue un actor y cantante, mientras que su hermano mayor Daniel Flynn también es actor), Flynn hizo su debut en pantalla en la serie American Playhouse en 1985. Poco a poco, consiguió más papeles como invitado antes de interpretar a Freddie en la serie, The Fear (1988). En 2010, fue confirmado para el papel de Bronn en la serie de la HBO, Game of Thrones, basada en la serie de libros Canción de hielo y fuego escrita por George R.R. Martin.','https://image.tmdb.org/t/p/original/yI5xxWITp2YjMgiwac72Nen60jq.jpg'),
