	(201665,'Eve Best','1971-07-31','Emily «Eve» Best (31 de julio de 1971) es una directora de teatro y actriz inglesa de teatro, cine y televisión.\n\nTras estudiar Inglés en el Lincoln College, ingresó al Royal Academy of Dramatic Art donde se graduó en 1999.2​ Ha recibido diversos reconocimientos en el ámbito teatral, entre ellos el Premio Laurence Olivier 2006 en la categoría mejor actriz por su rol en la obra Hedda Gabler montada en el Almeida Theatre y luego en el Duke of York\'s Theatre​ así como una nominación al mismo galardón y la misma categoría un año después por A Moon For The Misbegotten estrenada en el Teatro Old Vic.4 Adicionalmente, ha recibido dos nominaciones al Premio Tony a la mejor actriz principal en una obra de teatro en 2007 por su trabajo en Hedda Gabler y en 2008 por su rol en The Homecoming.\n\nEn televisión, es conocida por el papel de la doctora Eleanor O\'Hara en Nurse Jackie​ por el que fue nominada junto al resto del elenco al Premio del Sindicato de Actores al mejor reparto de televisión en una comedia en 2013.','https://image.tmdb.org/t/p/original/wCHFBoaVIQsGSyEerFacCSYhdMl.jpg'),
