	(204392,'Cristin Milioti','1985-08-16','Cristin Milioti (16 de agosto de 1985) es una actriz y cantante estadounidense.\n\nHa trabajado principalmente en obras teatrales de Broadway. En 2010 protagonizó la obra teatral That Face​ y recibió una nominación al premio Lucille Lortel como mejor actriz principal por su trabajo en Stunning. En 2012, Cristin recibió una nominación a los Premios Tony por su papel como actriz principal en el musical Once.2​ Su última actuación como \'Girl\' en Once fue el 24 de marzo de 2013.\n\nEl 14 de mayo de 2013 Carter Bays y Craig Thomas, cocreadores de How I Met Your Mother, confirmaron que interpretaría el papel de la madre en la serie (identidad oculta durante 8 temporadas, y cuyo descubrimiento ha sido siempre el motivo principal de dicha serie).','https://image.tmdb.org/t/p/original/54vq2oKWfVR7YZZeoY5j47hTZxW.jpg'),
