	(212154,'Deborah Ann Woll','1985-02-07','Deborah Ann Woll (Brooklyn, Nueva York, 7 de febrero de 1985) es una actriz estadounidense conocida por las series True Blood (2008) y Marvel\'s Daredevil (2015).\n\nWoll, apareció en diversas series como en El Mentalista, Life, Me llamo Earl y CSI: Crime Scene Investigation, pero su oportunidad llegó cuando se presentó al casting de la serie True Blood para realizar el papel de Jessica Hamby, siendo seleccionada. Para adaptarse más al personaje, se tiñó el pelo de rojo.\n\nGracias a su participación en True Blood, comenzó a obtener una mayor fama y llegó a ganar un Satellite Awards. Apareció en películas como Mother\'s Day, interpretando a Lidia Koffin; en Catch. 44, Highland Park y Ruby Sparks.\n\nEn 2014, se confirmó que Deborah interpretaría a Karen Page en la serie original de Netflix: Marvel\'s Daredevil; después de su estreno y debido a su gran éxito, Netflix consiguió más de 62 millones de clientes.\n\nDespués de True Blood, Deborah apareció en varios programas como Good Day L.A., Hell\'s Kitchen y Big Morning Buzz Live. También obtuvo popularidad en internet por su pequeño blog True Blood:Jessica\'s Blog, donde interpreta a Jessica Hamby siguiendo la historia de la pequeña vampiresa. Ha aparecido en revistas como Bello y Nylon Magazine.','https://image.tmdb.org/t/p/original/yKhny4ZkLmAGlrp37mWzzkvGApb.jpg'),
