	(227454,'Alicia Vikander','1988-10-03','Alicia Amanda Vikander (3 de octubre de 1988) es una actriz sueca, conocida mundialmente por su participación secundaria en la adaptación de 2012 de Anna Karenina, como Alice Deane en la película El séptimo hijo, como Heather Lee en la película Jason Bourne, como Ava en la película Ex Machina, recientemente como Lara Croft en la nueva película Tomb Raider, y obteniendo notoriedad internacional al ser la ganadora del Óscar como mejor actriz de reparto en la película La chica danesa.\n\nGanó el Rising Star Award en 2012 en el Festival Internacional de Cine de Estocolmo y el Premio Guldbagge a la mejor actriz otorgado por el Instituto Sueco del Cine por la película de 2010 Pure.','https://image.tmdb.org/t/p/original/9pmHTbXeRxUF51jJKthmHI49u9z.jpg'),
