	(232499,'Harry Shum Jr.','1982-04-28','Harry Shum, Jr. (28 de abril de 1982) es un actor, cantante, bailarín y coreógrafo. Es mayormente reconocido por su papel como Mike Chang en la serie de televisión Glee y como Magnus Bane en Shadowhunters. Shum nació en Costa Rica, hijo de padres chinos, y a los 6 años se mudó a los Estados Unidos. Comenzó su carrera a mediados de 2003, cuando empezó a aparecer en varias series de televisión y películas interpretando a bailarines y coreógrafos. Posteriormente, se familiarizó con el mundo de la actuación e ingresó en 2009 al elenco de Glee, donde grabó más de 70 episodios y permaneció hasta su culminación en 2015. El mismo año, fue contratado para formar parte del elenco principal de Shadowhunters interpretando el rol de Magnus Bane.','https://image.tmdb.org/t/p/original/vtKeIKJHQAnGsjbFuXrBQI3RxeQ.jpg'),
