	(239574,'Eugenio Derbez','1961-09-02','Eugenio Derbez nace el 2 de septiembre de 1961. Hijo de una de las grandes actrices del cine, teatro y televisión en México, Sylvia Derbez y de Eugenio González Salas, publicista de gran renombre.Estudió la carrera de Dirección de Cine en el Instituto Mexicano de Cinematografía y cursó la carrera de Actuación en el Centro de Educación Artística de Televisa. Cuenta con estudios de danza, música, canto y domina perfectamente el idioma inglés. Es Actor, Escritor, Productor y Director.Debido a su increíble habilidad para transformarse en cualquier personaje y por su amplia trayectoria en Cine, Teatro y Televisión, Eugenio es, sin duda, uno de los actores más reconocidos de México y gran parte de Latinoamérica, así como de la comunidad hispana en Estados Unidos y Canadá.Gran parte de su popularidad se debe a sus programas de televisión: Al Derecho y Al Derbez, Derbez en Cuando, XHDRBZ y La Familia P.LUCHE, mismos que han alcanzado records de audiencia.Su carrera en teatro ha sido igualmente exitosa, obras como: Ninnette y un Señor de Murcia, Sálvese quien pueda, Opción Múltiple, Un Gallego en París y Una Eva y Dos Patanes, le han hecho ganar el reconocimiento como Mejor Actor en Comedia Teatral, otorgado por la Asociación de Periodistas Teatrales (APT) y por la Asociación de Críticos y Periodistas de Teatro (ACPT).Aunque la mayoría de su trabajo se ha realizado en México, Eugenio ha llamado la atención en los Estados Unidos por su trabajo en la temporada de TeatroLatinologues hablada totalmente en inglés, misma que presento en Broadway, dirigida por Cheech Martin, en el Helen Hayes de Nueva York.Dreamworks, Disney y Warner Bros. han optado por él para realizar el doblaje en español de las películas; Mulán 1 y 2, Dr. Dolittle 1 y 2, 102 Dálmatas, Si Señor y Shrek 1, 2 y 3. Además, hizo la adaptación para México y toda Latinoamérica de la trilogía de Shrek, consolidando así su popularidad en el público latino de todo el mundo. Jeffrey Katzemberg, productor ejecutivo de estas cintas, reconoció que el trabajo de doblaje hecho por Eugenio ha sido el mejor a nivel mundial.En cine ha actuado en las películas: Fotógrafo de Modelos, Soy Hombre y Que, Zurdo, Pledge This, Sangre de mi Sangre, Under The Same Moon, Beverly Hills Chihuahua, No eres Tu, soy Yo, Te Presto a la Luna.','https://image.tmdb.org/t/p/original/947gI1TgtqYRoxcZ2M0RsglBRH9.jpg'),
