	(257713,'Alexis Valdés','1963-08-16','Alexis Valdés Gutiérrez (La Habana, 16 de agosto de 1963) es un actor, cineasta, humorista, guionista, monologuista, productor, poeta, compositor e intérprete cubano. Hijo del actor humorístico cubano Leonel Valdés (m. 2010) y una profesora, tras licenciarse en ingeniería y llevar diez años actuando en Cuba, se instala en España en la década de los 90 donde se hace conocido gracias a sus intervenciones en programas como El club de la comedia. En 2005, actúa, dirige y produce su primera película, Un rey en La Habana. Actualmente reside en Miami (Estados Unidos) donde produce y presenta Late Nights de gran éxito como \"Esta Noche Tu Night\" Y \" Seguro que Yes\" y también escribe y produce obras de teatro de gran éxito. En 2020 escribe el poema \'Esperanza\" de gran impacto en toda el habla hispana.','https://image.tmdb.org/t/p/original/tMacwMxeL7ff2XIvvmKaXyHk7w3.jpg'),
