	(505710,'Zendaya','1996-09-01','Zendaya Maree Stoermer Coleman (1 de septiembre de 1996)3​, más conocida como Zendaya, es una actriz y cantante estadounidense. Comenzó su carrera apareciendo como una modelo infantil y bailarina, antes de ganar reconocimiento por su papel como Rocky Blue en la serie de Disney Channel Shake It Up (2010–13).  En 2013, Zendaya participó en la decimosexta temporada del concurso Dancing with the Stars. De 2015 a 2018, produjo y encarnó el rol de KC Cooper en la sitcom de Disney Channel K.C. Undercover. Hizo su gran avance cinematográfico en 2017 y 2019, interpretando a Michelle «MJ» Jones en las películas Spider-Man: Homecoming y Spider-Man: Lejos de casa del Universo Cinematográfico de Marvel. También interpretó a Anne Wheeler en la película de drama musical El gran showman.\n\nZendaya comenzó su carrera en la música grabando canciones de forma independiente y lanzando los sencillos «Swag It Out» y «Watch Me» en 2011, esta última en colaboración con Bella Thorne. Firmó con Hollywood Records en 2012 y más tarde lanzó su primer sencillo, «Replay\", que alcanzó el número 40 en la lista de los Billboard Hot 100 en Estados Unidos. El álbum homónimo de su debut (2013) debutó en el número 51 de la lista Billboard 200.','https://image.tmdb.org/t/p/original/lxQBmrdX8NVin9gI5O0xbmODhbH.jpg'),
	(506085,'Sami Gayle','1996-01-22','','https://image.tmdb.org/t/p/original/f5IwezVGhiKSSaZT6SHYBhRDnn0.jpg'),
