	(527393,'Dylan O\'Brien','1991-08-26','Dylan O\'Brien (26 de agosto de 1991) es un actor estadounidense. Es mayormente conocido por sus roles como Stiles Stilinski en la serie de televisión Teen Wolf y como Thomas en la saga de películas de The Maze Runner (2014-2018). Además de ello, ha protagonizado The First Time (2012) y coprotagonizado High Road (2012) y The Internship (2013).\n\nCreció hasta los doce años en Nueva Jersey, hasta que su familia decidió mudarse a California. Allí, se graduó en la Mira Costa High School e intentó estudiar comentarista de deportes en la Universidad de Siracusa, pero abandonó la carrera para mudarse a Los Ángeles y dedicarse a su carrera actoral. Posteriormente, comenzó a hacer vídeos en YouTube y fue descubierto por uno de los productores de Teen Wolf, quien le ofreció el rol protagónico de Scott McCall, pero Dylan finalmente desarrolló el de Stiles Stilinski.\n\nEn 2014, protagonizó la película The Maze Runner con el papel de Thomas, que gracias a su éxito en taquilla, dio lugar a una secuela llamada Maze Runner: The Scorch Trials, también exitosa. Por otra parte, el actor es un filántropo activo de los derechos LGBT. Entre sus reconocimientos, ganó un premio especial en el Festival de Cine de Giffoni de 2014, además de contar con tres galardones en los MTV Movie Awards y siete en los Teen Choice Awards.4​5​6​7​8​9​ Desde 2011, el actor ha mantenido una relación amorosa con la actriz estadounidense Britt Robertson.','https://image.tmdb.org/t/p/original/gmU3f4aR6Bd8zkk6AiLm0dvWPaE.jpg'),
	(543204,'Susan Sullivan','1942-11-18','','https://image.tmdb.org/t/p/original/97sJLr59cD2bylm3geOUucdx0k5.jpg'),
	(543261,'Karen Gillan','1987-11-28','Karen Gillan (28 de noviembre de 1987) es una actriz, directora y guionista escocesa. Interpretó el papel de Amy Pond, compañera del Undécimo Doctor, en la serie de ciencia ficción de la BBC One Doctor Who (2010-2013).\n\nEn el cine, interpretó a Nebula en el Universo Cinematografico de Marvel en las películas Guardianes de la Galaxia (2014) y Guardianes de la Galaxia Vol. 2 (2017), Vengadores: Infinity War (2018) y Vengadores: Endgame (2019), y también obtuvo el papel de Ruby Roundhouse en el éxito de taquilla Jumanji: Welcome to the Jungle (2017).\n\nEn 2018, lanzó su primer largometraje como escritora y directora, titulado The Party\'s Just Beginning.','https://image.tmdb.org/t/p/original/kFLXcFdok3ShDxylr3WNreQphQm.jpg'),
