	(543530,'Dave Bautista','1969-01-18','David Michael «Dave» Bautista Jr.​ (18 de enero de 19691​) es un actor, ex-luchador profesional y expeleador de artes marciales mixtas estadounidense.\n\nComenzó su carrera como luchador profesional en 1999 y firmó con la World Wrestling Federation (WWF, ahora WWE) en 2000. De 2002 a 2010, ganó fama con el nombre de Batista y se convirtió en un seis veces campeón mundial al ganar el Campeonato Mundial Peso Pesado cuatro veces y el Campeonato de la WWE dos veces. Tiene el récord del reinado más largo como Campeón Mundial de Peso Pesado en 282 días y también ha ganado el Campeonato Mundial en Parejas tres veces (dos veces con Ric Flair y una vez con John Cena) y el Campeonato en Parejas de la WWE una vez (con Rey Mysterio). Fue el ganador del Royal Rumble 2005 y fue parte del evento estelar de WrestleMania 21, uno de los cinco eventos de pago por ver con mayor recaudación en la historia de la lucha libre profesional. Bautista volvió a la WWE en 2014, ganando el Royal Rumble 2014 y fue parte del evento estelar de WrestleMania XXX, y volvió a la WWE de nuevo en 2019.\n\nComenzó a actuar en 2006 y protagonizó El hombre de los puños de hierro (2012), Riddick (2013), la película de James Bond Spectre (2015) y Blade Runner 2049 (2017). También ha aparecido en varias películas directamente para vídeo desde 2009.\n\nEs conocido por interpretar a Drax en las películas del Universo cinematográfico de Marvel Guardianes de la Galaxia (2014), Guardianes de la Galaxia Vol. 2 (2017), Avengers: Infinity War (2018) y Avengers: Endgame (2019).\n\nEn agosto de 2012, Bautista firmó un contrato con Classic Entertainment & Sports para luchar en las artes marciales mixtas (MMA). Ganó su única pelea de MMA el 6 de octubre de 2012, derrotando a Vince Lucero por knockout técnico en la primera ronda.','https://image.tmdb.org/t/p/original/ymn6iQBJbQZN6BYI60YJDXVP4gF.jpg'),
