	(550843,'Elizabeth Olsen','1989-02-16','Elizabeth Chase Olsen (16 de febrero de 1989), hermana de Mary-Kate y Ashley Olsen. Apareció en las películas de sus hermanas mayores How the West Was Fun en 1994 y The Adventures of Mary-Kate & Ashley: The Case of the Mystery Cruise en 1995. Se graduó de la NYU Tisch School of the Arts y la Atlantic Theatre Company Acting Escuela en la ciudad de Nueva York.\n\nEl gran salto de su carrera se produjo en 2011 cuando protagonizó el drama de suspenso independiente Martha Marcy May Marlene, por el cual fue nominada para el Premio de la Asociación de Críticos de Cine Broadcast a la Mejor Actriz y el Premio Independent Spirit a la Mejor Actriz Femenina, entre otros premios. Posteriormente, protagonizó las películas Silent House (2011), Liberal Arts (2012), Oldboy (2013), Godzilla (2014), I Saw the Light (2015), Ingrid Goes West (2017) y Wind River (2017). Desde 2014, ha retratado a la superheroína Wanda Maximoff / Scarlet Witch en el Universo Cinematográfico de MARVEL.','https://image.tmdb.org/t/p/original/mbMsmQE5CyMVTIGMGCw2XpcPCOc.jpg'),
