	(560247,'Miren Ibarguren','1980-05-23','Miren Ibarguren Agudo (23 de mayo de 1980) es una actriz española que se hizo nacionalmente conocida por su interpretación de Sonia Valcárcel en la serie Escenas de matrimonio que emitió la cadena Telecinco. Aún así, está no fue su primera vez en la televisión ya que anteriormente interpretó el papel de Idoia en la serie vasca Goenkale en eitb1. Encarnaba el papel de una limpiadora interna que trabajaba en casa de María Luisa. Desde 2008 y hasta 2014 trabajó en la serie de humor también en telecinco Aída, dando vida al papel de Soraya García. Actualmente da vida a Yolanda en la serie La que se avecina.','https://image.tmdb.org/t/p/original/ndusbJn7YggtKhz37dIla81c72p.jpg'),
