	(681098,'Camila Bordonaba','1984-09-04','Camila Bordonaba Roldán es una actriz, cantante, bailarina y directora de teatro argentina. Saltó a la fama con la serie de televisión Chiquititas y más tarde llegó al estrellato con Rebelde Way, que le dio reconocimiento al formar parte de la banda Erreway con sus compañeros de elenco Luisana Lopilato, Felipe Colombo y Benjamín Rojas. Desde el año 2010 se encuentra alejada de la fama, En 2011, Camila se volcó totalmente en su proyecto Arcoyrá, subiéndose a una caravana para recorrer el país con su espacio de arte. Este estilo de vida, que incluía dormir en el campo y cocinar en un fogón, también ha dirigido la obra de teatro El castillo en el cielo.','https://image.tmdb.org/t/p/original/AaGXbVGDv3v8VynPo9CCxdvBIoY.jpg'),
