	(950564,'Danna García','1978-04-02','Danna María García Osuna (Medellín, Colombia, 4 de febrero de 1978)1​ más conocida como Danna García, es una actriz colombiana, ampliamente conocida por sus papeles en Pasión de gavilanes, Un gancho al corazón, Bella Calamidades y Que bonito amor.\n\nDanna García es hija de la cantante colombiana Claudia Osuna. Inició su carrera grabando comerciales de televisión y a los siete ya conducía Notituticuanti y protagonizaba los seriados Imagínate, Tantas Cosas y Seres queridos. Luego vinieron más de 25 apariciones en televisión y en telenovelas como Al final del arco íris, Azúcar, Zarabanda, La casa de las dos palmas, La otra raya del tigre y Victoria.\n\nDesde que interpretó a Marcela Vallejo en la telenovela Café con aroma de mujer, Danna se proyectó internacionalmente.','https://image.tmdb.org/t/p/original/io7ylNGU0Zm63RRIEaVcRDk3ynY.jpg'),
