	(968006,'Katherine McNamara','1995-11-22','Katherine Grace McNamara (22 de noviembre de 1995) es una actriz estadounidense.\n\nEs mayormente reconocida por interpretar a Clary Fray en la serie de televisión Shadowhunters, por protagonizar la serie Happyland, aparecer en la serie Arrow y en The Fosters y Girl vs. Monster.​\n\nDurante su niñez, creció en Lee\'s Summit y destacó considerablemente en sus estudios, graduándose de secundaria con solo 14 años. Posteriormente, cursó la carrera de administración y dirección de empresas en la Universidad Drexel, Filadelfia, y se graduó con honores a los 17. Actualmente se encuentra realizando una maestría en economía aplicada en la Universidad Johns Hopkins, Baltimore.','https://image.tmdb.org/t/p/original/cuGVMcnpi6HjobaGADo1xtaDglR.jpg'),
