	(971933,'Eduardo Velasco','1968-07-28','Eduardo Velasco Querino (Santa Coloma de Gramanet, Barcelona, 28 de julio de 1968) es un actor español.\n\nA la edad de 12 años se traslada a vivir con su familia a la localidad de Los Corrales en la provincia de Sevilla. Aún en su juventud se instala, de nuevo con su familia, en la ciudad de Málaga. Años después se trasladó a la capital hispalense donde se licenció en arte dramático por el Instituto de Teatro de Madrid. Su gran oportunidad artística se la proporciona José Carlos Plaza con la obra de teatro Solas, junto a Lola Herrera.\n\nInstalado ya en Madrid funda la compañía teatral Avanti Teatro.\n\nEn la pequeña pantalla, participa episódicamente en series como Los hombres de Paco, Los Serrano, Mis adorables vecinos, Acusados o Guante blanco, aunque su mayor popularidad televisiva en España le llega con el personaje fijo de Pedro Camacho, el profesor de gimnasia en la serie El internado. Posteriormente interpreta papeles principales en series como Bandolera o La reina del sur, pero aunque ha trabajado tanto en cine como en televisión y teatro, este último es el medio al que más se ha dedicado.','https://image.tmdb.org/t/p/original/mt0euzusbZucgmPFrifSJS9DpdK.jpg'),
