	(973385,'Ross Lynch','1995-12-29','Ross Shor Lynch (29 de diciembre de 1995) es un actor, cantante, músico, compositor y bailarín estadounidense. Lynch es uno de los miembros fundadores de la banda de pop rock R5 y The Driver Era. Es más conocido por su papel de Austin Moon en la exitosa serie juvenil de Disney Channel, Austin & Ally.2​ En 2013, protagonizó la película de Disney Channel Teen Beach Movie interpretando a Brady, y su secuela.\n\nEn 2017, Lynch participó en la película My Friend Dahmer, en donde protagonizó al joven Jeffrey Dahmer. Desde 2018, interpreta a Harvey Kinkle en serie de Netflix Chilling Adventures of Sabrina, basada en el comic book del mismo nombre.','https://image.tmdb.org/t/p/original/tpcszNyTefPVH19DMOgpxJ2VHO3.jpg'),
