	(990393,'Erin Moriarty','1994-06-24','Erin Moriarty (24 de junio de 1994) es una actriz estadounidense. Es mejor conocida por su papel de Kelly en The Kings of Summer (2013) y Chelsea McAllister en The Watch (2012).\n\nEn febrero de 2015, se unió al elenco principal de la serie Jessica Jones de Netflix, en donde interpreta a Hope Shlottman y tuvo su estreno el 20 de noviembre de 2015.​ En mayo del mismo año, fue estrenada la película Blood Father, en la cual interpretó a Lidya Link y la co-protagonizó junto al actor y también director de cine Mel Gibson.','https://image.tmdb.org/t/p/original/zY3ZMEXAmhU7hQO0B4Y3444rTHm.jpg'),
