	(1010157,'Diane Guerrero','1986-07-21','Diane Guerrero (21 de julio de 1986)​ es una actriz estadounidense. Es conocida por su papel de Maritza Ramos en la serie de Netflix Orange Is the New Black y Lina en Jane the Virgin. Entre sus otros papeles tuvo un rol recurrente en Are We There Yet?  Creció en Boston y permaneció allí después de que el resto de su familia fue deportada a Colombia. Ella es defensora de una reforma migratoria. Su papel en Orange is the New Black le permitió ganar dos veces el Premio del Sindicato de Actores al mejor reparto de televisión en comedia.','https://image.tmdb.org/t/p/original/5LXvRYdxKLWROAD2KDSXzRNNSdE.jpg'),
