	(1059040,'Lou Ferrigno Jr.','1984-11-10','Louis Jude \"Lou\" Ferrigno Jr. (10 de noviembre de 1984) es un actor estadounidense. Es mejor conocido por su papel en el reinicio de la serie de televisión CBS de S.W.A.T., Nicky, Ricky, Dicky & Dawn, Teen Wolf, How I Met Your Mother y 9-1-1.','https://image.tmdb.org/t/p/original/2rVCjxARRgogt4JH4uxO37CldUo.jpg'),
	(1059597,'Zoey Deutch','1994-11-10','Zoey Deutch se dió a conocer por su papel de Maya en la serie de Disney Channel Zack y Cody: Todos a bordo y actualmente, acaba de terminar el rodaje de Why Him?, film que protagoniza junto James Franco y Bryan Craston, dirigida por John Hamburg (I Love You Man).\n\nJunto a Kevin Spacey y Nicholas Hoult, Zoey formará parte del elenco de Rebel In The Rye, film dirigido por Nicholas Hoult. Basado en una historia real, la película sigue la vida del famoso escritor J.D. Salinger, centrándose en las circunstancias que rodean la creación de su obra más conocida: El guardián entre el centeno. Deutch interpretará a Oona O\'Neill, hija del legendario dramaturgo Eugene O\'Neill, que tuvo un romance con Salinger.\n\nEl pasado abril se estrenó a nivel mundial en el Festival de Cine de Tribeca la película Vincent N Roxxy. Este film en el que Zoey comparte cartel con Emile Hirsch, Zoe Kravitz y Emory Cohen.\n\nDentro del cine independiente, Deutch ha participado en varias producciones. Protagoniza la película de Ry Russo-Young Before I Fall y The Year of Spectacular Men, que supone el debut de su madre, Lea Thompson, a la dirección y ha sido escrito por su hermana. Zoey también protagoniza la comedia Good Kids junto a Julia Garner, Nicholas Braun, and Dayo Okeniyi. Escrita y dirigida por Chris McCoy, la película cuenta la historia de cuatro estudiantes de instituto que tratan de definir su futuro tras graduarse.','https://image.tmdb.org/t/p/original/csmSAm3vpJj9lB5vb5fTbRqOw9C.jpg'),
