	(1062005,'Manel Barceló','1953-01-19','En 1978 se inició en el teatro profesional y fundó, junto con Pep Bou , la compañía de teatro infantil Pan de rally. En 1979 se incorporó a Els Joglars para el espectáculo La Odisea. En 1983 estrenó La tigresa y otras historias , de Dario Fo y Franca Rame , monólogo que, representado a lo largo de casi veinte años, supuso su consolidación como intérprete solista, que Shylock , de Gareth Armstrong (2000), por el que recibió el el año 2001 el Premio Ciudad de Barcelona de artes escénicas, terminó de consagrar. Ha participado en otros montajes, como Fiestaristófanes , con dirección de Stavros Doufexis(1985), Caricias , de Sergi Belbel (1992), La guardia blanca , de Mijaíl Bulgákov (1993), o El perro del teniente , de Josep Maria Benet (1998). Es también autor de espectáculos tales como Cuatro y repicó (1981) o Cabaret para la guerra de Bosnia (1995), ambos premiados con el Aplauso Sebastià Gasch .  Ha trabajado en cine en La quinta del porro , de Francesc Bellmunt (1980) [3] o Vicky Cristina Barcelona (2008), y en series de televisión como Sitges (1996-1997), Laberinto de Sombras (1998 -2000),  El corazón de la ciudad (2005-2009), Laberinto de pasiones (2006-2008), Gran Norte (2012-2013) y Merlín (2016-2018), producidas por Televisión de Cataluña .','https://image.tmdb.org/t/p/original'),
