	(1071545,'Kenji Akabane','1984-10-31','Kenji Akabane (赤羽根 健治, Akabane Kenji, 31 de octubre de 1984) es un seiyū (actor de voz) japonés de la prefectura de Chiba, Japón. Después de graduarse de Amusement Media General Academy, se convirtió en miembro afiliado de Aoni Production.\n\nEn 2009 obtuvo su primer papel protagonista como Kouji Kabuto en el anime Mazinger: Edición Z Impacto! También interpretó el papel del productor en la adaptación al anime de 2011 del videojuego THE IDOLM@STER.','https://image.tmdb.org/t/p/original/sBduxft8NwdbASvtL14bMx86cPq.jpg'),
