	(1090789,'Paula Vives',NULL,'Esta barcelonesa que acaba de cumplir su primer cuarto de siglo es bien conocida entre los espectadores catalanes. De padre músico, en su niñez ya derrochaba creatividad y pensaba ser escritora o diseñadora de moda. Hasta que en 2005 la televisión se cruzó en su camino para mostrarle su verdadera vocación: durante cuatro temporadas bordó a la rebelde Mercè en El cor de la ciutat, la serie más longeva de TV3. En el canal autonómico ha trazado buena parte de su trayectoria con telefilmes como Xtrems, La síndrome Cacareco o 14 d’abril: Macià contra Companys. Debutó en el celuloide gracias a la película Pas a nivell, aunque brilló especialmente en el drama familiar de Morir cada día, cortometraje preseleccionado para los Goya del año pasado. Su sueño es triunfar en teatro con un musical. Y experiencia no le falta: su voz ya ha sonado en los montajes Un cau de mil secrets y Cop de Rock.','https://image.tmdb.org/t/p/original'),
