	(1163405,'Kayla Compton','1990-02-03','Kayla Compton se mudó a Los Ángeles para perseguir su sueño de actuar y cantar. Rápidamente tuvo éxito y interpretó a Mónica en el éxito de HBO, \"Entourage\". También apareció en \"Perception\" de TNT. En KING\'S FAITH, interpreta a Natalie, la popular animadora de secundaria con un pasado que está tratando de ocultar. Criada en Jacksonville, Florida, Kayla ha querido ser intérprete desde que era una niña. Cantar era su principal pasión hasta que su maestra de teatro en la escuela secundaria le dijo que realmente debería estudiar la actuación, un oficio del que rápidamente se enamoró.','https://image.tmdb.org/t/p/original/s5DQrvszZeLUIGdD9ryl1aMsGQv.jpg'),
