	(1172108,'Mckenna Grace','2006-06-25','Mckenna Grace (25 de junio de 20061​) es una actriz estadounidense. Es más conocida por interpretar el papel de Jasmine Bernstein en la serie cómica Crash & Bernstein (2012-2014) y el de Faith Newman en la telenovela The Young and the Restless (2013-2015). También ha protagonizado películas como Mr. Church (2016), Independence Day: Resurgence (2016), Gifted (2017), How to Be a Latin Lover (2017)​ y ha sido la joven Tonya en la aclamada película biográfica I, Tonya (2017). También ha participado en Young Sheldon como Paige, la chica prodigio. Desde 2016, Grace ha interpretado a Penny Kirkman en el drama Designated Survivor, de la cadena ABC. Además, ha desempeñado un papel recurrente en el programa de Netflix Fuller House.','https://image.tmdb.org/t/p/original/jQLBM6ErQnvU8QqNvW8KKF9y8N0.jpg'),
