	(1173984,'Olivia Cooke','1993-12-27','Olivia Kate Cooke​ (27 de diciembre de 1993) es una actriz inglesa. De 2013 a 2017, co-protagonizó como Emma Decody en la serie de televisión de thriller dramático de A&E Bates Motel. Antes de esto, apareció en dos miniseries de BBC, Blackout y The Secret of Crickley Hall. En 2014, Cooke protagonizó tres películas de suspenso sobrenaturales: The Quiet Ones, The Signal y Ouija. En 2015, interpretó a Rachel Kushner en el drama de comedia Me and Earl and the Dying Girl. En 2018, interpretó a Art3mis/Samantha en la película Ready Player One de Steven Spielberg.','https://image.tmdb.org/t/p/original/yZNcUEqmvDJQQ7avMfJfCh7sVk9.jpg'),
