	(1181313,'Maisie Williams','1997-04-15','Margaret Constance \"Maisie\" Williams​ (15 de abril de 1997) es una actriz inglesa. Hizo su debut como actriz profesional como Arya Stark de Invernalia en la serie de fantasía de HBO Game of Thrones en 2011, por la que ganó el EWwy Award a la mejor actriz de reparto en un drama, el Portal Award a la mejor actriz de reparto – Televisión y mejor joven actriz, y el Saturn Award a la Mejor Interpretación por una joven Actriz. En 2016, fue nominada para un Primetime Emmy Award por Mejor Actriz de Reparto en una Serie Dramática.\n\nTambién tuvo un papel recurrente en Doctor Who como Ashildr en 2015. Además de la televisión, debutó en el cine en la película de misterio The Falling (2014), por la que ganó el London Film Critics\' Circle Award for Young Performer of the Year.','https://image.tmdb.org/t/p/original/zLTq39cdRjS43dEzb78c1p1QcbT.jpg'),
