	(1192492,'Aisha Hinds','1975-11-13','Aisha Hinds (nacida el 13 de noviembre de 1975) es una actriz de cine y televisión estadounidense. Hinds nació en Brooklyn, Nueva York. Comenzó su carrera en la televisión en 2003, en NYPD Blue. En 2004, tuvo un papel recurrente en The Shield como Annie Price, y más tarde como invitada en Crossing Jordan, Boston Legal, It\'s Always Sunny in Philadelphia, Law & Order: Hinds fue una serie regular en las dos series de corta duración de la serie ABC Invasión de 2005 a 2006, y Detroit 1-8-7 (2010-2011). Tuvo papeles recurrentes en Dollhouse, HawthoRNe, True Blood y Cult. En la película, Hinds apareció en Mr. Brooks, Madea Goes to Jail, Unstoppable, y Star Trek Into Darkness. En 2013, Hinds apareció en la serie de CW, Cult, como la malvada Rosalind Sakelik. Inmediatamente después de la cancelación de Cult, Hinds fue seleccionada como parte regular de la serie de televisión de CBS Under the Dome, basada en el libro de Stephen King del mismo título. En 2014, tuvo papeles secundarios en las películas If I Stay and Beyond the Lights. También en ese año, tuvo el papel recurrente de la investigadora jefe Ava Wallace en el procedimiento policial de la CBS, NCIS: Los Ángeles.','https://image.tmdb.org/t/p/original/zk59cqqDmJMFjnjYSC2xOqwp91r.jpg'),
