	(1222596,'Justin Hartley','1977-01-29','Justin Scott Hartley (29 de enero de 1977)​ es un actor estadounidense.\n\nEs conocido por sus papeles en televisión que incluyen a Fox Crane en la serie diaria de la NBC Passions (2002–2006), a Oliver Queen en la serie de The CW Smallville (2006–2011), y a Adam Newman en la serie diaria de la CBS The Young and the Restless (2014–2016) que le valió una nominación al Emmy.\n\nApareció en el papel recurrente de Patrick Osbourne en la tercera temporada de la serie de televisión Revenge. Desde 2016, es parte del reparto principal en la serie de drama This Is Us, que le ha valido una nominación a los Critics Choice Television Awards por Mejor Actor Secundario de una serie dramática.','https://image.tmdb.org/t/p/original/oo7vqWz30pA1tY6quUOnS6O0AgB.jpg'),
	(1222609,'Catherine Siachoque','1972-01-21','Siachoque ha tenido papeles en telenovelas de Telemundo tales como, Amantes del desierto, La venganza, Te voy a enseñar a querer, Tierra de pasiones y Pecados ajenos donde actúa como la villana principal de las historias y actuando con figuras como Maritza Rodríguez, Gabriela Spanic, Danna García, Francisco Gattorno, Mauricio Islas, Lorena Rojas y además con su esposo Miguel Varoni. En 2008 obtuvo el rol coprotagónico de Doña Hilda Santana en la telenovela Sin senos no hay paraíso, actuando con Carmen Villalobos, Fabián Ríos y Maria Fernada Yépes. En 2010 regresa como villana interpretando a Cecilia Altamira la villana principal en ¿Dónde está Elisa? actuando con Sonya Smith, Gabriel Porras, Jorge Luis Pila y Roberto Mateos.\n\nEn 2011 interpretó a la villana \"Ignacia Conde\" en La casa de al lado junto a los actores que ya había trabajado anteriormente como Maritza Rodríguez y Gabriel Porras, y con David Chocarro, Ximena Duque, y Daniel Lugo y nuevamente con su esposo Miguel Varoni.\n\nEn 2014 vuelve a las telenovelas después de 3 años, interpretando a \"Estefanía Hidalgo\" la villana coprincipal en Reina de corazones actuando con Paola Nuñez, Eugenio Siller, Juan Soler.\n\nEn 2016 participa en la telenovela Sin senos sí hay paraíso junto a Fabián Ríos y Carolina Gaitán.','https://image.tmdb.org/t/p/original/cMMlna6LChMAOttFCdRWkj9rz1C.jpg'),
