	(1223786,'Emilia Clarke','1986-10-23','Tras graduarse, Clarke comenzó su carrera con un papel en la serie de la BBC Doctors, y un papel co-protagonista en el telefilme norteamericano Triassic Attack.\n\nDesde 2011 ha interpretado a Daenerys Targaryen en la serie fantástica y de gran éxito de HBO Juego de tronos, basada en la serie de novelas Canción de hielo y fuego, escritas por George R. R. Martin. Por su papel en la serie, fue nominada tres veces a los Premios Primetime Emmy en la categoría de mejor actriz de reparto en Serie dramática.\n\nEn 2012 participó en las películas Spike Island en el papel de Sally Harris, y en el cortometraje de suspense Shackled como Malu.\n\nEn 2013 realizó su debut en Broadway interpretando a Holly Golightly en la adaptación teatral del clásico de Truman Capote de 1958 Breakfast at Tiffany\'s. Además de poner voz a Marianne en la serie animada Futurama en el episodio \"Stench and Stenchibility\". En la gran pantalla, Clarke protagonizó junto con Jude Law y Demián Bichir la película Dom Hemingway que fue estrenada por Fox Searchlight Pictures el 4 de abril de 2014.\n\nEn 2015 protagonizó junto con Arnold Schwarzenegger la película Terminator Génesis interpretando a Sarah Connor. Se le ofreció el papel de Anastasia Steele en la película Cincuenta sombras de Grey pero lo rechazó debido a la gran cantidad de desnudos que debía hacer.\n\nEn 2016 interpretó a Louisa \"Lou\" Clark en la película Me Before You basada en el libro homónimo escrito por Jojo Moyes. Luego participó en Above Suspicion en el papel de Susan Smith, estrenada en 2017. En noviembre de 2016, fue confirmada para interpretar a Qi\'Ra en el spin-off de Star Wars Han Solo: una historia de Star Wars, junto a los actores Alden Ehrenreich y Donald Glover.\n\nFue confirmada para un papel en la película The Beauty Inside, a estrenarse en 2018.','https://image.tmdb.org/t/p/original/86jeYFV40KctQMDQIWhJ5oviNGj.jpg'),
	(1223787,'Finn Jones','1988-03-24','Terence Terry Jones (24 de marzo de 1988) conocido como Finn Jones​ es un actor británico, más conocido por su papel como Loras Tyrell en la serie de HBO, Juego de tronos y como Puño de Hierro en las series de Netflix, Iron Fist y The Defenders, que se fijan dentro del Universo cinematográfico de Marvel.','https://image.tmdb.org/t/p/original/rKzzQ7oc80xDYDmZykBjmXWt0VZ.jpg'),
	(1223886,'Elizabeth Henstridge','1987-09-11','Elizabeth Frances Henstridge (11 de noviembre de 1987)​ es una actriz británica. Es conocida por su personaje de Jemma Simmons en la serie Agents of S.H.I.E.L.D.','https://image.tmdb.org/t/p/original/ohoSW1kYL3GMlFgGWuLEC1IzjmE.jpg'),
	(1224010,'Jon Jon Briones','1965-08-07','','https://image.tmdb.org/t/p/original/rMLbpS7OgWcrDMKcJxrfk54Lm56.jpg'),
	(1224051,'Jon Michael Hill','1985-07-28','Jon Michael Hill es un actor americano. Es mejor conocido por su papel como Detective Damon Washington en el drama policíaco de ABC, Detroit 1-8-7 y actualmente es co-protagonista como Detective Marcus Bell en la serie de CBS Elementary.Hill nació en Waukegan, Illinois. Durante sus años de bachillerato, jugó al fútbol y al saxofón antes de enfocarse en seguir una carrera de actuación, asistiendo a un programa de teatro de verano en la Northwestern University. Se graduó de la Universidad de Illinois con una licenciatura en Bellas Artes. En 2009, Hill fue nominado para el premio Joseph Jefferson como actor de apoyo en una obra de teatro para \"The Tempest\" en la Compañía de Teatro Steppenwolf de Chicago, Illinois. 2010, Hill fue nominado para el premio Tony Award como actor de apoyo masculino en donuts superiores junto a Michael McKean. En el mismo año, comenzó su papel como detective Damon Washington en el drama policial ABC Detroit 1-8-7. También interpretó el papel de Puck en el Shakespeare en la producción de A Midsummer Night\'s Dream (El sueño de una noche de verano): Unidad de Víctimas Especiales, Persona de Interés y Eastbound & Down. Actualmente es co-protagonista como Detective Marcus Bell en la serie de CBS Elementary.','https://image.tmdb.org/t/p/original/cn8a3KUxhBIV5mJ04JldUeGrx3D.jpg'),
