	(1233741,'Jaime Lee Kirchner','1981-08-23','Jaime Lee Kirchner nació en Alemania, pero al poco tiempo se trasladó con sus padres a Tennessee, Estados Unidos.\n\nHija de una maestra y un militar, desde muy pequeña supo que su verdadera vocación era la actuación, por lo que comenzó a hacer pequeños papeles en el Teatro Regional de Roxy, en Clarksville.\n\nSu talento fue indiscutible desde que era una niña, pues, además de actuar, se destacó en varias disciplinas como el baile, el canto, la pintura y la gimnasia.\n\nLuego de un largo período de estudio, Jaime Lee se recibió en la Escuela de Artes Tisch de la Universidad de Nueva York. A partir de ese momento, comenzó a trabajar en varios comerciales, hasta que fue ascendiendo y llegó a ocupar varios roles protagónicos en distintos trabajos.\n\nA lo largo de su carrera, fue parte de varias series, entre las que se pueden encontrar: \"Rescue Me\", \"CSI: Crime Scene Investigation\", \"Just Legal\" (en la que interpretó a Dulcinea \'Dee\' Real durante 7 episodios) y \"Dollhouse\". Desde 2009, se la puede ver en el papel de Sonia Jimenez en \"Mercy\".\n\nAdemás, trabajó en el telefilme \"Austin Golden Hour\", y en la película \"Definitivamente, quizás\" (protagonizada por Ryan Reynolds).\n\nEn lo que respecta a su vida personal, la actriz forma parte de varios grupos en contra del maltrato en contra de los animales.','https://image.tmdb.org/t/p/original/nmhYzsBoK16ATMiGdXsGUAeMWIP.jpg'),
