	(1234166,'Dulce María','1985-12-06','Dulce María Espinosa Saviñón, conocida como Dulce María, es una cantante, actriz y compositora mexicana. Dulce María nació en la Ciudad de México, hija de Fernando Espinosa y Blanca Saviñón, profesora. También es sobrina-nieta de la pintora artista Frida Kahlo. Dulce es la menor de tres hermanas: Blanca Ireri, que estudió filosofía, y Claudia.','https://image.tmdb.org/t/p/original/wJ93czJ9NWdLVfYn7PGLsTFYqU7.jpg'),
