	(1234688,'Kris Jenner','1955-11-05','Kristen Mary Houghton, más conocida como Kris Jenner, es una personalidad de televisión y empresaria estadounidense.','https://image.tmdb.org/t/p/original/ksH1hHZzO1UXL3rohiyFBd2GH1x.jpg'),
	(1234713,'Melissa O\'Neil','1988-07-12','O\'Neil fue la primera mujer en ganar el Canadian Idol en la temporada 2005. Además de trabajar en su carrera musical, Melissa, que comenzó como actriz de teatro, se ha dedicado por completo a la actuación. Es conocida por su papel como TwoPortia Lin on Dark Matter que fue cancelado en septiembre de 2017.\n\nMelissa Crystal O\'Neil nació el 12 de julio de 1988 en Calgary, Alberta, de Tim O\'Neil y Alison Yeung. Su madre es china y su padre tiene ascendencia irlandesa, lo que convierte a Melissa en una persona de origen irlandés y chino. Su abuelo materno le dio el nombre chino Oh Seemun.O\'Neil asistió a la Escuela Secundaria Terry Fox y más tarde a la Escuela Secundaria Lester B. Pearson. Con una pasión temprana por el entretenimiento, Melissa estuvo involucrada en muchas producciones teatrales dentro de la escena de Calgary. Ella estaba trabajando en una guardería cuando decidió audicionar para la tercera temporada de American Idol. en sus audiciones, los jueces se mostraron impresionados por su voz y ella logró llegar al top 100, y luego al top 32 y finalmente a la ganadora de la competencia, convirtiéndola en la más joven y primera mujer en ganar el Canadian Idol.','https://image.tmdb.org/t/p/original/wvhTunk3QuTKWbp5yKulwlXpBMJ.jpg'),
