	(1246184,'Lali Espósito','1991-10-10','Mariana \"Lali\" Espósito es una actriz y cantante argentina. Comenzó a actuar de niña en diversas producciones de Cris Morena, como Rincón de luz, Floricienta y Chiquititas sin fin. Se hizo conocida por interpretar el personaje de Marianella Rinaldi en Casi ángeles y como miembro de la banda pop derivada de la serie, Teen Angels. Desde el 2013 desarolla una carrera como cantante solista','https://image.tmdb.org/t/p/original/iKDr7a7Fv8Ba6xYxo7BhF5To0ey.jpg'),
