	(1247586,'Mami Matsui','1962-12-08','Mami Matsui (松井 摩味, Matsui Mami, 8 de diciembre de 1962) es una seiyū (actriz de voz) japonesa de Tokio afiliada a Aoni Production. Se graduó en la 4.ª graduación de la Seijijuku Tokyo School. Comenzó sus actividades en 1984.\n\nMami Matsui es su nombre real y antiguo nombre artístico. Su nombre artístico actual es Mami (摩味).','https://image.tmdb.org/t/p/original/dOMEVOeg45aykNyKh8C3rkmBeEa.jpg'),
	(1247646,'Saori Sugimoto','1974-11-17','Saori Sugimoto (杉本 沙織, Sugimoto Saori, 17 de noviembre de 1964) es una seiyū (actriz de voz) y narradora japonesa nacia en la ciudad de Fujisawa, prefectura de Kanagawa. Está afiliada a Aoni Production. Anteriormente trabajó bajo el nombre artístico de Saori Suzuki (鈴木 砂織, Suzuki Saori).\n\nSaori reemplazó a Tomiko Suzuki en el papel de Kisanta Yamamura en Nintama Rantarō desde la temporada 12. Además, ha puesto voz al personaje de Ramurin en la serie Shima Shima Tora no Shimajirō durante muchos años, así como al de Nyakkii.','https://image.tmdb.org/t/p/original/oeCDJzWWkpZJV9Udh7mvc5MOR48.jpg'),
