	(1247847,'Kenji Hamada','1972-04-12','Kenji Hamada (浜田 賢二, Hamada Kenji) es un seiyū (actor de voz) japonés de Fukuoka, Japón, que está afiliado a Mausu Promotion. En 1996 se incorporó a la escuela de formación Ezaki Production. Desde 1998 está afiliado a Mausu Promotion. Trabaja tanto como actor de voz de anime y videojuegos, así como doblando películas extranjeras. Admitió haber empezado a fumar en el instituto, pero lo dejó en 2014. Está casado con la también seiyū Junko Takeuchi desde 2006, con quien tiene dos hijos.','https://image.tmdb.org/t/p/original/pco71k8P9XKBmbqX2tTN6sBfFBc.jpg'),
