	(1252026,'Fabián Ríos','1980-07-05','De joven llegó a Bucaramanga y comenzó con sus estudios de actuación y se conectó con el medio del modelaje; tiempo después se trasladó a Bogotá para ingresar a escuelas de actuación dónde conocio a su actual esposa Yuly Ferreira.\n\nTrabajó en Siete veces Amada en el 2002, gracias a esta interpretación fue nominado como \"Mejor actor revelación juvenil\" en los Premios TV & Novelas Colombia.2​ Al año siguiente, realizó un papel antagónico en la telenovela El auténtico Rodrigo Leal.\n\nEn 2005 protagonizó Padres e hijos.\n\nPara RCN, realizó en 2007 un papel antagónico en la versión colombiana de la novela Floricienta, luego ingresó al elenco de Zona Rosa.\n\nEn 2008 protagoniza Sin senos no hay paraíso de la cadena hispana Telemundo al lado Carmen Villalobos y Catherine Siachoque personificando a Albeiro.3​\n\nEn 2009 es contratado por RCN para protagonizar la telenovela Doña Bella al lado de Zharick León, Marcelo Buquet y Stephanie Cayo.4​\n\nEn 2010 firma un contrato exclusivo con Telemundo para ser el antagonista de la telenovela El fantasma de Elena al lado de Elizabeth Gutiérrez.5​\n\nEn 2011 actuó en Los herederos del Monte al lado de Marlene Favela y Mario Cimarro.6​\n\nEn 2011 actúa en Mi corazón insiste al lado de Jencarlos Canela y Carmen Villalobos.7​\n\nProtagonizó la telenovela Corazón valiente para Telemundo en 2012 junto a Adriana Fonseca y José Luis Reséndez.8​ También fue parte del panel de jurado en el certamen de Miss Universe Puerto Rico 2012 en Telemundo PR.\n\nEn 2013 trabaja en Dama y obrero, compartiendo créditos con Ana Layevska y José Luis Reséndez.9​\n\nEn 2014 antagoniza en Tierra de reyes.10​\n\nEn 2016 trabaja en la producción Sin senos sí hay paraíso.','https://image.tmdb.org/t/p/original/jvIGKqqoDcAEbRBVCVoLsfhNCy3.jpg'),
