	(1253360,'Pedro Pascal','1975-04-02','Pascal nació en Santiago de Chile, de madre psicóloga infantil y padre, José Balmaceda, que es médico de fertilidad. Es nieto de un matrimonio español, una abuela nacida en la isla de Mallorca y un abuelo nacido en el País Vasco.​\n\nSus padres fueron simpatizantes del presidente Salvador Allende,​ y estuvieron involucrados en el movimiento de oposición contra la dictadura militar de Augusto Pinochet alrededor de la fecha de su nacimiento. Poco después de su nacimiento, su familia obtuvo asilo político en Dinamarca donde vivieron un tiempo.​ Posteriormente se trasladaron a Estados Unidos. Pascal se crio en San Antonio (Texas) y en Orange County (California) y vive en Nueva York desde 1993. Estuvo involucrado en natación competitiva durante sus primeros años, participando en los campeonatos estatales en Texas a la edad de once años, pero inmediatamente dejó de nadar competitivo después de entrar en la clase de teatro.\n\nEstudió arte dramático en la Orange County High School of the Arts y la Tisch School of the Arts de la New York University y ha vivido en la ciudad de Nueva York durante más de 20 años.','https://image.tmdb.org/t/p/original/wROJBhRvazeFl1SIWfzwMcKrYYn.jpg'),
	(1253431,'Takuya Satou','1984-05-19','Takuya Satou (佐藤 拓也, Satō Takuya, 19 de mayo de 1984) es un seiyuu (actor de voz) y cantante japonés de la ciudad de Yamamoto, distrito de Watari, prefectura de Miyagi, que está afiliado a Ken Production.\n\nNo confundir con actor y actor de voz afiliado a Production Ace Takuya Sato (里 卓哉).','https://image.tmdb.org/t/p/original/wVzBJ6Qj1aURhnfkjP6nLfVwQqz.jpg'),
