	(1273309,'Alexander Dreymon','1983-02-07','Alexander Doetsch (7 de febrero de 1983), más conocido como Alexander Dreymon, es un actor nacido en Alemania conocido por interpretar Uhtred de Bebbanburg en la serie de la BBC2 The Last Kingdom.\n\nSu nombre de nacimiento es Alexander Doetsch. Creció en Francia, Suiza, Alemania y los EE. UU. Ha estudiado en París y se ha estado preparando tres años en el Drama Centre London. Habla de modo fluido en inglés, francés y alemán.\n\nDreymon ha aparecido en varios escenarios de Londres y París antes de su debut en la gran pantalla en el drama franco-belga Ni reprise, ni échangée y después intervino junto a Matt Smith en el telefilme de la BBC Christopher and His Kind.​\n\nDesde entonces ha trabajado en varios cortometrajes en los EE.UU. así como interpretando a Luke Ramsey en la tercera temporada de American Horror Story, Coven.','https://image.tmdb.org/t/p/original/4widAZ3bxaE6kIMiOWqpQLQWbsT.jpg'),
