	(1324472,'Kengo Kawanishi','1985-02-18','Kengo Kawanishi (河西 健吾 Kawanishi Kengo, prefectura de Osaka, Japón, 18 de febrero de 1985) es un actor de voz japonés. En 2005, se graduó en la Amusement Media Academy e hizo su debut como actor de voz al año siguiente. En 2010, fue el doblador japonés del personaje de Christopher Wilde en la película Starstruck. Kawanishi formó parte de Office Kaoru hasta junio de 2012 y, tras trabajar un tiempo como artista independiente, se unió a Mausu Promotion en 2013.','https://image.tmdb.org/t/p/original/fBzVAY4gcUvs5EfRWQMViYgp9xV.jpg'),
