	(1325949,'Inori Minase','1995-12-02','Inori Minase (水瀬 いのり, Minase Inori, 2 de diciembre de 1995) es una actriz, actriz de voz (seiyu) y cantante japonesa  de Tokio. Su agencia es Axl One y su sello discográfico es King Amusement Creative.\n\nInori debutó como cantante en diciembre de 2015 bajo el sello King Records. En marzo de 2016, ganó el premio a la mejor actriz principal en la décima edición de los Seiyū Awards por sus papeles principales como Jun Naruse en el éxito de taquilla El himno del corazón y como Yuki Takeya en la serie de televisión de anime School-Live! Sus otros papeles principales incluyen Chino en Gochuumon wa Usagi desu ka?, Noel en Sora no Method, Hestia en Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka, Rem en Re:Zero Kara Hajimeru Isekai Seikatsu - Hyouketsu no Kizuna, Chito en Shoujo Shuumatsu Ryokou, y Tamaki “Kimari” Mari en Sora yori mo Tooi Basho.','https://image.tmdb.org/t/p/original/gDyp6UrxZB3tppK3m16NFAggpuf.jpg'),
