	(1356210,'Millie Bobby Brown','2004-02-19','Millie Bobby Brown (19 de febrero de 2004) es una actriz y modelo británica. Inició su carrera en la actuación desde muy pequeña cuando se mudó a Orlando (Estados Unidos) en 2011. Saltó a la fama por su interpretación del papel de Once en la serie de Netflix, Stranger Things. Su debut en el cine se llevó a cabo en 2019 con la película Godzilla: King of the Monsters, donde interpretó el personaje de Madison Rusell.\n\nHa sido galardonada con diversos premios, entre ellos, un Premio Saturn a «mejor actriz joven en una serie de televisión», y ha sido nominada a los Premios Emmy y al Sindicato de Actores de Cine (SAG) a «mejor actriz de reparto en una serie de televisión» y «mejor actriz en una serie de televisión» respectivamente, por su papel de Once. Es una de las actrices más jóvenes en haber sido nominada en la historia de los Premios Emmy. Asimismo, la revista Time la nombró una de las «100 personas más influyentes del mundo» a los 14 años de edad, y es la persona más joven en haber sido nombrada Embajadora de buena voluntad de Unicef.','https://image.tmdb.org/t/p/original/cso2aK5Aeallh0AY7nOgqnfKqEd.jpg'),
