	(1372369,'Samara Weaving','1992-02-23','Samara es hija de Simon Weaving, un escritor, productor y director de cine, y tiene una hermana menor, la actriz Morgan Weaving. Es sobrina del famoso actor Hugo Weaving y de Anna-Jane Weaving, quien tuvo una corta carrera como cantante en París a mediados de la década de los 80. Sus primos son Holly Weaving y el actor Harry Greenwood.\n\nNació en Adelaida, pero creció en Singapur, Fiyi e Indonesia. Cuando vivió en Yakarta, Indonesia, asistió a la Pattimura Elementary School. En el 2000 regresó a Australia y asistió a The Pittwater House Schools en las playas del Norte de Sídney. Luego asistió a la Canberra Girls\' Grammar School (CGGS). Salió con un joven llamado Paul por tres años, sin embargo la relación terminó en abril de 2011. En junio de 2012 comenzó a salir con el actor Axle Whitehead,​ pero la relación terminó a finales de agosto del mismo año.​\n\nDesde 2013 comenzó a salir con el modelo británico Rob Moore,​ sin embargo la relación terminó. Samara mantiene una relación con Jimmy Warden y en marzo de 2019 se anunció que la pareja se había comprometido.','https://image.tmdb.org/t/p/original/iEciTz4yZQ6enJr5IxyyW7NQUEb.jpg'),
