	(1373737,'Florence Pugh','1996-01-03','Pugh nació y se crió en Oxfordshire. Vivió en Andalucía, España, durante parte de su infancia. Su primera educación fue brevemente en la escuela Wychwood (2007-2009), y luego en la escuela St. Edward, Oxford.\n\nEl debut de Pugh fue en el drama de misterio La Caída (2014). Por su papel de adolescente precoz en la película, fue nominada como Mejor Novata Británica en el Festival de Cine de Londres 2014 del BFI. También fue nominada a la Mejor Interpretación Joven Británica/Irlandesa en los Premios del Círculo de Críticos de Cine de Londres.\n\nEn 2015, obtuvo su primer papel principal en el piloto de televisión de Studio City, con Eric Mccormack. A continuación, interpretó el papel principal en el largometraje de William Oldroyd Lady Macbeth (2016). Protagonizó el drama de la ITV Marcella y en The Commuter con Liam Neeson. En octubre de 2016, fue anunciada como \"Estrella del mañana\" por Screen International. En diciembre de 2016, fue seleccionada por un jurado internacional para el premio BAFTA Breakthrough Brit Award de 2016. También en diciembre de 2016, ganó el Evening Standard Breakthrough of The Year Award por Lady Macbeth. En febrero de 2017, ganó el premio del Círculo de Críticos de Cine de Dublín a la mejor actriz en el Festival Internacional de Cine de Dublín.','https://image.tmdb.org/t/p/original/32bSZwIdTnq60JuJk8o9rbJewF5.jpg'),
