	(1407933,'Assa Sylla','1996-06-03','Assa Sylla , o Assa Aïcha Sylla , es una actriz francesa , nacida el 3 de junio de 1996 en Paris .\n\nSe dio a conocer por su primera actuación en el cine, en la película Bande de filles, de la que interpretó uno de los papeles principales. También interpreta al personaje de Imane en la versión francesa de la serie Skam .\n\nEn 2018 participó en el trabajo colectivo Noire n\'est pas mon métier.','https://image.tmdb.org/t/p/original/auVWfeeBeTirgyzRUc3EqVZkRn2.jpg'),
