	(1413434,'Jenny Boyd','1991-02-27','Jenny Boyd (27 de febrero de 1991) es una actriz con doble ciudadanía inglesa y estadounidense. Después de viajar por el mundo como modelo internacional con Elite New York, se graduó de la Academia de Música y Arte Dramático de Londres (LAMDA) con una licenciatura en actuación. En la actualidad interpreta a Lizzie Saltzman en la serie Legacies.','https://image.tmdb.org/t/p/original/pcU0SM9LPMFi5BkYOMwVosmNeut.jpg'),
