	(1417568,'Mar Saura','1975-10-16','María del Mar Gómez Saura, conocida como Mar Saura (Barcelona, 16 de octubre de 1975), es una actriz, modelo y presentadora de televisión. Comienza su carrera profesional como modelo publicitaria a mediados de la década de los noventa rodando numerosos anuncios para televisión. Su posterior evolución le lleva a desfilar en las pasarelas Gaudí y Cibeles. Tras dar por finalizada su etapa como modelo, inicia su actividad como presentadora de televisión y, actualmente, actriz.','https://image.tmdb.org/t/p/original/j8IfaZ3Anh5zmxS5j0KuTb0Q93d.jpg'),
