	(1423493,'Belén Cuesta','1984-01-24','Aunque nació en Sevilla, la infancia y adolescencia las pasó en Fuengirola, Málaga. En la actualidad reside y trabaja en Madrid. Se formó como actriz en la Escuela Superior de Arte Dramático de Málaga, además de recibir clases de interpretación en otras escuelas o disciplinas como: La Sala, Málaga; Cursos de Comedia del arte (Nando Llera), El Actor ante la cámara (Assumpta Serna), así como otros. Aunque es mayoritariamente conocida como actriz teatral, ha participado tanto en producciones cinematográficas, televisivas e incluso anuncios de televisión.','https://image.tmdb.org/t/p/original/xxaNCeIuLh7nZvuCrwANO3zwI5g.jpg'),
