	(1432319,'Silvia de Dios','1966-02-09','Silvia de Dios (Bogotá, 9 de febrero de 1966) es una actriz y modelo colombiana que hizo su début en la televisión en 1988, en la telenovela Caballo viejo pero saltó a la fama internacional gracias a su papel de la malvada Lucrecia en la telenovela Café, con aroma de mujer. Se ha destacado en roles antagónicos.\n\nEmpezó en la telenovela Caballo viejo en donde interpretaba a Nora un muchacha que estaba enamorada de su tío. Pero saltó a la fama cuando interpretó a la malvada Lucrecia de Vallejo en la inolvidable telenovela Café con aroma de mujer. Posteriormente continuó haciendo papeles de villana y apareció en otras telenovelas como Padres e hijos, Traga maluca y María Madrugada.\n\nEn 2009, volvió a protagonizar en la telenovela Verano en Venecia al lado del cubano Abel Rodríguez. Ella no protagonizaba una telenovela desde que sustituyó a Marcela Carvajal en De pies a cabeza.\n\nRecientemente apareció en la telenovela de RCN, La Traicionera. Para 2013, hará para Caracol Televisión el dramatizado Terapia de Pareja,1​ junto al actor peruano Diego Bertie.\n\nComo modelo ha trabajado para diversas marcas como Revlon, Trinity n\' Jeans e Yves Saint Laurent.','https://image.tmdb.org/t/p/original/3cazd5X3yZsLnZZwE0qP1v7GFl7.jpg'),
