	(1461608,'Karen Fukuhara','1992-02-10','Karen Stephanie Aika Fukuhara (10 de febrero de 1992) es una actriz estadounidense.\n\nEs conocida por sus papeles como Katana en la película de superhéroes de DC de 2016 Escuadrón suicida y como The Female (Kimiko) en la serie original de Amazon Prime de 2019 The Boys. También es conocida por interpretar al personaje de Glimmer en la serie de Netflix She-Ra y las princesas del poder y a Kipo en Kipo y la era de los magnimales.','https://image.tmdb.org/t/p/original/39xZ0fJEfq9Ql2fILUUDJmcHT15.jpg'),
