	(1464650,'Dafne Keen','2005-01-04','Dafne Keen Fernández (4 de enero de 2005) es una actriz hispano-británica.\n\nEs más conocida por interpretar el papel de X-23 / Laura en la película de James Mangold Logan, junto a Hugh Jackman y Patrick Stewart. También es popular por su papel de Ana \"Ani\" Cruz Oliver en la serie de televisión de la BBC y Atresmedia Refugiados, actuando junto a su padre, Will Keen. Ha protagonizado también el largometraje Ana, junto a Andy García, película que se estrenó en 2018.\n\nSus padres son la dramaturga, directora y actriz española María Fernández Ache y el actor y director británico Will Keen. Actualmente participa en la adaptación televisiva de \"His Dark Materials, producida por HBO.','https://image.tmdb.org/t/p/original/jIsL2F19RUksPvBHsA2xQ2OYXK3.jpg'),
