	(1520843,'Aidan Gallagher','2003-09-18','Con nueve años comenzó a actuar, ganando su primer papel profesional en un episodio de la serie ganadora del Emmy Modern Family. En el año 2014, Aidan consiguió su primer papel protagónico en la exitosa serie de Nickelodeon Nicky, Ricky, Dicky & Dawn, interpretando al hermano menor de la familia Harper, Nicholas «Nicky» Harper.\n\nTuvo un papel coprotagonista en el piloto Jacked Up y protagonizó un cortometraje llamado You & Me. Obtuvo el papel coprotagonista en la adaptación del cómic The Umbrella Academy, en la serie de Netflix, que fue estrenada el 15 de febrero de 2019, interpretando al personaje Número Cinco.\n\nCon respecto a su carrera musical, la misma aún no ha sido lanzada oficialmente, pero aun así se puede encontrar en su cuenta de Instagram, en la sección de IGTV, un vídeo en el que se lo ve presentando una canción original, titulada \"Let\'s Get Lost\". Aidan Gallagher también toca la Guitarra y el Piano, así mismo, es compositor.','https://image.tmdb.org/t/p/original/zwOMopF4dAAvA6Lexr2dxJ9qBlD.jpg'),
