	(1522703,'Hande Erçel','1993-11-24','Erçel protagonizó la serie Aşk Laftan Anlamaz (2016-2017) como Hayat Uzun, junto a Burak Deniz. También interpretó el papel de Hazal en Siyah İnci en Star TV (Turquía) y tuvo el papel de Müjde en Halka en TRT . Su actuación reciente fue el papel de Azize Günay en la transmisión de Azize en Kanal D junto a Buğra Gülsoy.  En 2020, Erçel fue elegida para un papel principal en Sen Çal Kapımı junto con Kerem Bürsin .  Erçel pronto debutará en su primer largometraje Mest-i Aşk, que es una película iraní-turca. Ella estará en el papel principal junto a Shahab Hosseini, Parsa Pirouzfar, İbrahim Çelikkol, Selma Ergeç, Bensu Soral y Boran Kuzum.','https://image.tmdb.org/t/p/original/heZOn03SAJkwbmTAdk7IXA5yMTV.jpg'),
