	(1524527,'Francisco Bolívar','1984-12-21','Francisco Bolívar actor de cine, teatro y televisión, nació el 21 de diciembre de 1984 en Bogotá, Colombia. Hijo único, su madre Luz Mireya Bolívar Moreno, una estilista independiente y madre soltera, su abuela Ernestina Moreno de Bolívar una enfermera y su tío, el escritor y político Gustavo Bolívar Moreno, quien adopta la figura paterna, forman parte importante en la vida de Francisco. Asistió a la escuela primaria en el Centro Educativo Asosiervas, más tarde cursa el primer grado de secundaria en el Colegio Seminario Espíritu Santo, colegio que debe abandonar por razones familiares y más adelante en el año 2002 termina sus estudios de secundaria en el Colegio Nacional Restrepo Millán.','https://image.tmdb.org/t/p/original/jzivDMzGpATBpTNnTWBXcfSwhr6.jpg'),
	(1525047,'Dacre Montgomery','1994-11-22','Dacre Montgomery (22 de noviembre de 1994) es un actor australiano, conocido principalmente por interpretar a Billy Hargrove en la serie de Netflix de suspenso y ciencia ficción llamada Stranger Things.','https://image.tmdb.org/t/p/original/38jnyqD2HCQVs4zNHktxA2Ko8KN.jpg'),
	(1525689,'Ludi Lin','1987-11-11','Ludi Lin es una estrella en ascensode Asia y fue lanzado como Zack The Black Ranger en THE POWER RANGERS, la última franquicia de Lions Gate. También se le puede ver en la próxima temporada de Netflix MARCO POLO y las próximas películas chinas vienen a través del amor y me lleva a los extremos de la tierra.\n\nLudi nació en una ciudad a lo largo de la costa sur de China, donde aprendió a hablar mandarín. A la edad de 4 años, emigró a Hong Kong donde aprendió a hablar cantonés con fluidez. Su inmersión total en la cultura occidental llegó a la edad de 9 años cuando fue enviado al extranjero a Sydney, Australia, para continuar sus estudios. Finalmente, cuando tenía 17 años se mudó a Vancouver, Canadá, para completar su educación universitaria.','https://image.tmdb.org/t/p/original/9Ila4K8POeuVWRO9hzyekFjvCDk.jpg'),
