	(1590797,'Sadie Sink','2002-04-16','Sadie Sink (16 de abril de 2002) es una actriz estadounidense principalmente conocida por su interpretación como Max Mayfield en la serie de Netflix Stranger Things. También apareció en el circuito de Broadway, con créditos en Annie y The Audience. En 2016, Sink fue incluida al reparto de la serie sobrenatural de ciencia ficción de Netflix Stranger Things y aparece en la segunda temporada, estrenada en 2017, interpretando el papel de Max, uno de los personajes de la serie. En 2019, continuó en el papel de Max en la tercera temporada. En estos momentos se encuentra participando en la película Dear Zoe en la cual se presentará como personaje principal.','https://image.tmdb.org/t/p/original/idEJHCuQX7XlMnBt4sCf9g3BmoA.jpg'),
