	(1653291,'Gaten Matarazzo','2002-09-08','Gaetano John Matarazzo III (8 de septiembre de 2002) es un actor estadounidense. Inició su carrera como actor en Broadway en 2011 interpretando a Benji en la obra Priscilla, reina del desierto. En 2014 interpretó el papel de Gavroche en la versión de teatro del musical Les Misérables.​ Es más conocido por su interpretación de Dustin Henderson en la serie original de Netflix Stranger Things. También apareció como \"Jesús\" en una producción especial de \"Godspell Cast of 2032\", después de participar en 2011 del regreso del musical Godspell. En 2017, Matarazzo hace una aparición en el video musical de Swish Swish de la cantante estadounidense Katy Perry. Luego a fines de octubre de 2019, lanzó su propio programa Prank Encounters (Grita te estamos filmando), que trata sobre un programa de cámaras ocultas donde dos víctimas son asustados/as en forma de broma y diversión.','https://image.tmdb.org/t/p/original/gfxSa9pwafFEyzok6N4sIVbJLS.jpg'),
