	(1706738,'Itzan Escamilla','1996-09-23','El actor ha estudiado interpretación en Madrid en la Escuela de Cristina Rota. Se hizo conocido a nivel nacional con un primer papel de larga duración en la televisión en \'Victor Ros\' como el hijastro del protagonista, aunque anteriormente había hecho alguna aparición en series como \'Seis hermanas\'. Escamilla tiene también experiencia en el mundo del teatro, conquistó al público en \'Los universos paralelos\', una obra de David Lindsay-Abaire en la que participó junto a actrices de la talla de Malena Alterio o Belen Cuesta.\n\nTras una pequeña aparición en \'El Ministerio del Tiempo\' llega su inmersión en la plataforma de contenidos digitales Netflix con el papel del joven Francisco en la segunda temporada de \'Las chicas del cable\', con el que participó en hasta tres episodios. Las puertas de esta casa se quedan abiertas para el joven actor que se sumerge en la aventura de la serie adolescente de Netflix, \'Élite\'. En ella interpreta a Samuel, un chico que trabaja de camarero y al que le pagan una beca en la escuela privada de Las Encinas. Una nueva vida que traerá consecuencias en su vida. La clase social no será una traba para los sentimientos que empiezan a despertarse en su personaje por Marina (María Pedraza), pero sí que su hermano, interpretado por Jaime Lorente (\'La casa de papel\') esté enamorado de la misma chica.','https://image.tmdb.org/t/p/original/ki0FqpQZONlq3KD5OpGBrqtPD9N.jpg'),
