	(1721740,'Camila Mendes','1994-06-29','Camila Carraro Mendes es una actriz estadounidense. Es conocida por protagonizar la serie de The CW Riverdale en la que interpreta a Verónica Lodge. Mendes nació en Charlottesville, Virginia, de padres brasileños, Gisele y Victor Mendes. Su madre es de Porto Alegre, Rio Grande do Sul, mientras que su padre es de Brasilia, Distrito Federal. Ella tiene una hermana mayor. Mendes se mudó 16 veces mientras crecía, pero pasó la mayor parte de su infancia en Florida, donde asistió a American Heritage School, en Plantation. A la edad de 10 años, vivió en Brasil por un año. Cuando ella estaba en la escuela primaria actuó en varias obras de teatro, luego su madre la cambió de escuela dónde tuviera un mejor programa de teatro.','https://image.tmdb.org/t/p/original/a9RYVaY64cGmQoQJC8AcedYwUNR.jpg'),
