	(2072869,'Rikako Aida','1992-08-08','Rikako Aida (逢田 梨香子, Aida Rikako, nacida el 8 de agosto de 1992) es una cantante, actriz y actriz de voz (seiyuu) japonesa de Tokio afiliada a Ken Production. Es más conocida por su papel de Riko Sakurauchi en Love Live! Sunshine!! Anteriormente trabajó bajo el nombre artístico de Rikako Itō (伊藤 梨花子, Itō Rikako).\n\nComenzó su carrera como actriz de teatro, dramas y películas bajo el nombre de Rikako Itō alrededor de 2012, apareciendo en las películas «The Farmers Bride: 35 Years Old» y «I\'ll Give It My All... Tomorrow». Después de encontrarse por casualidad con el anime Gintama, decidió que quería hacer un cambio en su carrera y convertirse en actriz de voz (seiyuu), debutando como seiyuu en el anime «Hyperdevotion Noire: Goddess Black Heart» en 2014. Tras aparecer en unos pocos papeles con su antiguo nombre, cambió su nombre artístico a Rikako Aida en 2015.','https://image.tmdb.org/t/p/original/1PAs6DNVGpZUSiBhqny83qNVBQS.jpg'),
