	(2146942,'Freya Allan','2001-09-06','Freya Allan (6 de septiembre de 2001)​ es una actriz británica. Entre sus papeles más notables está su interpretación de Ciri en la serie de televisión de Netflix, The Witcher.\n\nTras una controversia sobre un texto donde, para interpretar a Ciri, se solicitaba una actriz catalogada como BAME (Black, Asian or Minority Ethnic), algo que chocaría con los orígenes del personaje en relación a la historia original de Andrzej Sapkowski,​ finalmente Freya Allan fue seleccionada para el papel.','https://image.tmdb.org/t/p/original/cjsSdfv9U8PboNG1SNfnvd5558T.jpg'),
